INSERT INTO movies (id, name, released_at, poster_url, synopsis, duration, trailer_url, average_rating, created_at, url, updated_at) VALUES
(1, 'Toy Story', 1995, '/uXDfjJbdP4ijW5hWSBrPrlKpxab.jpg', 'Led by Woody, Andy\'s toys live happily in his room until Andy\'s birthday brings Buzz Lightyear onto the scene. Afraid of losing his place in Andy\'s heart, Woody plots against Buzz. But when circumstances separate Buzz and Woody from their owner, the duo eventually learns to put aside their differences.', 81, NULL, 7.97, '2024-09-17 21:37:30', 'https://www.themoviedb.org/movie/862', '2024-09-20 21:17:52.000000'),
(2, 'Jumanji ', 1995, '/vgpXmVaVyUL7GGiDeiK1mKEKzcX.jpg', 'When siblings Judy and Peter discover an enchanted board game that opens the door to a magical world, they unwittingly invite Alan -- an adult who\'s been trapped inside the game for 26 years -- into their living room. Alan\'s only hope for freedom is to finish the game, which proves risky as all three find themselves running from giant rhinoceroses, evil monkeys and other terrifying creatures.', 104, NULL, 7.24, '2024-09-17 21:37:31', 'https://www.themoviedb.org/movie/8844', NULL),
(3, 'Grumpier Old Men ', 1995, '/1FSXpj5e8l4KH6nVFO5SPUeraOt.jpg', 'A family wedding reignites the ancient feud between next-door neighbors and fishing buddies John and Max. Meanwhile, a sultry Italian divorcée opens a restaurant at the local bait shop, alarming the locals who worry she\'ll scare the fish away. But she\'s less interested in seafood than she is in cooking up a hot time with Max.', 101, NULL, 6.50, '2024-09-17 21:37:32', 'https://www.themoviedb.org/movie/15602', NULL),
(4, 'Waiting to Exhale ', 1995, '/qJU6rfil5xLVb5HpJsmmfeSK254.jpg', 'Cheated on, mistreated and stepped on, the women are holding their breath, waiting for the elusive \"good man\" to break a string of less-than-stellar lovers. Friends and confidants Vannah, Bernie, Glo and Robin talk it all out, determined to find a better way to breathe.', 127, NULL, 6.28, '2024-09-17 21:37:33', 'https://www.themoviedb.org/movie/31357', NULL),
(5, 'Father of the Bride Part II ', 1995, '/rj4LBtwQ0uGrpBnCELr716Qo3mw.jpg', 'Just when George Banks has recovered from his daughter\'s wedding, he receives the news that she\'s pregnant ... and that George\'s wife is expecting too. He was planning on selling their home, but that\'s a plan that—like George—will have to change with the arrival of both a grandchild and a kid of his own.', 106, NULL, 6.24, '2024-09-17 21:37:33', 'https://www.themoviedb.org/movie/11862', NULL),
(6, 'Heat ', 1995, '/umSVjVdbVwtx5ryCA2QXL44Durm.jpg', 'Obsessive master thief Neil McCauley leads a top-notch crew on various daring heists throughout Los Angeles while determined detective Vincent Hanna pursues him without rest. Each man recognizes and respects the ability and the dedication of the other even though they are aware their cat-and-mouse game may end in violence.', 170, NULL, 7.92, '2024-09-17 21:37:34', 'https://www.themoviedb.org/movie/949', NULL),
(7, 'Sabrina ', 1995, '/z1oNjotUI7D06J4LWQFQzdIuPnf.jpg', 'An ugly duckling having undergone a remarkable change, still harbors feelings for her crush: a carefree playboy, but not before his business-focused brother has something to say about it.', 127, NULL, 6.17, '2024-09-17 21:37:35', 'https://www.themoviedb.org/movie/11860', NULL),
(8, 'Tom and Huck ', 1995, '/vIG8hWOa7DyLMRiurzKwVAnIYoU.jpg', 'A mischievous young boy, Tom Sawyer, witnesses a murder by the deadly Injun Joe. Tom becomes friends with Huckleberry Finn, a boy with no future and no family. Tom has to choose between honoring a friendship or honoring an oath because the town alcoholic is accused of the murder. Tom and Huck go through several adventures trying to retrieve evidence.', 97, NULL, 5.30, '2024-09-17 21:37:36', 'https://www.themoviedb.org/movie/45325', NULL),
(9, 'Sudden Death ', 1995, '/1pylO6YX5XdOA6QCc5IRxrrffkg.jpg', 'When a man\'s daughter is suddenly taken during a championship hockey game – with the captors demanding a billion dollars by game\'s end – he frantically sets a plan in motion to rescue her and abort an impending explosion before the final buzzer.', 110, NULL, 5.97, '2024-09-17 21:37:37', 'https://www.themoviedb.org/movie/9091', NULL),
(10, 'GoldenEye ', 1995, '/z0ljRnNxIO7CRBhLEO0DvLgAFPR.jpg', 'When a powerful satellite system falls into the hands of Alec Trevelyan, AKA Agent 006, a former ally-turned-enemy, only James Bond can save the world from a dangerous space weapon that -- in one short pulse -- could destroy the earth! As Bond squares off against his former compatriot, he also battles Xenia Onatopp, an assassin who uses pleasure as her ultimate weapon', 130, NULL, 6.89, '2024-09-17 21:37:37', 'https://www.themoviedb.org/movie/710', NULL),
(11, 'American President, The ', 1995, '/yObOAYFIHXHkFPQ3jhgkN2ezaD.jpg', 'Widowed U.S. president Andrew Shepherd, one of the world\'s most powerful men, can have anything he wants -- and what he covets most is Sydney Ellen Wade, a Washington lobbyist. But Shepherd\'s attempts at courting her spark wild rumors and decimate his approval ratings.', 114, NULL, 6.55, '2024-09-17 21:37:38', 'https://www.themoviedb.org/movie/9087', NULL),
(12, 'Dracula: Dead and Loving It ', 1995, '/4rRfZz8YnHNRr16t3CFcJrPdXHi.jpg', 'When a lawyer shows up at the vampire\'s doorstep, he falls prey to his charms and joins him in his search for fresh blood. Enter Professor Van Helsing, who may be the only one able to vanquish the Count.', 88, NULL, 6.07, '2024-09-17 21:37:39', 'https://www.themoviedb.org/movie/12110', NULL),
(13, 'Balto ', 1995, '/dCVcdb5oxDizqFLz0F7TE60NoC9.jpg', 'An outcast half-wolf risks his life to prevent a deadly epidemic from ravaging Nome, Alaska.', 78, NULL, 7.30, '2024-09-17 21:37:39', 'https://www.themoviedb.org/movie/21032', NULL),
(14, 'Nixon ', 1995, '/cz2MTGr2wpDZLirgV2rGHBdA2t3.jpg', 'A look at President Richard M. Nixon—a man carrying the fate of the world on his shoulders while battling the self-destructive demands from within—spanning his troubled boyhood in California to the shocking Watergate scandal that would end his Presidency.', 192, NULL, 6.90, '2024-09-17 21:37:40', 'https://www.themoviedb.org/movie/10858', NULL),
(15, 'Cutthroat Island ', 1995, '/cDYa1i5UzXWztO5ZUp4azv7ycPs.jpg', 'Morgan Adams and her slave, William Shaw, are on a quest to recover the three portions of a treasure map. Unfortunately, the final portion is held by her murderous uncle, Dawg. Her crew is skeptical of her leadership abilities, so she must complete her quest before they mutiny against her. This is made yet more difficult by the efforts of the British crown to end her pirate raids.', 124, NULL, 5.79, '2024-09-17 21:37:41', 'https://www.themoviedb.org/movie/1408', NULL),
(16, 'Casino ', 1995, '/4TS5O1IP42bY2BvgMxL156EENy.jpg', 'In early-1970s Las Vegas, Sam \"Ace\" Rothstein gets tapped by his bosses to head the Tangiers Casino. At first, he\'s a great success in the job, but over the years, problems with his loose-cannon enforcer Nicky Santoro, his ex-hustler wife Ginger, her con-artist ex Lester Diamond and a handful of corrupt politicians put Sam in ever-increasing danger.', 179, NULL, 8.00, '2024-09-17 21:37:41', 'https://www.themoviedb.org/movie/524', NULL),
(17, 'Sense and Sensibility ', 1995, '/cBK2yL3HqhFvIVd7lLtazWlRZPR.jpg', 'The Dashwood sisters, sensible Elinor and passionate Marianne, whose chances at marriage seem doomed by their family\'s sudden loss of fortune.  When Henry Dashwood dies unexpectedly, his estate must pass on by law to his son from his first marriage, John and wife Fanny. But these circumstances leave Mr. Dashwood\'s current wife, and daughters Elinor, Marianne and Margaret, without a home and with barely enough money to live on. As Elinor and Marianne struggle to find romantic fulfillment in a society obsessed with financial and social status, they must learn to mix sense with sensibility in their dealings with both money and men.', 136, NULL, 7.40, '2024-09-17 21:37:42', 'https://www.themoviedb.org/movie/4584', NULL),
(18, 'Four Rooms ', 1995, '/75aHn1NOYXh4M7L5shoeQ6NGykP.jpg', 'It\'s Ted the Bellhop\'s first night on the job...and the hotel\'s very unusual guests are about to place him in some outrageous predicaments. It seems that this evening\'s room service is serving up one unbelievable happening after another.', 98, NULL, 5.80, '2024-09-17 21:37:43', 'https://www.themoviedb.org/movie/5', NULL),
(19, 'Ace Ventura: When Nature Calls ', 1995, '/wcinCf1ov2D6M3P7BBZkzQFOiIb.jpg', 'Summoned from an ashram in Tibet, Ace finds himself on a perilous journey into the jungles of Africa to find Shikaka, the missing sacred animal of the friendly Wachati tribe. He must accomplish this before the wedding of the Wachati\'s Princess to the prince of the warrior Wachootoos. If Ace fails, the result will be a vicious tribal war.', 90, NULL, 6.32, '2024-09-17 21:37:44', 'https://www.themoviedb.org/movie/9273', NULL),
(20, 'Money Train ', 1995, '/jWBDz6Mf9aQVBiUS76JQsEhvoJl.jpg', 'When a vengeful New York transit cop decides to steal a trainload of subway fares, his foster brother—a fellow cop—tries to protect him.', 110, NULL, 5.83, '2024-09-17 21:37:44', 'https://www.themoviedb.org/movie/11517', NULL),
(21, 'Get Shorty ', 1995, '/r82SdPhg4fnIcLt0ogIjQxqjdcO.jpg', 'Chili Palmer is a Miami mobster who gets sent by his boss, the psychopathic \"Bones\" Barboni, to collect a bad debt from Harry Zimm, a Hollywood producer who specializes in cheesy horror films. When Chili meets Harry\'s leading lady, the romantic sparks fly. After pitching his own life story as a movie idea, Chili learns that being a mobster and being a Hollywood producer really aren\'t all that different.', 105, NULL, 6.47, '2024-09-17 21:37:45', 'https://www.themoviedb.org/movie/8012', NULL),
(22, 'Copycat ', 1995, '/oMgwJb016znNZcpDR20eXxZoW8A.jpg', 'An agoraphobic psychologist and a female detective must work together to take down a serial killer who copies serial killers from the past.', 124, NULL, 6.49, '2024-09-17 21:37:47', 'https://www.themoviedb.org/movie/1710', NULL),
(23, 'Assassins ', 1995, '/kgqS4jn60E8UIExfceMUExB3ZKK.jpg', 'Assassin Robert Rath arrives at a funeral to kill a prominent mobster, only to witness a rival hired gun complete the job for him -- with grisly results. Horrified by the murder of innocent bystanders, Rath decides to take one last job and then return to civilian life. But finding his way out of the world of contract killing grows ever more dangerous as Rath falls for his female target and becomes a marked man himself.', 132, NULL, 6.47, '2024-09-17 21:37:47', 'https://www.themoviedb.org/movie/9691', NULL),
(24, 'Powder ', 1995, '/kImKATjY4EsK5MDgrmpJdGbQEbq.jpg', 'Harassed by classmates who won\'t accept his shocking appearance, a shy young man known as \"Powder\" struggles to fit in. But the cruel taunts stop when Powder displays a mysterious power that allows him to do incredible things. This phenomenon changes the lives of all those around him in ways they never could have imagined.', 111, NULL, 6.99, '2024-09-17 21:37:48', 'https://www.themoviedb.org/movie/12665', NULL),
(25, 'Leaving Las Vegas ', 1995, '/wIfP6uLXD9Ptu68SyRx8WuSNNSK.jpg', 'Ben Sanderson, an alcoholic Hollywood screenwriter who lost everything because of his drinking, arrives in Las Vegas to drink himself to death. There, he meets and forms an uneasy friendship and non-interference pact with prostitute Sera.', 111, NULL, 7.27, '2024-09-17 21:37:49', 'https://www.themoviedb.org/movie/451', NULL),
(26, 'Othello ', 1995, '/kyevuYzW36wKadiE8lftLac5VwQ.jpg', 'The evil Iago pretends to be friend of Othello in order to manipulate him to serve his own end in the film version of this Shakespeare classic.', 123, NULL, 6.40, '2024-09-17 21:37:49', 'https://www.themoviedb.org/movie/16420', NULL),
(27, 'Now and Then ', 1995, '/q31Ks8oAmM4Nq2CcGjyYYpdBAmh.jpg', 'Waxing nostalgic about the bittersweet passage from childhood to puberty, four childhood girlfriends — Teeny, Chrissy, Samantha and Roberta — recall the magical summer of 1970. During their walk down memory lane, they reconcile experiences with boys, secrets, bullies and more.', 100, NULL, 6.90, '2024-09-17 21:37:50', 'https://www.themoviedb.org/movie/9263', NULL),
(28, 'Persuasion ', 1995, '/10hycdhFLq3M3y0ONxIMSiY8Mrs.jpg', 'Anne Elliot, the daughter of a financially troubled aristocratic family, is persuaded to break her engagement to Frederick Wentworth, a young sea captain of meager means. Years later, money troubles force Anne\'s father to rent out the family estate to Admiral Croft, and Anne is again thrown into company with Frederick -- who is now rich, successful, and perhaps still in love with Anne.', 107, NULL, 7.08, '2024-09-17 21:37:51', 'https://www.themoviedb.org/movie/17015', NULL),
(29, 'City of Lost Children, The (Cité des enfants perdus, La) ', 1995, '/whwT3Q9JxbAYzEc3t7uYYcCbTMf.jpg', 'A scientist in a surrealist society kidnaps children to steal their dreams, hoping that they slow his aging process.', 113, NULL, 7.24, '2024-09-17 21:37:51', 'https://www.themoviedb.org/movie/902', NULL),
(30, 'Shanghai Triad (Yao a yao yao dao waipo qiao) ', 1995, '/tzG1UxUSfPACREjgBrsPDRUvneH.jpg', 'Shanghai, China, 1930. When young Shuisheng arrives from the countryside, his uncle Liushu puts him at the service of Bijou, the mistress of Laoda, supreme boss of the Tang Triad, constantly threatened by his enemies, both those he knows and those lurking in the shadows.', 108, NULL, 6.77, '2024-09-17 21:37:52', 'https://www.themoviedb.org/movie/37557', NULL),
(31, 'Dangerous Minds ', 1995, '/yWHWC8fJRp2kLgiFrEa8o3krOH9.jpg', 'Former Marine Louanne Johnson lands a gig teaching in a pilot program for bright but underachieving teens at a notorious inner-city high school. After having a terrible first day, she decides she must throw decorum to the wind. When Johnson returns to the classroom, she does so armed with a no-nonsense attitude informed by her military training and a fearless determination to better the lives of her students -- no matter what the cost.', 99, NULL, 6.97, '2024-09-17 21:37:53', 'https://www.themoviedb.org/movie/9909', NULL),
(32, 'Twelve Monkeys (a.k.a. 12 Monkeys) ', 1995, '/gt3iyguaCIw8DpQZI1LIN5TohM2.jpg', 'In the year 2035, convict James Cole reluctantly volunteers to be sent back in time to discover the origin of a deadly virus that wiped out nearly all of the earth\'s population and forced the survivors into underground communities. But when Cole is mistakenly sent to 1990 instead of 1996, he\'s arrested and locked up in a mental hospital. There he meets psychiatrist Dr. Kathryn Railly, and patient Jeffrey Goines, the son of a famous virus expert, who may hold the key to the mysterious rogue group, the Army of the 12 Monkeys, thought to be responsible for unleashing the killer disease.', 129, NULL, 7.60, '2024-09-17 21:37:54', 'https://www.themoviedb.org/movie/63', NULL),
(33, 'Wings of Courage ', 1995, '/gA88wt3Rkk3YRc2phEcvlAzpQJG.jpg', 'In 1930 South America, a small group of French pilots struggle to prove they can offer a reliable airmail service over the Andes. When one of the young pilots crashes on such a flight, he has to try and get back to civilization on foot. Back home, his wife and colleagues start to fear the worst.', 50, NULL, 6.90, '2024-09-17 21:37:54', 'https://www.themoviedb.org/movie/78802', NULL),
(34, 'Babe ', 1995, '/zKuQMtnbVTz9DsOnOJmlW71v4qH.jpg', 'Babe is a little pig who doesn\'t quite know his place in the world. With a bunch of odd friends, like Ferdinand the duck who thinks he is a rooster and Fly the dog he calls mum, Babe realises that he has the makings to become the greatest sheep pig of all time, and Farmer Hogget knows it. With the help of the sheep dogs, Babe learns that a pig can be anything that he wants to be.', 91, NULL, 6.23, '2024-09-17 21:37:55', 'https://www.themoviedb.org/movie/9598', NULL),
(35, 'Carrington ', 1995, '/8NmeBTkC4UQa8XT2GGsBN2R8Bqo.jpg', 'Painter Dora Carrington develops an intimate but extremely complex bond with writer Lytton Strachey. Though Lytton is a homosexual, he is enchanted by the mysterious Dora and they begin a lifelong friendship that has strangely romantic undertones. Eventually, Lytton and Dora decide to live together, despite the fact that the latter has fallen in love with military man Ralph Partridge, whom she plans to marry.', 121, NULL, 6.20, '2024-09-17 21:37:56', 'https://www.themoviedb.org/movie/47018', NULL),
(36, 'Dead Man Walking ', 1995, '/eShxyjhWoFl3BwsuEmVsr4nLaMZ.jpg', 'A death row inmate turns for spiritual guidance to a local nun in the days leading up to his scheduled execution for the murders of a young couple.', 122, NULL, 7.30, '2024-09-17 21:37:56', 'https://www.themoviedb.org/movie/687', NULL),
(37, 'Across the Sea of Time ', 1995, '/iP0bT4f4BTAZ6fWKgLmd4lNeJ2H.jpg', 'A young Russian boy, Thomas Minton, travels to New York as a passenger on a Russian freighter. Close to Ellis Island he gets off and thus starts his journey to America the same way as all immigrants in former times. Thomas is searching for the family of one of his ancestors, who had emigrated decades ago, but once sent a letter home together with a sample of his new profession: 3D-Photography.', 51, NULL, 5.20, '2024-09-17 21:37:57', 'https://www.themoviedb.org/movie/139405', NULL),
(38, 'It Takes Two ', 1995, '/4CptjFLiIJXtjc3dykS7vkEHMbw.jpg', 'Identical 9-year-olds from very different backgrounds: orphaned Amanda and wealthy Alyssa meet at summer camp and decide to switch places -- and play matchmaker between Alyssa\'s dad, Roger, and the kind social worker who cares for Amanda.', 101, NULL, 6.49, '2024-09-17 21:37:58', 'https://www.themoviedb.org/movie/33689', NULL),
(39, 'Clueless ', 1995, '/8AwVTcgpTnmeOs4TdTWqcFDXEsA.jpg', 'Shallow, rich and socially successful Cher is at the top of her Beverly Hills high school\'s pecking scale. Seeing herself as a matchmaker, Cher first coaxes two teachers into dating each other. Emboldened by her success, she decides to give hopelessly klutzy new student Tai a makeover. When Tai becomes more popular than she is, Cher realizes that her disapproving ex-stepbrother was right about how misguided she was -- and falls for him.', 97, NULL, 7.27, '2024-09-17 21:37:58', 'https://www.themoviedb.org/movie/9603', NULL),
(40, 'Cry, the Beloved Country ', 1995, '/kGPsBswFOCjiGzXq4OZwzEAAODa.jpg', 'A South-African preacher goes to search for his wayward son who has committed a crime in the big city.', 106, NULL, 6.70, '2024-09-17 21:37:59', 'https://www.themoviedb.org/movie/34615', NULL),
(41, 'Richard III ', 1995, '/aN2BcIH6rvGbYiRQCS8lxOdeeVQ.jpg', 'A murderous lust for the British throne sees Richard III descend into madness. Though the setting is transposed to the 1930s, England is torn by civil war, split between the rivaling houses of York and Lancaster. Richard aspires to a fascist dictatorship, but must first remove the obstacles to his ascension—among them his brother, his nephews and his brother\'s wife. When the Duke of Buckingham deserts him, Richard\'s plans are compromised.', 104, NULL, 6.70, '2024-09-17 21:38:00', 'https://www.themoviedb.org/movie/31174', NULL),
(42, 'Dead Presidents ', 1995, '/wRLepMZoUCwjLFb1WSbuUT6uVWR.jpg', 'On the streets they call cash dead presidents. And that\'s just what a Vietnam veteran is after when he returns home from the war only to find himself drawn into a life of crime. With the aid of his fellow vets he plans the ultimate heist -- a daring robbery of an armored car filled with unmarked U.S. currency!', 119, NULL, 6.63, '2024-09-17 21:38:00', 'https://www.themoviedb.org/movie/11443', NULL),
(43, 'Restoration ', 1995, '/d7udB1dbJ2zAewg4FjFFnPq8iow.jpg', 'An aspiring young physician, Robert Merivel found himself in the service of King Charles II and saves the life of someone close to the King. Merivel joins the King\'s court and lives the high life provided to someone of his position. Merivel is ordered to marry his King\'s mistress in order to divert the queens suspicions. He is given one order by the king and that is not to fall in love. The situation worsens when Merivel finds himself in love with his new wife. Eventually, the King finds out and relieves Merivel of his position and wealth. His fall from grace leaves Merivel where he first started. And through his travels and reunions with an old friend, he rediscovers his love for true medicine and what it really means to be a physician.', 117, NULL, 6.05, '2024-09-17 21:38:01', 'https://www.themoviedb.org/movie/35196', NULL),
(44, 'Mortal Kombat ', 1995, '/aVotlc03uy62YJUFGxlQUF7FZXV.jpg', 'For nine generations an evil sorcerer has been victorious in hand-to-hand battle against his mortal enemies. If he wins a tenth Mortal Kombat tournament, desolation and evil will reign over the multiverse forever. To save Earth, three warriors must overcome seemingly insurmountable odds, their own inner demons, and superhuman foes in this action/adventure movie based on one of the most popular video games of all time.', 101, NULL, 5.85, '2024-09-17 21:38:02', 'https://www.themoviedb.org/movie/9312', NULL),
(45, 'To Die For ', 1995, '/bEY2XKUlCY03KA7XT59W2OPCGZm.jpg', 'Suzanne Stone wants to be a world-famous news anchor and she is willing to do anything to get what she wants. What she lacks in intelligence, she makes up for in cold determination and diabolical wiles. As she pursues her goal with relentless focus, she is forced to destroy anything and anyone that may stand in her way, regardless of the ultimate cost or means necessary.', 106, NULL, 6.58, '2024-09-17 21:38:03', 'https://www.themoviedb.org/movie/577', NULL),
(46, 'How to Make an American Quilt ', 1995, '/vwYRaERccwXWCYrTzeWRZRarJOo.jpg', 'Soon-to-be-wed graduate student Finn Dodd develops cold feet when she suspects her fiancé is cheating on her. In order to clear her head, Finn visits her grandmother, Hy, and great aunt, Glady Joe Cleary, in Grasse, Calif. There, Finn learns that Hy and Glady Joe are members of a group of passionate quilters, and over the course of her visit she is regaled with tales of love and life by women who have collected rich experiences and much wisdom.', 116, NULL, 6.42, '2024-09-17 21:38:03', 'https://www.themoviedb.org/movie/11861', NULL),
(47, 'Seven (a.k.a. Se7en) ', 1995, '/6yoghtyTpznpBik8EngEmJskVUO.jpg', 'Two homicide detectives are on a desperate hunt for a serial killer whose crimes are based on the \"seven deadly sins\" in this dark and haunting film that takes viewers from the tortured remains of one victim to the next. The seasoned Det. Sommerset researches each sin in an effort to get inside the killer\'s mind, while his novice partner, Mills, scoffs at his efforts to unravel the case.', 127, NULL, 8.38, '2024-09-17 21:38:04', 'https://www.themoviedb.org/movie/807', NULL),
(48, 'Pocahontas ', 1995, '/kZ1ft0QZ4e3zDUPMBftEkwI9ftd.jpg', 'Pocahontas, daughter of a Native American tribe chief, falls in love with an English soldier as colonists invade 17th century Virginia.', 81, NULL, 6.93, '2024-09-17 21:38:05', 'https://www.themoviedb.org/movie/10530', NULL),
(49, 'When Night Is Falling ', 1995, '/6Ac5GLwJ01uli5mCXqXwquR36Y1.jpg', 'A prudish woman working on tenure as a literacy professor at a large urban university finds herself attracted to a free-spirited, liberal woman who works at a local carnival.', 96, NULL, 6.24, '2024-09-17 21:38:05', 'https://www.themoviedb.org/movie/8391', NULL),
(50, 'Usual Suspects, The ', 1995, '/rWbsxdwF9qQzpTPCLmDfVnVqTK1.jpg', 'Held in an L.A. interrogation room, Verbal Kint attempts to convince the feds that a mythic crime lord, Keyser Soze, not only exists, but was also responsible for drawing him and his four partners into a multi-million dollar heist that ended with an explosion in San Pedro harbor – leaving few survivors. Verbal lures his interrogators with an incredible story of the crime lord\'s almost supernatural prowess.', 106, NULL, 8.18, '2024-09-17 21:38:06', 'https://www.themoviedb.org/movie/629', NULL),
(51, 'Guardian Angel ', 1994, '/AoRBM85EbRY9U0jtgy88DtV99Jl.jpg', 'Detective - turned - bodyguard Cynthia McKay (Cynthia Rothrock) is hired by a psychotic icy seductress, Nina Lindell (Lydie Denier), the same woman who killed Mckay\'s lover months earlier.  With vendetta in her heart McKay accompanies the flamboyantly playful womanizer through the glamourous world of the super-rich as his protector.  In a unique role reversal, it is the woman protecting the man from another woman, erupting into a deadly triangle of passion, suspense and action.', 97, NULL, 4.90, '2024-09-17 21:38:07', 'https://www.themoviedb.org/movie/117164', NULL),
(52, 'Mighty Aphrodite ', 1995, '/ice135yQZp4iX2SgCmd90nKgS5j.jpg', 'When Lenny and his wife, Amanda, adopt a baby, Lenny realizes that his son is a genius and becomes obsessed with finding the boy\'s biological mother in hopes that she will be brilliant too. But when he learns that Max\'s mother is Linda Ash, a kindhearted prostitute and porn star, Lenny is determined to reform her immoral lifestyle. A Greek chorus chimes in to relate the plot to Greek mythology in this quirky comedy.', 95, NULL, 6.70, '2024-09-17 21:38:07', 'https://www.themoviedb.org/movie/11448', NULL),
(53, 'Lamerica ', 1994, '/nnLpA4mqb3gvhNJQZ00cOyBmeq3.jpg', 'Fiore, an Italian conman, arrives in post Communist Albania with Gino, his young apprentice, to set up a shoe factory that will never open. The con requires a native Albanian, so they designate Spiro, an impoverished and confused former political prisoner as chairman of the board. When Fiore returns to Italy to get government funds for the project, Spiro unexpectedly disappears and Gino sets out on a journey to find him. The search leads him to discover Spiro\'s tragic personal history and witness Albanian poverty firsthand.', 112, NULL, 7.09, '2024-09-17 21:38:08', 'https://www.themoviedb.org/movie/49133', NULL),
(54, 'Big Green, The ', 1995, '/nVHqIuBTcTLmAIrML7T704UwfNI.jpg', 'In a depressed Texas town, British foreign exchange teacher Anna attempts to inject some life into her hopeless kids by introducing them to soccer. They\'re terrible at first, but Anna and her football-hero assistant whip them into shape. As they work overtime, the pair help kids build their self-esteem and also get involved in solving family squabbles.', 100, NULL, 5.53, '2024-09-17 21:38:09', 'https://www.themoviedb.org/movie/26441', NULL),
(55, 'Georgia ', 1995, '/uXjfK404xo7SiVlFcAoRyaFqXR4.jpg', 'Sadie looks up to her older sister Georgia, a successful folk singer who\'s happily married with children, but can\'t break out of the bar-band circuit and hit the big time she desperately covets. It\'s in part due to her attraction to drugs and booze, and also to her own unwise choice in men. Finally, though, Sadie\'s Achilles heel is a rough, unlovely voice very different than her sister\'s crowd-pleasing singing.', 115, NULL, 5.86, '2024-09-17 21:38:09', 'https://www.themoviedb.org/movie/97406', NULL),
(56, 'Kids of the Round Table ', 1995, '/1y8KAZOKrdmTI2sddcilcbRsMtI.jpg', 'Set in modern times, Alex finds King Arthur\'s sword Excalibur and must prove himself worthy of it.', 89, NULL, 4.43, '2024-09-17 21:38:10', 'https://www.themoviedb.org/movie/124057', NULL),
(57, 'Home for the Holidays ', 1995, '/3zqlKdOttWyExzopVxglz50Vjxq.jpg', 'After losing her job, making out with her soon-to-be former boss, and finding out that her daughter plans to spend Thanksgiving with her boyfriend, Claudia Larson faces spending the holiday with her unhinged family.', 103, NULL, 6.30, '2024-09-17 21:38:11', 'https://www.themoviedb.org/movie/9089', NULL),
(58, 'Postman, The (Postino, Il) ', 1994, '/cUaCpjVDefYShKyLmkcDsiPaBHn.jpg', 'Simple Italian postman learns to love poetry while delivering mail to a famous poet; he uses this to woo local beauty Beatrice.', 109, NULL, 7.93, '2024-09-17 21:38:11', 'https://www.themoviedb.org/movie/11010', NULL),
(59, 'Confessional, The (Confessionnal, Le) ', 1995, '/9ApR0PwQdlnvc76NmlbUWkeAK9i.jpg', 'Pierre Lamontagne has returned to Quebec to attend his father\'s funeral. He meets up with his adopted brother, Marc, who has begun questioning his identity and has embarked on a quest for his roots that would lead them to the Quebec of the 1950s. Past and present converge in a complex web of intrigue where the answer to the mystery lies.', 100, NULL, 6.40, '2024-09-17 21:38:12', 'https://www.themoviedb.org/movie/99040', NULL),
(60, 'Indian in the Cupboard, The ', 1995, '/ozQAmW85tTJu2dhRe3evzyY03Nb.jpg', 'A nine-year-old boy gets a plastic Indian and a cupboard for his birthday and finds himself involved in adventure when the Indian comes to life and befriends him.', 96, NULL, 6.45, '2024-09-17 21:38:13', 'https://www.themoviedb.org/movie/11359', NULL),
(61, 'Eye for an Eye ', 1996, '/y2lZSdJ1o0VvLegTw3ad6KFtxra.jpg', 'It\'s fire and brimstone time as grieving mother Karen McCann takes justice into her own hands when a kangaroo court in Los Angeles fails to convict Robert Doob, the monster who raped and murdered her 17-year-old daughter.', 101, NULL, 6.12, '2024-09-17 21:38:14', 'https://www.themoviedb.org/movie/17182', NULL),
(62, 'Mr. Holland\'s Opus ', 1995, '/kBmwWeSN3ajnYHZ3dSybEobxEPI.jpg', 'In 1965, passionate musician Glenn Holland takes a day job as a high school music teacher, convinced it\'s just a small obstacle on the road to his true calling: writing a historic opus. As the decades roll by with the composition unwritten but generations of students inspired through his teaching, Holland must redefine his life\'s purpose.', 143, NULL, 6.97, '2024-09-17 21:38:14', 'https://www.themoviedb.org/movie/2054', NULL),
(63, 'Don\'t Be a Menace to South Central While Drinking Your Juice in the Hood ', 1996, '/HZQBF7JDd2e9p4rPSbSHuWHaCC.jpg', 'When Ashtray moves to South Central L.A. to live with his father (who appears to be the same age he is) and grandmother (who likes to talk tough and smoke reefer), he falls in with his gang-banging cousin Loc Dog, who along with the requisite pistols and Uzi carries a thermo-nuclear warhead for self-defense. Will Ashtray be able to keep living the straight life?', 89, NULL, 7.00, '2024-09-17 21:38:15', 'https://www.themoviedb.org/movie/10607', NULL),
(64, 'Two if by Sea ', 1996, '/xSfqAMYqrTtDeAjPtYo0S8nc5Zz.jpg', 'Frank O\'Brien, a petty thief, and his 7-year-long girlfriend Roz want to put an end to their unsteady lifestyle and just do that last job, which involves stealing a valuable painting. Frank takes Roz to an island on the coast of New England, where he wants to sell the painting and also hopes that their sagging relationship will get a positive push back up. Not everything goes as planned.', 96, NULL, 4.85, '2024-09-17 21:38:16', 'https://www.themoviedb.org/movie/19760', NULL),
(65, 'Bio-Dome ', 1996, '/pkL8rqpO0EryTV1DLJJdrhOZ7sL.jpg', 'Bud and Doyle are two losers who are doing nothing with their lives. Both of their girlfriends are actively involved in saving the environment, but the two friends couldn\'t care less about saving the Earth. One day, when a group of scientists begin a mission to live inside a \"Bio-Dome\" for a year without outside contact, Bud and Doyle mistakenly become part of the project themselves.', 95, NULL, 4.54, '2024-09-17 21:38:16', 'https://www.themoviedb.org/movie/9536', NULL),
(66, 'Lawnmower Man 2: Beyond Cyberspace ', 1996, '/nsKDpcdC62krEPlCKKjLSHuMwwu.jpg', 'Jobe is resuscitated by Jonathan Walker. He wants Jobe to create a special computer chip that would connect all the computers in the world into one network, which Walker would control and use. But what Walker doesn\'t realize is a group of teenage hackers are on to him and out to stop his plan.', 92, NULL, 3.14, '2024-09-17 21:38:17', 'https://www.themoviedb.org/movie/11525', NULL),
(67, 'Two Bits ', 1995, '/ianK4zwR5Vv4JSDm3sNDh3kH86I.jpg', 'It\'s a hot summer day in 1933 in South Philly, where 12-year old Gennaro lives with his widowed mom and his ailing grandpa, who sits outside holding tight to his last quarter, which he\'s promised to Gennaro and which Gennaro would like to have to buy a ticket to the plush new movie theater. But grandpa\'s not ready to pass on the quarter or pass on to his final reward: he has some unfinished business with a woman from his past, and he enlists Gennaro to act as his emissary.', 85, NULL, 5.70, '2024-09-17 21:38:18', 'https://www.themoviedb.org/movie/40628', NULL),
(68, 'French Twist (Gazon maudit) ', 1995, '/xlLnHizshGBwMiNrnop2kg2nYzE.jpg', 'After learning of her husband\'s infidelities, a housewife invites an itinerant lesbian to move in with them. None of their lives will ever be the same again.', 95, NULL, 6.07, '2024-09-17 21:38:19', 'https://www.themoviedb.org/movie/4482', NULL),
(69, 'Friday ', 1995, '/2lReF53F8trkC68piGSfk0JVwWU.jpg', 'Craig and Smokey are two guys in Los Angeles hanging out on their porch on a Friday afternoon, smoking and drinking, looking for something to do.', 91, NULL, 7.16, '2024-09-17 21:38:19', 'https://www.themoviedb.org/movie/10634', NULL),
(70, 'From Dusk Till Dawn ', 1996, '/sV3kIAmvJ9tPz4Lq5fuf9LLMxte.jpg', 'After kidnapping a father and his two kids, the Gecko brothers head south to a seedy Mexican bar to hide out in safety, unaware of its notorious vampire clientele.', 108, NULL, 7.03, '2024-09-17 21:38:20', 'https://www.themoviedb.org/movie/755', NULL),
(71, 'Fair Game ', 1995, '/qcxsWOzBaF7MZNNThtRQWQ9Wrdk.jpg', 'Max Kirkpatrick is a cop who protects Kate McQuean, a civil law attorney, from a renegade KGB team out to terminate her', 91, NULL, 5.10, '2024-09-17 21:38:21', 'https://www.themoviedb.org/movie/11859', NULL),
(72, 'Kicking and Screaming ', 1995, '/ynAtSpTou7snNOq32djzILw9VCA.jpg', 'After college graduation, Grover\'s girlfriend Jane tells him she\'s moving to Prague to study writing. Grover declines to accompany her, deciding instead to move in with several friends, all of whom can\'t quite work up the inertia to escape their university\'s pull. Nobody wants to make any big decisions that would radically alter his life, yet none of them wants to end up like Chet, the professional student who tends bar and is in his tenth year of university studies.', 96, NULL, 6.18, '2024-09-17 21:38:21', 'https://www.themoviedb.org/movie/28387', NULL),
(73, 'Misérables, Les ', 1995, '/toQ6BJCiKVSnklpsma2GnJ6KKah.jpg', 'In France during World War II, a poor and illiterate man, Henri Fortin, is introduced to Victor Hugo\'s classic novel Les Misérables and begins to see parallels between the book and his own life.', 175, NULL, 6.74, '2024-09-17 21:38:22', 'https://www.themoviedb.org/movie/48750', NULL),
(74, 'Bed of Roses ', 1996, '/e0Eho8TETw1RhvX9MH9i19Xf1iM.jpg', 'The seeds of love are planted when Lisa, a high-powered investment banker, receives flowers from a secret admirer. But when his fairy-tale fantasies clash with her workaholic ways, they soon find out that sometimes, it\'s harder than it seems for love to conquer all.', 87, NULL, 5.84, '2024-09-17 21:38:23', 'https://www.themoviedb.org/movie/20927', NULL),
(75, 'Big Bully ', 1996, '/dws3JR4Yi325Tz33XnuXEB6XjGr.jpg', 'A writer returns to his hometown where he faces the childhood nemesis whose life he ultimately ruined, only the bully wants to relive their painful past by torturing him once again.', 90, NULL, 4.56, '2024-09-17 21:38:24', 'https://www.themoviedb.org/movie/36929', NULL),
(76, 'Screamers ', 1995, '/eqgBf791rMZG7ywHfObpXeMpiRf.jpg', 'SIRIUS 6B, Year 2078. On a distant mining planet ravaged by a decade of war, scientists have created the perfect weapon: a blade-wielding, self-replicating race of killing devices known as Screamers designed for one purpose only -- to hunt down and destroy all enemy life forms.', 108, NULL, 6.21, '2024-09-17 21:38:24', 'https://www.themoviedb.org/movie/9102', NULL),
(77, 'Nico Icon ', 1995, '/w3oiJZTB1UP3lj0uSVLdsYfsBbC.jpg', 'A look into the many lives of Christa Päffgen, otherwise known as Nico; from cutie German mädchen to the first of the supermodels, to glamorous diva of the Velvet Underground, to cult item, junkie and hag. Many faces for the same woman, whom, you realize, just couldn\'t bring herself to care enough to live.', 70, NULL, 7.20, '2024-09-17 21:38:25', 'https://www.themoviedb.org/movie/124626', NULL),
(78, 'Crossing Guard, The ', 1995, '/kogaCIIylHmWQo2gJrrdq8Br8b8.jpg', 'Unable to move on from the loss of his daughter, Freddy, now a shell of the person he was before, swears to kill the man responsible for her death.', 111, NULL, 6.04, '2024-09-17 21:38:26', 'https://www.themoviedb.org/movie/27526', NULL),
(79, 'Juror, The ', 1996, '/31mRYhJvaknQx8PQnR2UV7YCkLT.jpg', 'With his gangster boss on trial for murder, a mob thug known as \"the Teacher\" tells Annie Laird she must talk her fellow jurors into a not-guilty verdict, implying that he\'ll kill her son Oliver if she fails. She manages to do this, but, when it becomes clear that the mobsters might want to silence her for good, she sends Oliver abroad and tries to gather evidence of the plot against her, setting up a final showdown.', 118, NULL, 5.58, '2024-09-17 21:38:26', 'https://www.themoviedb.org/movie/9623', NULL),
(80, 'White Balloon, The (Badkonake sefid) ', 1995, '/u6jrlgZZx3zSFPDPTVOYpueljgH.jpg', 'Several people try to take advantage of a little girl\'s innocence to hustle money her mom gave to her to buy a goldfish with.', 85, NULL, 7.50, '2024-09-17 21:38:27', 'https://www.themoviedb.org/movie/46785', NULL),
(81, 'Things to Do in Denver When You\'re Dead ', 1995, '/rA4Jttg1kJvNhSv7wM0SNyXrqY0.jpg', 'Five different criminals face imminent death after botching a job quite badly.', 116, NULL, 6.50, '2024-09-17 21:38:28', 'https://www.themoviedb.org/movie/400', NULL),
(82, 'Antonia\'s Line (Antonia) ', 1995, '/nUCVi6bBIL7LGC61nYaCqikAhIA.jpg', 'After World War II, Antonia and her daughter, Danielle, go back to their Dutch hometown, where Antonia\'s late mother has bestowed a small farm upon her. There, Antonia settles down and joins a tightly-knit but unusual community. Those around her include quirky friend Crooked Finger, would-be suitor Bas and, eventually for Antonia, a granddaughter and great-granddaughter who help create a strong family of empowered women.', 102, NULL, 7.03, '2024-09-17 21:38:29', 'https://www.themoviedb.org/movie/880', NULL),
(83, 'Once Upon a Time... When We Were Colored ', 1995, '/45xucuNlia6vEPWYrYu2QlnwgpO.jpg', 'This film relates the story of a tightly connected Afro-American community informally called Colored Town where the inhabitants live and depend on each other in a world where racist oppression is everywhere, as told by a boy called Cliff who spent his childhood there. Despite this, we see the life of the community in all its joys and sorrows, of those that live there while others decide to leave for a better life north. For those remaining, things come to a serious situation when one prominent businessman is being muscled out by a white competitor using racist intimidation. In response, the community must make the decision of whether to submit meekly like they always have, or finally fight for their rights.', 115, NULL, 4.20, '2024-09-17 21:38:29', 'https://www.themoviedb.org/movie/146599', NULL),
(84, 'Last Summer in the Hamptons ', 1995, '/g3m93gROYRRgu7lyQPzrka612uK.jpg', 'Helena Mora, the head of an eccentric theatrical family, has decided to sell her large estate in the Hamptons because of her recent money troubles. Before she completes the sale, she wants to have one last gathering of family and friends, with dramatic performances. Bringing everyone together, though, creates rivalries and tension, especially for Oona, a temperamental but successful movie actress who seeks the approval of her creative peers.', 108, NULL, 5.50, '2024-09-17 21:38:30', 'https://www.themoviedb.org/movie/188588', NULL),
(85, 'Angels and Insects ', 1995, '/w1i5JdddoLuzSmnKo5ORDoKdMm2.jpg', 'In Victorian England, wealthy patriarch Sir Harald Alabaster invites an impoverished biologist, William Adamson, into his home. There, William tries to continue his work, but is distracted by Alabaster\'s seductive daughter, Eugenia. William and Eugenia begin a torrid romance, but as the couple become closer, the young scientist begins to realize that dark, disturbing things are happening behind the closed doors of the Alabaster manor.', 118, NULL, 6.40, '2024-09-17 21:38:31', 'https://www.themoviedb.org/movie/8447', NULL),
(86, 'White Squall ', 1996, '/muhTVa52IufjTaqNseXFQUAEuyG.jpg', 'In 1960, a hardy group of prep school students boards an old-fashioned sailing ship. With Capt. Christopher Sheldon at the helm, the oceangoing voyage is intended to teach the boys fortitude and discipline. But the youthful crew are about to get some unexpected instruction in survival when they get caught in the clutches of a white squall storm.', 129, NULL, 6.27, '2024-09-17 21:38:31', 'https://www.themoviedb.org/movie/10534', NULL),
(87, 'Dunston Checks In ', 1996, '/xR2cWC04kWNr7TBeXNOf4uOqn00.jpg', 'Hotel manager Robert Grant is forced by his boss to postpone his family vacation when a hotel critic checks in. Trouble is, the critic is really a villainous jewel thief with an orangutan assistant named Dunston. When Dunston gets loose and tries to escape a life of crime -- aided by Robert\'s sons -- havoc, hijinks and lots of laughs abound!', 88, NULL, 5.45, '2024-09-17 21:38:32', 'https://www.themoviedb.org/movie/17414', NULL),
(88, 'Black Sheep ', 1996, '/bqIW5oE4WeHAvk1nh2Y6rfOLGrF.jpg', 'When dignified Albert Donnelly runs for Governor, his team moves to keep his slow-witted and klutzy younger brother, Mike, out of the eye of the media. To baby-sit Mike, the campaign assigns sarcastic Steve, who gets the experience of a lifetime when he tries to take Mike out of town during the election.', 87, NULL, 6.02, '2024-09-17 21:38:33', 'https://www.themoviedb.org/movie/13997', NULL),
(89, 'Nick of Time ', 1995, '/A1FJwUVg84sQSjHVz5jVMXQvifJ.jpg', 'An ordinary man is suddenly forced into a plot to kill a politician in exchange for his kidnapped daughter\'s freedom.', 89, NULL, 6.21, '2024-09-17 21:38:34', 'https://www.themoviedb.org/movie/2086', NULL),
(90, 'The Journey of August King ', 1995, '/1kWPXnCyUo20QCrv8lwQhTFPj9f.jpg', 'The Journey of August King is a multi-dimensional drama about a North Carolina farmer in 1815. August King, a widower, is on his way home as he does every year after selling his produce and purchasing the stock and goods he will need to survive the winter. On his journey, he comes upon a run-away slave, a young woman about 19 and August King must decide to violate the law and help this slave to freedom or else leave her to be hunted down and, ultimately, returned to her slave owner.', 91, NULL, 6.70, '2024-09-17 21:38:34', 'https://www.themoviedb.org/movie/61548', NULL),
(92, 'Mary Reilly ', 1996, '/eAOPWQdwytdRaLK3VXi7JFJFqmj.jpg', 'A housemaid falls in love with Dr. Jekyll and his darkly mysterious counterpart, Mr. Hyde.', 104, NULL, 5.80, '2024-09-17 21:38:35', 'https://www.themoviedb.org/movie/9095', NULL),
(93, 'Vampire in Brooklyn ', 1995, '/fodPA5x3REtOwColG17CucreZqM.jpg', 'Detective Rita Veder is assigned to a baffling serial murder case. After examining the crime scene — a corpse-filled ship found adrift at sea — she meets Maximilian, a smooth-talking Caribbean playboy determined to romance her.', 102, NULL, 5.08, '2024-09-17 21:38:36', 'https://www.themoviedb.org/movie/12158', NULL),
(94, 'Beautiful Girls ', 1996, '/sHcx1fBmrtZYvFmUywU0d5cvIFd.jpg', 'During a snowy winter in the small fictional town of Knight\'s Ridge, Massachusetts, a group of lifelong buddies hang out, drink and struggle to connect with the women who affect their decisions, dreams and desires.', 112, NULL, 6.70, '2024-09-17 21:38:36', 'https://www.themoviedb.org/movie/9283', NULL),
(95, 'Broken Arrow ', 1996, '/iBPMwYYJFvdCBkXrwV75peo5Lz2.jpg', 'When rogue stealth-fighter pilot Vic Deakins deliberately drops off the radar while on maneuvers, the Air Force ends up with two stolen nuclear warheads -- and Deakins\'s co-pilot, Riley Hale, is the military\'s only hope for getting them back. Traversing the deserted canyons of Utah, Hale teams with park ranger Terry Carmichael to put Deakins back in his box.', 108, NULL, 6.05, '2024-09-17 21:38:37', 'https://www.themoviedb.org/movie/9208', NULL),
(96, 'In the Bleak Midwinter ', 1995, '/lam5mVjru6yhgG8N1MHCqAUrxzL.jpg', 'Out of work actor Joe volunteers to help try and save his sister\'s local church for the community by putting on a Christmas production of Hamlet, somewhat against the advice of his agent Margaretta. As the cast he assembles are still available even at Christmas and are prepared to do it on a \'profit sharing\' basis (that is, they may not get paid anything) he cannot expect - and does not get - the cream of the cream. But although they all bring their own problems and foibles along, something bigger starts to emerge in the perhaps aptly named village of Hope.', 99, NULL, 7.00, '2024-09-17 21:38:38', 'https://www.themoviedb.org/movie/40154', NULL),
(97, 'Hate (Haine, La) ', 1995, '/iH8saz6s0Z8SPPrKaMI2KrRzTED.jpg', 'After a chaotic night of rioting in a marginal suburb of Paris, three young friends, Vinz, Hubert and Saïd, wander around unoccupied waiting for news about the state of health of a mutual friend who has been seriously injured when confronting the police.', 98, NULL, 8.10, '2024-09-17 21:38:39', 'https://www.themoviedb.org/movie/406', NULL),
(98, 'Shopping ', 1994, '/jiIQO8UWyvVkdJEujb6VWKUBzaz.jpg', 'A dark, hip, urban story of a barren and anonymous city where the underclass\' sport of choice is ram-raiding. An exciting game in which stolen cars are driven through shop windows to aid large-scale looting before the police arrive. For Tommy, it\'s a business, but for Billy and Jo, it\'s a labour of love. As the competition between Tommy and Billy grows more fierce, the stakes become higher and the \"shopping\" trips increasingly risky.', 105, NULL, 5.40, '2024-09-17 21:38:39', 'https://www.themoviedb.org/movie/45549', NULL),
(99, 'Heidi Fleiss: Hollywood Madam ', 1995, '/laPSb9I8TuYslOh1OcgaTByWKnw.jpg', 'A documentary crew from the BBC arrives in L.A. intent on interviewing Heidi Fleiss, a year after her arrest for running a brothel but before her trial. Several months elapse before the interview, so the crew searches for anyone who\'ll talk about the young woman. Two people have a lot to say to the camera: a retired madam named Alex for whom Fleiss once worked and Fleiss\'s one-time boyfriend, Ivan Nagy, who introduced her to Alex. Alex and Nagy don\'t like each other, so the crew shuttles between them with \"she said\" and \"he said.\" When they finally interview Fleiss, they spend their time reciting what Alex and Nagy have had to say and asking her reaction.', 106, NULL, 6.60, '2024-09-17 21:38:40', 'https://www.themoviedb.org/movie/63076', NULL),
(100, 'City Hall ', 1996, '/tEpefYZtoDZsMflWrPIXbW0OSwN.jpg', 'The accidental shooting of a boy in New York leads to an investigation by the Deputy Mayor, and unexpectedly far-reaching consequences.', 111, NULL, 5.90, '2024-09-17 21:38:41', 'https://www.themoviedb.org/movie/11062', NULL),
(101, 'Bottle Rocket ', 1996, '/6E7mJ5wpzTFbYFbJvTzzZ8Til9C.jpg', 'Upon his release from a mental hospital following a nervous breakdown, the directionless Anthony joins his friend Dignan, who seems far less sane than the former. Dignan has hatched a harebrained scheme for an as-yet-unspecified crime spree that somehow involves his former boss, the (supposedly) legendary Mr. Henry.', 91, NULL, 6.70, '2024-09-17 21:38:42', 'https://www.themoviedb.org/movie/13685', NULL),
(102, 'Mr. Wrong ', 1996, '/yGbPzJ5hib2TFi0Rkb6JH8webaL.jpg', 'A single and lonely woman finds the seemingly perfect man to date, but soon regrets it when his deranged and possessive other personality emerges and worst still, she cannot convince anyone else of his Jekyll/Hyde true nature.', 96, NULL, 4.00, '2024-09-17 21:38:42', 'https://www.themoviedb.org/movie/47475', NULL),
(103, 'Unforgettable ', 1996, '/500Ne3EDn3HHpuCQWwGKR74r0cB.jpg', 'Seattle medical examiner David Krane is obsessed with solving his wife\'s murder. A possible solution presents itself in an experimental \"memory\" serum designed by a neurobiology professor, which has the ability to transfer memories from one person to another, but with potentially fatal consequences.', 116, NULL, 5.58, '2024-09-17 21:38:43', 'https://www.themoviedb.org/movie/2045', NULL),
(104, 'Happy Gilmore ', 1996, '/4RnCeRzvI1xk5tuNWjpDKzSnJDk.jpg', 'Failed hockey player-turned-golf whiz Happy Gilmore -- whose unconventional approach and antics on the grass courts the ire of rival Shooter McGavin -- is determined to win a PGA tournament so he can save his granny\'s house with the prize money. Meanwhile, an attractive tour publicist tries to soften Happy\'s image.', 92, NULL, 6.64, '2024-09-17 21:38:44', 'https://www.themoviedb.org/movie/9614', NULL),
(105, 'Bridges of Madison County, The ', 1995, '/teGMLWvCnJqvtPYCSuUKRM9MvFe.jpg', 'Photographer Robert Kincaid wanders into the life of housewife Francesca Johnson for four days in the 1960s.', 135, NULL, 7.71, '2024-09-17 21:38:44', 'https://www.themoviedb.org/movie/688', NULL),
(106, 'Nobody Loves Me (Keiner liebt mich) ', 1994, '/vBDJPkoTOKT9F1zx0y9tT7G62vF.jpg', 'On the brink of her 30th birthday, Fanny feels the door to marital happiness closing on her. She is obsessed with death and even visits evening classes on dying, so it seems fitting that she encounters a skeleton in the malfunctioning elevator of her apartment building. The skeleton is her neighbour Orfeo, a Black, gay, self-declared psychic, who convinces her that she is about to meet \"him\". But is it really Lothar, the new yuppie apartment manager ...?', 104, NULL, 6.27, '2024-09-17 21:38:45', 'https://www.themoviedb.org/movie/11907', NULL);
INSERT INTO movies (id, name, released_at, poster_url, synopsis, duration, trailer_url, average_rating, created_at, url, updated_at) VALUES
(107, 'Muppet Treasure Island ', 1996, '/gX2TAgjGvk2LJk4Awu0LM7UScfQ.jpg', 'After telling the story of Flint\'s last journey to young Jim Hawkins, Billy Bones has a heart attack and dies just as Jim and his friends are attacked by pirates. The gang escapes into the town where they hire out a boat and crew to find the hidden treasure, which was revealed by Bones before he died. On their voyage across the seas, they soon find out that not everyone on board can be trusted.', 100, NULL, 6.64, '2024-09-17 21:38:46', 'https://www.themoviedb.org/movie/10874', NULL),
(108, 'Catwalk ', 1996, '/8Db2Tx2RkTUozzilF1SGMitcHLl.jpg', 'A documentary following Christy Turlington and other models during spring fashion week in Milan, Paris and New York.', 95, NULL, 7.50, '2024-09-17 21:38:47', 'https://www.themoviedb.org/movie/89333', NULL),
(109, 'Headless Body in Topless Bar ', 1995, '/smnQdk2Nlq6lZyvAgHetrn2Ohkl.jpg', 'An ex-con holds a group of people hostage in a topless bar.', 110, NULL, 2.67, '2024-09-17 21:38:47', 'https://www.themoviedb.org/movie/96357', NULL),
(110, 'Braveheart ', 1995, '/or1gBugydmjToAEq7OZY0owwFk.jpg', 'Enraged at the slaughter of Murron, his new bride and childhood love, Scottish warrior William Wallace slays a platoon of the local English lord\'s soldiers. This leads the village to revolt and, eventually, the entire country to rise up against English rule.', 177, NULL, 7.94, '2024-09-17 21:38:48', 'https://www.themoviedb.org/movie/197', NULL),
(111, 'Taxi Driver ', 1976, '/ekstpH614fwDX8DUln1a2Opz0N8.jpg', 'A mentally unstable Vietnam War veteran works as a night-time taxi driver in New York City where the perceived decadence and sleaze feed his urge for violent action.', 114, NULL, 8.10, '2024-09-17 21:38:49', 'https://www.themoviedb.org/movie/103', NULL),
(112, 'Rumble in the Bronx (Hont faan kui) ', 1995, '/1nAfchiXHQB3iyhK8fCJJEnNs5A.jpg', 'Keong comes from Hong Kong to visit New York for his uncle\'s wedding. His uncle runs a market in the Bronx and Keong offers to help out while Uncle is on his honeymoon. During his stay in the Bronx, Keong befriends a neighbor kid and beats up some neighborhood thugs who cause problems at the market. One of those petty thugs in the local gang stumbles into a criminal situation way over his head.', 104, NULL, 6.81, '2024-09-17 21:38:50', 'https://www.themoviedb.org/movie/33542', NULL),
(113, 'Before and After ', 1996, '/oK8UKDrjFS14OFoihaQPfmmMOyI.jpg', 'Two parents deal with the effects when their son is accused of murdering his girlfriend.', 108, NULL, 5.92, '2024-09-17 21:38:50', 'https://www.themoviedb.org/movie/43566', NULL),
(114, 'Margaret\'s Museum ', 1995, '/ulhih7Th6S9zuhR5kOiVdCm8Il4.jpg', 'In a town where half the men die down the coalpit, Margaret MacNeil is quite happy being single in her small Cape Breton island town. Until she meets Neil Currie, a charming and sincere bagpipe-playing, Gaelic-speaking dishwasher. But no matter what you do, you can\'t avoid the spectre of the pit forever.', 114, NULL, 6.60, '2024-09-17 21:38:51', 'https://www.themoviedb.org/movie/71754', NULL),
(115, 'Happiness Is in the Field (Bonheur est dans le pré, Le) ', 1995, '/tjHn19RpFMBmzQx58SBO40nLvhu.jpg', 'Francis, the boss of a small plumbing supply company, is harassed by tax collectors, striking employees, and an impossible wife and daughter. His only joy is sharing lunch with his friend Gerard. Then a TV show called \"where are you?\" shows a woman from Gers who is searching for her husband who disappeared 28 years ago. The lost husband looks like an identical twin of Francis...', 106, NULL, 6.87, '2024-09-17 21:38:52', 'https://www.themoviedb.org/movie/43612', NULL),
(116, 'Anne Frank Remembered ', 1995, '/6nyhzrSGimCbdxiY8DEO7kI7xx4.jpg', 'Using previously unreleased archival material in addition to contemporary interviews, this Academy Award-winning documentary tells the story of the Frank family and presents the first fully-rounded portrait of their brash and free-spirited daughter Anne, perhaps the world\'s most famous victim of the Holocaust.', 117, NULL, 7.57, '2024-09-17 21:38:53', 'https://www.themoviedb.org/movie/51352', NULL),
(117, 'Young Poisoner\'s Handbook, The ', 1995, '/d3Lakfy0K1eRHUbay9kMeWdt7y6.jpg', 'Graham Young is a teenage misfit living in suburban London in the 1960s. He hates his stepmother but loves chemistry, and the two impulses unite in a wicked plot to slowly poison her. After she dies, he\'s found guilty and sent to a psychiatric hospital, where an idealistic doctor thinks he can be cured.', 99, NULL, 6.64, '2024-09-17 21:38:53', 'https://www.themoviedb.org/movie/16934', NULL),
(118, 'If Lucy Fell ', 1996, '/l3Bwmjdon6JBDzJUA3ZSdMZZ7lI.jpg', 'Joe and Lucy are roommates and best friends. Lucy, whose love life is embarrassingly dull, convinces Joe, who is infatuated with a neighbor he\'s never met, that if they don\'t have stable romances within a month, they must jump off the Brooklyn Bridge.', 92, NULL, 5.15, '2024-09-17 21:38:54', 'https://www.themoviedb.org/movie/10324', NULL),
(119, 'Steal Big, Steal Little ', 1995, '/83TvBaWt8wZHUZo8MKwE2cLRBiT.jpg', 'Ruben and Robby are twin brothers, adopted by Mona, one of the wealthiest - and most eccentric - women in Santa Barbara. Ruben is devoted to Mona, but Robby is more devoted to her money. So when Mona leaves her fortune and estate to Ruben it starts a battle between brothers that soon leads to madness, mayhem, and even attempted murder. On Ruben\'s side is Lou Perilli an ex-Chicago cop and used car dealer who knows the law - and how to get around it. On Robby\'s side is ruthless businessman Reed Tyler, who is out to turn a swift profit on Mona\'s property. Walking a shifty line between them is Eddie Agopian, the family lawyer, who doesn\'t care which side wins as long as he\'s on the winner\'s side. But whether they\'re stealing big or stealing little, they\'re all stealing in this hilarious comedy about greed, power... and brotherly love.', 113, NULL, 4.30, '2024-09-17 21:38:55', 'https://www.themoviedb.org/movie/78406', NULL),
(120, 'Race the Sun ', 1996, '/jQA7TXgmEi35Zab6fHQ8VZ7Zhfn.jpg', 'A bunch of high school misfits in Hawaii, introduced by their new teacher, attend a science fair in which they draw up inspiration to build their own solar car and win a trip to compete in the 1990 World Solar Challenge in Australia.', 100, NULL, 5.18, '2024-09-17 21:38:56', 'https://www.themoviedb.org/movie/55731', NULL),
(121, 'Boys of St. Vincent, The ', 1992, '/cam0cG0UWdUVtQRvFHJXmNtL1hY.jpg', 'The true story of boys being sexually abused at their orphanage, run by a religious community in Newfoundland.', 93, NULL, 7.20, '2024-09-17 21:38:56', 'https://www.themoviedb.org/movie/32119', NULL),
(122, 'Boomerang ', 1992, '/cc9YAZq5NXiIEJsHjW7p2FaHQkp.jpg', 'Marcus is a successful advertising executive who woos and beds women almost at will. After a company merger he finds that his new boss, the ravishing Jacqueline, is treating him in exactly the same way. Completely traumatised by this, his work goes badly downhill.', 117, NULL, 5.67, '2024-09-17 21:38:57', 'https://www.themoviedb.org/movie/11066', NULL),
(123, 'Chungking Express (Chung Hing sam lam) ', 1994, '/43I9DcNoCzpyzK8JCkJYpHqHqGG.jpg', 'Two melancholic Hong Kong policemen fall in love: one with a mysterious underworld figure, the other with a beautiful and ethereal server at a late-night restaurant.', 103, NULL, 8.00, '2024-09-17 21:38:58', 'https://www.themoviedb.org/movie/11104', NULL),
(124, 'Star Maker, The (Uomo delle stelle, L\') ', 1995, '/wousyAPimHw7RQVjlvzA8BSr2pt.jpg', 'The adventures and deceptions of a photographer who travels through small villages of 1950s Sicily pretending to work for the big film studios in Rome.', 113, NULL, 7.06, '2024-09-17 21:38:58', 'https://www.themoviedb.org/movie/37975', NULL),
(125, 'Flirting With Disaster ', 1996, '/sRRdVLuxk8OLCDRd4u4xDrDdwv7.jpg', 'Adopted as a child, new father Mel Colpin decides he cannot name his son until he knows his birth parents, and determines to make a cross-country quest to find them. Accompanied by his wife, Nancy, and an inept yet gorgeous adoption agent, Tina, he departs on an epic road trip that quickly devolves into a farce of mistaken identities, wrong turns, and overzealous and love-struck ATF agents.', 92, NULL, 6.20, '2024-09-17 21:38:59', 'https://www.themoviedb.org/movie/2074', NULL),
(126, 'NeverEnding Story III, The ', 1994, '/o75HHfr23sgeqIeUPwjKY0V9Ppi.jpg', 'A young boy must restore order when a group of bullies steal the magical book that acts as a portal between Earth and the imaginary world of Fantasia.', 95, NULL, 4.46, '2024-09-17 21:39:00', 'https://www.themoviedb.org/movie/27793', NULL),
(127, 'Silences of the Palace, The (Saimt el Qusur) ', 1994, '/c8QQRaI3k3LNUqYKmlKldhLpgYK.jpg', 'The death of a prince brings a young woman back to the palace where she was born into servitude. The lingering legacy is brought into light from behind frosted windows and velvet curtains.', 124, NULL, 6.50, '2024-09-17 21:39:01', 'https://www.themoviedb.org/movie/44284', NULL),
(128, 'Jupiter\'s Wife ', 1994, '/2GIdaPLF7gYyXnlxGzTwV5fQGWy.jpg', 'Michel Negroponte, a documentary filmmaker, meets Maggie one day in Central Park. Maggie claims to be married to the god Jupiter and the daughter of actor Robert Ryan. Michel gets to know Maggie over the next couple of years, and attempts to use her often outlandish stories as clues to reconstruct her past.', 87, NULL, 7.14, '2024-09-17 21:39:02', 'https://www.themoviedb.org/movie/290157', NULL),
(129, 'Pie in the Sky ', 1996, '/iZs2BzP1nbrcHCDX3QEHa3Nn0y4.jpg', 'A young man obsessed with traffic patterns attempts to reunite with his first love.', 95, NULL, 6.60, '2024-09-17 21:39:03', 'https://www.themoviedb.org/movie/110972', NULL),
(130, 'Angela ', 1995, '/fhxU3jFzC2tlBgqFhB7NqO4qAFe.jpg', 'A ten year old girl named Angela leads her six year old sister, Ellie, through various regimens of \'purification\' in an attempt to rid themselves of their evil, which she believes to be the cause of their mother\'s mental illness. Precocious, to say the least, Angela has visions of Lucifer coming to take her and her sister away, and one of her remedies for this is for them to remain within a circle of their dolls and toys until they see a vision of the virgin Mary come to them. But such thinking can only lead to an ending befitting of her own mental state.', 99, NULL, 5.56, '2024-09-17 21:39:03', 'https://www.themoviedb.org/movie/32622', NULL),
(131, 'Frankie Starlight ', 1995, '/6v3VxWhFsr2Qx8qIQkG4WL3f76X.jpg', 'The quirky story of a young boy\'s adventures growing up with his stunningly beautiful mother and the two very different men who love her.', 101, NULL, 5.30, '2024-09-17 21:39:04', 'https://www.themoviedb.org/movie/73067', NULL),
(132, 'Jade ', 1995, '/8KWiZKDYpAgh8n27lanvTuDquyX.jpg', 'When a prominent art dealer is found murdered, the man\'s death leads to an intriguing investigation steeped in sex, corruption and crime. District Attorney David Corelli gets assigned to the case and discovers that a key suspect is his ex-lover Katrina Gavin, a beautiful psychologist who has settled down with his old friend and peer. As Corelli gets deeper into the case, he uncovers dark secrets with far-reaching implications.', 95, NULL, 5.41, '2024-09-17 21:39:05', 'https://www.themoviedb.org/movie/11863', NULL),
(133, 'Nueba Yol ', 1995, '/wXJImKBIFIanoZQsx0knEfthpq5.jpg', 'Balbuena is a genial illegal immigrant who makes his way to New York City to take a bite out of the Big Apple. But his hopes of finding a better life soon begin to fade as Balbuena encounters one obstacle after another in the hardscrabble, uncaring metropolis.', 102, NULL, 4.80, '2024-09-17 21:39:05', 'https://www.themoviedb.org/movie/55475', NULL),
(134, 'Sonic Outlaws ', 1995, '/AnUjiKfCnxwgEVW9r4xXq09BhdL.jpg', 'Within days of the release of Negativland\'s clever parody of U2 and Casey Kasem, recording industry giant Island Records descended upon the band with a battery of lawyers intent on erasing the piece from the history of rock music.  Craig \"Tribulation 99\" Baldwin follows this and other intellectual property controversies across the contemporary arts scene. Playful and ironic, his cut-and-paste collage-essay surveys the prospects for an \"electronic folk culture\" in the midst of an increasingly commodified corporate media landscape.', 87, NULL, 7.40, '2024-09-17 21:39:06', 'https://www.themoviedb.org/movie/124636', NULL),
(135, 'Down Periscope ', 1996, '/brleKcHsirTw7lFqcgUMOfgL2nl.jpg', 'Maverick Navy Lieutenant Commander Tom Dodge will never be a textbook officer, but he\'s a brilliant seaman who\'s always wanted to command a nuclear submarine — he\'s been given one last chance to clean up his record. Unfortunately, Admiral Graham, his nemesis, would rather sink the fleet than give Dodge his own boat. So, Graham stacks the deck against him and assigns Dodge to the Stingray, a diesel-powered WW2 submarine that can barely keep afloat. To make matters worse, Dodge\'s crew is a collection of maladjusted, mistake-prone misfits. Then, he\'s tagged the \"enemy\" in a crucial war game, and ordered to take on the U.S. Navy\'s best.', 92, NULL, 6.32, '2024-09-17 21:39:07', 'https://www.themoviedb.org/movie/9101', NULL),
(136, 'From the Journals of Jean Seberg ', 1995, '/i434k0SSFhDav9lCxFQzD95EciY.jpg', 'Mark Rappaport\'s creative bio-pic about actress Jean Seberg is presented in a first-person, autobiographical format. He seamlessly interweaves cinema, politics, American society and culture, and film theory to inform, entertain, and move the viewer. Seberg\'s many marriages, as well as her film roles, are discussed extensively. Her involvement with the Black Panther Movement and subsequent investigation by the FBI is covered. Notably, details of French New Wave cinema, Russian Expressionist (silent) films, and the careers of Jane Fonda, Vanessa Redgrave, and Clint Eastwood are also intensively examined. Much of the film is based on conjecture, but Rappaport encourages viewers to re-examine their ideas about women in film with this thought-provoking picture.', 97, NULL, 5.80, '2024-09-17 21:39:08', 'https://www.themoviedb.org/movie/123360', NULL),
(137, 'Man of the Year ', 1995, '/jVO3Gvsdqe5C9Jr7cE1fSOtW2Op.jpg', 'First-time director Dirk Shafer also penned this raucous \"mockumentary,\" a blend of fact and fiction that re-creates his 1992 reign as Playgirl magazine\'s Centerfold of the Year. When Shafer chooses to keep the fact that he\'s gay a secret from the magazine\'s editors, he finds himself living the ultimate lie -- and incapable of giving female readers what they really want. Will he succumb to his lover\'s pressures to come out of the closet?', 86, NULL, 3.10, '2024-09-17 21:39:08', 'https://www.themoviedb.org/movie/5757', NULL),
(138, 'Neon Bible, The ', 1995, '/2DyeA45isq3jIRlwG6VgwV8KQq7.jpg', 'During a train ride, a teenager recalls his upbringing in 1940s small-town Georgia and the events that have led to this point.', 92, NULL, 6.10, '2024-09-17 21:39:09', 'https://www.themoviedb.org/movie/39428', NULL),
(139, 'Target ', 1995, NULL, 'A subtle yet violent commentary on feudal lords.', 122, NULL, 0.00, '2024-09-17 21:39:10', 'https://www.themoviedb.org/movie/124639', NULL),
(140, 'Up Close and Personal ', 1996, '/2yf1pCiQk6JMy4k5zxf39YXQxGB.jpg', 'Tally Atwater has a dream: to be a prime-time network newscaster. She pursues this dream with nothing but ambition, raw talent and a homemade demo tape. Warren Justice is a brilliant, hard edged, veteran newsman. He sees Tally has talent and becomes her mentor. Tally’s career takes a meteoric rise and she and Warren fall in love. The romance that results is as intense and revealing as television news itself. Yet, each breaking story, every videotaped crisis that brings them together, also threatens to drive them apart...', 119, NULL, 6.30, '2024-09-17 21:39:11', 'https://www.themoviedb.org/movie/9302', NULL),
(141, 'Birdcage, The ', 1996, '/4IpC35BoA5aRO0Q1DpFGJ8iKKYq.jpg', 'A gay cabaret owner and his drag queen companion agree to put up a false straight front so that their son can introduce them to his fiancée\'s conservative moralistic parents.', 119, NULL, 7.03, '2024-09-17 21:39:11', 'https://www.themoviedb.org/movie/11000', NULL),
(142, 'Shadows (Cienie) ', 1988, '/emSTzEr2qdo3lV14ZQ3uIYsqHJS.jpg', 'During the Second World War, tens of thousands of blonde, blue-eyed Polish children were snatched from their parents and given to German families. Lebensborn was part of Hitler\'s plan to expand the Aryan master race within the Third Reich. Eight-year old Jerzy returns home at the end of the war to a joyful reunion with his long-lost mother and grandfather. But problems arise as he is taunted by his peers and, longing for his missing father, burns with resentment for his new communist stepfather.', 101, NULL, 7.60, '2024-09-17 21:39:12', 'https://www.themoviedb.org/movie/525153', NULL),
(143, 'Gospa ', 1995, '/dIvQt3ykeR2TsRMOuDtlR1p2uCt.jpg', 'In 1981 in Medjugorje (BA), a group of kids claim that Virgin Mary appeared to them on a hill. The local priest believes them and spreads the word. Religious tourism blossoms. The communist government is concerned and arrests the priest.', 125, NULL, 4.60, '2024-09-17 21:39:13', 'https://www.themoviedb.org/movie/249882', NULL),
(144, 'Brothers McMullen, The ', 1995, '/6oWsOJP0ed5gs8n2UywcailoxFN.jpg', 'Deals with the lives of the three Irish Catholic McMullen brothers from Long Island, New York, over three months, as they grapple with basic ideas and values — love, sex, marriage, religion and family — in the 1990s. Directed, written, produced by and starring Edward Burns.', 98, NULL, 6.00, '2024-09-17 21:39:14', 'https://www.themoviedb.org/movie/16388', NULL),
(145, 'Bad Boys ', 1995, '/x1ygBecKHfXX4M2kRhmFKWfWbJc.jpg', 'Marcus Burnett is a henpecked family man. Mike Lowrey is a footloose and fancy free ladies\' man. Both Miami policemen, they have 72 hours to reclaim a consignment of drugs stolen from under their station\'s nose. To complicate matters, in order to get the assistance of the sole witness to a murder, they have to pretend to be each other.', 119, NULL, 6.81, '2024-09-17 21:39:14', 'https://www.themoviedb.org/movie/9737', NULL),
(146, 'Amazing Panda Adventure, The ', 1995, '/tIK40vCE9i8g4VhyJ3LLr5y1ROJ.jpg', 'Far from home in the lush bamboo forests of China, ten-year-old Ryan Tyler, with the help of a young girl, goes on a wonderful journey to rescue a baby panda taken by poachers.', 84, NULL, 5.55, '2024-09-17 21:39:15', 'https://www.themoviedb.org/movie/30765', NULL),
(147, 'Basketball Diaries, The ', 1995, '/AhvO1GGDPIgN0hOqZEgaFCbswMK.jpg', 'A high school basketball player’s life turns upside down after free-falling into the harrowing world of drug addiction.', 102, NULL, 7.40, '2024-09-17 21:39:16', 'https://www.themoviedb.org/movie/10474', NULL),
(148, 'Awfully Big Adventure, An ', 1995, '/tfXBuRBMbyu9IF9KCFz3kXeWQDT.jpg', 'Liverpool. 1947. Right after World War II, a star struck naive teenage girl joins a shabby theatre troupe in Liverpool. During a winter production of Peter Pan, the play quickly turns into a dark metaphor for youth as she becomes drawn into a web of sexual politics and intrigue and learns about the grown-up world of the theater.', 113, NULL, 6.63, '2024-09-17 21:39:17', 'https://www.themoviedb.org/movie/22279', NULL),
(149, 'Amateur ', 1994, '/pTgQTGeeQVw5Hhh48fIs2ImDn0p.jpg', 'A man wakes up in an alley, bleeding and with no memory of who he is. He stumbles into a coffee shop and is befriended by a charitable ex-nun who is failing in her attempts to write marketable pornography.', 105, NULL, 6.30, '2024-09-17 21:39:17', 'https://www.themoviedb.org/movie/30157', NULL),
(150, 'Apollo 13 ', 1995, '/kzj95o9FlVxKziQq36mjES3wxel.jpg', 'The true story of technical troubles that scuttle the Apollo 13 lunar mission in 1970, risking the lives of astronaut Jim Lovell and his crew, with the failed journey turning into a thrilling saga of heroism. Drifting more than 200,000 miles from Earth, the astronauts work furiously with the ground crew to avert tragedy.', 140, NULL, 7.40, '2024-09-17 21:39:18', 'https://www.themoviedb.org/movie/568', NULL),
(151, 'Rob Roy ', 1995, '/4QuypgbNYmPECAAHnV3QY8qEpOz.jpg', 'In the highlands of Scotland in the 1700s, Rob Roy tries to lead his small town to a better future, by borrowing money from the local nobility to buy cattle to herd to market. When the money is stolen, Rob is forced into a Robin Hood lifestyle to defend his family and honour.', 139, NULL, 6.73, '2024-09-17 21:39:19', 'https://www.themoviedb.org/movie/11780', NULL),
(152, 'Addiction, The ', 1995, '/1Yy8H2tKQ16mffLFRfxcBHKBdyF.jpg', 'A vampiric doctoral student tries to follow the philosophy of a nocturnal comrade and control her thirst for blood.', 82, NULL, 6.49, '2024-09-17 21:39:20', 'https://www.themoviedb.org/movie/34996', NULL),
(153, 'Batman Forever ', 1995, '/mzzNBVwTiiY94xAXDMWJpNPW2US.jpg', 'Batman must battle a disfigured district attorney and a disgruntled former employee with help from an amorous psychologist and a young circus acrobat.', 121, NULL, 5.43, '2024-09-17 21:39:21', 'https://www.themoviedb.org/movie/414', NULL),
(154, 'Beauty of the Day (Belle de jour) ', 1967, '/iUAFECovwPA0cVV9bo4uNGLJSGL.jpg', 'Beautiful young housewife Séverine Serizy cannot reconcile her masochistic fantasies with her everyday life alongside dutiful husband Pierre. When her lovestruck friend Henri mentions a secretive high-class brothel run by Madame Anais, Séverine begins to work there during the day under the name Belle de Jour. But when one of her clients grows possessive, she must try to go back to her normal life.', 101, NULL, 7.38, '2024-09-17 21:39:22', 'https://www.themoviedb.org/movie/649', NULL),
(155, 'Beyond Rangoon ', 1995, '/xTiy5kSP3Hetig7xB4E8INq5ron.jpg', 'Dr. Laura Bowman is a young widow who\'s unwittingly drawn into political turmoil while vacationing in Burma in the late 1980s. Bowman initially left San Francisco with her sister in an attempt to escape painful memories of her husband and son\'s violent deaths. But her fight to escape to Thailand could prove just as harrowing.', 100, NULL, 6.60, '2024-09-17 21:39:22', 'https://www.themoviedb.org/movie/1873', NULL),
(156, 'Blue in the Face ', 1995, '/u0iwm9SDjlfFZDrSdSbcebX7VUG.jpg', 'Auggie runs a small tobacco shop in Brooklyn, New York. The whole neighborhood comes to visit him to buy cigarettes and have some small talk. During the movie Lou Reed tries to explain why he has to have a cut on his health insurance bill if he keeps smoking and Madonna acts as a Singing Telegram.', 83, NULL, 6.56, '2024-09-17 21:39:23', 'https://www.themoviedb.org/movie/5894', NULL),
(157, 'Canadian Bacon ', 1995, '/bzK2aQ8xUB67kwCR5LHTSY99HtT.jpg', 'The U.S. President, low in the opinion polls, gets talked into raising his popularity by trying to start a cold war with Canada.', 91, NULL, 5.70, '2024-09-17 21:39:24', 'https://www.themoviedb.org/movie/1775', NULL),
(158, 'Casper ', 1995, '/2ah8fNJFZVU3vcXhU5xfAYi2eym.jpg', 'Casper is a kind young ghost who peacefully haunts a mansion in Maine. When specialist James Harvey arrives to communicate with Casper and his fellow spirits, he brings along his teenage daughter, Kat. Casper quickly falls in love with Kat, but their budding relationship is complicated not only by his transparent state, but also by his troublemaking apparition uncles and their mischievous antics.', 100, NULL, 6.32, '2024-09-17 21:39:25', 'https://www.themoviedb.org/movie/8839', NULL),
(159, 'Clockers ', 1995, '/c79uqLJleho2a7OQayfrW5Ypphf.jpg', 'Strike is a young city drug pusher under the tutelage of drug lord Rodney Little. When a night manager at a fast-food restaurant is found with four bullets in his body, Strike’s older brother turns himself in as the killer. Detective Rocco Klein doesn’t buy the story, however, setting out to find the truth, and it seems that all the fingers point toward Strike & Rodney.', 128, NULL, 6.70, '2024-09-17 21:39:26', 'https://www.themoviedb.org/movie/20649', NULL),
(160, 'Congo ', 1995, '/hPNSToNIIpRO6y5Rh973leqQqNr.jpg', 'Eight people embark on an expedition into the Congo, a mysterious expanse of unexplored Africa where human greed and the laws of nature have gone berserk. When the thrill-seekers -- some with ulterior motives -- stumble across a race of killer apes.', 109, NULL, 5.50, '2024-09-17 21:39:26', 'https://www.themoviedb.org/movie/10329', NULL),
(161, 'Crimson Tide ', 1995, '/21nqRJ6ofEgVvEl68J4O9V26Xzy.jpg', 'After the Cold War, a breakaway Russian republic with nuclear warheads becomes a possible worldwide threat. U.S. submarine Capt. Frank Ramsey signs on a relatively green but highly recommended Lt. Cmdr. Ron Hunter to the USS Alabama, which may be the only ship able to stop a possible Armageddon. When Ramsay insists that the Alabama must act aggressively, Hunter, fearing they will start rather than stop a disaster, leads a potential mutiny to stop him.', 116, NULL, 7.17, '2024-09-17 21:39:27', 'https://www.themoviedb.org/movie/8963', NULL),
(162, 'Crumb ', 1994, '/oJWGWzaYdYG4mkQK6sbus5Tenho.jpg', 'This movie chronicles the life and times of R. Crumb. Robert Crumb is the cartoonist/artist who drew Keep On Truckin\', Fritz the Cat, and played a major pioneering role in the genesis of underground comix. Through interviews with his mother, two brothers, wife, and ex-girlfriends, as well as selections from his vast quantity of graphic art, we are treated to a darkly comic ride through one man\'s subconscious mind.', 120, NULL, 7.54, '2024-09-17 21:39:28', 'https://www.themoviedb.org/movie/26564', NULL),
(163, 'Desperado ', 1995, '/e3gwpBeXpvGZsxUya9zNym5QXrw.jpg', 'El Mariachi plunges headfirst into the dark border underworld when he follows a trail of blood to the last of the infamous Mexican drug lords, Bucho, for an action-packed, bullet-riddled showdown. With the help of his friend and a beautiful bookstore owner, El Mariachi tracks Bucho, takes on his army of desperados, and leaves his own trail of blood.', 104, NULL, 6.90, '2024-09-17 21:39:29', 'https://www.themoviedb.org/movie/8068', NULL),
(164, 'Devil in a Blue Dress ', 1995, '/5lcJhwKGavLbPva17QkTBhLfqEk.jpg', 'In late 1940s Los Angeles, Easy Rawlins is an unemployed black World War II veteran with few job prospects. At a bar, Easy meets DeWitt Albright, a mysterious white man looking for someone to investigate the disappearance of a missing white woman named Daphne Monet, who he suspects is hiding out in one of the city\'s black jazz clubs. Strapped for money and facing house payments, Easy takes the job, but soon finds himself in over his head.', 102, NULL, 6.44, '2024-09-17 21:39:30', 'https://www.themoviedb.org/movie/8512', NULL),
(165, 'Die Hard: With a Vengeance ', 1995, '/skdHpVja0uRNKVVN9ksviI86I4z.jpg', 'New York detective John McClane is back and kicking bad-guy butt in the third installment of this action-packed series, which finds him teaming with civilian Zeus Carver to prevent the loss of innocent lives. McClane thought he\'d seen it all, until a genius named Simon engages McClane, his new \"partner\" -- and his beloved city -- in a deadly game that demands their concentration.', 128, NULL, 7.27, '2024-09-17 21:39:31', 'https://www.themoviedb.org/movie/1572', NULL),
(166, 'Doom Generation, The ', 1995, '/cRzRj2UBvIH8ryWhu5PNL2PzV7j.jpg', 'Jordan White and Amy Blue, two troubled teens, pick up an adolescent drifter, Xavier Red. Together, the threesome embarks on a sex- and violence-filled journey through a United States of psychos and quickie marts.', 83, NULL, 6.40, '2024-09-17 21:39:31', 'https://www.themoviedb.org/movie/13552', NULL),
(167, 'Feast of July ', 1995, '/inUPybROcLlzdG4EQeDIShfFjsD.jpg', 'After an abandoned young woman in late 19th Century England is taken in by a rural couple with three handsome sons, tragic consequences result.', 116, NULL, 5.90, '2024-09-17 21:39:32', 'https://www.themoviedb.org/movie/259209', NULL),
(168, 'First Knight ', 1995, '/xuXkCcrvUTkehVXuTGpnfySsx0Z.jpg', 'The timeless tale of King Arthur and the legend of Camelot are retold in this passionate period drama. Arthur is reluctant to hand the crown to Lancelot, and Guinevere is torn between her loyalty to her husband and her growing love for his rival. But Lancelot must balance his loyalty to the throne with the rewards of true love.', 134, NULL, 6.09, '2024-09-17 21:39:33', 'https://www.themoviedb.org/movie/6520', NULL),
(169, 'Free Willy 2: The Adventure Home ', 1995, '/3wpug3W5rYBdqeAnhc1UeXLE5ZF.jpg', 'Jesse becomes reunited with Willy three years after the whale\'s jump to freedom as the teenager tries to rescue the killer whale and other orcas from an oil spill.', 95, NULL, 5.92, '2024-09-17 21:39:34', 'https://www.themoviedb.org/movie/9073', NULL),
(170, 'Hackers ', 1995, '/qfx2EENW1sOpKNVKLzr7VOhlxkt.jpg', 'Along with his new friends, a teenager who was arrested by the US Secret Service and banned from using a computer for writing a computer virus discovers a plot by a nefarious hacker, but they must use their computer skills to find the evidence while being pursued by the Secret Service and the evil computer genius behind the virus.', 107, NULL, 6.40, '2024-09-17 21:39:35', 'https://www.themoviedb.org/movie/10428', NULL),
(171, 'Jeffrey ', 1995, '/tHcKImp3QqG7UWdv3PzEHZX8oHT.jpg', 'Jeffrey, a gay man living in New York City with an overwhelming fear of contracting AIDS, concludes that being celibate is the only option to protect himself. As fate would have it, shortly after his declaration of a sex-free existence, he meets the handsome Steve Howard, his dream man -- except for his HIV-positive status. Facing this dilemma, Jeffrey turns to his best friend and an outrageous priest for guidance.', 92, NULL, 6.23, '2024-09-17 21:39:36', 'https://www.themoviedb.org/movie/17447', NULL),
(172, 'Johnny Mnemonic ', 1995, '/iH8Jgi8qvb7pnBfI8fVGaUbyRna.jpg', 'In a dystopian 2021, Johnny is a data trafficker who has an implant that allows him to securely store data too sensitive for regular computer networks. On one delivery run, he accepts a package that not only exceeds the implant\'s safety limits—and will kill him if the data is not removed in time—but also contains information far more important and valuable than he had ever imagined. On a race against time, he must avoid the assassins sent to kill him and remove the data before it, too, ends his life.', 97, NULL, 5.75, '2024-09-17 21:39:36', 'https://www.themoviedb.org/movie/9886', NULL),
(173, 'Judge Dredd ', 1995, '/cfSnKn8NDU3m8UxihjVcYprA0Aq.jpg', 'In a dystopian future, Dredd, the most famous judge (a cop with instant field judiciary powers) is convicted for a crime he did not commit while his murderous counterpart escapes.', 96, NULL, 5.80, '2024-09-17 21:39:37', 'https://www.themoviedb.org/movie/9482', NULL),
(174, 'Jury Duty ', 1995, '/DbKQDPqBE4kCaePj4CHu6r3ZAb.jpg', 'When jobless Tommy Collins discovers that sequestered jurors earn free room and board as well as $5-a-day, he gets himself assigned to a jury in a murder trial. Once there, he does everything he can to prolong the trial and deliberations and make the sequestration more comfortable for himself.', 88, NULL, 4.38, '2024-09-17 21:39:38', 'https://www.themoviedb.org/movie/19326', NULL),
(175, 'Kids ', 1995, '/8qV8hUVCUnFIQKewzlhaFWhdszK.jpg', 'A day in the life of a group of teens as they travel around New York City skating, drinking, smoking and deflowering virgins.', 91, NULL, 6.87, '2024-09-17 21:39:39', 'https://www.themoviedb.org/movie/9344', NULL),
(176, 'Living in Oblivion ', 1995, '/b54xDk98oWtEtAso9sj1wjaZDDH.jpg', 'Nick is the director of a low-budget indie film. He tries to keep everything together as his production is plagued with an insecure actress, a megalomaniac star, a pretentious, beret-wearing director of photography, and lousy catering.', 90, NULL, 7.18, '2024-09-17 21:39:40', 'https://www.themoviedb.org/movie/9071', NULL),
(177, 'Lord of Illusions ', 1995, '/miQREwapDUNwfInokjeVLt8BiNM.jpg', 'During a routine case in L.A., NY private investigator Harry D\'Amour stumbles over members of a fanatic cult who are preparing for the resurrection of their leader Nix, a powerful magician who was killed 13 years earlier.', 119, NULL, 6.00, '2024-09-17 21:39:41', 'https://www.themoviedb.org/movie/8973', NULL),
(178, 'Love & Human Remains ', 1993, '/9QVw6cPXfsjr4PncE1TeWudeLmh.jpg', 'In a Canadian metropolis, failed actor David shares a place with the bookish Candy, whom he dated before coming out as gay. While David, who now waits tables, pursues an aimless romance with a younger coworker, Candy dabbles in both same-sex and heterosexual affairs. As David and Candy\'s odd assortment of friends — including a telepathic sex worker and an ill-tempered yuppie — pass in and out of their beds, a serial murder stalks the city\'s women.', 100, NULL, 5.77, '2024-09-17 21:39:41', 'https://www.themoviedb.org/movie/15730', NULL),
(179, 'Mad Love ', 1995, '/glhctWoYw1jg8z0FUSwFD4UTNi4.jpg', 'Matt falls for Casey, the new girl in school. She\'s fun-loving and eccentric, but there\'s a darkness to her whimsy that Matt can\'t begin to comprehend. When Casey attempts to commit suicide, her parents place her in a mental institution. Matt springs her out, and together the young lovers head on a road trip. They believe their love can \"cure\" Casey\'s problems. Matt starts to wonder, though, if are they inspired or misguided.', 95, NULL, 5.15, '2024-09-17 21:39:42', 'https://www.themoviedb.org/movie/47608', NULL),
(180, 'Mallrats ', 1995, '/kNm0AQFIc4nlzCd8Nqvbb5gccAV.jpg', 'Both dumped by their girlfriends, two best friends seek refuge in the local mall. Eventually, they decide to try and win back their significant others and take care of their respective nemeses.', 94, NULL, 6.80, '2024-09-17 21:39:43', 'https://www.themoviedb.org/movie/2293', NULL),
(181, 'Mighty Morphin Power Rangers: The Movie ', 1995, '/pcLbHqs80dchv0byHivhdwHKEup.jpg', 'Six incredible teens out-maneuver and defeat evil everywhere as the Mighty Morphin Power Rangers, but this time the Power Rangers may have met their match when they face off with Ivan Ooze, the most sinister monster the galaxy has ever seen.', 96, NULL, 5.82, '2024-09-17 21:39:44', 'https://www.themoviedb.org/movie/9070', NULL),
(182, 'Moonlight and Valentino ', 1995, '/wZJ94p4Hih0UlsWNlvR2XDtTkDH.jpg', 'A young widow still grieving over the death of her husband finds herself being comforted by a local housepainter.', 100, NULL, 5.56, '2024-09-17 21:39:45', 'https://www.themoviedb.org/movie/68274', NULL),
(183, 'Mute Witness ', 1994, '/kfCIZNpb2bWspnQNkIQftQlksCU.jpg', 'Billy is mute, but it hasn\'t kept her from becoming a successful makeup artist. While in Russia, working on a film directed by her sister\'s boyfriend, Andy, Billy finds herself trapped in the studio one night and is horrified to see a snuff film being made. Billy escapes and, with the help of her sister, Kate, alerts authorities about what she saw. Unfortunately, in doing so, she makes an enemy of the Russian mafia, who funded the snuff film.', 95, NULL, 6.30, '2024-09-17 21:39:46', 'https://www.themoviedb.org/movie/48787', NULL),
(184, 'Nadja ', 1994, '/sIZl6Oy5nn4kHKHamX50tSPF4Ob.jpg', 'In a contemporary New York City, members of a dysfunctional family of vampires are trying to come to terms with each other, in the wake of their father\'s death. Meanwhile, they are being hunted by Dr. Van Helsing and his hapless nephew. As in all good vampire movies, forces of love are pitted against forces of destruction.', 93, NULL, 5.67, '2024-09-17 21:39:46', 'https://www.themoviedb.org/movie/34574', NULL),
(185, 'Net, The ', 1995, '/dtupntUFMD5iXBo8HLfALt2ET4R.jpg', 'Angela Bennett is a freelance software engineer who lives in a world of computer technology. When a cyber friend asks Bennett to debug a new game, she inadvertently becomes involved in a conspiracy that will soon turn her life upside down and make her the target of an assassination.', 114, NULL, 6.02, '2024-09-17 21:39:47', 'https://www.themoviedb.org/movie/1642', NULL),
(186, 'Nine Months ', 1995, '/z1nzYuoeTbGBrSicDxJEhJhEQz8.jpg', 'When he finds out his longtime girlfriend is pregnant, a commitment-phobe realizes he might have to change his lifestyle for better or much, much worse.', 103, NULL, 5.70, '2024-09-17 21:39:48', 'https://www.themoviedb.org/movie/11472', NULL),
(187, 'Party Girl ', 1995, '/cfGEUftQVjvJHTTc3OKbzfsBamT.jpg', 'Although Mary has little income, she still finds ways to spend her nights at clubs. After being arrested for throwing an illegal rave, she asks her aunt Judy for bail money. Judy then finds Mary a job at her library so that Mary can repay her. Initially, Mary finds the job as a clerk boring and stifling, and prefers to get to know a street food vendor whom she likes. However, Mary must refocus her life once she loses her job and apartment.', 94, NULL, 6.40, '2024-09-17 21:39:49', 'https://www.themoviedb.org/movie/36196', NULL),
(188, 'Prophecy, The ', 1995, '/4ZWFhQipzBHJze2llzCzhrSIZsn.jpg', 'The angel Gabriel comes to Earth to collect a soul which will end the stalemated war in Heaven, and only a former priest and a little girl can stop him.', 98, NULL, 6.47, '2024-09-17 21:39:50', 'https://www.themoviedb.org/movie/11980', NULL),
(189, 'Reckless ', 1995, '/edNTtl2UuKcU8vXEaYgu76vISXw.jpg', 'On Christmas Eve, a relentlessly cheerful woman escapes from the killers hired by her husband, and embarks on a series of strange encounters.', 91, NULL, 6.36, '2024-09-17 21:39:50', 'https://www.themoviedb.org/movie/58372', NULL),
(190, 'Safe ', 1995, '/2O71QsBkbqdLqQdx2yuNpJ4pFPq.jpg', 'Carol White, a Los Angeles housewife in the late 1980s, comes down with a debilitating illness with no clear diagnosis.', 119, NULL, 6.97, '2024-09-17 21:39:51', 'https://www.themoviedb.org/movie/32646', NULL),
(191, 'Scarlet Letter, The ', 1995, '/8gIU7O3oV6NyWUjlL6ppbpnIZLW.jpg', 'Set in puritanical Boston in the mid 1600s, the story of seamstress Hester Prynne, who is outcast after she becomes pregnant by a respected reverend. She refuses to divulge the name of the father, is \"convicted\" of adultery and forced to wear a scarlet \"A\" until an Indian attack unites the Puritans and leads to a reevaluation of their laws and morals.', 135, NULL, 6.03, '2024-09-17 21:39:52', 'https://www.themoviedb.org/movie/10533', NULL),
(192, 'The Show ', 1995, '/u08TkPYyKeHvkrpvLEZxRLVxdwu.jpg', 'A documentary about the culture of hip-hop. Through interviews with some of hip-hops biggest names, the film makers attempt to find out why it has become so popular.', 93, NULL, 6.38, '2024-09-17 21:39:53', 'https://www.themoviedb.org/movie/56088', NULL),
(193, 'Showgirls ', 1995, '/atjtGFIIt9QMGf9ELyboq5cl466.jpg', 'Fresh to Las Vegas with no connections, Nomi Malone takes a job as an exotic dancer. Her talents are quickly noticed by Cristal, a headlining dancer who senses an opportunity to bolster her own act. But Nomi won’t play second fiddle and soon begins her venomous path to the top, ruthlessly backstabbing anyone who gets in her way.', 131, NULL, 5.55, '2024-09-17 21:39:54', 'https://www.themoviedb.org/movie/10802', NULL),
(194, 'Smoke ', 1995, '/phvnN7OPEnlHoAZe8nsSqPDD8B0.jpg', 'Writer Paul Benjamin is nearly hit by a bus when he leaves Auggie Wren\'s smoke shop. Stranger Rashid Cole  saves his life, and soon middle-aged Paul tells homeless Rashid that he wouldn\'t mind a short-term housemate. Still grieving over his wife\'s murder, Paul is moved by both Rashid\'s quest to reconnect with his father and Auggie\'s discovery that a woman who might be his daughter is about to give birth.', 112, NULL, 7.19, '2024-09-17 21:39:55', 'https://www.themoviedb.org/movie/10149', NULL),
(195, 'Something to Talk About ', 1995, '/a52KpsmvLNdTdmDzw1fUrJONpfH.jpg', 'Grace King Bichon, who is managing her father\'s riding-stable, discovers that her husband Eddie is deceiving her with another woman. After confronting him in the middle of the night on the streets of their small home town, she decides to stay at her sister Emma Rae\'s house for a while to make up her mind. Breaking out of her everyday life, she starts to question the authority of everyone.', 106, NULL, 5.70, '2024-09-17 21:39:56', 'https://www.themoviedb.org/movie/18402', NULL),
(196, 'Species ', 1995, '/cT5wdyo8kT7dycqjrolJ2sHWkFx.jpg', 'In 1993, the Search for Extra Terrestrial Intelligence Project receives a transmission detailing an alien DNA structure, along with instructions on how to splice it with human DNA. The result is Sil, a sensual but deadly creature who can change from a beautiful woman to an armour-plated killing machine in the blink of an eye.', 108, NULL, 5.97, '2024-09-17 21:39:56', 'https://www.themoviedb.org/movie/9348', NULL),
(197, 'Stars Fell on Henrietta, The ', 1995, '/dQYD0WNRNZ5OBQ8iWRySIH8TEVd.jpg', 'The setting is early America during the oil boom. An elderly, down on his luck \'oil man\', Mr. Cox finds himself in the town of Henrietta. Using unconventional methods, he convinces himself and local Don Day that there is oil on Day\'s land. The financially strapped Day puts everything into finding oil...but at what cost?', 109, NULL, 6.10, '2024-09-17 21:39:57', 'https://www.themoviedb.org/movie/139408', NULL),
(198, 'Strange Days ', 1995, '/rY5BrDRcYAKE0BYmmT66YG6Uy5Q.jpg', 'Former policeman Lenny Nero has moved into a more lucrative trade: the illegal sale of virtual reality-like recordings that allow users to experience the emotions and past experiences of others. While they typically contain tawdry incidents, Nero is shocked when he receives one showing a murder.', 145, NULL, 7.00, '2024-09-17 21:39:58', 'https://www.themoviedb.org/movie/281', NULL),
(199, 'Umbrellas of Cherbourg, The (Parapluies de Cherbourg, Les) ', 1964, '/7XHxvEo1C1GzbTkZuH8aAU8wOeV.jpg', 'This simple romantic tragedy begins in 1957. Guy Foucher, a 20-year-old French auto mechanic, has fallen in love with 17-year-old Geneviève Emery, an employee in her widowed mother\'s chic but financially embattled umbrella shop. On the evening before Guy is to leave for a two-year tour of combat in Algeria, he and Geneviève make love. She becomes pregnant and must choose between waiting for Guy\'s return or accepting an offer of marriage from a wealthy diamond merchant.', 92, NULL, 7.36, '2024-09-17 21:39:59', 'https://www.themoviedb.org/movie/5967', NULL),
(200, 'Tie That Binds, The ', 1995, '/xwrY46PITbSoCiKm9gTnDWP47Kh.jpg', 'A young couple adopts a traumatized child, unaware that her parents are fugitives and murderers who will do anything to get her back.', 99, NULL, 4.80, '2024-09-17 21:40:00', 'https://www.themoviedb.org/movie/79593', NULL),
(201, 'Three Wishes ', 1995, '/8uzNbDH1b90DTsy38NPLqVIVpAH.jpg', 'While Jane Holman is driving with her two sons, she accidentally runs into a drifter, Jack McCloud, who breaks his leg. Being responsible, Jane invites Jack, and his dog, to stay at her home until his leg has healed. Jack struggles to adapt their lifestyle, and finds himself loved by the family.', 115, NULL, 6.16, '2024-09-17 21:40:00', 'https://www.themoviedb.org/movie/47939', NULL),
(202, 'Total Eclipse ', 1995, '/e0j1zDF3ITeTbGTXFGamosCxT4z.jpg', 'Young, wild poet Arthur Rimbaud and his mentor Paul Verlaine engage in a fierce, forbidden romance while feeling the effects of a hellish artistic lifestyle.', 111, NULL, 6.43, '2024-09-17 21:40:01', 'https://www.themoviedb.org/movie/36834', NULL),
(203, 'To Wong Foo, Thanks for Everything! Julie Newmar ', 1995, '/8bkJiI6N8wDxAtQ49bLUt0qCBII.jpg', 'Manhattan drag queens Vida Boheme and Noxeema Jackson impress regional judges in competition, securing berths in the Nationals in Los Angeles. When the two meet pathetic drag novice Chi-Chi Rodriguez — one of the losers that evening — the charmed Vida and Noxeema agree to take the hopeless youngster under their joined wing. Soon the three set off on a madcap road trip across America and struggle to make it to Los Angeles in time.', 109, NULL, 7.30, '2024-09-17 21:40:02', 'https://www.themoviedb.org/movie/9090', NULL),
(204, 'Under Siege 2: Dark Territory ', 1995, '/gElwFCQTbSK5hdK0PVyia547nst.jpg', 'A passenger train has been hijacked by an electronics expert and turned into an untraceable command center for a weapons satellite. He has planned to blow up Washington DC and only one man can stop him, former Navy SEAL Casey Ryback.', 99, NULL, 5.83, '2024-09-17 21:40:03', 'https://www.themoviedb.org/movie/3512', NULL),
(205, 'Unstrung Heroes ', 1995, '/twnqc80AL55WYnCVz4nMGEGcL7.jpg', 'Steven Lidz, unhappy with his home life since his mother became sick, moves in with his two eccentric uncles. As Steven grows closer to his uncles, he learns how to cope with his emotions and to value his own uniqueness.', 93, NULL, 5.93, '2024-09-17 21:40:04', 'https://www.themoviedb.org/movie/52856', NULL),
(206, 'Unzipped ', 1995, '/dnIzv4rXr9FXkqW880E3rStYQA7.jpg', 'Isaac Mizrahi, one of the most successful designers in high fashion, plans his fall 1994 collection.', 73, NULL, 5.47, '2024-09-17 21:40:05', 'https://www.themoviedb.org/movie/77350', NULL),
(207, 'Walk in the Clouds, A ', 1995, '/xencQzZnUWDRAOUydjf9PWet8Ae.jpg', 'World War II vet Paul Sutton falls for a pregnant and unwed woman who persuades him -- during their first encounter -- to pose as her husband so she can face her family.', 103, NULL, 7.30, '2024-09-17 21:40:06', 'https://www.themoviedb.org/movie/9560', NULL),
(208, 'Waterworld ', 1995, '/f4Q6BKm1lv9u5xoffbIIwrOYf6z.jpg', 'In a futuristic world where the polar ice caps have melted and made Earth a liquid planet, a beautiful barmaid rescues a mutant seafarer from a floating island prison. They escape, along with her young charge, Enola, and sail off aboard his ship. But the trio soon becomes the target of a menacing pirate who covets the map to \'Dryland\'—which is tattooed on Enola\'s back.', 135, NULL, 6.22, '2024-09-17 21:40:06', 'https://www.themoviedb.org/movie/9804', NULL),
(209, 'White Man\'s Burden ', 1995, '/5MPatVYJXPYEGrd9RQiwldBBQvJ.jpg', 'The story takes place in alternative America where the blacks are members of social elite, and whites are inhabitants of inner city ghettos. Louis Pinnock is a white worker in a chocolate factory, loving husband and father of two children. While delivering a package for black CEO Thaddeus Thomas, he is mistaken for a voyeur and, as a result, loses his job, gets beaten by black cops and his family gets evicted from their home. Desperate Pinnock takes a gun and kidnaps Thomas, demanding justice.', 89, NULL, 5.00, '2024-09-17 21:40:07', 'https://www.themoviedb.org/movie/31611', NULL),
(210, 'Wild Bill ', 1995, '/g5sQTDwc4BcvRCBAhnujhBPIEO1.jpg', 'Biopic about famous gunslinger Wild Bill Hickock. The early career of legendary lawman is telescoped and culminates in his relocation in Deadwood and a reunion with Calamity Jane.', 98, NULL, 5.65, '2024-09-17 21:40:08', 'https://www.themoviedb.org/movie/65796', NULL),
(211, 'Browning Version, The ', 1994, '/8My9Wnzu1zasVVzGdDj5y2dItuM.jpg', 'Andrew Crocker-Harris is an embittered and disliked teacher of Greek and Latin at a British prep school. After nearly 20 years of service, he is being forced to retire for \'health reasons\', and perhaps may not even be given a pension. The boys regard him as a Hitler, with some justification. His unfaithful wife Laura tries to hurt him in any way she can. Andrew must come to terms with his failed life and at least regain his own self-esteem.', 97, NULL, 6.47, '2024-09-17 21:40:09', 'https://www.themoviedb.org/movie/49805', NULL),
(212, 'Bushwhacked ', 1995, '/uurw7SlXjIrxEaiFFzDifanhfIq.jpg', 'A inept courier realises he has been used by criminals to deliver money. On the run from both the criminals and police, he poses as a Scout leader and leads a scout group on a hike through the mountains.', 90, NULL, 5.25, '2024-09-17 21:40:10', 'https://www.themoviedb.org/movie/26258', NULL),
(213, 'Burnt by the Sun (Utomlyonnye solntsem) ', 1994, '/4zsq30Zj9iAeqejEkkmclL7VnwV.jpg', 'Russia, 1936: revolutionary hero Colonel Kotov is spending an idyllic summer in his dacha with his young wife and six-year-old daughter Nadia and other assorted family and friends. Things change dramatically with the unheralded arrival of Cousin Dmitri from Moscow, who charms the women and little Nadia with his games and pianistic bravura. But Kotov isn\'t fooled: this is the time of Stalin\'s repression, with telephone calls in the middle of the night spelling doom - and he knows that Dmitri isn\'t paying a social call...', 135, NULL, 7.05, '2024-09-17 21:40:11', 'https://www.themoviedb.org/movie/50797', NULL),
(214, 'Before the Rain (Pred dozhdot) ', 1994, '/sAVSVFonnNkup5xnlxDkuRrmI2N.jpg', 'The circularity of violence seen in a story that circles on itself. In Macedonia, during the war in Bosnia, Christians hunt an ethnic Albanian girl who may have murdered one of their own. A young monk who\'s taken a vow of silence offers her protection. In London, a photographic editor who\'s pregnant needs to talk it out with her estranged husband and chooses a toney restaurant.', 113, NULL, 7.30, '2024-09-17 21:40:11', 'https://www.themoviedb.org/movie/19155', NULL),
(215, 'Before Sunrise ', 1995, '/kf1Jb1c2JAOqjuzA3H4oDM263uB.jpg', 'A young man and woman meet on a train in Europe, and wind up spending one evening together in Vienna. Unfortunately, both know that this will probably be their only night together.', 101, NULL, 7.97, '2024-09-17 21:40:12', 'https://www.themoviedb.org/movie/76', NULL);
INSERT INTO movies (id, name, released_at, poster_url, synopsis, duration, trailer_url, average_rating, created_at, url, updated_at) VALUES
(216, 'Billy Madison ', 1995, '/sOdgtJdFalL9kRKaeJItARLTAEq.jpg', 'Billy Madison is the 27 year-old son of Bryan Madison, a very rich man who has made his living in the hotel industry. Billy stands to inherit his father\'s empire, but only if he can make it through all 12 grades, 2 weeks per grade, to prove that he has what it takes to run the family business.', 90, NULL, 6.18, '2024-09-17 21:40:13', 'https://www.themoviedb.org/movie/11017', NULL),
(217, 'Babysitter, The ', 1995, '/wOv6HKiKTcDiyZRXPOsjm2JhVZV.jpg', 'Jennifer (Alicia Silverstone) is a lovely teen who has been hired to baby-sit the kids of Harry Tucker (J.T. Walsh) and his wife, Dolly (Lee Garlington). The Tuckers go to a party and proceed to get inebriated, with Mr. Tucker fantasizing about his beautiful baby sitter. Meanwhile, Jack (Jeremy London), her boyfriend, and Mark (Nicky Katt), another guy interested in her, decide to spy on Jennifer at the Tucker house, with each young man also fixated on her.', 90, NULL, 5.22, '2024-09-17 21:40:14', 'https://www.themoviedb.org/movie/37141', NULL),
(218, 'Boys on the Side ', 1995, '/2dhZnfBjiza5TupvOupRU4hFAcJ.jpg', 'After breaking up with her girlfriend, a nightclub singer, Jane, answers a personal ad from Robin, a real estate agent with AIDS, seeking a cross-country travel partner. On their journey from New York City to Los Angeles, the two stop by Pittsburgh to pick up Jane\'s friend Holly, who is trying to escape an abusive relationship. With three distinct personalities, the women must overcome their differences to help one another.', 115, NULL, 6.31, '2024-09-17 21:40:15', 'https://www.themoviedb.org/movie/9382', NULL),
(219, 'Cure, The ', 1995, '/3WN1H5NzLOjhY9AP848v8WPc9uu.jpg', 'Erik, a loner, finds a friend in Dexter, an eleven-year-old boy with AIDS. They vow to find a cure for AIDS together and save Dexter\'s life in an eventful summer.', 97, NULL, 7.93, '2024-09-17 21:40:15', 'https://www.themoviedb.org/movie/6715', NULL),
(220, 'Castle Freak ', 1995, '/rZv3aUkNngyZeiCgAjOEF5n0tve.jpg', 'John Reilly discovers that his family\'s newly inherited castle in Italy is haunted by a relentless bloodthirsty creature.', 90, NULL, 6.21, '2024-09-17 21:40:16', 'https://www.themoviedb.org/movie/18256', NULL),
(222, 'Circle of Friends ', 1995, '/dmyEriE6TsnbgkNaFOvCcXaF0Nt.jpg', 'Three girlhood friends now at college share first loves, first kisses and first betrayals. At the center of it all is the best-looking boy on campus. Can a self-conscious dreamer hook the biggest fish in the pond?', 103, NULL, 6.25, '2024-09-17 21:40:17', 'https://www.themoviedb.org/movie/22625', NULL),
(223, 'Clerks ', 1994, '/9IiSgiq4h4siTIS9H3o4nZ3h5L9.jpg', 'Convenience and video store clerks Dante and Randal are sharp-witted, potty-mouthed and bored out of their minds. So in between needling customers, the counter jockeys play hockey on the roof, visit a funeral home and deal with their love lives.', 92, NULL, 7.41, '2024-09-17 21:40:18', 'https://www.themoviedb.org/movie/2292', NULL),
(224, 'Don Juan DeMarco ', 1995, '/fe0TuYz9jCKUba2Omj48K8bWJ8z.jpg', 'John Arnold DeMarco is a man who believes he is Don Juan, the greatest lover in the world. Clad in a cape and mask, DeMarco undergoes psychiatric treatment with Dr. Jack Mickler to cure him of his apparent delusion. But the psychiatric sessions have an unexpected effect on the psychiatric staff and, most profoundly, Dr Mickler, who rekindles the romance in his complacent marriage.', 97, NULL, 6.70, '2024-09-17 21:40:19', 'https://www.themoviedb.org/movie/1909', NULL),
(225, 'Disclosure ', 1994, '/dnA4QkIZZCF9wRtF8HHxWwUXVMf.jpg', 'A computer specialist is sued for sexual harassment by a former lover turned boss who initiated the act forcefully, which threatens both his career and his personal life.', 128, NULL, 6.26, '2024-09-17 21:40:20', 'https://www.themoviedb.org/movie/8984', NULL),
(226, 'Dream Man ', 1995, '/tsgOkBKwz694XDRg3VfOSD7rq5e.jpg', 'Kris is a homicide cop with psychic abilities. She works to prove that the prime suspect in her latest case (the much younger husband of the millionaire victim) is innocent. But are her visions true, or planned by someone who knows what she can see?', 94, NULL, 3.40, '2024-09-17 21:40:20', 'https://www.themoviedb.org/movie/61813', NULL),
(227, 'Drop Zone ', 1994, '/bbveyfmq6pGrzKL0l4waeA2WHHp.jpg', 'A daring prison break from an airliner at 30,000 feet leaves U.S. Marshal Pete Nessip mourning a brother and gunning for revenge. After being ordered to turn in his badge, he seeks out Jessie Crossman, a noted skydiver, and offers to sponsor her crew for the annual Independence Day parachuting show in Washington, D.C., if she trains him. Meanwhile, the mastermind behind the mid-air jailbreak is planning a daring computer theft on Independence Day.', 101, NULL, 5.68, '2024-09-17 21:40:21', 'https://www.themoviedb.org/movie/4954', NULL),
(228, 'Destiny Turns on the Radio ', 1995, '/kd04IvuW1wvgGoB2HxSuFVIU9rU.jpg', 'Johnny Destiny burns into Las Vegas in his hot Plymouth RoadRunner, stopping only to pick up a stranger stranded in the desert. But then, things aren\'t always as they seem. Anything can happen in that town of many possibilities...especially since there\'s been some weird electrical disturbances. As the stranger, fresh out of prison, tries to put his life back together--to recover his money from an old bank heist and the girl he lost in doing the job--something keeps interfering with his plans. Is it fate...or just Destiny?', 103, NULL, 5.20, '2024-09-17 21:40:22', 'https://www.themoviedb.org/movie/62488', NULL),
(229, 'Death and the Maiden ', 1994, '/hlUXQ2aEuYDEE0ok7DORE4uffjl.jpg', 'A political activist is convinced that her guest is a man who once tortured her for the government.', 103, NULL, 7.14, '2024-09-17 21:40:23', 'https://www.themoviedb.org/movie/10531', NULL),
(230, 'Dolores Claiborne ', 1995, '/3RlG7uhJEqc5Ws2PIpNok0LuJ1I.jpg', 'Dolores Claiborne was accused of killing her abusive husband twenty years ago, but the court\'s findings were inconclusive and she was allowed to walk free. Now she has been accused of killing her employer, Vera Donovan, and this time there is a witness who can place her at the scene of the crime. Things look bad for Dolores when her daughter Selena, a successful Manhattan magazine writer, returns to cover the story.', 132, NULL, 7.24, '2024-09-17 21:40:24', 'https://www.themoviedb.org/movie/11929', NULL),
(231, 'Dumb & Dumber (Dumb and Dumber) ', 1994, '/4LdpBXiCyGKkR8FGHgjKlphrfUc.jpg', 'Lloyd and Harry are two men whose stupidity is really indescribable. When Mary, a beautiful woman, loses an important suitcase with money before she leaves for Aspen, the two friends (who have found the suitcase) decide to return it to her. After some \"adventures\" they finally get to Aspen where, using the lost money they live it up and fight for Mary\'s heart.', 107, NULL, 6.64, '2024-09-17 21:40:25', 'https://www.themoviedb.org/movie/8467', NULL),
(232, 'Eat Drink Man Woman (Yin shi nan nu) ', 1994, '/olhIWtIBFg6VWK59DEd4lAvgVgz.jpg', 'A retired and widowed Chinese master chef Chu and his family live in modern day Taipei, Taiwan. He lives with his three attractive daughters, all of whom are unattached. Soon, each of the daughters encounter new men in their lives. When these new relationships blossom, stereotypes are broken and the living situation within the family changes.', 123, NULL, 7.60, '2024-09-17 21:40:25', 'https://www.themoviedb.org/movie/10451', NULL),
(233, 'Exotica ', 1994, '/y6us5CnG3JeCt5zVf0qOJZhzNUs.jpg', 'In the upscale Toronto strip club Exotica, dancer Christina is visited nightly by the obsessive Francis, a depressed tax auditor. Her ex-boyfriend, the club\'s MC, Eric, still jealously pines for her even as he introduces her onstage, but Eric is having his own relationship problems with the club\'s female owner. Thomas, a mysterious pet-shop owner, is about to become unexpectedly involved in their lives.', 104, NULL, 6.64, '2024-09-17 21:40:26', 'https://www.themoviedb.org/movie/20156', NULL),
(234, 'Exit to Eden ', 1994, '/dUtpplO9K03uYCA71Vqj9ZRkVyA.jpg', 'Photographer Elliot Slater has inadvertently snapped the only existing photos of elusive jewel thief Omar. When Elliot leaves for a private vacation on an S&M island, he is followed by Omar; Omar\'s partner, Nina; and police officers Fred and Sheila. Unaware of the number of people chasing him, Elliot enjoys his stay at the resort, and finds himself falling in love with head dominatrix Lisa.', 114, NULL, 4.10, '2024-09-17 21:40:27', 'https://www.themoviedb.org/movie/18395', NULL),
(235, 'Ed Wood ', 1994, '/n8SrO3WbyuY2b6KazogqbQF348C.jpg', 'The mostly true story of the legendary \"worst director of all time\", who, with the help of his strange friends, filmed countless B-movies without ever becoming famous or successful.', 127, NULL, 7.48, '2024-09-17 21:40:28', 'https://www.themoviedb.org/movie/522', NULL),
(236, 'French Kiss ', 1995, '/odG0qfyK2SIc6vfGYIiH8aLASqL.jpg', 'After her fiancee admits to infidelity while on a business trip in France, a woman attempts to get her lover back and marry him by traveling to Paris despite her crippling fear of flying.  On the way she unwittingly smuggles something of value that has a charming crook chasing her across France as she chases after her future husband.', 111, NULL, 6.40, '2024-09-17 21:40:29', 'https://www.themoviedb.org/movie/397', NULL),
(237, 'Forget Paris ', 1995, '/c2RwGHqWwvh7nmRKpdIyYUWMEvP.jpg', 'Mickey Gordon is a basketball referee who travels to France to bury his father. Ellen Andrews is an American living in Paris who works for the airline he flies on. They meet and fall in love, but their relationship goes through many difficult patches.', 101, NULL, 6.22, '2024-09-17 21:40:30', 'https://www.themoviedb.org/movie/10525', NULL),
(238, 'Far From Home: The Adventures of Yellow Dog ', 1995, '/bGSXHkITArICNipXJHdRZRFhmmA.jpg', 'Teenager Angus adopts a stray dog and names him Yellow. Several days later, while travelling along the coast of British Columbia with Angus\'s father, John, the boy and dog become stranded when turbulent waters capsize their boat. Angus\'s parents relentlessly badger rescue teams. Angus, schooled by his father in wilderness survival skills, and assisted by the intelligent Yellow Dog, tries to attract rescuers.', 87, NULL, 6.06, '2024-09-17 21:40:30', 'https://www.themoviedb.org/movie/27985', NULL),
(239, 'Goofy Movie, A ', 1995, '/bycmMhO3iIoEDzP768sUjq2RV4T.jpg', 'An endearing modern-day story about how the lovable Goof bonds with his teenage son Max on a hilarious cross-country road trip. En route to the ol\' fishing hole, they find themselves up to their floppy ears in misadventure!', 78, NULL, 6.98, '2024-09-17 21:40:31', 'https://www.themoviedb.org/movie/15789', NULL),
(240, 'Hideaway ', 1995, '/cYWjgxgIJrak0BTemkij3gOCbMa.jpg', 'Hatch Harrison, his wife, Lindsey, and their daughter, Regina, are enjoying a pleasant drive when a car crash leaves wife and daughter unharmed but kills Hatch. However, an ingenious doctor, Jonas Nyebern, manages to revive Hatch after two lifeless hours. But Hatch does not come back unchanged. He begins to suffer horrible visions of murder -- only to find out the visions are the sights of a serial killer.', 103, NULL, 5.15, '2024-09-17 21:40:32', 'https://www.themoviedb.org/movie/27303', NULL),
(241, 'Fluke ', 1995, '/k7BHqoTWJPpoSpfCzzUjAduuIbX.jpg', 'Workaholic Thomas Johnson dies in an auto accident and reincarnates as a dog. Remembering some of his previous being, he returns to his wife and son to protect them from the man who caused his accident. But, as time goes by, his memories return, and Thomas realizes he wasn\'t such a good husband and father.', 96, NULL, 7.10, '2024-09-17 21:40:33', 'https://www.themoviedb.org/movie/21183', NULL),
(242, 'Farinelli: il castrato ', 1994, '/i5h0ZjYobco5HRPaAU6QTlrMYw0.jpg', 'The life and career of Italian opera singer Farinelli, considered one of the greatest castrato singers of all time.', 111, NULL, 6.60, '2024-09-17 21:40:34', 'https://www.themoviedb.org/movie/10954', NULL),
(243, 'Gordy ', 1995, '/4sLmghaiAIYXh320qCvZWY4avVT.jpg', 'A talking pig named Gordy becomes involved in a quest to save his family from the slaughterhouse.', 90, NULL, 5.30, '2024-09-17 21:40:35', 'https://www.themoviedb.org/movie/47867', NULL),
(244, 'Gumby: The Movie ', 1995, '/A4wc8SrcaKyfNKXA0g5Aydpk4Id.jpg', 'On the brink of a big deal with mogul Lucky Claybert, Gumby and his band The Clayboys must do battle with the villainous Blockheads, who have kidnapped their loyal canine Lowbelly.', 91, NULL, 5.50, '2024-09-17 21:40:35', 'https://www.themoviedb.org/movie/43475', NULL),
(245, 'The Glass Shield ', 1994, '/iXFMQhghwjUjlJazqOPD281xG4d.jpg', 'J.J. is a rookie in the Sheriff\'s Department and the first black officer at that station. Racial tensions run high in the department as some of J.J.\'s fellow officers resent his presence. His only real friend is the other new trooper, the first female officer to work there, who also suffers similar discrimination in the otherwise all-white male work environment. When J.J. becomes increasingly aware of police corruption during the murder trial of Teddy Woods, whom he helped to arrest, he faces difficult decisions and puts himself into grave personal danger in the service of justice.', 109, NULL, 4.80, '2024-09-17 21:40:36', 'https://www.themoviedb.org/movie/72031', NULL),
(246, 'Hoop Dreams ', 1994, '/gLzHl2XBtVwycl8DxdOXRHPm8G3.jpg', 'Every school day, African-American teenagers William Gates and Arthur Agee travel 90 minutes each way from inner-city Chicago to St. Joseph High School in Westchester, Illinois, a predominately white suburban school well-known for the excellence of its basketball program. Gates and Agee dream of NBA stardom, and with the support of their close-knit families, they battle the social and physical obstacles that stand in their way. This acclaimed documentary was shot over the course of five years.', 174, NULL, 7.63, '2024-09-17 21:40:37', 'https://www.themoviedb.org/movie/14275', NULL),
(247, 'Heavenly Creatures ', 1994, '/uvb86wVCIqD3Rlbr0GTNgWDF7Zo.jpg', 'Wealthy and precocious teenager Juliet transfers from England to New Zealand with her family, and soon befriends the quiet, brooding Pauline through their shared love of fantasy and literature. When their parents begin to suspect that their increasingly intense and obsessive bond is becoming unhealthy, the girls hatch a dark plan for those who threaten to keep them apart.', 109, NULL, 6.98, '2024-09-17 21:40:38', 'https://www.themoviedb.org/movie/1024', NULL),
(248, 'Houseguest ', 1994, '/cdiHlZho11EEqD3aPanYe1rEYRB.jpg', 'In hot water with the mob over an unpaid debt, a con man poses as a family friend in an affluent Pennsylvania suburb.', 109, NULL, 5.42, '2024-09-17 21:40:39', 'https://www.themoviedb.org/movie/17207', NULL),
(249, 'Immortal Beloved ', 1994, '/lkqz2R5pjXeDaiIjR3Z6JTGjtg6.jpg', 'A chronicle of the life of infamous classical composer Ludwig van Beethoven and his painful struggle with hearing loss. Following Beethoven\'s death in 1827, his assistant, Schindler, searches for an elusive woman referred to in the composer\'s love letters as \"immortal beloved.\" As Schindler solves the mystery, a series of flashbacks reveal Beethoven\'s transformation from passionate young man to troubled musical genius.', 121, NULL, 7.10, '2024-09-17 21:40:39', 'https://www.themoviedb.org/movie/13701', NULL),
(250, 'Heavyweights (Heavy Weights) ', 1995, '/phjBzKsMySBz4NgKHPhPMTmIEjl.jpg', 'Camp Hope is a summer retreat for overweight boys run by a kindly couple who make the campers feel comfortable with their extra pounds. But when tyrannical fitness guru Tony buys the camp, he puts the kids on a cruel regimen that goes too far. Sick of the endless weeks of \"all work and no play,\" the kids stage a coup and reclaim their summer of fun.', 100, NULL, 6.14, '2024-09-17 21:40:40', 'https://www.themoviedb.org/movie/14819', NULL),
(251, 'Hunted, The ', 1995, '/luCVuKiRBcQjr9MuY9mRCTehjpY.jpg', 'Paul Racine, a high-powered American business executive in Japan, is catapulted into a maze of danger and intrigue after he and his sexy companion are the targets of assassins hired by the ruthless Kinjo.  To survive, Racine must join forces with a powerful samurai and together they will fight the force of evil in an awesome battle rooted in centuries of brutal conflict.', 110, NULL, 5.70, '2024-09-17 21:40:41', 'https://www.themoviedb.org/movie/32631', NULL),
(252, 'I.Q. ', 1994, '/1dLR9LX4O8DSyaU5OR3N0472IR.jpg', 'Albert Einstein helps a young man who\'s in love with Einstein\'s niece to catch her attention by pretending temporarily to be a great physicist.', 100, NULL, 6.03, '2024-09-17 21:40:42', 'https://www.themoviedb.org/movie/11777', NULL),
(253, 'Interview with the Vampire: The Vampire Chronicles ', 1994, '/2162lAT2MP36MyJd2sttmj5du5T.jpg', 'A vampire relates his epic life story of love, betrayal, loneliness, and dark hunger to an over-curious reporter.', 123, NULL, 7.39, '2024-09-17 21:40:43', 'https://www.themoviedb.org/movie/628', NULL),
(254, 'Jefferson in Paris ', 1995, '/vcZCvsm920LoNDb7pMibJkxIE4n.jpg', 'His wife having recently died, Thomas Jefferson accepts the post of United States ambassador to pre-revolutionary France, though he finds it difficult to adjust to life in a country where the aristocracy subjugates an increasingly restless peasantry. In Paris, he becomes smitten with cultured artist Maria Cosway, but, when his daughter visits from Virginia accompanied by her attractive slave, Sally Hemings, Jefferson\'s attentions are diverted.', 139, NULL, 5.10, '2024-09-17 21:40:44', 'https://www.themoviedb.org/movie/87729', NULL),
(255, 'Jerky Boys, The ', 1995, '/yUbdqyZaeaoNKBQmnmtim1IIAf1.jpg', 'When two unemployed telephone pranksters decide to use their vocal \"talents\" to impersonate a Chicago mob boss and curry favor with organized crime in New York, the trouble begins. It isn\'t long before Johnny and Kamal (the \"Jerky Boys\" of crank call fame) are wanted by the local mafia, the police, and their neighbor.', 82, NULL, 4.20, '2024-09-17 21:40:44', 'https://www.themoviedb.org/movie/18713', NULL),
(256, 'Junior ', 1994, '/eQmgPrXf7c7daRdl3Zwgm65lw3o.jpg', 'A research scientist becomes the world\'s first pregnant man in order to test a drug he and a colleague have designed for expectant women. To carry out the trial, he has an embryo implant, believing that he will only carry the baby for three months – hardly expecting to face the prospect of giving birth.', 109, NULL, 5.18, '2024-09-17 21:40:45', 'https://www.themoviedb.org/movie/6280', NULL),
(257, 'Just Cause ', 1995, '/z8WqDIUC00TPX6U24ah0C7IMEKf.jpg', 'A Harvard professor is lured back into the courtroom after twenty-five years to take the case of a young black man condemned to death for the horrific murder of a child.', 102, NULL, 6.20, '2024-09-17 21:40:46', 'https://www.themoviedb.org/movie/9061', NULL),
(258, 'Kid in King Arthur\'s Court, A ', 1995, '/nzkCh60LNLTaAl8YCCVFM5OASUS.jpg', 'A Southern California kid named Calvin Fuller is magically transported to the medieval kingdom of Camelot through a crack in the ground caused by an earthquake. Once there, he learns he was summoned by the wizard Merlin, who needs Calvin to save Camelot. Using dazzling modern inventions, can Calvin help King Arthur retain his crown and thwart the evil Lord Belasco?', 89, NULL, 4.80, '2024-09-17 21:40:47', 'https://www.themoviedb.org/movie/37108', NULL),
(259, 'Kiss of Death ', 1995, '/h9E0Sz9VCVTwPEIsg9pr7hnFJ9w.jpg', 'Jimmy Kilmartin is an ex-con trying to stay clean and raise a family. When his cousin Ronnie causes him to take a fall for driving an illegal transport of stolen cars, Detective Calvin Hart is injured and Jimmy lands back in prison. In exchange for an early release, he is asked to help bring down a local crime boss named \'Little Junior\' Brown. However, he\'s also sent undercover by Detective Hart to work with Little Junior and infiltrate his operations. As soon as Little Junior kills an undercover Federal agent with Jimmy watching, the unscrupulous DA and the Feds further complicate his life.', 101, NULL, 5.63, '2024-09-17 21:40:48', 'https://www.themoviedb.org/movie/6071', NULL),
(260, 'Star Wars: Episode IV - A New Hope ', 1977, '/6FfCtAuVAW8XJjZ7eWeLibRLWTw.jpg', 'Princess Leia is captured and held hostage by the evil Imperial forces in their effort to take over the galactic Empire. Venturesome Luke Skywalker and dashing captain Han Solo team together with the loveable robot duo R2-D2 and C-3PO to rescue the beautiful princess and restore peace and justice in the Empire.', 121, NULL, 8.20, '2024-09-17 21:40:49', 'https://www.themoviedb.org/movie/11', NULL),
(261, 'Little Women ', 1994, '/1ZzH1XMcKAe5NdrKL5MfcqZHHsZ.jpg', 'With their father away as a chaplain in the Civil War, Jo, Meg, Beth and Amy grow up with their mother in somewhat reduced circumstances. They are a close family who inevitably have their squabbles and tragedies. But the bond holds even when, later, male friends start to become a part of the household.', 119, NULL, 7.29, '2024-09-17 21:40:50', 'https://www.themoviedb.org/movie/9587', NULL),
(262, 'Little Princess, A ', 1995, '/9V4bAVEskSNbEqjVI0YmeuB0n8I.jpg', 'When her father enlists to fight for the British in WWI, young Sara Crewe goes to New York to attend the same boarding school her late mother attended. She soon clashes with the severe headmistress, Miss Minchin, who attempts to stifle Sara\'s creativity and sense of self-worth.', 97, NULL, 7.64, '2024-09-17 21:40:51', 'https://www.themoviedb.org/movie/19101', NULL),
(263, 'Ladybird Ladybird ', 1994, '/91KSK1xKdVEIDASKRo9ahBFCtM2.jpg', 'Maggie has had four children, by four different fathers, removed by social services because of a previous violent relationship. When she meets Jorge, a gentle Latin American refugee, she gradually sees her chance for happiness, but her history still haunts her.', 101, NULL, 7.21, '2024-09-17 21:40:51', 'https://www.themoviedb.org/movie/49980', NULL),
(264, 'Enfer, L\' ', 1994, '/76ccjXiC0sBBGGD75HCQrmGBgP7.jpg', 'Forced to work extremely hard to keep things afloat, Paul begins hearing voices in his head questioning his past choices. Convinced that his wife has been unfaithful, he begins to see every male guest as a potential threat. What follows is Paul\'s downward spiral into the madness of deranged jealousy where he finally discovers that hell is not a state of mind – hell is himself.', 102, NULL, 6.83, '2024-09-17 21:40:52', 'https://www.themoviedb.org/movie/17961', NULL),
(265, 'Like Water for Chocolate (Como agua para chocolate) ', 1992, '/itwUdMqLmPfhtGJ44hiDxkqZhiq.jpg', 'Tita is passionately in love with Pedro, but her controlling mother forbids her from marrying him. When Pedro marries her sister, Tita throws herself into her cooking and discovers she can transfer her emotions through the food she prepares, infecting all who eat it with her intense heartbreak.', 105, NULL, 7.30, '2024-09-17 21:40:53', 'https://www.themoviedb.org/movie/18183', NULL),
(266, 'Legends of the Fall ', 1994, '/t1KPGlW0UGd0m515LPQmk2F4nu1.jpg', 'In early 20th-century Montana, Col. William Ludlow lives on a ranch in the wilderness with his sons, Alfred, Tristan, and Samuel. Eventually, the unconventional but close-knit family are bound by loyalty, tested by war, and torn apart by love, as told over the course of several decades in this epic saga.', 133, NULL, 7.39, '2024-09-17 21:40:54', 'https://www.themoviedb.org/movie/4476', NULL),
(267, 'Major Payne ', 1995, '/kWHx5eq7PELkF3If7LrrhuBskRG.jpg', 'Major Benson Winifred Payne is being discharged from the Marines. Payne is a killin\' machine, but the wars of the world are no longer fought on the battlefield. A career Marine, he has no idea what to do as a civilian, so his commander finds him a job - commanding officer of a local school\'s JROTC program, a bunch of ragtag losers with no hope.', 95, NULL, 6.36, '2024-09-17 21:40:55', 'https://www.themoviedb.org/movie/11008', NULL),
(268, 'Little Odessa ', 1994, '/80zDn3oanRMWDSDX1cPKZVIi8OO.jpg', 'Long separated from his Russian family, hitman Joshua returns to Brighton Beach for a contract killing for the Russian Mafia. His abusive father, Arkady, banned him from returning after Joshua committed his first murder. He takes up residence in a hotel, and soon everyone knows he has returned. He goes home to visit his dying mother, Irina, and prepares for the assassination, getting drawn back into the criminal community he left behind.', 98, NULL, 6.47, '2024-09-17 21:40:56', 'https://www.themoviedb.org/movie/47504', NULL),
(269, 'My Crazy Life (Mi vida loca) ', 1993, '/gtKIaHUqkNqdgVnMFosyVJXvKMC.jpg', 'Mousie and Sad Girl are childhood best friends in a contemporary Los Angeles poor Hispanic neighborhood. But when Sad Girl becomes pregnant by Mousie\'s boyfriend, a drug dealer named Ernesto, the two become bitter enemies. While their dispute escalates towards violence, the violence of the world around them soon also impacts their lives.', 92, NULL, 7.10, '2024-09-17 21:40:56', 'https://www.themoviedb.org/movie/32325', NULL),
(270, 'Love Affair ', 1994, '/A7Ex1CSjfCYUgornOiJTJkJkw0A.jpg', 'Ex-football star Mike Gambril meets Terry McKay on a flight to Sydney, which is forced to land on a small atoll. They become romantic on board a ship sent to take them to a larger island. They agree to meet in New York three months later to see if the attraction is real. One shows up but the other doesn\'t. However, a chance meeting brings them together again.', 108, NULL, 5.38, '2024-09-17 21:40:57', 'https://www.themoviedb.org/movie/43742', NULL),
(271, 'Losing Isaiah ', 1995, '/oHALKuPewtqIn2BcluZsGvcEG1P.jpg', 'Khaila Richards, a crack-addicted single mother, accidentally leaves her baby in a dumpster while high and returns the next day in a panic to find he is missing. In reality, the baby has been adopted by a warm-hearted social worker, Margaret Lewin, and her husband, Charles. Years later, Khaila has gone through rehab and holds a steady job. After learning that her child is still alive, she challenges Margaret for the custody.', 106, NULL, 6.40, '2024-09-17 21:40:58', 'https://www.themoviedb.org/movie/28313', NULL),
(272, 'Madness of King George, The ', 1994, '/1dTSY023ZyBbgVSKDRuA6JLGSnZ.jpg', 'Aging King George III of England is exhibiting signs of madness, a problem little understood in 1788. As the monarch alternates between bouts of confusion and near-violent outbursts of temper, his hapless doctors attempt the ineffectual cures of the day. Meanwhile, Queen Charlotte and Prime Minister William Pitt the Younger attempt to prevent the king\'s political enemies, led by the Prince of Wales, from usurping the throne.', 107, NULL, 6.70, '2024-09-17 21:40:59', 'https://www.themoviedb.org/movie/11318', NULL),
(273, 'Mary Shelley\'s Frankenstein (Frankenstein) ', 1994, '/bOwCAQsZlEKrwhPi1ejY6BS8jpL.jpg', 'Victor Frankenstein is a promising young doctor who, devastated by the death of his mother during childbirth, becomes obsessed with bringing the dead back to life. His experiments lead to the creation of a monster, which Frankenstein has put together with the remains of corpses. It\'s not long before Frankenstein regrets his actions.', 123, NULL, 6.40, '2024-09-17 21:41:00', 'https://www.themoviedb.org/movie/3036', NULL),
(274, 'Man of the House ', 1995, '/6bnOhhrrrq6RZhMgz4aGyqbJ9Wf.jpg', 'Ben Archer is not happy. His mother, Sandy, has just met a man, and it looks like things are pretty serious. Driven by a fear of abandonment, Ben tries anything and everything to ruin the \"love bubble\" which surrounds his mom. However, after Ben and Jack\'s experiences in the Indian Guides, the two become much closer.', 96, NULL, 5.30, '2024-09-17 21:41:00', 'https://www.themoviedb.org/movie/40490', NULL),
(275, 'Mixed Nuts ', 1994, '/rI5oZR0ov3ki72Gy1QDM8XJ43mo.jpg', 'The events of a crisis hotline business on one crazy night during the Christmas holidays.', 97, NULL, 5.43, '2024-09-17 21:41:01', 'https://www.themoviedb.org/movie/24070', NULL),
(276, 'Milk Money ', 1994, '/od8SCOMLDq4iRYaHNqihQVn1SNE.jpg', 'Three young boys pool their money and pay V, a kindhearted prostitute, to strip for them. Afterward, she drives them home to the suburbs -- but then her car breaks down. It\'s just as well, though, because a mobster named Waltzer is after her, and V realizes the suburbs are the perfect place to hide. But things get a lot more complicated when V falls in love with Tom, a single father who is unaware of her real profession.', 108, NULL, 6.36, '2024-09-17 21:41:02', 'https://www.themoviedb.org/movie/8986', NULL),
(277, 'Miracle on 34th Street ', 1994, '/iUTPKkljdEjPlcPPYgbUz7APnHu.jpg', 'Six-year-old Susan Walker has doubts about childhood\'s most enduring miracle—Santa Claus. Her mother told her the secret about Santa a long time ago, but, after meeting a special department store Santa who\'s convinced he\'s the real thing, Susan is given the most precious gift of all—something to believe in.', 114, NULL, 6.73, '2024-09-17 21:41:03', 'https://www.themoviedb.org/movie/10510', NULL),
(278, 'Miami Rhapsody ', 1995, '/h7I2DgoxdkVMiPx4usFNkfvSoBs.jpg', 'Even though Gwyn Marcus is engaged to her boyfriend, Matt, she is still afraid of commitment. While she admires her parents\' loving relationship, she discovers that her family has not always been faithful in marriage, making it harder than ever to settle down. As her mother pressures her to get married, and plenty of attractive men appear in her life, Gwyn learns that she must balance her career, relationships and marriage to be truly happy.', 95, NULL, 5.29, '2024-09-17 21:41:04', 'https://www.themoviedb.org/movie/17402', NULL),
(279, 'My Family ', 1995, '/i6t6QF5QyUd3UAQ8JM8eVU1169D.jpg', 'Traces over three generations an immigrant family\'s trials, tribulations, tragedies, and triumphs. Maria and Jose, the first generation, come to Los Angeles, meet, marry, face deportation all in the 1930s. They establish their family in East L.A., and their children Chucho, Paco, Memo, Irene, Toni, and Jimmy deal with youth culture and the L.A. police in the \'50s. As the second generation become adults in the \'60s, the focus shifts to Jimmy, his marriage to Isabel (a Salvadorian refugee), their son, and Jimmy\'s journey to becoming a responsible parent.', 128, NULL, 7.60, '2024-09-17 21:41:05', 'https://www.themoviedb.org/movie/38722', NULL),
(280, 'Murder in the First ', 1995, '/sU37ONoL9qUyYXUhubJSYH9tEoc.jpg', 'A young, inexperienced public defender is assigned to defend an inmate accused of committing murder while behind bars.', 122, NULL, 7.17, '2024-09-17 21:41:05', 'https://www.themoviedb.org/movie/8438', NULL),
(281, 'Nobody\'s Fool ', 1994, '/xyAXFy6mOfgZcVWbceCeuTYadeq.jpg', 'Sully is a rascally ne\'er-do-well approaching retirement age. While he is pressing a worker\'s compensation suit for a bad knee, he secretly works for his nemesis, Carl, and flirts with Carl\'s young wife Toby. Sully\'s long- forgotten son and family have moved back to town, so Sully faces unfamiliar family responsibilities. Meanwhile, Sully\'s landlady\'s banker son plots to push through a new development and evict Sully from his mother\'s life.', 110, NULL, 6.86, '2024-09-17 21:41:06', 'https://www.themoviedb.org/movie/11593', NULL),
(282, 'Nell ', 1994, '/aIDp3x2YfijtdherR28pIH6yenn.jpg', 'In a remote woodland cabin, a small town doctor discovers Nell — a beautiful young hermit woman with many secrets.', 112, NULL, 6.56, '2024-09-17 21:41:07', 'https://www.themoviedb.org/movie/1945', NULL),
(283, 'New Jersey Drive ', 1995, '/lXJWJT6lfAg2NEqEueJcI4ESWSG.jpg', 'New Jersey Drive is a 1995 film about black youths in Newark, New Jersey, the unofficial \"car theft capital of the world\". Their favorite pastime is that of everybody in their neighborhood: stealing cars and joyriding. The trouble starts when they steal a police car and the cops launch a violent offensive that involves beating and even shooting suspects.', 98, NULL, 6.00, '2024-09-17 21:41:08', 'https://www.themoviedb.org/movie/39310', NULL),
(284, 'New York Cop (Nyû Yôku no koppu) ', 1993, '/5kXO783UrTaKZE3wn0KZv3RubZc.jpg', 'Allegedly based on a true story, this film follows the life of Toshi, a Japanese man living in America and working with the New York City police. After being recommended for undercover work, Toshi decides to go after a gang lead by Hawk. Hawk and Toshi soon become friends, although Hawk\'s second-in-command, Tito, is suspicious of the newcomer. Will Toshi be able to bring the gang down, or will his cover be blown before he can finish the assignment?', 88, NULL, 2.90, '2024-09-17 21:41:09', 'https://www.themoviedb.org/movie/109560', NULL),
(285, 'Beyond Bedlam ', 1993, '/rqArVCgag2ng179rb3OXeEnS4Lo.jpg', 'An experiment gone awry places a neurologist and a homicide detective in a psychopath\'s nightmarish world.', 89, NULL, 5.00, '2024-09-17 21:41:10', 'https://www.themoviedb.org/movie/56428', NULL),
(286, 'Nemesis 2: Nebula ', 1995, '/dfBROAe2wXgbB7NbksvVvT49vZW.jpg', 'It has been 73 years since Alex failed and the Humans lost the Cyborg Wars. Since then, the Humans have been enslaved. Scientists have developed a new DNA strain, which could signal the end of the Cyborgs, and they inject it into a volunteer. When the Cyborgs learn of the woman and the baby they list both for termination.', 83, NULL, 4.27, '2024-09-17 21:41:10', 'https://www.themoviedb.org/movie/63105', NULL),
(287, 'Nina Takes a Lover ', 1994, '/mSPoA8exUsNThCfBjjTug7V7wGJ.jpg', 'Laura San Giacomo stars in this sexy comedy about adultery. When Nina\'s (San Giacomo) husband goes out of town for several weeks on a business trip, Nina hooks up with a photographer. Told from a reporter\'s point of view, his interviews with Nina and the photographer provide comic insights. Stars Laura San Giacomo, Paul Rhys, Michael O\'Keefe, Fisher Stevens and more.', 100, NULL, 5.70, '2024-09-17 21:41:11', 'https://www.themoviedb.org/movie/131957', NULL),
(288, 'Natural Born Killers ', 1994, '/fEKZwT91gxvkAoyPgpNXo8W5fu0.jpg', 'Two victims of traumatized childhoods become lovers and serial murderers irresponsibly glorified by the mass media.', 118, NULL, 7.06, '2024-09-17 21:41:12', 'https://www.themoviedb.org/movie/241', NULL),
(289, 'Only You ', 1994, '/7mLLANXgUg3bibTiUitDlB0NZcU.jpg', 'Two childhood paranormal incidents have convinced schoolteacher Faith Corvatch that her true love is a guy named \"Damon Bradley,\" but she has yet to meet him. Preparing to marry podiatrist Dwayne in 10 days, Faith receives a phone call from Dwayne\'s old classmate named Damon Bradley who is on his way to Venice. Faith tries to catch him at the airport but just misses him so she impulsively decides to fly to Venice hoping to finally encounter the man of her dreams; accompanying her on the trip is her sister-in-law and childhood best friend, Kate, who has just left her husband, Faith\'s brother Larry.', 115, NULL, 6.80, '2024-09-17 21:41:13', 'https://www.themoviedb.org/movie/9058', NULL),
(290, 'Once Were Warriors ', 1994, '/1nd4SsytVc96hy92g8NNVPD3mzf.jpg', 'A drama about a Maori family living in Auckland, New Zealand. Lee Tamahori tells the story of Beth Heke’s strong will to keep her family together during times of unemployment and abuse from her violent and alcoholic husband.', 99, NULL, 7.37, '2024-09-17 21:41:14', 'https://www.themoviedb.org/movie/527', NULL),
(292, 'Outbreak ', 1995, '/4KymNvlWR0XF0sqX2BWRd9Z3yXR.jpg', 'A deadly airborne virus finds its way into the USA and starts killing off people at an epidemic rate. Col. Sam Daniels\' job is to stop the virus spreading from a small town, which must be quarantined, and to prevent an over reaction by the White House.', 127, NULL, 6.55, '2024-09-17 21:41:15', 'https://www.themoviedb.org/movie/6950', NULL),
(293, 'Léon: The Professional (a.k.a. The Professional) (Léon) ', 1994, '/yI6X2cCM5YPJtxMhUd3dPGqDAhw.jpg', 'Léon, the top hit man in New York, has earned a rep as an effective \"cleaner\". But when his next-door neighbors are wiped out by a loose-cannon DEA agent, he becomes the unwilling custodian of 12-year-old Mathilda. Before long, Mathilda\'s thoughts turn to revenge, and she considers following in Léon\'s footsteps.', 111, NULL, 8.31, '2024-09-17 21:41:15', 'https://www.themoviedb.org/movie/101', NULL),
(294, 'Perez Family, The ', 1995, '/jxi3UDHf86kDk5hqJxnpEMzVch2.jpg', 'In the midst of the Mariel boat lift -- a hurried exodus of refugees from Cuba going to America -- an immigration clerk accidentally presumes that dissident Juan Raul Perez and Dorita Evita Perez are married. United by their last name and a mutual resolve to emigrate, Dorita and Juan agree to play along. But it gets complicated when the two begin falling for each other just as Juan reunites with his wife, Carmela, whom he hasn\'t seen in decades.', 113, NULL, 6.30, '2024-09-17 21:41:16', 'https://www.themoviedb.org/movie/63020', NULL),
(295, 'Pyromaniac\'s Love Story, A ', 1995, '/9pU8aNS1wEXVGNR9WnsX2O3w9qF.jpg', 'A pastry boy and the son of a hair-piece mogul become involved in an arson scandal. Sergio is offered a bribe in exchange for taking the blame for the fire that destroys his workplace. Garet, the real arsonist, is apalled that someone else would try to take credit for his act of love. Before long, Sergio and Garet become entangled in a zany love-quadrangle involving Hattie and Stephanie. Written by Brian Whiting', 94, NULL, 4.80, '2024-09-17 21:41:17', 'https://www.themoviedb.org/movie/2307', NULL),
(296, 'Pulp Fiction ', 1994, '/d5iIlFn5s0ImszYzBPb8JPIfbXD.jpg', 'A burger-loving hit man, his philosophical partner, a drug-addled gangster\'s moll and a washed-up boxer converge in this sprawling, comedic crime caper. Their adventures unfurl in three stories that ingeniously trip back and forth in time.', 154, NULL, 8.49, '2024-09-17 21:41:18', 'https://www.themoviedb.org/movie/680', NULL),
(297, 'Panther ', 1995, '/gxGOkt6WBhSIdZiQqyVEccRURVv.jpg', 'Panther is a semi-historic film about the origins of The Black Panther Party for Self-Defense. The movie spans about 3 years (1966-68) of the Black Panther\'s history in Oakland. Panther also uses historical footage (B/W) to emphasize some points.', 124, NULL, 6.19, '2024-09-17 21:41:19', 'https://www.themoviedb.org/movie/41478', NULL),
(298, 'Pushing Hands (Tui shou) ', 1992, '/46WdJMUhZpIsG5D7bb0lYjoE1Uu.jpg', 'Mr. Chu is an elderly widower who teaches tai chi chuan in Beijing. He moves to America to live with his son\'s family, but finds the cultural adjustment difficult. Since his daughter-in-law is a white woman who does not speak Chinese, Mr. Chu\'s son, Alex, must mediate.', 105, NULL, 7.20, '2024-09-17 21:41:20', 'https://www.themoviedb.org/movie/25296', NULL),
(299, 'Priest ', 1994, '/bi1BeQMuPm1HzFfIZX4KHtKdJgy.jpg', 'Father Greg Pilkington is torn between his call as a conservative Catholic priest and his secret life as a homosexual with a gay lover, frowned upon by the Church. Upon hearing the confession of a young girl of her incestuous father, Greg enters an intensely emotional spiritual struggle deciding between choosing morals over religion and one life over another.', 98, NULL, 6.40, '2024-09-17 21:41:21', 'https://www.themoviedb.org/movie/40156', NULL),
(300, 'Quiz Show ', 1994, '/yoGJo1h3Hl2exXPVcG9UXWDENtX.jpg', 'Herbert Stempel\'s transformation into an unexpected television personality unfolds as he secures victory on the cherished American game show, \'Twenty-One.\' However, when the show introduces the highly skilled contestant Charles Van Doren to replace Stempel, it compels Stempel to let out his frustrations and call out the show as rigged. Lawyer Richard Goodwin steps in and attempts to uncover the orchestrated deception behind the scenes.', 133, NULL, 7.27, '2024-09-17 21:41:21', 'https://www.themoviedb.org/movie/11450', NULL),
(301, 'Picture Bride (Bijo photo) ', 1994, '/s1lUr4NWgOi4ftXLrUWGI49IvKK.jpg', 'Riyo, an orphaned 17-year old, sails from Yokohama to Hawaii in 1918 to marry Matsuji, a man she has never met. Hoping to escape a troubled past and start anew, Riyo is bitterly disappointed upon her arrival: her husband is twice her age. The miserable girl finds solace with her new friend Kana, a young mother who helps Riyo accept her new life.', 94, NULL, 6.32, '2024-09-17 21:41:22', 'https://www.themoviedb.org/movie/30304', NULL),
(302, 'Queen Margot (Reine Margot, La) ', 1994, '/8uGkhBLiJMIkwohGPo3iB9AuwDg.jpg', 'Paris, Kingdom of France, August 18, 1572. To avoid the outbreak of a religious war, the Catholic princess Marguerite de Valois, sister of the feeble King Charles IX, marries the Huguenot King Henry III of Navarre.', 138, NULL, 7.20, '2024-09-17 21:41:23', 'https://www.themoviedb.org/movie/10452', NULL),
(303, 'Quick and the Dead, The ', 1995, '/jhEmrXJpP6F3cqwyLjvgBgxxxFA.jpg', 'A mysterious woman comes to compete in a quick-draw elimination tournament, in a town taken over by a notorious gunman.', 107, NULL, 6.54, '2024-09-17 21:41:24', 'https://www.themoviedb.org/movie/12106', NULL),
(304, 'Roommates ', 1995, '/sNSwgnb81gfbki5ohGb766zvGQX.jpg', 'An elderly, yet young-at-heart man, moves in with his grandson, and both their lives turn upside-down.', 108, NULL, 6.18, '2024-09-17 21:41:25', 'https://www.themoviedb.org/movie/161495', NULL),
(305, 'Ready to Wear (Pret-A-Porter) ', 1994, '/ehg1dTxsqx2eMZpd5Tio9JifwqB.jpg', 'During Paris Fashion Week, models, designers and industry hot shots gather to work, mingle, argue and try to seduce one another.', 133, NULL, 5.20, '2024-09-17 21:41:26', 'https://www.themoviedb.org/movie/3586', NULL),
(306, 'Three Colors: Red (Trois couleurs: Rouge) ', 1994, '/cTvIvblms2p4cEPT4lnJWTYG3DC.jpg', 'Valentine, a student model in Geneva, struggles with a possessive boyfriend and a troubled family. When she runs over a dog, she discovers that its owner, a retired judge, is illegally wiretapping and eavesdropping on his neighbors\' phone calls. Although Valentine is outraged, she develops a strange bond with the judge – and as the two become closer, she finds herself caught in the middle of events that could change her life.', 100, NULL, 7.90, '2024-09-17 21:41:27', 'https://www.themoviedb.org/movie/110', NULL),
(307, 'Three Colors: Blue (Trois couleurs: Bleu) ', 1993, '/33wsWxzsNstI8N7dvuwzFmj1qBd.jpg', 'The wife of a famous composer survives a car accident that kills her husband and daughter. Now alone, she shakes off her old identity and explores her newfound freedom but finds that she is unbreakably bound to other humans, including her husband’s mistress, whose existence she never suspected.', 98, NULL, 7.65, '2024-09-17 21:41:27', 'https://www.themoviedb.org/movie/108', NULL),
(308, 'Three Colors: White (Trzy kolory: Bialy) ', 1994, '/fdIet3NSa27gobMbaUml66oCQNT.jpg', 'Polish immigrant Karol Karol finds himself out of a marriage, a job and a country when his French wife, Dominique, divorces him after six months due to his impotence. Forced to leave France after losing the business they jointly owned, Karol enlists fellow Polish expatriate Mikołaj to smuggle him back to their homeland.', 92, NULL, 7.50, '2024-09-17 21:41:28', 'https://www.themoviedb.org/movie/109', NULL),
(309, 'Red Firecracker, Green Firecracker (Pao Da Shuang Deng) ', 1994, '/wmW9WnTTBib4XTiLOYtLOlxvh5G.jpg', 'A woman inherits her father\'s fireworks factory, as he had no son. The business does well and everything works in an orderly fashion until one day, an itinerant painter is hired to decorate the doors and vases at the factory. The woman, forbidden to marry and thereby involve outsiders in the factory ownership, finds herself drawn to the headstrong painter. When they fall in love, the situation throws her entire life into disarray', 111, NULL, 6.20, '2024-09-17 21:41:29', 'https://www.themoviedb.org/movie/159185', NULL),
(310, 'Rent-a-Kid ', 1995, '/hYxc2o3HHL3x47J5s9taQZ6AUI4.jpg', 'Harry Habert, owner of a rental company, has an original idea—to rent baby\'s from a nearby orphanage to local families. He rents the Ward siblings, 2 boys and a girl, to his first customers.', 85, NULL, 5.50, '2024-09-17 21:41:30', 'https://www.themoviedb.org/movie/36357', NULL),
(311, 'Relative Fear ', 1994, '/wG6wdsB9lqCwxsRycnzzXZDSo6m.jpg', 'Linda and Peter Pratman\'s son Adam is autistic, but they still love him and hope that he\'ll at least start talking some day. However he\'s teased and abused by the kids of the neighborhood and his grandpa . When several people around Adam die an unexpected death, his parents start to suspect Adam - is he just simulating to be so ignorant about his environment?', 90, NULL, 4.70, '2024-09-17 21:41:31', 'https://www.themoviedb.org/movie/92769', NULL),
(312, 'Stuart Saves His Family ', 1995, '/80YaWpUokDoPynsJi0ittpts3J0.jpg', 'A self-help advocate struggles to put his dysfunctional family in its place.', 95, NULL, 5.16, '2024-09-17 21:41:32', 'https://www.themoviedb.org/movie/28033', NULL),
(313, 'Swan Princess, The ', 1994, '/tmpO3vk8WguFOE4UXESGdWwHQOX.jpg', 'The beautiful princess Odette is transformed into a swan by an evil sorcerer\'s spell. Held captive at an enchanted lake, she befriends Jean-Bob the frog, Speed the turtle and Puffin the bird. Despite their struggle to keep the princess safe, these good-natured creatures can do nothing about the sorcerer\'s spell, which can only be broken by a vow of everlasting love.', 89, NULL, 6.57, '2024-09-17 21:41:32', 'https://www.themoviedb.org/movie/22586', NULL),
(314, 'Secret of Roan Inish, The ', 1994, '/jjYHAhscWp3uWutHSvFaLC3vEEW.jpg', 'Ten-year-old Fiona is sent to live with her grandparents in a small fishing village in Donegal, Ireland. She soon learns the local legend that an ancestor of hers married a Selkie – a seal who can turn into a human. Years earlier, her baby brother was washed out to sea and never seen again, so when Fiona spies a naked little boy on the abandoned Isle of Roan Inish, she is compelled to investigate.', 103, NULL, 6.70, '2024-09-17 21:41:33', 'https://www.themoviedb.org/movie/14334', NULL),
(315, 'Specialist, The ', 1994, '/9CVAjtkSaFs9FyddGfThj11ZuQq.jpg', 'May Munro is a woman obsessed with getting revenge on the people who murdered her parents when she was still a girl. She hires Ray Quick, a retired explosives expert to kill her parent\'s killers. When Ned Trent, embittered ex-partner of Quick\'s is assigned to protect one of Quick\'s potential victims, a deadly game of cat and mouse ensues.', 110, NULL, 5.88, '2024-09-17 21:41:34', 'https://www.themoviedb.org/movie/2636', NULL),
(316, 'Stargate ', 1994, '/4T6Po0XnZlevmhfPh3ZfEs5butR.jpg', 'An interstellar teleportation device, found in Egypt, leads to a planet with humans resembling ancient Egyptians who worship the god Ra.', 121, NULL, 7.01, '2024-09-17 21:41:35', 'https://www.themoviedb.org/movie/2164', NULL),
(317, 'Santa Clause, The ', 1994, '/2yqaR8HJUQowx8agxEjWVmyBIqo.jpg', 'On Christmas Eve, divorced dad Scott Calvin and his son discover Santa Claus has fallen off their roof. When Scott takes the reins of the magical sleigh, he finds he is now the new Santa, and must convince a world of disbelievers, including himself.', 97, NULL, 6.49, '2024-09-17 21:41:36', 'https://www.themoviedb.org/movie/11395', NULL),
(318, 'Shawshank Redemption, The ', 1994, '/9cqNxx0GxF0bflZmeSMuL5tnGzr.jpg', 'Imprisoned in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufresne comes to be admired by the other inmates -- including an older prisoner named Red -- for his integrity and unquenchable sense of hope.', 142, NULL, 8.71, '2024-09-17 21:41:36', 'https://www.themoviedb.org/movie/278', NULL),
(319, 'Shallow Grave ', 1994, '/gqvSKLbfIg1mja1ulVkVcLhdwWF.jpg', 'When David, Juliet, and Alex are searching for a fourth roommate for their flat, they settle on the aloof Hugo. However, they soon find Hugo dead, with a large sum of cash being among his belongings. The three friends decide to keep the money, dismembering and burying Hugo\'s body. However, their newfound fortune begins to corrode their friendships, with each roommate resorting to manipulation tactics to scam the others out of the money.', 93, NULL, 7.00, '2024-09-17 21:41:37', 'https://www.themoviedb.org/movie/9905', NULL),
(320, 'Suture ', 1993, '/89jGoGPFqOl6JR144iEOxeciggM.jpg', 'Brothers Vincent and Clay meet up for the first time after their father\'s funeral and remark on how similar they look. But unknown to Clay, Vince is actually plotting to kill him with a car bomb and pass the corpse off as his own, planning to start a new life elsewhere with his father\'s inheritance. But Clay survives the blast and has his face, memory and identity restored in hospital... but are they the right ones?', 96, NULL, 6.43, '2024-09-17 21:41:38', 'https://www.themoviedb.org/movie/87078', NULL),
(321, 'Strawberry and Chocolate (Fresa y chocolate) ', 1993, '/tMwUsu080E4kS4rkHPffy1ugvaJ.jpg', 'Set in 1979, following a young Communist man\'s relationship with a gay Catholic writer, exploring tolerance, inclusion, homophobia and challenging its Cuban audience with great humour. Based on the short story by Cuban writer Senel Paz.', 108, NULL, 7.10, '2024-09-17 21:41:39', 'https://www.themoviedb.org/movie/12527', NULL);
INSERT INTO movies (id, name, released_at, poster_url, synopsis, duration, trailer_url, average_rating, created_at, url, updated_at) VALUES
(322, 'Swimming with Sharks ', 1995, '/eMRiIJIEyMLjWjktIqjNfzs9jGX.jpg', 'Guy is a young film executive who\'s willing to do whatever it takes to make it in Hollywood. He begins working for famed producer Buddy Ackerman, a domineering, manipulative, coldhearted boss. When Guy also finds out that his cynical girlfriend, Dawn, has been using sex as a career move, he reaches his limit. Guy decides to exact revenge on Buddy by kidnapping him and subjecting him to cruel and unusual punishment.', 93, NULL, 6.62, '2024-09-17 21:41:40', 'https://www.themoviedb.org/movie/20306', NULL),
(324, 'Sum of Us, The ', 1994, '/4rBI4KISTuMCsWGb0kurWxKjqPQ.jpg', 'A widowed father has to deal with two complex issues: while he is searching for \"Miss Right,\" his son, who is in his 20s and gay, is searching for \"Mr. Right.\"', 100, NULL, 6.83, '2024-09-17 21:41:40', 'https://www.themoviedb.org/movie/36614', NULL),
(325, 'National Lampoon\'s Senior Trip ', 1995, '/qfMbFIGNIQ76FEu7Wg48aEbxFh1.jpg', 'While on detention, a group of misfits and slackers have to write a letter to the President explaining what is wrong with the education system. There is only one problem, the President loves it! Hence, the group must travel to Washington to meet the Main Man.', 91, NULL, 5.40, '2024-09-17 21:41:41', 'https://www.themoviedb.org/movie/27993', NULL),
(326, 'To Live (Huozhe) ', 1994, '/bv0qREWTw8TPAtgt22ELp1UlKVl.jpg', 'Fugui and Jiazhen endure tumultuous events in China as their personal fortunes move from wealthy landownership to peasantry. Addicted to gambling, Fugui loses everything. In the years that follow he is pressed into both the nationalist and communist armies, while Jiazhen is forced into menial work.', 133, NULL, 8.00, '2024-09-17 21:41:42', 'https://www.themoviedb.org/movie/31439', NULL),
(327, 'Tank Girl ', 1995, '/qohdY3BcJ98sFneOUAWp0FmH4Z6.jpg', 'After a comet disrupts the rain cycle of Earth, the planet has become a desolate, barren desert by the year 2033. With resources scarce, Kesslee — head of the powerful and evil Water & Power Corporation, the de facto government — has taken control of the water supply. Unwilling to cower under Kesslee\'s tyrannical rule, a pair of outlaws known as Tank Girl and Jet Girl rise up, joining the mysterious rebel Rippers to destroy the corrupt system.', 104, NULL, 5.42, '2024-09-17 21:41:43', 'https://www.themoviedb.org/movie/9067', NULL),
(328, 'Tales from the Crypt Presents: Demon Knight ', 1995, '/1TekTWa1htkb554KDplTXskQupo.jpg', 'Ex-soldier Frank Brayker is the guardian of an ancient key that can unlock tremendous evil; the sinister Collector is a demon who wants the key so he can initiate the apocalypse. On the run from wicked mercenaries for almost 90 years, Brayker finally stops in at a boarding house in New Mexico where — with the help of its residents — he plans to face off against the Collector and his band of ghouls, preventing them from ever seizing the key.', 92, NULL, 6.86, '2024-09-17 21:41:44', 'https://www.themoviedb.org/movie/9059', NULL),
(329, 'Star Trek: Generations ', 1994, '/rHsCYDGHFUarGh5k987b0EFU6kC.jpg', 'Captain Jean-Luc Picard and the crew of the Enterprise-D find themselves at odds with the renegade scientist Soran who is destroying entire star systems. Only one man can help Picard stop Soran\'s scheme...and he\'s been dead for seventy-eight years.', 117, NULL, 6.51, '2024-09-17 21:41:45', 'https://www.themoviedb.org/movie/193', NULL),
(330, 'Tales from the Hood ', 1995, '/glPNCcI7V8zTTI3BG0iIUJJcwXN.jpg', 'A strange mortician tells four horrific tales to three drug dealers that he traps in their local funeral parlor.', 98, NULL, 6.27, '2024-09-17 21:41:45', 'https://www.themoviedb.org/movie/25066', NULL),
(331, 'Tom & Viv ', 1994, '/iw4ofGbX2AbJ4p17CixwnMjuoJ0.jpg', 'The story of the marriage of the poet T. S. Eliot to socialite Vivienne Haigh-Wood, which had to cope with her gynaecological and emotional problems and his growing fame.', 115, NULL, 6.04, '2024-09-17 21:41:46', 'https://www.themoviedb.org/movie/46797', NULL),
(332, 'Village of the Damned ', 1995, '/vnK68SPMQTvLWVYaNMINJOismEr.jpg', 'An American village is visited by some unknown life form which leaves the women of the village pregnant. Nine months later, the babies are born, and they all look normal, but it doesn\'t take the \"parents\" long to realize that the kids are not human or humane.', 99, NULL, 6.10, '2024-09-17 21:41:47', 'https://www.themoviedb.org/movie/12122', NULL),
(333, 'Tommy Boy ', 1995, '/6m1xJqfViDkmNmKUKvTSJ5fo0k4.jpg', 'To save the family business, two ne’er-do-well traveling salesmen hit the road with disastrously funny consequences.', 98, NULL, 6.80, '2024-09-17 21:41:48', 'https://www.themoviedb.org/movie/11381', NULL),
(334, 'Vanya on 42nd Street ', 1994, '/sYkkHsqXyUcFoLbXt4WNwnRRpT1.jpg', 'An uninterrupted rehearsal of Chekhov\'s 1899 play \"Uncle Vanya\" played out by a company of actors. The setting is their run down theater with an unusable stage and crumbling ceiling. The play is shown act by act with the briefest of breaks to move props or for refreshments. The lack of costumes, real props and scenery is soon forgotten.', 120, NULL, 6.60, '2024-09-17 21:41:49', 'https://www.themoviedb.org/movie/32636', NULL),
(335, 'Underneath ', 1995, '/61yu1ejOBWUrrMRplRbjpvxgxVc.jpg', 'A recovering gambling addict attempts to reconcile with his family and friends but finds trouble and temptation when caught between feelings for his ex-wife and her dangerous hoodlum boyfriend.', 99, NULL, 5.60, '2024-09-17 21:41:50', 'https://www.themoviedb.org/movie/36141', NULL),
(336, 'Walking Dead, The ', 1995, '/c0RtcIN4oSzSZoNs0nJMevfGYS4.jpg', 'Five young marines on a suicide mission in Vietnam, struggle for survival in a jungle minefield. The mean streets of home did not prepare them for this.', 88, NULL, 6.23, '2024-09-17 21:41:51', 'https://www.themoviedb.org/movie/95963', NULL),
(337, 'What\'s Eating Gilbert Grape ', 1993, '/8FxWgsfDNosewo7H65oE4QkOb7g.jpg', 'Gilbert Grape is a small-town young man with a lot of responsibility. Chief among his concerns are his mother, who is so overweight that she can\'t leave the house, and his mentally impaired younger brother, Arnie, who has a knack for finding trouble. Settled into a job at a grocery store and an ongoing affair with local woman Betty Carver, Gilbert finally has his life shaken up by the free-spirited Becky.', 118, NULL, 7.67, '2024-09-17 21:41:51', 'https://www.themoviedb.org/movie/1587', NULL),
(338, 'Virtuosity ', 1995, '/rLQh1tZZoiMRUKwNk92jHTaIClP.jpg', 'The Law Enforcement Technology Advancement Centre (LETAC) has developed SID version 6.7: a Sadistic, Intelligent, and Dangerous virtual reality entity which is synthesized from the personalities of more than 150 serial killers, and only one man can stop him.', 106, NULL, 5.48, '2024-09-17 21:41:52', 'https://www.themoviedb.org/movie/9271', NULL),
(339, 'While You Were Sleeping ', 1995, '/qNGO3ETcNwlWqK2kNRpbJSJRlos.jpg', 'A transit worker pulls commuter Peter off railway tracks after he\'s mugged, but—while he\'s in a coma—his family mistakenly thinks she\'s Peter\'s fiancée, and she doesn\'t correct them. Things get more complicated when she falls for his brother, who\'s not quite sure that she\'s who she claims to be.', 103, NULL, 7.00, '2024-09-17 21:41:53', 'https://www.themoviedb.org/movie/2064', NULL),
(340, 'War, The ', 1994, '/eMJYqr5zs7rz54oZhiX4ez1BI5E.jpg', 'The son of a Vietnam War Veteran must deal with neighborhood bullies as well as his dad\'s post-traumatic stress disorder while growing up in the deep south in the 1970\'s.', 126, NULL, 6.64, '2024-09-17 21:41:54', 'https://www.themoviedb.org/movie/19855', NULL),
(341, 'Double Happiness ', 1994, '/5sbnCdiFoZLe4G27ERS7wtj1lCY.jpg', 'Jade Li is a feisty, 20-something Chinese Canadian, trying to achieve that happy medium between giving in to her parent\'s wishes and fulfilling her own needs and desires - double happiness. Naturally, something\'s got to give and when love beckons in the shape of Mark, a white university student, the facade of the perfect Chinese daughter begins to slip.', 87, NULL, 6.60, '2024-09-17 21:41:55', 'https://www.themoviedb.org/movie/60855', NULL),
(342, 'Muriel\'s Wedding ', 1994, '/zJyTr8Fo412a2OIfJGXTRAm4IwX.jpg', 'A young social outcast in Australia steals money from her parents to finance a vacation where she hopes to find happiness, and perhaps love.', 106, NULL, 6.82, '2024-09-17 21:41:56', 'https://www.themoviedb.org/movie/236', NULL),
(343, 'Baby-Sitters Club, The ', 1995, '/juT5eKRDhmluaiVhymjViyXArCq.jpg', 'Seven junior-high-school girls organize a daycare camp for children while at the same time experiencing classic adolescent growing pains.', 94, NULL, 5.38, '2024-09-17 21:41:57', 'https://www.themoviedb.org/movie/48287', NULL),
(344, 'Ace Ventura: Pet Detective ', 1994, '/yaHnZqJvsSddOKYxf4zCj2Ww2hA.jpg', 'He\'s Ace Ventura: Pet Detective. Jim Carrey is on the case to find the Miami Dolphins\' missing mascot and quarterback Dan Marino. He goes eyeball to eyeball with a man-eating shark, stakes out the Miami Dolphins and woos and wows the ladies. Whether he\'s undercover, under fire or underwater, he always gets his man… or beast!', 86, NULL, 6.57, '2024-09-17 21:41:57', 'https://www.themoviedb.org/movie/3049', NULL),
(345, 'Adventures of Priscilla, Queen of the Desert, The ', 1994, '/J6IseZVnDNWs12Wbqquh42iYqy.jpg', 'Two drag queens and a transgender woman contract to perform a drag show at a resort in Alice Springs, a town in the remote Australian desert. As they head west from Sydney aboard their lavender bus, Priscilla, the three friends come to the forefront of a comedy of errors, encountering a number of strange characters, as well as incidents of homophobia, whilst widening comfort zones and exploring new horizons.', 103, NULL, 7.28, '2024-09-17 21:41:58', 'https://www.themoviedb.org/movie/2759', NULL),
(346, 'Backbeat ', 1993, '/1BuFx7P8veAUUZDXqdMNhtdCUSM.jpg', 'Chronicles the early days of The Beatles in Hamburg, Germany. The film focuses primarily on the relationship between Stuart Sutcliffe, John Lennon, and Sutcliffe\'s girlfriend Astrid Kirchherr.', 100, NULL, 6.07, '2024-09-17 21:41:59', 'https://www.themoviedb.org/movie/12635', NULL),
(347, 'Bitter Moon ', 1992, '/g1DGU526GVG0NI7QkJVLprZelBa.jpg', 'A passenger on a cruise ship develops an irresistible infatuation with an eccentric paraplegic\'s wife.', 139, NULL, 7.10, '2024-09-17 21:42:00', 'https://www.themoviedb.org/movie/10497', NULL),
(348, 'Bullets Over Broadway ', 1994, '/mY9D1oCLeDKNMdUO8EV7MoCZ3up.jpg', 'After young playwright, David Shayne obtains funding for his play from gangster Nick Valenti, Nick\'s girlfriend Olive miraculously lands the role of a psychiatrist—but not only is she a bimbo who could never pass for a psychiatrist—she\'s a dreadful actress. David puts up with the leading man who is a compulsive eater, the grand dame who wants her part jazzed up, and Olive\'s interfering hitman/bodyguard—but, eventually he must decide whether art or life is more important.', 98, NULL, 7.09, '2024-09-17 21:42:01', 'https://www.themoviedb.org/movie/11382', NULL),
(349, 'Clear and Present Danger ', 1994, '/6xTM8FPxrLRYwz6I3fqtwh7xybs.jpg', 'Agent Jack Ryan becomes acting Deputy Director of Intelligence for the CIA when Admiral Greer is diagnosed with cancer. When an American businessman, and friend of the president, is murdered on his yacht, Ryan starts discovering links between the man and drug dealers. As former CIA agent John Clark is sent to Colombia to kill drug cartel kingpins in retaliation, Ryan must fight through multiple cover-ups to figure out what happened and who\'s responsible.', 141, NULL, 6.64, '2024-09-17 21:42:02', 'https://www.themoviedb.org/movie/9331', NULL),
(350, 'Client, The ', 1994, '/oLdkJ4ZjxPtFSUChdjDQvHM9l75.jpg', 'A street-wise kid, Mark Sway, sees the suicide of Jerome Clifford, a prominent Louisiana lawyer, whose current client is Barry \'The Blade\' Muldano, a Mafia hit-man. Before Jerome shoots himself, he tells Mark where the body of a Senator is buried. Clifford shoots himself and Mark is found at the scene, and both the FBI and the Mafia quickly realize that Mark probably knows more than he says.', 119, NULL, 6.68, '2024-09-17 21:42:02', 'https://www.themoviedb.org/movie/10731', NULL),
(351, 'Corrina, Corrina ', 1994, '/xuEubxRGut2Yh118RyNa6ruXXCp.jpg', 'When Manny Singer\'s wife dies, his young daughter Molly becomes mute and withdrawn. To help cope with looking after Molly, he hires sassy housekeeper Corrina Washington, who coaxes Molly out of her shell and shows father and daughter a whole new way of life. Manny and Corrina\'s friendship delights Molly and enrages the other townspeople.', 115, NULL, 6.68, '2024-09-17 21:42:03', 'https://www.themoviedb.org/movie/10464', NULL),
(352, 'Crooklyn ', 1994, '/iFqe07F78SO0SIBzWcK4I5MwNvP.jpg', 'From Spike Lee comes this vibrant semi-autobiographical portrait of a school-teacher, her stubborn jazz-musician husband and their five kids living in \'70s Brooklyn.', 115, NULL, 6.80, '2024-09-17 21:42:04', 'https://www.themoviedb.org/movie/34152', NULL),
(353, 'Crow, The ', 1994, '/rMMB3v6jYHjsvXRNJYESacoTD7j.jpg', 'Exactly one year after young rock guitarist Eric Draven and his fiancée are brutally killed by a ruthless gang of criminals, Draven—watched over by a hypnotic crow—returns from the grave to exact revenge.', 102, NULL, 7.50, '2024-09-17 21:42:05', 'https://www.themoviedb.org/movie/9495', NULL),
(354, 'Cobb ', 1994, '/clOqh9is8vWZvX6AUjF4HtLdQMj.jpg', 'Al Stump is a famous sports-writer chosen by Ty Cobb to co-write his official, authorized \'autobiography\' before his death. Cobb, widely feared and despised, feels misunderstood and wants to set the record straight about \'the greatest ball-player ever,\' in his words.', 128, NULL, 6.00, '2024-09-17 21:42:06', 'https://www.themoviedb.org/movie/29973', NULL),
(355, 'Flintstones, The ', 1994, '/ocsb0qiGlcn6UlcDRHa3xxSCc8Y.jpg', 'Modern Stone Age family the Flintstones hit the big screen in this live-action version of the classic cartoon. Fred helps Barney adopt a child. Barney sees an opportunity to repay him when Slate Mining tests its employees to find a new executive. But no good deed goes unpunished.', 91, NULL, 5.33, '2024-09-17 21:42:07', 'https://www.themoviedb.org/movie/888', NULL),
(356, 'Forrest Gump ', 1994, '/arw2vcBveWOVZr6pxd9XTd1TdQa.jpg', 'A man with a low IQ has accomplished great things in his life and been present during significant historic events—in each case, far exceeding what anyone imagined he could do. But despite all he has achieved, his one true love eludes him.', 142, NULL, 8.47, '2024-09-17 21:42:07', 'https://www.themoviedb.org/movie/13', NULL),
(357, 'Four Weddings and a Funeral ', 1994, '/qa72G2VS0bpxms6yo0tI9vsHm2e.jpg', 'Over the course of five social occasions, a committed bachelor must consider the notion that he may have discovered love.', 117, NULL, 6.77, '2024-09-17 21:42:08', 'https://www.themoviedb.org/movie/712', NULL),
(358, 'Higher Learning ', 1995, '/tuud1Blsdwo1KQRdz5UVwjlLAWQ.jpg', 'African-American student Malik is on a track scholarship; academics are not his strong suit, and he goes in thinking that his athletic abilities will earn him a free ride through college. Fudge, a \"professional student\" who has been at Columbus for six years so far, becomes friendly with Malik and challenges his views about race and politics in America.', 128, NULL, 6.34, '2024-09-17 21:42:09', 'https://www.themoviedb.org/movie/16295', NULL),
(359, 'I Like It Like That ', 1994, '/aCxh21UPLHi7Pxm9ykH1GNx39OW.jpg', 'After her husband is arrested for looting, Lisette struggles for independence while dealing with her gender-confused sibling, her critical mother-in-law and assorted neighborhood eccentrics.', 104, NULL, 6.40, '2024-09-17 21:42:10', 'https://www.themoviedb.org/movie/48992', NULL),
(360, 'I Love Trouble ', 1994, '/lXpbYJQJ7tvYZ8S29Nwpzsh07PN.jpg', 'Rival Chicago reporters Sabrina Peterson and Peter Brackett join forces to uncover a train wreck conspiracy.', 123, NULL, 5.48, '2024-09-17 21:42:11', 'https://www.themoviedb.org/movie/10879', NULL),
(361, 'It Could Happen to You ', 1994, '/6UOaeLDOdwwTMQtbl5YL6EGjqy0.jpg', 'Charlie Lang is a simple, kindhearted New York City cop. When he realizes he has no money to tip waitress Yvonne Biasi, Lang offers her half the winnings of his lottery ticket. Amazingly, the ticket happens to be a winner, in the sum of $4 million. True to his word, Lang proceeds to share the prize money with Biasi, which infuriates his greedy wife, Muriel. Not content with the arrangement, Muriel begins scheming to take all the money.', 101, NULL, 6.60, '2024-09-17 21:42:11', 'https://www.themoviedb.org/movie/10660', NULL),
(362, 'Jungle Book, The ', 1994, '/rYoE6cuup9Ofam6AuYaiJLxF9OO.jpg', 'Raised by wild animals since childhood, Mowgli is drawn away from the jungle by the beautiful Kitty. But Mowgli must eventually face corrupt Capt. Boone, who wants both Kitty\'s hand and the treasures of Monkey City – a place only Mowgli can find.', 111, NULL, 5.93, '2024-09-17 21:42:12', 'https://www.themoviedb.org/movie/10714', NULL),
(363, 'Wonderful, Horrible Life of Leni Riefenstahl, The (Macht der Bilder: Leni Riefenstahl, Die) ', 1993, '/qFqmjoQwOjo3YgxSw7Q3mMOzx4A.jpg', 'This documentary recounts the life and work of one of most famous, and yet reviled, German film directors in history, Leni Riefenstahl. The film recounts the rise of her career from a dancer, to a movie actor to the most important film director in Nazi Germany who directed such famous propaganda films as Triumph of the Will and Olympiad. The film also explores her later activities after Nazi Germany\'s defeat in 1945 and her disgrace for being so associated with it which includes her amazingly active life over the age of 90.', 180, NULL, 7.10, '2024-09-17 21:42:13', 'https://www.themoviedb.org/movie/41647', NULL),
(364, 'Lion King, The ', 1994, '/sKCr78MXSLixwmZ8DyJLrpMsd15.jpg', 'A young lion prince is cast out of his pride by his cruel uncle, who claims he killed his father. While the uncle rules with an iron paw, the prince grows up beyond the Savannah, living by a philosophy: No worries for the rest of your days. But when his past comes to haunt him, the young prince must decide his fate: Will he remain an outcast or face his demons and become what he needs to be?', 89, NULL, 8.26, '2024-09-17 21:42:14', 'https://www.themoviedb.org/movie/8587', NULL),
