(367, 'Mask, The ', 1994, '/xbbXp9px4o8Oe7IbGd0yIbla8mZ.jpg', 'When timid bank clerk Stanley Ipkiss discovers a magical mask containing the spirit of the Norse god Loki, his entire life changes. While wearing the mask, Ipkiss becomes a supernatural playboy exuding charm and confidence which allows him to catch the eye of local nightclub singer Tina Carlyle. Unfortunately, under the mask\'s influence, Ipkiss also robs a bank, which angers junior crime lord Dorian Tyrell, whose goons get blamed for the heist.', 101, NULL, 6.96, '2024-09-17 21:42:17', 'https://www.themoviedb.org/movie/854', NULL),
(368, 'Maverick ', 1994, '/mTVbGGi5PIexmxVzeyFd2RYKwfM.jpg', 'Maverick is a gambler who would rather con someone than fight them, and needs an additional three thousand dollars in order to enter a winner-takes-all poker game that begins in a few days, so he joins forces with a woman gambler with a marvellous southern accent, and the two try and enter the game.', 127, NULL, 6.88, '2024-09-17 21:42:18', 'https://www.themoviedb.org/movie/9359', NULL),
