(371, 'Paper, The ', 1994, '/pGPrFbucRLwVtCKCeinwAklAl0l.jpg', 'Henry Hackett is the workaholic editor of a New York City tabloid. He loves his job, but the long hours and low pay are leading to discontent. Also, publisher Bernie White faces financial straits, and has hatchet-man Alicia Clark—Henry\'s nemesis—impose unpopular cutbacks.', 112, NULL, 6.57, '2024-09-17 21:42:20', 'https://www.themoviedb.org/movie/12280', NULL),
(372, 'Reality Bites ', 1994, '/qGDhodtpkpxkrFqokenGNJlzt6w.jpg', 'A small circle of friends suffering from post-collegiate blues must confront the hard truth about life, love and the pursuit of gainful employment. As they struggle to map out survival guides for the future, the Gen-X quartet soon begins to realize that reality isn\'t all it\'s cracked up to be.', 98, NULL, 6.56, '2024-09-17 21:42:21', 'https://www.themoviedb.org/movie/2788', NULL),
(373, 'Red Rock West ', 1992, '/ewofUEqU3Gpr7WSgSz3TEVPIfBg.jpg', 'When a promised job for Texan Michael fails to materialize in Wyoming, Mike is mistaken by Wayne to be the hitman he hired to kill his unfaithful wife, Suzanne. Mike takes full advantage of the situation, collects the money, and runs. During his getaway, things go wrong, and soon get worse when he runs into the real hitman, Lyle.', 98, NULL, 6.68, '2024-09-17 21:42:22', 'https://www.themoviedb.org/movie/10427', NULL),
