(381, 'When a Man Loves a Woman ', 1994, '/cA1uMNX3sdWAWfMZbsgm1VIJYSY.jpg', 'An airline pilot and his wife are forced to face the consequences of her alcoholism when her addictions threaten her life and their daughter\'s safety. While the woman enters detox, her husband must face the truth of his enabling behavior.', 126, NULL, 6.49, '2024-09-17 21:42:29', 'https://www.themoviedb.org/movie/10449', NULL),
