(383, 'Wyatt Earp ', 1994, '/51LItgyecu2KMAtIchYogEykCIu.jpg', 'From Wichita to Dodge City, to the O.K. Corral in Tombstone, Wyatt Earp is taught that nothing matters more than family and the law. Joined by his brothers and Doc Holliday, Earp wages war on the dreaded Clanton and McLaury gangs.', 191, NULL, 6.76, '2024-09-17 21:42:31', 'https://www.themoviedb.org/movie/12160', NULL),
(384, 'Bad Company ', 1995, '/5q5r3cpaTDByz4qko9ZWHlK3gMF.jpg', 'CIA operative Nelson Crowe is tasked with a deadly assignment: infiltrate a highly secret industrial espionage firm. Once inside, he teams with Margaret Wells, a master spy and seductive manipulator, in a plot to overthrow the organization\'s sinister president, which leads them into a darkly mysterious web of intrigue -- and shocking murder!', 108, NULL, 4.81, '2024-09-17 21:42:31', 'https://www.themoviedb.org/movie/40480', NULL),
(385, 'Man of No Importance, A ', 1994, '/nSBeudgK6eFA1kzSAR4b8ndZked.jpg', 'Alfie Byrne is a middle-aged bus conductor in Dublin in 1963. He would appear to live a life of quiet desperation: he\'s gay, but firmly closeted, and his sister is always trying to find him \"the right girl\". His passion is Oscar Wilde, his hobby is putting on amateur theatre productions in the local church hall. We follow him as he struggles with temptation, friendship, disapproval, and the conservative yet oddly lyrical world of Ireland in the early 1960s.', 99, NULL, 6.31, '2024-09-17 21:42:33', 'https://www.themoviedb.org/movie/52038', NULL),
