(398, 'Frank and Ollie ', 1995, '/eUIELE2IkuWkAc3JzjYz6J2Lpx5.jpg', 'Before computer graphics, special effects wizardry, and out-of-this world technology, the magic of animation flowed from the pencils of two of the greatest animators The Walt Disney Company ever produced -- Frank Thomas and Ollie Johnston. Frank and Ollie, the talent behind BAMBI, PINOCCHIO, LADY AND THE TRAMP, THE JUNGLE BOOK, and others, set the standard for such modern-day hits as THE LION KING. It was their creative genius that helped make Disney synonymous with brilliant animation, magnificent music, and emotional storytelling. Take a journey with these extraordinary artists as they share secrets, insights, and the inspiration behind some of the greatest animated movies the world has ever known!', 89, NULL, 7.51, '2024-09-17 21:42:43', 'https://www.themoviedb.org/movie/42981', NULL),
