(417, 'Barcelona ', 1994, '/7dgX3naR9EsFMvQhwHY8My6r5FR.jpg', 'During the 1980s, uptight Ted Boynton is a salesman working in the Barcelona office of a Chicago-based company. He receives an unexpected visit from his cousin Fred, a naval officer who has come to Spain on a public relations mission for a U.S. fleet. Not exactly friends in the past, Ted and Fred strike up relationships with women in the Spanish city and experience conflicts -- Ted with his employer, and Fred with the Barcelona community.', 100, NULL, 6.21, '2024-09-17 21:42:59', 'https://www.themoviedb.org/movie/16771', NULL),
(418, 'Being Human ', 1993, '/1OJilNyyJPH3es0HZzebJjuPJua.jpg', 'One man must learn the meaning of courage across four lifetimes centuries apart.', 122, NULL, 5.00, '2024-09-17 21:43:00', 'https://www.themoviedb.org/movie/46924', NULL),
(419, 'Beverly Hillbillies, The ', 1993, '/refYLEQvzkY63i2IHronCPQODex.jpg', 'Jed Clampett and kin move from Arkansas to Beverly Hills when he becomes a billionaire, after an oil strike. The country folk are very naive with regard to life in the big city, so when Jed starts a search for a new wife there are inevitably plenty of takers and con artists ready to make a fast buck', 93, NULL, 6.30, '2024-09-17 21:43:01', 'https://www.themoviedb.org/movie/11041', NULL),
(420, 'Beverly Hills Cop III ', 1994, '/7vIpCkgGEfk5LZwm78nMxswLJRH.jpg', 'When his boss is killed, Detroit cop Axel Foley finds evidence that the murderer had ties to a California amusement park called Wonder World. Returning to sunny Beverly Hills once more, Foley reunites with Detective Billy Rosewood to solve the case. Along with Billy\'s new partner, Detective Jon Flint, they discover that Wonder World is being used as a front for a massive counterfeiting ring.', 105, NULL, 5.88, '2024-09-17 21:43:02', 'https://www.themoviedb.org/movie/306', NULL),
(421, 'Black Beauty ', 1994, '/5uH60FBDPQoyAnc4uvU0fIB8JXv.jpg', 'The fates of horses, and the people who own and command them, are revealed as Black Beauty narrates the circle of his life.', 88, NULL, 6.74, '2024-09-17 21:43:03', 'https://www.themoviedb.org/movie/14522', NULL),
(422, 'Blink ', 1994, '/yNlatJk6C2zYTqAUkaxtBJQKQSf.jpg', 'Emma is an attractive girl in her 20s who has been blind for 20 years. A new type of eye operation partially restores her sight, but she is having problems: sometimes she doesn\'t \"remember\" what she\'s seen until later. One night she is awakened by a commotion upstairs. Peering out of her door, she sees a shadowy figure descending the stairs. Convinced that her neighbour has been murdered she approaches the police, only to find that she is unsure if it was just her new eyes playing tricks on her.', 106, NULL, 6.17, '2024-09-17 21:43:03', 'https://www.themoviedb.org/movie/26203', NULL),
(423, 'Blown Away ', 1994, '/oZLQXYAlL61NGvzK0MWyUsVLyjs.jpg', 'Blown Away tells the story of Jimmy Dove, who works for the Boston bomb squad. Shortly after Dove leaves the force, his partner is killed by a bomb that Dove thinks might have been made by someone he knows.', 121, NULL, 6.20, '2024-09-17 21:43:04', 'https://www.themoviedb.org/movie/178', NULL),
(424, 'Blue Chips ', 1994, '/tO71i4Ob64tchCRBB5MoqonPKAF.jpg', 'Pete Bell, a college basketball coach is under a lot of pressure. His team isn\'t winning and he cannot attract new players. The stars of the future are secretly being paid by boosters. This practice is forbidden in the college game, but Pete is desperate and has pressures from all around.', 108, NULL, 6.03, '2024-09-17 21:43:05', 'https://www.themoviedb.org/movie/19819', NULL),
(425, 'Blue Sky ', 1994, '/zG40OnO4Y98lo1iDHyFo5TaZyP1.jpg', 'Hank Marshall is a tough, square-jawed, straitlaced Army engineer and nuclear science expert, assigned to help conduct weapons testing in 1950s America. Hank has become a thorn in the side of the Army, though, for a couple of very different reasons. He is an outspoken opponent of atmospheric testing, though his superiors hold contrary views and want to squelch his concerns...and his reports. The other problem is his wife, Carly. She is voluptuous and volatile, wreaking havoc in his personal life and stirring up intrigue at each new Army base.', 101, NULL, 6.00, '2024-09-17 21:43:06', 'https://www.themoviedb.org/movie/57834', NULL),
(426, 'Body Snatchers ', 1993, '/s8WdtuOBvfEsuPtbQVpNfEgd5aR.jpg', 'When Environmental Protection Agency inspector Steve Malone travels to a remote military base in order to check for toxic materials, he brings his family along for the ride. After arriving at the base, his teenage daughter Marti befriends Jean Platt, daughter of the base\'s commander, General Platt. When people at the base begin acting strangely, Marti becomes convinced that they are slowly being replaced by plant-like aliens.', 87, NULL, 6.12, '2024-09-17 21:43:07', 'https://www.themoviedb.org/movie/4722', NULL),
(427, 'Boxing Helena ', 1993, '/vgs0h94IllpZRheIjBTonjR7Zf2.jpg', 'A top surgeon is besotted with a beautiful woman who once rebuffed him. Unable to come to terms with life without her, he tries to convince her that they need each other. She has other ideas, but a horrific accident leaves her at his mercy.', 107, NULL, 5.10, '2024-09-17 21:43:07', 'https://www.themoviedb.org/movie/18215', NULL),
(428, 'Bronx Tale, A ', 1993, '/sDbO6LmLYtyqAoFTPpRcMgPSCEO.jpg', 'Set in the Bronx during the tumultuous 1960s, an adolescent boy is torn between his honest, working-class father and a violent yet charismatic crime boss. Complicating matters is the youngster\'s growing attraction - forbidden in his neighborhood - for a beautiful black girl.', 121, NULL, 7.87, '2024-09-17 21:43:08', 'https://www.themoviedb.org/movie/1607', NULL),
(429, 'Cabin Boy ', 1994, '/xy2BzE3siqU67VQCQ2k4xideNNM.jpg', 'A foul-mouthed finishing school graduate mistakenly winds up on an ill-fated fishing boat, and faces the wrath of a crew that considers him bad luck.', 80, NULL, 5.10, '2024-09-17 21:43:09', 'https://www.themoviedb.org/movie/26391', NULL),
(430, 'Calendar Girl ', 1993, '/ljSqZTl5oophHsH1Qtyv7AF2BW6.jpg', 'Three young men go on an end of the summer trip to Hollywood, California. Their quest: to fulfill the fantasy of meeting Marilyn Monroe.', 90, NULL, 5.10, '2024-09-17 21:43:10', 'https://www.themoviedb.org/movie/117553', NULL),
(431, 'Carlito\'s Way ', 1993, '/g6D7mjQtndu768cusGmoEQY9fTB.jpg', 'A Puerto-Rican ex-con, just released from prison, pledges to stay away from drugs and violence despite the pressure around him, and lead a better life outside NYC.', 144, NULL, 7.80, '2024-09-17 21:43:11', 'https://www.themoviedb.org/movie/6075', NULL),
(432, 'City Slickers II: The Legend of Curly\'s Gold ', 1994, '/gh0lsyJARglhpbKmnY8i8M7V5bI.jpg', 'Mitch Robbins\' 40th birthday begins quite well until he returns home and finds his brother Glen, the black sheep of the family, in his sofa. Nevertheless he is about to have a wonderful birthday-night with his wife when he discovers a treasure map of Curly by chance. Together with Phil and unfortunately Glen he tries to find the hidden gold of Curly\'s father in the desert of Arizona.', 116, NULL, 5.23, '2024-09-17 21:43:12', 'https://www.themoviedb.org/movie/11310', NULL),
(433, 'Clean Slate ', 1994, '/kAYsvQvBVshLHGTIDGHcj9jTJq0.jpg', 'Pogue is a private eye with a problem: every morning when he wakes up, he has total amnesia, waking up with a \'blank slate\'. Since he is in the middle of a hot investigation and has a developing romance, this is less than convenient.', 107, NULL, 5.80, '2024-09-17 21:43:13', 'https://www.themoviedb.org/movie/18658', NULL),
(434, 'Cliffhanger ', 1993, '/b28DOM54OHb1c7Lsk6Nu7Kwuonj.jpg', 'A year after losing his friend in a tragic 4,000-foot fall, former ranger Gabe Walker and his partner, Hal, are called to return to the same peak to rescue a group of stranded climbers, only to learn the climbers are actually thieving hijackers who are looking for boxes full of money.', 112, NULL, 6.50, '2024-09-17 21:43:13', 'https://www.themoviedb.org/movie/9350', NULL),
(435, 'Coneheads ', 1993, '/4eHnstayi28SCHv8ATcISFEv1Rl.jpg', 'A pair of aliens arrive on Earth to prepare for invasion, but crash instead. With enormous cone-shaped heads, robotlike walks and an appetite for toilet paper, aliens Beldar and Prymatt don\'t exactly blend in with the population of Paramus, N.J. But for some reason, everyone believes them when they say they\'re from France.', 87, NULL, 5.37, '2024-09-17 21:43:14', 'https://www.themoviedb.org/movie/9612', NULL),
(436, 'Color of Night ', 1994, '/584MXUHljFOvhHVc9oXtHuq12U8.jpg', 'A color-blind psychiatrist is stalked by an unknown killer after taking over his murdered friend\'s therapy group and becomes embroiled in an intense affair with a mysterious woman who may be connected to the crime.', 121, NULL, 5.70, '2024-09-17 21:43:15', 'https://www.themoviedb.org/movie/2124', NULL),
(437, 'Cops and Robbersons ', 1994, '/wnkWgFU5UcLwbExCp1YtCg5Ox4E.jpg', 'Hard-as-nails cop Jake Stone moves in with the Robbersons so he can watch a hitman who has moved in next door. The hitman is one thing, but can he survive the Robberson family?', 93, NULL, 5.12, '2024-09-17 21:43:16', 'https://www.themoviedb.org/movie/26261', NULL),
(438, 'Cowboy Way, The ', 1994, '/r7sckMs1xy4fXYGzzs6anofu10F.jpg', 'Two championship rodeo partners travel to New York to find their missing friend, Nacho Salazar who went missing there.', 102, NULL, 5.61, '2024-09-17 21:43:17', 'https://www.themoviedb.org/movie/19176', NULL);
INSERT INTO movies (id, name, released_at, poster_url, synopsis, duration, trailer_url, average_rating, created_at, url, updated_at) VALUES
(439, 'Dangerous Game ', 1993, '/f8Vd4eq4Rq6ns54IRyouCNfOEmY.jpg', 'A New York film director, working on his latest movie in Los Angeles, begins to reflect the actions in his movie and real life, especially when he begins an affair with the lead actress.', 108, NULL, 5.80, '2024-09-17 21:43:18', 'https://www.themoviedb.org/movie/49299', NULL),
(440, 'Dave ', 1993, '/wIUuf1NFchdCJe833JBTiSMzqfv.jpg', 'A sweet-natured Temp Agency operator and amateur Presidential look-alike is recruited by the Secret Service to become a temporary stand-in for the President of the United States.', 110, NULL, 6.65, '2024-09-17 21:43:18', 'https://www.themoviedb.org/movie/11566', NULL),
(441, 'Dazed and Confused ', 1993, '/msG9awbLhVZwv1Eh9Ge7SofMexW.jpg', 'The adventures of a group of Texas teens on their last day of school in 1976, centering on student Randall Floyd, who moves easily among stoners, jocks and geeks. Floyd is a star athlete, but he also likes smoking weed, which presents a conundrum when his football coach demands he sign a \"no drugs\" pledge.', 102, NULL, 7.33, '2024-09-17 21:43:19', 'https://www.themoviedb.org/movie/9571', NULL),
(442, 'Demolition Man ', 1993, '/dq6AmlVFo92PRuoLCcIyFdoRuxf.jpg', 'Simon Phoenix, a violent criminal cryogenically frozen in 1996, escapes during a parole hearing in 2032 in the utopia of San Angeles. Police are incapable of dealing with his violent ways and turn to his captor, who had also been cryogenically frozen after being wrongfully accused of killing 30 innocent people while apprehending Phoenix.', 115, NULL, 6.72, '2024-09-17 21:43:20', 'https://www.themoviedb.org/movie/9739', NULL),
(443, 'Endless Summer 2, The ', 1994, '/89y5faI7wXFghUcsMtwfcVS6JBZ.jpg', 'Bruce Brown, king of surfing documentaries, returns after nearly thirty years to trace the steps of two young surfers to top surfing spots around the world. Along the way we see many of the people and locales Bruce visited during the filming of Endless Summer (1966).', 109, NULL, 7.30, '2024-09-17 21:43:21', 'https://www.themoviedb.org/movie/24257', NULL),
(444, 'Even Cowgirls Get the Blues ', 1993, '/20x8nm0nPXkYv04COAHFA2AHyAl.jpg', 'A girl born with enormous thumbs in the repressive era of the 1950s learns to turn her quirks into assets.', 96, NULL, 4.40, '2024-09-17 21:43:22', 'https://www.themoviedb.org/movie/34444', NULL),
(445, 'Fatal Instinct ', 1993, '/syewFnehGbbya5BdxoHLzrcm5Ne.jpg', 'Ned Ravine is a police officer and lawyer who occasionally defends the delinquents he arrests. He crosses paths with seductive Lola Cain during an assignment and promptly begins an affair with her. Meanwhile, Ned\'s wife, Lana, is deep in an affair of her own. Lana and her lover are planning to murder Ned in an elaborate fashion so they can collect on his triple indemnity life insurance policy.', 91, NULL, 5.39, '2024-09-17 21:43:23', 'https://www.themoviedb.org/movie/26141', NULL),
(446, 'Farewell My Concubine (Ba wang bie ji) ', 1993, '/f54hNIiHNINw3JiUJB2XaQl5wCN.jpg', 'Two boys meet at an opera training school in Peking in 1924. Their resulting friendship will span nearly 70 years and endure some of the most troublesome times in China\'s history.', 171, NULL, 7.95, '2024-09-17 21:43:24', 'https://www.themoviedb.org/movie/10997', NULL),
(447, 'Favor, The ', 1994, '/uFooKexRxruACuxnkQVmwf3nNcU.jpg', 'On the eve of her high school reunion, bored housewife Kathy convinces her single best friend Emily to seduce an old flame Tom, so she can get all the juicy details. But when Emily falls for Tom, it\'s like high school all over again!', 97, NULL, 4.80, '2024-09-17 21:43:24', 'https://www.themoviedb.org/movie/50463', NULL),
(448, 'Fearless ', 1993, '/yiCAa85nJJDFiq0LmZ2Fgvu4RgY.jpg', 'After a terrible air disaster, survivor Max Klein emerges a changed person. Unable to connect to his former life or to wife Laura, he feels godlike and invulnerable. When psychologist Bill Perlman is unable to help Max, he has Max meet another survivor, Carla Rodrigo, who is wracked with grief and guilt since her baby died in the crash which she and Max survived.', 122, NULL, 6.90, '2024-09-17 21:43:25', 'https://www.themoviedb.org/movie/10443', NULL),
(449, 'Fear of a Black Hat ', 1994, '/jiJp7B74GBKJK8yCqLjMaFu24nJ.jpg', 'Chronicling the controversial career of bad boys N.W.H. (Niggaz With Hats), this uproarious \'mockumentary\' lampoons all of hardcore rap\'s hot-button issues. This underground laugh riot recounts the rise, fall and resurrection of a clueless bunch of would-be rappers, Ice Cold, Tone-Def & Tasty Taste performing as N.W.H.', 88, NULL, 6.00, '2024-09-17 21:43:26', 'https://www.themoviedb.org/movie/20239', NULL),
(450, 'With Honors ', 1994, '/iMcSUbMT13Rb8fmhwvanVAMwRW.jpg', 'Convinced he\'ll graduate with honors because of his thesis paper, a stuffy Harvard student finds his paper being held hostage by a homeless man, who might be the guy to school the young man in life.', 103, NULL, 6.80, '2024-09-17 21:43:27', 'https://www.themoviedb.org/movie/16297', NULL),
(451, 'Flesh and Bone ', 1993, '/gNaZSODlVRiQltGWjS8vQZEYJTq.jpg', 'Haunted by memories of his father murdering a family, Arlis Sweeney prefers to keep to himself, focusing his energy on his work. One day, the traumatic past that eats away at him returns when he meets Kay Davies, a woman connected to the bloody event. Against all odds, Arlis and Kay fall in love; however, when his father, Roy, reappears in his life -- with the coldhearted Ginnie in tow -- Arlis must deal with his past demons.', 126, NULL, 6.03, '2024-09-17 21:43:28', 'https://www.themoviedb.org/movie/18551', NULL),
(452, 'Widows\' Peak ', 1994, '/xXyVUwvJesJJChzpvn7xj5cAOfm.jpg', 'Scandal and mystery reign following the arrival of Edwina in a small Irish town populated entirely by widows. Edwina quickly falls out with the locals while also falling in with the son of the community\'s leader', 101, NULL, 6.22, '2024-09-17 21:43:28', 'https://www.themoviedb.org/movie/25440', NULL),
(453, 'For Love or Money ', 1993, '/x1twBUsthHeA7FwOxPpQWtJb9zy.jpg', 'New York concierge Doug Ireland wants to go into business for himself and refurbish a hotel on Roosevelt Island, N.Y., but he needs an investor. With a few weeks left before his option on the site runs out, Doug agrees to help wealthy Christian Hanover conceal his affair with salesgirl Andy Hart from his wife. Despite his own attraction to Andy, Doug tries to stay focused on getting Christian to invest $3 million in his project.', 94, NULL, 6.20, '2024-09-17 21:43:29', 'https://www.themoviedb.org/movie/9024', NULL),
(454, 'Firm, The ', 1993, '/i9a4vbkzausnAzH07IOusX3ToTv.jpg', 'Mitch McDeere is a young man with a promising future in Law. About to sit his Bar exam, he is approached by \'The Firm\' and made an offer he doesn\'t refuse. Seduced by the money and gifts showered on him, he is totally oblivious to the more sinister side of his company. Then, two Associates are murdered. The FBI contact him, asking him for information and suddenly his life is ruined. He has a choice - work with the FBI, or stay with the Firm. Either way he will lose his life as he knows it. Mitch figures the only way out is to follow his own plan...', 154, NULL, 6.74, '2024-09-17 21:43:30', 'https://www.themoviedb.org/movie/37233', NULL),
(455, 'Free Willy ', 1993, '/9iBgd9gi9ztWiVcYSG6zl8wDFBN.jpg', 'When maladjusted orphan Jesse vandalizes a theme park, he is placed with foster parents and must work at the park to make amends. There he meets Willy, a young Orca whale who has been separated from his family. Sensing kinship, they form a bond and, with the help of kindly whale trainer Rae Lindley, develop a routine of tricks. However, greedy park owner Dial soon catches wind of the duo and makes plans to profit from them.', 112, NULL, 6.17, '2024-09-17 21:43:31', 'https://www.themoviedb.org/movie/1634', NULL),
(456, 'Fresh ', 1994, '/uXRIIUzjDZZdWR2cUzPJ9eAqaHv.jpg', 'Death and violence anger twelve year old drug courier Fresh, who sets his employers against each other.', 114, NULL, 7.10, '2024-09-17 21:43:32', 'https://www.themoviedb.org/movie/13815', NULL),
(457, 'Fugitive, The ', 1993, '/b3rEtLKyOnF89mcK75GXDXdmOEf.jpg', 'Wrongfully convicted of murdering his wife and sentenced to death, Richard Kimble escapes from the law in an attempt to find the real killer and clear his name.', 131, NULL, 7.47, '2024-09-17 21:43:33', 'https://www.themoviedb.org/movie/5503', NULL),
(458, 'Geronimo: An American Legend ', 1993, '/oW4IM0G5fCR68YalmemTGbPK15F.jpg', 'The Apache Indians have reluctantly agreed to settle on a US Government approved reservation. Not all the Apaches are able to adapt to the life of corn farmers. One in particular, Geronimo, is restless. Pushed over the edge by broken promises and necessary actions by the government, Geronimo and thirty or so other warriors form an attack team which humiliates the government by evading capture, while reclaiming what is rightfully theirs.', 115, NULL, 6.29, '2024-09-17 21:43:33', 'https://www.themoviedb.org/movie/35588', NULL),
(459, 'Getaway, The ', 1994, '/4tWvZ4BQu3ICmtUL8lXHa9OgkoF.jpg', 'Doc McCoy is put in prison because his partners chickened out and flew off without him after exchanging a prisoner with a lot of money. Doc knows Jack Benyon, a rich \"business\"-man, is up to something big, so he tells his wife (Carol McCoy) to tell him that he\'s for sale if Benyon can get him out of prison. Benyon pulls some strings and Doc McCoy is released again. Unfortunately he has to cooperate with the same person that got him to prison.', 115, NULL, 5.70, '2024-09-17 21:43:34', 'https://www.themoviedb.org/movie/2087', NULL),
(460, 'Getting Even with Dad ', 1994, '/yZLcdtT8UVlj6j3H8Rl51PxIdza.jpg', 'Ray, an ex-con and widower, is planning a coin heist with two accomplices to help him to buy his own bakery. However, he doesn\'t expect his son Timmy, who was living with Ray\'s sister, to show up at the house right in the middle of planning. Timmy is ignored and Ray and his buddies pull off the heist. Timmy gets his father\'s attention by stealing the coins and hiding them. To get them back, his father must take him to a number of different places and treat him like he enjoys his presence. They grow fond of each other but Timmy won\'t stay with his dad unless he gives up the coins.', 109, NULL, 5.25, '2024-09-17 21:43:35', 'https://www.themoviedb.org/movie/41579', NULL),
(461, 'Go Fish ', 1994, '/4hczdEX2RmQTOmiIKygoOYCy0bI.jpg', 'Max is a trendy, pretty, young lesbian, who is having trouble finding love. A friend sets her up with Ely, whom Max likes, but Ely is frumpy, homely, and older. Nor do they have much in common. Can Max learn to look past the packaging?', 83, NULL, 4.61, '2024-09-17 21:43:36', 'https://www.themoviedb.org/movie/18620', NULL),
(462, 'Good Man in Africa, A ', 1994, '/4BBZLZVEANsnCVqIF9fgf0bshQD.jpg', 'Morgan Leafy is a secretary to the British High Commissioner to an Africa nation. Leafy is a man that makes himself useful to his boss, the snobbish Arthur Fanshawe, who has no clue about what\'s going on around him, but who wants to use his secretary to carry on his dirty work, which involves getting one of the most powerful men in the country to do business with his country.The young secretary has an eye for beautiful women around him, especially Hazel, a native beauty, with whom he is having an affair. Things get complicated because Sam Adekunle, a man running for president of the country, wants a favor from Leafy in return after he has accepted the invitation to visit London. The proposition involves swaying a prominent doctor\'s opposition to a plan that will make Adenkule filthy rich.', 94, NULL, 5.20, '2024-09-17 21:43:37', 'https://www.themoviedb.org/movie/41006', NULL),
(463, 'Guilty as Sin ', 1993, '/yqEFrL47aqfKf1glpkv06sk8dom.jpg', 'Before a criminal lawyer knows what has happened, she is forced to defend a wife killer she knows is guilty.', 107, NULL, 5.71, '2024-09-17 21:43:37', 'https://www.themoviedb.org/movie/4916', NULL),
(464, 'Hard Target ', 1993, '/kufvuQYWdl82sYzmhy2naBLyMui.jpg', 'When a woman\'s father goes missing, she enlists a local to aid in her search.  The pair soon discover that her father has died at the hands of a wealthy sportsman who hunts homeless men as a form of recreation.', 97, NULL, 6.40, '2024-09-17 21:43:38', 'https://www.themoviedb.org/movie/2019', NULL),
(465, 'Heaven & Earth ', 1993, '/xn3Oc3GwZwWrpd6KbEEPrA4h6EY.jpg', 'Le Ly lives in a small Vietnamese village whose serenity is shattered when war breaks out. Caught between the Viet Cong and the South Vietnamese army, the village is all but destroyed. After being both brutalized and raped, Le Ly resolves to flee. She leaves for the city, surviving desperate situations, but surviving nonetheless. Eventually she meets a U.S. Marine named Steve Butler who treats her kindly and tells her he would like to be married -- maybe to her.', 140, NULL, 6.70, '2024-09-17 21:43:39', 'https://www.themoviedb.org/movie/31642', NULL),
(466, 'Hot Shots! Part Deux ', 1993, '/zh9EGK970GHo10ETclWBOjZVUOK.jpg', 'Topper Harley is found to be working as an odd-job-man in a monastery. The CIA want him to lead a rescue mission into Iraq, to rescue the last rescue team, who went in to rescue the last rescue team—who went in to rescue hostages left behind after Desert Storm.', 88, NULL, 6.54, '2024-09-17 21:43:40', 'https://www.themoviedb.org/movie/9255', NULL),
(467, 'Live Nude Girls ', 1995, '/vg9piYFtCTHep2V5EmLjwsYMzn2.jpg', 'A group of old friends at a Hens Night discuss their issues, uncertainties, fears and fantasies.', 95, NULL, 4.50, '2024-09-17 21:43:41', 'https://www.themoviedb.org/movie/26271', NULL),
(468, 'Englishman Who Went Up a Hill But Came Down a Mountain, The ', 1995, '/dnatrgiXFf6BLfb2IKHVmg9tCi7.jpg', 'When an English cartographer arrives in Wales to tell the residents of the Welsh village of Ffynnon Garw  that their \'mountain\' is only a hill, the offended community sets out to remedy the situation.', 91, NULL, 6.30, '2024-09-17 21:43:42', 'https://www.themoviedb.org/movie/10612', NULL),
(469, 'House of the Spirits, The ', 1993, '/q0YyNTvooXI9ZF71dAYKcRwqlGn.jpg', 'A rancher, his clairvoyant wife and their family face turbulent years in South America.', 140, NULL, 6.89, '2024-09-17 21:43:42', 'https://www.themoviedb.org/movie/2259', NULL),
(470, 'House Party 3 ', 1994, '/jLUgvHO3vVLkzKs3OcYksGPbLnA.jpg', 'Hip Hop duo Kid & Play return in the second follow-up to their 1990 screen debut House Party. Kid (Christopher \"Kid\" Reid) is taking the plunge and marrying his girlfriend Veda (Angela Means), while his friend Play (Christopher Martin) is dipping his toes into the music business, managing a roughneck female rap act called Sex as a Weapon. Play books the ladies for a concert with heavy-hitting pr', 100, NULL, 5.07, '2024-09-17 21:43:43', 'https://www.themoviedb.org/movie/16097', NULL),
(471, 'Hudsucker Proxy, The ', 1994, '/yWKm4yzRU4hokkbYCJ34vwVwb9R.jpg', 'A naive business graduate is installed as president of a manufacturing company as part of a stock scam.', 111, NULL, 7.10, '2024-09-17 21:43:44', 'https://www.themoviedb.org/movie/11934', NULL),
(472, 'I\'ll Do Anything ', 1994, '/q7CFDCUNfuOxZssINLGkPE9m2l1.jpg', 'Matt Hobbs is a talented but unsuccessful actor. When estranged (and strange) ex-wife Beth dumps their daughter Jeannie on Matt, father and daughter have a lot of adjusting to do. His budding relationship with attractive production assistant Cathy Breslow is made complicated, while the precocious child is overly accustomed to getting her own way. Matt eventually faces the choice of family vs career in a particularly difficult way.', 115, NULL, 5.60, '2024-09-17 21:43:45', 'https://www.themoviedb.org/movie/106143', NULL),
