(529, 'Searching for Bobby Fischer ', 1993, '/oAJpHkMpfXiFY9F3HocIz9fhHLc.jpg', 'A seven-year-old chess prodigy refuses to harden himself in order to become a champion like the famous but unlikable Bobby Fischer.', 110, NULL, 7.10, '2024-09-17 21:44:34', 'https://www.themoviedb.org/movie/14291', NULL),
(530, 'Second Best ', 1994, '/aKnqvAIYLUXm1Lnih0Oc024HbYV.jpg', 'The difficult relationship between a british postal officer and his adoptive son.', 105, NULL, 6.68, '2024-09-17 21:44:35', 'https://www.themoviedb.org/movie/103413', NULL),
(531, 'Secret Garden, The ', 1993, '/zf6h5dJ7wVG7LqMO9dhHGHVejzj.jpg', 'A young British girl born and reared in India loses her neglectful parents in an earthquake. She is returned to England to live at her uncle\'s castle. Her uncle is very distant due to the loss of his wife ten years before. Neglected once again, she begins exploring the estate and discovers a garden that has been locked and forgotten. Aided by one of the servants\' boys, she begins restoring the garden, and eventually discovers some other secrets of the manor.', 102, NULL, 7.40, '2024-09-17 21:44:36', 'https://www.themoviedb.org/movie/11236', NULL),
(532, 'Serial Mom ', 1994, '/svjDGRzT5IsR1odhBOPPBLSF4sm.jpg', 'Beverly is the perfect happy homemaker, along with her doting husband and two children, but this nuclear family just might explode when her fascination with serial killers collides with her ever-so-proper code of ethics.', 94, NULL, 6.75, '2024-09-17 21:44:36', 'https://www.themoviedb.org/movie/11592', NULL),
(533, 'Shadow, The ', 1994, '/xAbFJH3vQYZvUyzzGAtG4OLy492.jpg', 'Based on the 1930\'s comic strip, puts the hero up against his arch enemy, Shiwan Khan, who plans to take over the world by holding a city to ransom using an atom bomb. Using his powers of invisibility and \"The power to cloud men\'s minds\", the Shadow comes blazing to the city\'s rescue with explosive results.', 108, NULL, 6.00, '2024-09-17 21:44:37', 'https://www.themoviedb.org/movie/8850', NULL),
(534, 'Shadowlands ', 1993, '/5jTWY1M2O4Zhid4rLOpftzazRGn.jpg', 'C.S. Lewis, a world-renowned writer and professor, leads a passionless life until he meets spirited poet Joy Gresham.', 131, NULL, 6.90, '2024-09-17 21:44:38', 'https://www.themoviedb.org/movie/10445', NULL),
(535, 'Short Cuts ', 1993, '/nAEBc3g9bHAcF9whKFMfIxHxVwn.jpg', 'Many loosely connected characters cross paths in this film, based on the stories of Raymond Carver. Waitress Doreen Piggot accidentally runs into a boy with her car. Soon after walking away, the child lapses into a coma. While at the hospital, the boy\'s grandfather tells his son, Howard, about his past affairs. Meanwhile, a baker starts harassing the family when they fail to pick up the boy\'s birthday cake.', 188, NULL, 7.23, '2024-09-17 21:44:39', 'https://www.themoviedb.org/movie/695', NULL),
(536, 'Simple Twist of Fate, A ', 1994, '/2Jorj80Y4EVEAPDRVVdDXKSVUTw.jpg', 'When Michael McCann is thrown over by the woman he loves, he becomes something of a misanthrope and a miser, spending all of his spare money on collectible gold coins. Living in the same town is an affluent family with two sons: John and Tanny. Tanny\'s a wild boy, whom John cannot control, and one night he breaks into McCann\'s house, and steals the gold and disappears, which nearly confirms McCann\'s distrust of mankind. But then, a mysterious young woman dies in the snow outside McCann\'s house, and her small daughter makes her way to McCann\'s house and into McCann\'s life and heart.', 106, NULL, 6.00, '2024-09-17 21:44:40', 'https://www.themoviedb.org/movie/43535', NULL),
(537, 'Sirens ', 1994, '/bOUDHgOlxANs1KsYZEsLSjZBTkd.jpg', 'In 1930s Australia, Anglican clergyman Anthony Campion and his prim wife, Estella, are asked to visit noted painter Norman Lindsay, whose planned contribution to an international art exhibit is considered blasphemous. While Campion and Lindsay debate, Estella finds herself drawn to the three beautiful models sitting for the painter\'s current work, freethinking Sheela, sensual Pru and virginal Giddy.', 98, NULL, 5.60, '2024-09-17 21:44:41', 'https://www.themoviedb.org/movie/12519', NULL),
(538, 'Six Degrees of Separation ', 1993, '/oH0bl69uZZA6dAclgFRkm1Vwcry.jpg', 'The story of a young, gay, black, con artist who, posing as the son of Sidney Poitier, cunningly maneuvers his way into the lives of a white, upper-class New York family.', 112, NULL, 6.40, '2024-09-17 21:44:41', 'https://www.themoviedb.org/movie/23210', NULL),
(539, 'Sleepless in Seattle ', 1993, '/iLWsLVrfkFvOXOG9PbUAYg7AK3E.jpg', 'After the death of his mother, a young boy calls a radio station in an attempt to set his father up on a date. Talking about his father’s loneliness soon leads to a meeting with a young female journalist, who has flown to Seattle to write a story about the boy and his father.', 105, NULL, 6.74, '2024-09-17 21:44:42', 'https://www.themoviedb.org/movie/858', NULL),
(540, 'Sliver ', 1993, '/g7PC2e2KqDkIfOoJx9iXJJez99d.jpg', 'A woman moves into an apartment in Manhattan and learns that the previous tenant\'s life ended mysteriously after they fell from the balcony.', 108, NULL, 5.47, '2024-09-17 21:44:43', 'https://www.themoviedb.org/movie/867', NULL),
(541, 'Blade Runner ', 1982, '/63N9uy8nd9j7Eog2axPQ8lbr3Wj.jpg', 'In the smog-choked dystopian Los Angeles of 2019, blade runner Rick Deckard is called out of retirement to terminate a quartet of replicants who have escaped to Earth seeking their creator for a way to extend their short life spans.', 118, NULL, 7.94, '2024-09-17 21:44:44', 'https://www.themoviedb.org/movie/78', NULL),
(542, 'Son in Law ', 1993, '/A1PzB78kLgJRhslXumMTFjsIUcV.jpg', 'Country girl Rebecca has spent most of her life on a farm in South Dakota, and, when she goes away to college in Los Angeles, Rebecca immediately feels out of place in the daunting urban setting. She is befriended by a savvy party animal named Crawl, who convinces the ambivalent Rebecca to stay in the city. When Thanksgiving break rolls around, Rebecca, no longer an innocent farm girl, invites Crawl back to South Dakota, where he pretends to be her fiancé.', 95, NULL, 5.99, '2024-09-17 21:44:45', 'https://www.themoviedb.org/movie/13203', NULL),
(543, 'So I Married an Axe Murderer ', 1993, '/wMr6ZjfOnCHOA9Qm3jvo0e7nzfx.jpg', 'Just after a bad breakup, Charlie MacKenzie falls for lovely butcher Harriet Michaels and introduces her to his parents. But, as voracious consumers of sensational tabloids, his parents soon come to suspect that Harriet is actually a notorious serial killer -- \"Mrs. X\" -- wanted in connection with a string of bizarre honeymoon killings. Thinking his parents foolish, Charlie proposes to Harriet. But while on his honeymoon with her, he begins to fear they were right.', 93, NULL, 6.10, '2024-09-17 21:44:46', 'https://www.themoviedb.org/movie/10442', NULL),
(544, 'Striking Distance ', 1993, '/Am7iQWLSIDFbUB1o1xtvrbFxV1X.jpg', 'Coming from a police family, Tom Hardy ends up fighting his uncle after the murder of his father. Tom believes the killer is another cop, and goes on the record with his allegations. Demoted to water-way duty Tom, along with new partner Jo Christman, navigate the three rivers looking for clues and discovering bodies. This time the victims are women Tom knows, he must find the killer to prove his innocence.', 102, NULL, 5.80, '2024-09-17 21:44:47', 'https://www.themoviedb.org/movie/11074', NULL),
(546, 'Super Mario Bros. ', 1993, '/yt5bbMfKpg1nRr4k5edxs7tPK2m.jpg', 'Mario and Luigi, plumbers from Brooklyn, find themselves in an alternate universe where evolved dinosaurs live in hi-tech squalor. They\'re the only hope to save our universe from invasion by the dino dictator, Koopa.', 104, NULL, 4.41, '2024-09-17 21:44:48', 'https://www.themoviedb.org/movie/9607', NULL),
(547, 'Surviving the Game ', 1994, '/wRtpJFGney5gqHmMb3JjT5WN3FH.jpg', 'A homeless man is hired as a survival guide for a group of wealthy businessmen on a hunting trip in the mountains, unaware that they are killers who hunt humans for sport, and that he is their new prey.', 96, NULL, 6.09, '2024-09-17 21:44:49', 'https://www.themoviedb.org/movie/17585', NULL),
(548, 'Terminal Velocity ', 1994, '/jmxE6kKhXaqD2ZKJQO8FYDaLgQ5.jpg', 'A maverick skydiver and a former KGB agent team up to stop the Russian mafia from stealing gold.', 102, NULL, 5.32, '2024-09-17 21:44:49', 'https://www.themoviedb.org/movie/9057', NULL),
(549, 'Thirty-Two Short Films About Glenn Gould ', 1993, '/gIvypJ6N8aUN9DoeRY1siPDF9AW.jpg', 'A collection of vignettes highlighting different aspects of the life, work, and character of the acclaimed Canadian classical pianist.', 93, NULL, 7.12, '2024-09-17 21:44:50', 'https://www.themoviedb.org/movie/20967', NULL),
(550, 'Threesome ', 1994, '/gHXXhuGJKUjq5Pl9RNgfQbqLIxw.jpg', 'At a sizable public college, high-minded student Eddy is forced to room with the slovenly Stuart, but the pair strike up a surprising friendship. When attractive co-ed Alex is assigned to live with the two male students because of her gender-neutral name, a roundabout love triangle ensues. Eddy secretly yearns for Stuart, who wants Alex, but she prefers Eddy. The complex situation leads to sexual experimentation and strained relationships.', 93, NULL, 6.40, '2024-09-17 21:44:51', 'https://www.themoviedb.org/movie/10635', NULL),
(551, 'Nightmare Before Christmas, The ', 1993, '/oQffRNjK8e19rF7xVYEN8ew0j7b.jpg', 'Tired of scaring humans every October 31 with the same old bag of tricks, Jack Skellington, the spindly king of Halloween Town, kidnaps Santa Claus and plans to deliver shrunken heads and other ghoulish gifts to children on Christmas morning. But as Christmas approaches, Jack\'s rag-doll girlfriend, Sally, tries to foil his misguided plans.', 76, NULL, 7.84, '2024-09-17 21:44:52', 'https://www.themoviedb.org/movie/9479', NULL);
INSERT INTO movies (id, name, released_at, poster_url, synopsis, duration, trailer_url, average_rating, created_at, url, updated_at) VALUES
(552, 'Three Musketeers, The ', 1993, '/mk8UH7JRmK8adcqJJpB1ygP7B1C.jpg', 'D\'Artagnan travels to Paris hoping to become a musketeer, one of the French king\'s elite bodyguards, only to discover that the corps has been disbanded by conniving Cardinal Richelieu, who secretly hopes to usurp the throne. Fortunately, Athos, Porthos and Aramis have refused to lay down their weapons and continue to protect their king. D\'Artagnan joins with the rogues to expose Richelieu\'s plot against the crown.', 105, NULL, 6.39, '2024-09-17 21:44:53', 'https://www.themoviedb.org/movie/10057', NULL),
(553, 'Tombstone ', 1993, '/f6Lb4bpUW2AJW42Hpnix2533RKU.jpg', 'Legendary marshal Wyatt Earp, now a weary gunfighter, joins his brothers Morgan and Virgil to pursue their collective fortune in the thriving mining town of Tombstone. But Earp is forced to don a badge again and get help from his notorious pal Doc Holliday when a gang of renegade brigands and rustlers begins terrorizing the town.', 130, NULL, 7.60, '2024-09-17 21:44:54', 'https://www.themoviedb.org/movie/11969', NULL),
(554, 'Trial by Jury ', 1994, '/uYVGv35bMH7MybbfvWHEC9xQDMY.jpg', 'Valerie is a juror in the trial of a mob boss. When her young son\'s life is threatened, she has no option other than to see that justice isn\'t done.', 107, NULL, 5.36, '2024-09-17 21:44:54', 'https://www.themoviedb.org/movie/41590', NULL),
(555, 'True Romance ', 1993, '/39lXk6ud6KiJgGbbWI2PUKS7y2.jpg', 'Clarence marries hooker Alabama, steals cocaine from her pimp, and tries to sell it in Hollywood, while the owners of the coke try to reclaim it.', 118, NULL, 7.54, '2024-09-17 21:44:55', 'https://www.themoviedb.org/movie/319', NULL),
(556, 'War Room, The ', 1993, '/prfxsyG4SnlnqqulavCJ4RksFUA.jpg', 'A behind-the-scenes documentary about the Clinton for President campaign, focusing on the adventures of spin doctors James Carville and George Stephanopoulos.', 96, NULL, 7.02, '2024-09-17 21:44:56', 'https://www.themoviedb.org/movie/26408', NULL),
(558, 'Pagemaster, The ', 1994, '/etctWkYFfP7voGM3rd7uqxQJavY.jpg', 'Rich knows a lot about accidents. So much so, he is scared to do anything that might endanger him, like riding his bike, or climbing into his treehouse. While in an old library, he is mystically transported into the unknown world of books, and he has to try and get home again.', 75, NULL, 6.38, '2024-09-17 21:44:57', 'https://www.themoviedb.org/movie/15139', NULL),
(559, 'Paris, France ', 1993, '/thcPOPd5e497Ta0pYN8lSBkfYMN.jpg', 'A writer has torrid fantasy affairs with young men.', 112, NULL, 4.80, '2024-09-17 21:44:58', 'https://www.themoviedb.org/movie/161158', NULL),
(560, 'Beans of Egypt, Maine, The ', 1994, '/aPhwUrsviNrbBs8khuDHsnX9cn9.jpg', 'The Beans are poor, proud, hated by all, but alive in the sense that they struggle against their lot and support each other in time of trouble. Earlene lives across the street from the Bean\'s trailer, and the view from her window is better than any daytime television soap opera; especially Beal Bean, and especially Beal Bean shirtless. When Reuben Bean is sent to prison for resisting arrest for out-of-season deer hunting, Beal takes up with Reuben\'s woman Roberta. He also has a child by Earlene, with a triangle of sex complicated by poverty.', 99, NULL, 5.00, '2024-09-17 21:44:59', 'https://www.themoviedb.org/movie/218473', NULL),
(561, 'Killer (Bulletproof Heart) ', 1994, '/nKEwcGrTl0kWcFQlbrhciP8wYtK.jpg', 'Cynical hit man Mick is tiring of his job and asks his boss George for time off. However, George gives him the assignment of his life, prompting Mick\'s soul-searching to reach new heights. Mick is asked to kill sultry Fiona, who owes George money and claims she wants to die. But as Mick spends time with her, he finds himself falling for her.', 97, NULL, 4.80, '2024-09-17 21:45:00', 'https://www.themoviedb.org/movie/85247', NULL),
(562, 'Welcome to the Dollhouse ', 1995, '/jWP9OUb8Xl3PQ9qxpXFkreFMqEH.jpg', 'An unattractive 7th grader struggles to cope with suburban life as the middle child with inattentive parents and bullies at school.', 88, NULL, 7.12, '2024-09-17 21:45:00', 'https://www.themoviedb.org/movie/11446', NULL),
(563, 'Germinal ', 1993, '/cizv23RUxcpTrQt4kcOz7Sv6YJl.jpg', 'It\'s mid 19th century, north of France. The story of a coal miner\'s town. They are exploited by the mine\'s owner. One day the decide to go on strike, and then the authorities repress them.', 160, NULL, 6.73, '2024-09-17 21:45:01', 'https://www.themoviedb.org/movie/51980', NULL),
(564, 'Chasers ', 1994, '/mEG6fTyTjsA1vzTTqCXsiJzjdQ5.jpg', 'Military men Rock Reilly and Eddie Devane are tasked with taking a prisoner, blonde bombshell Toni Johnson, on what becomes an unforgettable road trip. Toni, an enlistee who\'s in trouble for deserting her unit, soon proves that she\'s craftier than most inmates.', 102, NULL, 5.33, '2024-09-17 21:45:02', 'https://www.themoviedb.org/movie/24405', NULL),
(565, 'Cronos ', 1993, '/bRX8au50CnhC8hXr8AbsCNdb96G.jpg', 'Faced with his own mortality, an ingenious alchemist tried to perfect an invention that would provide him with the key to eternal life. It was called the Cronos device. When he died more than 400 years later, he took the secrets of this remarkable device to the grave with him. Now, an elderly antiques dealer has found the hellish machine hidden in a statue and learns about its incredible powers. The more he uses the device, the younger he becomes...but nothing comes without a price. Life after death is just the beginning as this nerve-shattering thriller unfolds and the fountain of youth turns bloody.', 94, NULL, 6.66, '2024-09-17 21:45:03', 'https://www.themoviedb.org/movie/11655', NULL),
(566, 'Naked in New York ', 1994, '/gAufFGm2Qly8TYrhy4me9X35B7m.jpg', 'Naked in New York begins in the car of grown up Jake, he is talking to us about his girlfriend, Joanne,  and to whom you can turn to for help while facing life. From there it flashes back to his memories of his parents, college, house across from a squirrel infested peanut factory, best friend, writing career and Joanne.', 95, NULL, 4.70, '2024-09-17 21:45:04', 'https://www.themoviedb.org/movie/11800', NULL),
(567, 'Kika ', 1993, '/jUEBKaMqcvrz0HHF8Cei8asjRWr.jpg', 'When American author Nicholas brings in a cosmetologist named Kika to prepare the corpse of his recently deceased son, she inadvertently revives the young man, then falls in love with him. Forces conspire against the couple, though, as Nicholas wants Kika for himself.', 117, NULL, 6.47, '2024-09-17 21:45:05', 'https://www.themoviedb.org/movie/8223', NULL),
(568, 'Bhaji on the Beach ', 1993, '/3J5XZgf0NsvTumKMXMqPz5dNhfY.jpg', 'A group of South Asian women try but cannot escape their problems on a day trip to a British beach resort.', 100, NULL, 5.30, '2024-09-17 21:45:06', 'https://www.themoviedb.org/movie/14587', NULL),
(569, 'Little Big League ', 1994, '/dyZ6Agvh2yAFe91J8pJroAPCZgh.jpg', 'When the owner of the Minnesota Twins passes away, he bequeaths the team to his preteen grandson. The newly minted head honcho quickly appoints himself manager, causing unrest in an organization that struggles to take orders from a 12-year-old.', 119, NULL, 5.74, '2024-09-17 21:45:06', 'https://www.themoviedb.org/movie/31504', NULL),
(570, 'Slingshot, The (Kådisbellan) ', 1993, '/uSm5xpVmwiDZ0MbWkZOfu54k8hE.jpg', 'Stockholm in the 1920s. Young Roland lives with his socialist father, Jewish mother and a boxing brother. His mother sells condoms illegally, and from them, Roland makes slingshots which he sells. His rebellious ways has gotten him the special attention of his school teacher, who always makes sure that Roland is punished. Roland also tries to make extra money by repairing bicycles, a successful business that in the end lands him in hot water.', 102, NULL, 6.30, '2024-09-17 21:45:07', 'https://www.themoviedb.org/movie/41653', NULL),
(571, 'Wedding Gift, The ', 1994, '/kZt6Lu6mqJPUfEcB851APlnHN4m.jpg', 'Diana and Deric have an ideal marriage: they thrive in each other\'s company, they\'re funny, and they enjoy their two grown children and Deric\'s dotty mother; the trouble is, Diana can no longer walk and her malady defies medical diagnosis. To care for Diana, Deric is letting his business slide, but at a civic luncheon, he is seated next to Aileen Armitage, a novelist who is blind. They have a nice time, and on the sly, Diana contacts Aileen to made an odd request. Diana\'s declining health and her resolve bring this triangle of unlikely friends to a surprising place.', 102, NULL, 6.00, '2024-09-17 21:45:08', 'https://www.themoviedb.org/movie/53185', NULL),
(572, 'Foreign Student ', 1994, '/4LexKl8qiKEneVN7uSVN3zDvVDZ.jpg', 'A French football playing exchange student falls in love.', 90, NULL, 4.50, '2024-09-17 21:45:09', 'https://www.themoviedb.org/movie/95743', NULL),
(573, 'Ciao, Professore! (Io speriamo che me la cavo) ', 1992, '/b4wZkB4FNUi7SK46Tw9kxT5oW8M.jpg', 'A bureaucratic snafu sends Marco Tullio Sperelli, a portly, middle-aged northern Italian, to teach third grade in a poor town outside Naples', 93, NULL, 7.16, '2024-09-17 21:45:10', 'https://www.themoviedb.org/movie/23637', NULL),
(574, 'Spanking the Monkey ', 1994, '/cXgBxiPn1GBVMZX7mPsMSMjpfmt.jpg', 'Bright young student Raymond Aibelli is forced to sidetrack an important medical internship because his mother, Susan, is recovering from a broken leg. When he isn\'t tasked with the most mundane aspects of Susan\'s recuperation, Raymond finds distraction in a neighborhood girl, Toni Peck. But, as Susan begins relying on her son for both physical and emotional needs, Raymond starts developing disturbing and unwanted new yearnings.', 106, NULL, 5.60, '2024-09-17 21:45:11', 'https://www.themoviedb.org/movie/17600', NULL),
(575, 'Little Rascals, The ', 1994, '/qI7PKX2JSw4yD2iQm3pyHvKir28.jpg', 'When nine-year-old Alfalfa falls for Darla, his \"He-Man-Woman-Hating\" friends attempt to sabotage their relationship.', 82, NULL, 6.78, '2024-09-17 21:45:12', 'https://www.themoviedb.org/movie/10897', NULL),
(576, 'Fausto ', 1993, '/hx95nBuHwprvE6f3N0Ho26s4Rtg.jpg', 'Fausto enters an orphanage and is initially bullied, but then makes friends with a new bunkmate, Raymond. He is apprenticed to Mietek, a tailor in the Jewish quarter, who teaches him the trade. Fausto charms everyone in the quarter, and falls in love with Tonie, the mechanic\'s daughter. He starts making outrageous suits for publicity and, after dressing Tonie, decides that he wants to be a famous couturier.', 82, NULL, 4.70, '2024-09-17 21:45:12', 'https://www.themoviedb.org/movie/349394', NULL),
(577, 'Andre ', 1994, '/uo5BozBpQfKXGLPUeUkwBGLG0XW.jpg', 'The true story of how a marine seal named Andre befriended a little girl and her family, circa 1962.', 94, NULL, 5.30, '2024-09-17 21:45:13', 'https://www.themoviedb.org/movie/21352', NULL),
(579, 'Escort, The (Scorta, La) ', 1993, '/3R7E9fuuu3kftGXkNibWDejRO0K.jpg', 'The film shows the difficulties of an honest, imperiled judge and his bodyguard of four men, trying to clean up a Sicilian town. Corrupt local politicians, working hand-in-hand with the Mafia, will stop at nothing to prevent exposure of their rackets.', 92, NULL, 6.50, '2024-09-17 21:45:14', 'https://www.themoviedb.org/movie/68806', NULL),
(580, 'Princess Caraboo ', 1994, '/a3Fw33tSGdO2eV8SULQigOITzH4.jpg', 'Bristol, England, early 19th century. A beautiful young stranger who speaks a weird language is tried for the crime of begging. But when a man claims that he can translate her dialect, it is understood that the woman is a princess from a far away land. She is then welcomed by a family of haughty aristocrats that only wants to heighten their prestige. However, the local reporter is not at all convinced she is what she claims to be and investigates. Is Caraboo really a princess?', 97, NULL, 5.40, '2024-09-17 21:45:15', 'https://www.themoviedb.org/movie/37345', NULL),
(581, 'Celluloid Closet, The ', 1995, '/x0DSh3uMeQk6EG1DHjGJUywN7C0.jpg', 'What \"That\'s Entertainment\" did for movie musicals, \"The Celluloid Closet\" does for Hollywood homosexuality, as this exuberant, eye-opening movie serves up a dazzling hundred-year history of the role of gay men and lesbians have had on the silver screen.  Lily Tomlin narrates as Oscar-winning moviemaker Rob Epstein (\"The Times of Harvey Milk\" and \"Common Threads: Stories from the Quilt\") and Jeffrey Friedman assemble fabulous footage from 120 films showing the changing face of cinema sexuality, from cruel stereotypes to covert love to the activist triumphs of the 1990s. Tom Hanks, Susan Sarandon, Whoopi Goldberg, Tony Curtis, Harvey Fierstein and Gore Vidal are just a few of the many actors, writers and commentators who provide funny and insightful anecdotes.', 102, NULL, 7.13, '2024-09-17 21:45:16', 'https://www.themoviedb.org/movie/32562', NULL),
(582, 'Métisse (Café au Lait) ', 1993, '/ojNzabwK0IaAVIjQwcNhxBNYRmr.jpg', 'Lola is pregnant, and she isn’t sure who the father is: Félix, a Jewish delivery boy, or Jamal, a black law student.', 94, NULL, 6.12, '2024-09-17 21:45:17', 'https://www.themoviedb.org/movie/47507', NULL),
(583, 'Dear Diary (Caro Diario) ', 1994, '/3BV4iLXqPdcQzfKpLVaLuWdRY25.jpg', 'Nanni Moretti recalls in his diary three slice of life stories characterized by a sharply ironic look: in the first one he wanders through a deserted Rome, in the second he visits a reclusive friend on an island, and in the last he has to grapple with an unknown illness.', 101, NULL, 7.39, '2024-09-17 21:45:18', 'https://www.themoviedb.org/movie/25403', NULL),
(584, 'I Don\'t Want to Talk About It (De eso no se habla) ', 1993, '/ijVUC5LFY2XA2FtLpz7WqMR29TL.jpg', 'In an Argentine village in the 1930s, the willful Leonor discovers that her beloved daughter, Charlotte, has dwarfism. Attempting to let her have as normal a childhood as possible, Leonor never discusses Charlotte\'s lack of stature, nor lets anyone else in the village ever mention it. As Charlotte grows up into a smart and self-possessed young woman, local eccentric Ludovico, who collects miniatures, becomes smitten with her.', 106, NULL, 6.00, '2024-09-17 21:45:19', 'https://www.themoviedb.org/movie/124304', NULL),
(585, 'Brady Bunch Movie, The ', 1995, '/kbJfBJh5vEf5356Jlm6P37H48hD.jpg', 'The original \'70s TV family is now placed in the 1990s, where they\'re even more square and out of place than ever.', 89, NULL, 6.10, '2024-09-17 21:45:20', 'https://www.themoviedb.org/movie/9066', NULL),
(586, 'Home Alone ', 1990, '/onTSipZ8R3bliBdKfPtsDuHTdlL.jpg', 'Eight-year-old Kevin McCallister makes the most of the situation after his family unwittingly leaves him behind when they go on Christmas vacation. But when a pair of bungling burglars set their sights on Kevin\'s house, the plucky kid stands ready to defend his territory. By planting booby traps galore, adorably mischievous Kevin stands his ground as his frantic mother attempts to race home before Christmas Day.', 103, NULL, 7.44, '2024-09-17 21:45:21', 'https://www.themoviedb.org/movie/771', NULL),
(587, 'Ghost ', 1990, '/w9RaPHov8oM5cnzeE27isnFMsvS.jpg', 'Even though Sam Wheat, the successful investment counsellor, still finds it difficult to express his deeper feelings for her after all these years, his young potter girlfriend, Molly Jensen, is the love of his life. However, a curious case of a systematic discrepancy will prepare the ground for a hideous urban homicide in one of Manhattan\'s dark alleys, trapping, seemingly forever, the unfortunate deceased\'s immortal soul in the realm of the mortals. With the condemned spirit unable to interact with the physical world--and as Molly\'s life, too, is in grave danger--Sam will have to turn to the spiritual medium, Oda Mae Brown, to warn and protect her. Can Oda and the ghost settle the unfinished business in time?', 127, NULL, 7.22, '2024-09-17 21:45:22', 'https://www.themoviedb.org/movie/251', NULL),
(588, 'Aladdin ', 1992, '/eLFfl7vS8dkeG1hKp5mwbm37V83.jpg', 'Princess Jasmine grows tired of being forced to remain in the palace, so she sneaks out into the marketplace, in disguise, where she meets street urchin Aladdin. The couple falls in love, although Jasmine may only marry a prince. After being thrown in jail, Aladdin becomes embroiled in a plot to find a mysterious lamp, with which the evil Jafar hopes to rule the land.', 95, NULL, 7.65, '2024-09-17 21:45:23', 'https://www.themoviedb.org/movie/812', NULL),
(589, 'Terminator 2: Judgment Day ', 1991, '/5M0j0B18abtBI5gi2RhfjjurTqb.jpg', 'Set ten years after the events of the original, James Cameron’s classic sci-fi action flick tells the story of a second attempt to get the rid of rebellion leader John Connor, this time targeting the boy himself. However, the rebellion has sent a reprogrammed terminator to protect Connor.', 137, NULL, 8.12, '2024-09-17 21:45:24', 'https://www.themoviedb.org/movie/280', NULL),
(590, 'Dances with Wolves ', 1990, '/cvaBVpS0GzKqBd63pFT8f1E8OKv.jpg', 'Wounded Civil War soldier John Dunbar tries to commit suicide—and becomes a hero instead. As a reward, he\'s assigned to his dream post, a remote junction on the Western frontier, and soon makes unlikely friends with the local Sioux tribe.', 181, NULL, 7.85, '2024-09-17 21:45:24', 'https://www.themoviedb.org/movie/581', NULL),
(591, 'Tough and Deadly ', 1995, '/ozqhRWXkNavtxWVk04bOQPgf5CZ.jpg', 'A private eye helps an amnesiac CIA agent elude mobsters who don\'t want him to regain his memory of their drug operation.', 92, NULL, 5.18, '2024-09-17 21:45:25', 'https://www.themoviedb.org/movie/80350', NULL),
(592, 'Batman ', 1989, '/oYWUsIVoMl2H6Xl3FTBi9R9Y4OS.jpg', 'Batman must face his most ruthless nemesis when a deformed madman calling himself \"The Joker\" seizes control of Gotham\'s criminal underworld.', 126, NULL, 7.23, '2024-09-17 21:45:26', 'https://www.themoviedb.org/movie/268', NULL),
(593, 'Silence of the Lambs, The ', 1991, '/uS9m8OBk1A8eM9I042bx8XXpqAq.jpg', 'Clarice Starling is a top student at the FBI\'s training academy.  Jack Crawford wants Clarice to interview Dr. Hannibal Lecter, a brilliant psychiatrist who is also a violent psychopath, serving life behind bars for various acts of murder and cannibalism.  Crawford believes that Lecter may have insight into a case and that Starling, as an attractive young woman, may be just the bait to draw him out.', 119, NULL, 8.30, '2024-09-17 21:45:27', 'https://www.themoviedb.org/movie/274', NULL),
(594, 'Snow White and the Seven Dwarfs ', 1937, '/3VAHfuNb6Z7UiW12iYKANSPBl8m.jpg', 'A beautiful girl, Snow White, takes refuge in the forest in the house of seven dwarfs to hide from her stepmother, the wicked Queen. The Queen is jealous because she wants to be known as \"the fairest in the land,\" and Snow White\'s beauty surpasses her own.', 83, NULL, 7.13, '2024-09-17 21:45:28', 'https://www.themoviedb.org/movie/408', NULL),
(595, 'Beauty and the Beast ', 1991, '/hUJ0UvQ5tgE2Z9WpfuduVSdiCiU.jpg', 'Follow the adventures of Belle, a bright young woman who finds herself in the castle of a prince who\'s been turned into a mysterious beast. With the help of the castle\'s enchanted staff, Belle soon learns the most important lesson of all -- that true beauty comes from within.', 84, NULL, 7.74, '2024-09-17 21:45:29', 'https://www.themoviedb.org/movie/10020', NULL),
(596, 'Pinocchio ', 1940, '/bnZJrLRnoQHpzEJdka1KYfsAF3N.jpg', 'When loving Geppetto creates a wooden puppet, his wish is granted when it comes to life as a little wooden boy named Pinocchio. With his faithful friend and conscience Jiminy Cricket by his side, Pinocchio, embarks on fantastic adventures that his bravery, loyalty and honesty until triumphs in his triumphs in his quest for his heart\'s desire: to become a real boy.', 88, NULL, 7.11, '2024-09-17 21:45:30', 'https://www.themoviedb.org/movie/10895', NULL),
(597, 'Pretty Woman ', 1990, '/hVHUfT801LQATGd26VPzhorIYza.jpg', 'While on a business trip in Los Angeles, Edward Lewis, a millionaire entrepreneur who makes a living buying and breaking up companies, picks up a prostitute, Vivian, while asking for directions; after, Edward hires Vivian to stay with him for the weekend to accompany him to a few social events, and the two get closer only to discover there are significant hurdles to overcome as they try to bridge the gap between their very different worlds.', 119, NULL, 7.47, '2024-09-17 21:45:30', 'https://www.themoviedb.org/movie/114', NULL),
(598, 'Window to Paris (Okno v Parizh) ', 1994, '/pV9ziTxVGDFRgVqiWkxJnKjzaxM.jpg', 'Nikolai (played by Sergei Dontsov) has been fired from his job as a music teacher and has to live in the gym until he finds a place to stay. Finally, he gets a communal room in the apartment of Gorokhov (Victor Mikhalkov). The room\'s previous inhabitant, an old lady, has died a year ago, and yet her cat, Maxi, is still in the locked room, healthy and fat. Soon, Nikolai and his neighbours discover the mystery: there is a window to Paris in the room. That\'s when the comedy begins - will the Russians be able to cope with the temptation to profit from the discovery?', 112, NULL, 6.33, '2024-09-17 21:45:31', 'https://www.themoviedb.org/movie/41043', NULL),
(599, 'Wild Bunch, The ', 1969, '/8j9yEC3xjy1PJDSizIbaxcHaSph.jpg', 'An aging group of outlaws look for one last big score as the \"traditional\" American West is disappearing around them.', 145, NULL, 7.61, '2024-09-17 21:45:32', 'https://www.themoviedb.org/movie/576', NULL),
(600, 'Love and a .45 ', 1994, '/96a45owsQJiBMKw4Iw8zjRZu2AB.jpg', 'Small-time criminal Watty Watts attempts to rob a convenience store with his drug-addict buddy, Billy Mack Black. The robbery, however, leads to murder, and soon Watty leaves Billy behind and goes on the run with his beloved girlfriend, Starlene. Heading toward Mexico, the fugitive couple gets plenty of media coverage, until there are even more people on their trail. Can Watty and Starlene make it south of the border without getting caught?', 101, NULL, 5.67, '2024-09-17 21:45:33', 'https://www.themoviedb.org/movie/15477', NULL),
(601, 'Wooden Man\'s Bride, The (Yan shen) ', 1994, '/6qX1sUq4daMpHWMhtWScYMKGGCn.jpg', 'After her groom is killed in a bandit ambush, a young peasant bride must move into the home of her wealthy mother-in-law, Madame Liu. In a perverse tribute to her fallen son, Madame Liu imposes on her new daughter-in-law a life of domestic servitude. In the midst of her misery, the young widow finds new romance with another peasant, the gentle and brave Kui. But when Madame Liu discovers her infidelity, she vows to keep the lovers apart.', 113, NULL, 6.90, '2024-09-17 21:45:34', 'https://www.themoviedb.org/movie/59146', NULL),
(602, 'Great Day in Harlem, A ', 1994, '/606IorDjRMQZYaEdPBvjM8uI6qm.jpg', 'Art Kane, now deceased, coordinated a group photograph of all the top jazz musicians in NYC in the year 1958, for a piece in Esquire magazine. Just about every jazz musician at the time showed up for the photo shoot which took place in front of a brownstone near the 125th street station. The documentary compiles interviews of many of the musicians in the photograph to talk about the day of the photograph, and it shows film footage taken that day by Milt Hinton and his wife.', 60, NULL, 6.22, '2024-09-17 21:45:35', 'https://www.themoviedb.org/movie/124472', NULL),
(603, 'Bye Bye, Love ', 1995, '/qMAvEXDLLhIKJzCSiMUgn1ypsO4.jpg', 'With varying degrees of success, recently divorced friends Dave, Vic and Donny are trying to move on with their lives. Vic feels vilified by his ex-wife\'s parents, while Donny has a shaky bond with his teen daughter, Emma. Dave, meanwhile, has an enviable problem -- he has more dates than he can handle. As they confront their post-marital challenges, the men take solace in one another\'s plights.', 106, NULL, 5.90, '2024-09-17 21:45:35', 'https://www.themoviedb.org/movie/30528', NULL),
(604, 'Criminals ', 1996, '', '', 0, NULL, 0.00, '2024-09-17 21:45:36', 'https://www.themoviedb.org/movie/538286', NULL),
(605, 'One Fine Day ', 1996, '/Ao6OFtTH93p0yZ4vFNjHz5QgPrB.jpg', 'Melanie Parker, an architect and mother of Sammy, and Jack Taylor, a newspaper columnist and father of Maggie, are both divorced. They meet one morning when overwhelmed Jack is left unexpectedly with Maggie and forgets that Melanie was to take her to school. As a result, both children miss their school field trip and are stuck with the parents. The two adults project their negative stereotypes of ex-spouses on each other, but end up needing to rely on each other to watch the children as each must save his job. Humor is added by Sammy\'s propensity for lodging objects in his nose and Maggie\'s tendency to wander.', 108, NULL, 6.45, '2024-09-17 21:45:37', 'https://www.themoviedb.org/movie/7300', NULL),
(606, 'Candyman: Farewell to the Flesh ', 1995, '/2scgM9dFaHEppWb3tS99gCAh8KX.jpg', 'Annie, a young schoolteacher struggling to solve the brutal murder of her father, unwittingly summons the \"Candyman\" to New Orleans, where she learns the secret of his power, and discovers the link that connects them.', 91, NULL, 5.44, '2024-09-17 21:45:38', 'https://www.themoviedb.org/movie/10824', NULL),
(607, 'Century ', 1993, '/ntFKHMOKwJ42TCxOc3MVgTX4BXb.jpg', 'Turn-of-the-century love story centered around a young doctor and the emergence of modern science.', 112, NULL, 5.40, '2024-09-17 21:45:39', 'https://www.themoviedb.org/movie/261246', NULL),
(608, 'Fargo ', 1996, '/rt7cpEr1uP6RTZykBFhBTcRaKvG.jpg', 'Jerry, a small-town Minnesota car salesman is bursting at the seams with debt... but he\'s got a plan. He\'s going to hire two thugs to kidnap his wife in a scheme to collect a hefty ransom from his wealthy father-in-law. It\'s going to be a snap and nobody\'s going to get hurt... until people start dying. Enter Police Chief Marge, a coffee-drinking, parka-wearing - and extremely pregnant - investigator who\'ll stop at nothing to get her man. And if you think her small-time investigative skills will give the crooks a run for their ransom... you betcha!', 98, NULL, 7.86, '2024-09-17 21:45:40', 'https://www.themoviedb.org/movie/275', NULL),
(609, 'Homeward Bound II: Lost in San Francisco ', 1996, '/kfYawa9SF9MQ3ae0TXAfhDLFGv7.jpg', 'When the pets accidentally get separated from their vacationing owners, Chance, Shadow, and Sassy navigate the mean streets of San Francisco, trying to find their home across the Golden Gate Bridge. But the road is blocked by a series of hazards, both man and beast.', 89, NULL, 6.57, '2024-09-17 21:45:41', 'https://www.themoviedb.org/movie/25059', NULL),
(610, 'Heavy Metal ', 1981, '/atUtWrDlLzT1yeVK2EoYtvbS963.jpg', 'The embodiment of ultimate evil, a glowing orb terrorizes a young girl with bizarre stories of dark fantasy, eroticism and horror.', 90, NULL, 6.50, '2024-09-17 21:45:41', 'https://www.themoviedb.org/movie/11827', NULL),
(611, 'Hellraiser: Bloodline ', 1996, '/tCQsVackQil2fl5TzOYrCAI6All.jpg', 'Three generations of the same family deal with the consequences of unleashing the forces of hell.', 86, NULL, 5.26, '2024-09-17 21:45:42', 'https://www.themoviedb.org/movie/8766', NULL),
(612, 'Pallbearer, The ', 1996, '/d0Z5nZAZltUeZauVfBWApt8lKTN.jpg', 'Aspiring architect Tom Thompson is told by mysterious Ruth Abernathy that his best friend, \"Bill,\" has taken his own life. Except that Tom has never met Bill and neither have his incredulous friends. So when Tom foolishly agrees to give the eulogy at Bill\'s funeral, it sets him on a collision course with Ruth -- who is revealed to be Bill\'s oversexed mother -- and Julie DeMarco, the longtime crush Tom hasn\'t seen since they were teens.', 97, NULL, 4.90, '2024-09-17 21:45:43', 'https://www.themoviedb.org/movie/23570', NULL),
(613, 'Jane Eyre ', 1996, '/2vyt97wy8dEJYILoDoiPwTzLnzK.jpg', 'Jane Eyre is an orphan cast out as a young girl by her aunt, Mrs. Reed, and sent to be raised in a harsh charity school for girls. There she learns to become a teacher and eventually seeks employment outside the school. Her advertisement is answered by the housekeeper of Thornfield Hall, Mrs. Fairfax.', 112, NULL, 6.90, '2024-09-17 21:45:44', 'https://www.themoviedb.org/movie/47333', NULL),
(614, 'Loaded ', 1994, '/4r5rgcUDYv8qMeQ8wzOPZsycjxY.jpg', 'A group of young friends convene in the countryside to shoot a horror movie. But an experiment with LSD sees normal boundaries between them collapsing, and tragedy subsequently striking.', 91, NULL, 3.90, '2024-09-17 21:45:45', 'https://www.themoviedb.org/movie/54850', NULL),
(615, 'Bread and Chocolate (Pane e cioccolata) ', 1973, '/24D3e6xBPEvqlFoq4tSMVqVQ3TO.jpg', 'An Italian immigrant tries to make a new life in Switzerland, taking on a series of increasingly menial jobs in order to do it. He attempts to fit into his new home and society but fails at every turn. Unable to go home again, will his tenacity and optimism be enough to live on?', 110, NULL, 7.20, '2024-09-17 21:45:45', 'https://www.themoviedb.org/movie/51242', NULL),
(616, 'Aristocats, The ', 1970, '/g6eNiFFakVOpEZvx8sL6IfFsrJE.jpg', 'When Madame Adelaide Bonfamille leaves her fortune to Duchess and her children—Bonfamille’s beloved family of cats—the butler plots to steal the money and kidnaps the legatees, leaving them out on a country road. All seems lost until the wily Thomas O’Malley Cat and his jazz-playing alley cats come to the aristocats’ rescue.', 78, NULL, 7.30, '2024-09-17 21:45:46', 'https://www.themoviedb.org/movie/10112', NULL),
(617, 'Flower of My Secret, The (La flor de mi secreto) ', 1995, '/iYBuLANAg6YYSNT3SfgmmpzhQCE.jpg', 'Leo is a middle-aged writer of popular romantic novels who writes under a pseudonym, since she despises her own work. At home, her husband, who works overseas, is distant both physically and emotionally. As she reevaluates her life and writing, Leo is led to an unexpected relationship with Ángel, a sensitive newspaper editor.', 103, NULL, 6.80, '2024-09-17 21:45:47', 'https://www.themoviedb.org/movie/4307', NULL),
(618, 'Two Much ', 1995, '/65WB70Jhi3G2c5C41PyL5pl9L9p.jpg', 'Art Dodge is a painter-turned-gallerist drowning in debt. He gets in over his head when a con job leads to an engagement with a rich divorcee. He gets in deeper when he falls for her sister, and invents a twin brother to be her beau; and deeper still when his fiancée\'s ex-husband comes looking for revenge.', 118, NULL, 5.34, '2024-09-17 21:45:48', 'https://www.themoviedb.org/movie/46029', NULL),
(619, 'Ed ', 1996, '/oSNX3zyTpRMN0ExtOobt7eaJfPD.jpg', 'Jack Cooper could be a world-class baseball pitcher if he didn\'t keep buckling under the pressure. He tries to keep his spirits up after he\'s traded to a minor league team but loses all hope when he discovers that Ed, one of his teammates, is a chimp. Ed used to be the team mascot, but was promoted to third base when the owners realized he had a talent for baseball. As Jack struggles to get used to his new surroundings, Ed helps him regain his confidence on and off the field.', 94, NULL, 4.08, '2024-09-17 21:45:49', 'https://www.themoviedb.org/movie/32308', NULL),
(620, 'Scream of Stone (Cerro Torre: Schrei aus Stein) ', 1991, '/egROOqQo00anjXFYd6YDZoM4VA3.jpg', 'A meeting of two world famous climbers, one an experienced mountaineer the other a sport climber, and a journalist (Ivan) results in a bet on which of the two is the best climber. Roger (the mountaineering expert) states that Martin (the sport climber) wouldn\'t survive a day on a \'real\' climbing expedition, although he is considered to be the world\'s best sport climber (having just won an indoor \'world championship,\' an event depicted in the opening scene). They plan to climb \'Cerro Torre,\' in the Patagonia region of South America, near the Argentinian/Chilean border, one of the world\'s most difficult mountains, especially considering the extreme weather conditions common to the area.', 105, NULL, 6.30, '2024-09-17 21:45:50', 'https://www.themoviedb.org/movie/88893', NULL),
(621, 'My Favorite Season ', 1993, '/mWQhnhvNo8B2WRZhvv9XxrA7HgF.jpg', 'Elderly woman Berthe leaves her house to live with her daughter Emilie. Emilie and her brother Antoine had a falling out three years ago and have not seen each other since, but Emilie invites him for Christmas. Memories will resurface and impact both Berthe\'s destiny and the strange relationship between Emilie and Antoine.', 127, NULL, 6.20, '2024-09-17 21:45:51', 'https://www.themoviedb.org/movie/52873', NULL),
(623, 'Modern Affair, A ', 1995, NULL, 'A Modern Affair is an independent feature directed by Vern Oakley and produced by Tribe Pictures. Starring Stanley Tucci and Lisa Eichhorn, the film\'s plot reverses the conventions of romantic comedies: instead of man meet woman - fall in love, marry and have baby, in this film the woman gets pregnant, then meets the father, then falls in love. Grace Rhodes (Lisa Eichhorn) is a lonely, successful executive whose biological clock is loudly ticking.', 90, NULL, 5.00, '2024-09-17 21:45:52', 'https://www.themoviedb.org/movie/123505', NULL),
(625, 'Asfour Stah ', 1990, '/uI7hb9flZetd0KZoN2BGHLq4uvZ.jpg', 'Twelve-year-old Noura dangles uncertainly in that difficult netherworld between childhood and adulthood. His growing libido has gotten him banned from the women\'s baths, where his mother took him when he was younger, but he\'s not yet old enough to participate in grown-up discussions with the men of his Tunisian village. Noura\'s only real friend is a troublemaker named Salih -- the village political outcast.', 98, NULL, 6.46, '2024-09-17 21:45:53', 'https://www.themoviedb.org/movie/44281', NULL),
(626, 'Thin Line Between Love and Hate, A ', 1996, '/wo9AGi5LlFXZUj8MDPq3eKCUMpd.jpg', 'Nightclub manager Darnell Wright is a perpetual playboy who is almost as devoted to his job as he is to the pursuit of beautiful women. After he sets his sights on the ultra-classy Brandi Web, he launches an all-out assault to win her heart. Ultimately, charm, lust and passion prevail, but Darnell learns the hard way that when you play, you pay. Brandi is much harder to get rid of than she was to get--especially when she realizes that she has a rival vying for Darnell\'s affection. When he finally decides to call it quits, Brandi becomes an obsessed femme fatale stalking the new love of her life.', 108, NULL, 5.70, '2024-09-17 21:45:53', 'https://www.themoviedb.org/movie/28121', NULL),
(627, 'Last Supper, The ', 1995, '/oIgPiiM0qD1mCo1SYG3Sd0vmKTa.jpg', 'A group of idealistic, but frustrated, liberals succumb to the temptation of murdering rightwing pundits for their political beliefs.', 92, NULL, 6.56, '2024-09-17 21:45:54', 'https://www.themoviedb.org/movie/12520', NULL),
(628, 'Primal Fear ', 1996, '/qJf2TzE8nRTFbFMPJNW6c8mI0KU.jpg', 'An arrogant, high-powered attorney takes on the case of a poor altar boy found running away from the scene of the grisly murder of the bishop who has taken him in. The case gets a lot more complex when the accused reveals that there may or may not have been a third person in the room.', 129, NULL, 7.66, '2024-09-17 21:45:55', 'https://www.themoviedb.org/movie/1592', NULL),
(629, 'Rude ', 1995, '/439AGtHRMO9TGUfiFZ97odEdvq.jpg', 'This is the Easter weekend. In an inner city project, three people struggle against their demons and try to find redemption. They are Maxine, a window dresser depressed since she had an abortion and lost her lover ; Jordan, a boxer who has indulged in gay-bashing ; and \'The General\', a drug dealer turned artist.', 89, NULL, 4.50, '2024-09-17 21:45:56', 'https://www.themoviedb.org/movie/166901', NULL),
(630, 'Carried Away ', 1996, '/58pT6TIvkQNJYefpeKFa3nBwcSr.jpg', 'Based on Jim Harrison\'s book, \"Farmer\". 47-year-old Joseph Svenden lives on the family farm with his dying mother and teaches at a two room schoolhouse with Rosealee, his lover and his best friend\'s widow. Joseph, who lacks a college degree, learns that he will lose his teaching job at the end of the year when the school district expands into his town. Meanwhile, he is seduced by 17-year-old Catherine, a new student in his class. His affair with Catherine and losing his teaching job forces Joseph to take a look at his previously dull life and to decide how he wants to live the rest of it.', 109, NULL, 5.80, '2024-09-17 21:45:57', 'https://www.themoviedb.org/movie/36447', NULL),
(631, 'All Dogs Go to Heaven 2 ', 1996, '/kNmIJILOW9qF2F1Z0qOXkadaS50.jpg', 'Charlie and Itchy return to Earth to find Gabriel\'s Horn, but along the way meet up with a young boy named David, who ran away from home.', 82, NULL, 5.90, '2024-09-17 21:45:58', 'https://www.themoviedb.org/movie/19042', NULL),
(632, 'Land and Freedom (Tierra y libertad) ', 1995, '/u5QRqW0vFYMHFzeQJ4oFgJtu5Xp.jpg', 'David Carr is a British Communist who is unemployed. In 1936, when the Spanish Civil War begins, he decides to fight for the Republican side, a coalition of liberals, communists and anarchists, so he joins the POUM militia and witnesses firsthand the betrayal of the Spanish revolution by Stalin\'s followers and Moscow\'s orders.', 109, NULL, 7.40, '2024-09-17 21:45:59', 'https://www.themoviedb.org/movie/38884', NULL),
(633, 'Denise Calls Up ', 1995, '/ab8iYcRfEAFwzcrkYP8tJBISX1E.jpg', 'A group of friends in New York, working away at their PCs and laptops, keep in touch exclusively by phone and fax. They are all too busy to meet face to face. Gale plays matchmaker, by phone, to Jerry and Barbara who, in turn, hit it off beautifully – via phone and fax. Martin gets a telephone call from someone he\'s never met. It\'s Denise, with some extraordinary news. Tapping away at his computer all the while, he develops a sort of friendship with Denise – via phone. And so it goes as the friends, tap, tap, tapping away, share news, hopes, and dreams – via phone and fax. Finally Gale has an unfortunate encounter with a phone, Denise has some more news for Martin, and Frank plans a gala New Year\'s Eve party, but will he answer the door?', 80, NULL, 6.50, '2024-09-17 21:46:00', 'https://www.themoviedb.org/movie/47449', NULL),
(634, 'Theodore Rex ', 1995, '/fUUbOE91SK4GCpiyftEY5USjCh1.jpg', 'In an alternate futuristic society, a tough female police detective is paired with a talking dinosaur to find the killer of dinosaurs and other prehistoric animals leading them to a mad scientist bent on creating a new Armageddon.', 92, NULL, 3.60, '2024-09-17 21:46:01', 'https://www.themoviedb.org/movie/36259', NULL),
(635, 'Family Thing, A ', 1996, '/v6BAse5R1jaTgxXNKMpdphVFZTh.jpg', 'Earl Pilcher Jr. runs an equipment rental outfit in Arkansas, lives with his wife and kids and parents, and rarely takes off his gimme cap. His mother dies, leaving a letter explaining he\'s not her natural son, but the son of a Black woman who died in childbirth; plus, he has a half brother Ray, in Chicago, she wants him to visit. Earl makes the trip, initially receiving a cold welcome from Ray and Ray\'s son, Virgil. His birth mother\'s sister, Aunt T., an aged and blind matriarch, takes Earl in tow and insists that the family open up to him.', 109, NULL, 6.30, '2024-09-17 21:46:02', 'https://www.themoviedb.org/movie/41852', NULL),
(636, 'Frisk ', 1995, '/2BsmfL2wr4sAjrsBFePewmslnXO.jpg', 'A first person narrative of the exploits of a gay serial killer in deeply disturbing, controversial drama about violence, sexuality, and the imagination. Dennis, the main character, whose lead we follow on this path between what is real and what we can only hope is surreal. His friends attempt to determine if he\'s truly a psychopath.', 88, NULL, 4.10, '2024-09-17 21:46:02', 'https://www.themoviedb.org/movie/40926', NULL),
(637, 'Sgt. Bilko ', 1996, '/q4zmVdQq35ZBj8uyxsU2RCPOQxo.jpg', 'The US army is known for churning out lean mean fighting machines intent on protecting our great nation. Sergeant Ernie Bilko is the leader of a ragtag group of the sorriest soldiers ever to enlist in the armed forces.', 90, NULL, 5.80, '2024-09-17 21:46:03', 'https://www.themoviedb.org/movie/9099', NULL),
(638, 'Jack and Sarah ', 1995, '/yWMj1KMfnixB35qa2IZKniHF4sn.jpg', 'Jack always lands on his feet. He lands on his feet when he marries the beautiful Sarah. He lands on his feet when he buys a luxurious new home. However, when Sarah goes into labour, he takes a tumble down the stairs and lands on his head. When he comes around he discovers he is the proud father of a baby girl, but deficient in the spouse department to the tune of 1.', 110, NULL, 6.70, '2024-09-17 21:46:04', 'https://www.themoviedb.org/movie/2021', NULL),
(639, 'Girl 6 ', 1996, '/un5YpVy7fxb7PxlRlQqLusVM2SM.jpg', 'A struggling actress in New York City takes a job as a phone sex operator.', 108, NULL, 5.00, '2024-09-17 21:46:05', 'https://www.themoviedb.org/movie/61752', NULL),
(640, 'Diabolique ', 1996, '/zSW4A35r7Vpz0ainYJGb2QVwCh0.jpg', 'The wife and mistress of a cruel school master collaborate in a carefully planned and executed scheme to murder him. The plan goes well until the body, which has been strategically dumped, disappears. The psychological strain starts to weigh on the two women when a retired police investigator begins looking into the man\'s disappearance on a whim.', 107, NULL, 5.52, '2024-09-17 21:46:06', 'https://www.themoviedb.org/movie/10988', NULL),
(641, 'Little Indian, Big City (Un indien dans la ville) ', 1994, '/qysVy8is0no4YFadX0bUB71GpVc.jpg', 'Stephen, an international trader, tracks down his ex-wife Patricia in some Amazonian backwater. He needs her consent to a divorce so that he can marry Charlotte. Unfortunately, he discovers a son he didn’t know he had – Mimi-Siku. The young jungle boy yearns to see Paris so Stephen reluctantly agrees to take him back home with him for a few days. How will Mimi-Siku react to life in the great metropolis?', 90, NULL, 5.97, '2024-09-17 21:46:06', 'https://www.themoviedb.org/movie/11479', NULL),
(642, 'Roula ', 1995, '/7vlYt3ekwqi8zD6zZp6YatixdQN.jpg', 'Troubled Roula finds herself drawn to Leon, an author of children\'s books who has suffered an enormous emotional and creative blockage ever since his wife died in a motorcycle accident two years before. Leon has only his 12-year-old daughter Tanja to keep him company. As romance blooms between Leon and Roula, his daughter approves. Unfortunately, Roula is carrying heavy emotional baggage stemming from the incest she suffered at the hands of her father.', 97, NULL, 5.60, '2024-09-17 21:46:07', 'https://www.themoviedb.org/movie/398959', NULL),
(643, 'Peanuts - Die Bank zahlt alles ', 1996, '/4fau0OjSK0wLhUMfvupJ2RQaYBB.jpg', '', 0, NULL, 4.00, '2024-09-17 21:46:08', 'https://www.themoviedb.org/movie/287305', NULL),
(644, 'Happy Weekend ', 1996, '/w55hqfPue4RFKXYqDrufMxQ63oQ.jpg', 'The young policeman Joachim Krippo likes to occasionally share his bed with a nice married couple. When he is supposed to be guarding the criminal Engel Potraske during a court appearance, the dangerous Engel manages a spectacular escape, but departs minus a toe! Krippo is subsequently suspended from his duties and put with other police officers under the care of an elderly police psychologist. Krippo\'s professional set-backs are followed by private ones: his grandad - who was actually being well looked-after in an old people\'s home - is dropped off at his place because the payments due have not been made. He tries to get his grandad out of the flat by pairing him off with the police psychologist. But, in the critical moment, Krippo lunges for the bait himself. At least, this means that he will be discharged from the psychograph tests as being fit for service again...', 0, NULL, 1.00, '2024-09-17 21:46:09', 'https://www.themoviedb.org/movie/339428', NULL),
(645, 'Nelly & Monsieur Arnaud ', 1995, '/87kKTPi9r7YIVrlo9Z42NwTXBVi.jpg', 'Nelly leaves her lazy, unemployed husband to work for retired judge Mr Arnaud, forty years her senior, after he offers to clear her bills for her. While she types his memoirs the two develop a close friendship, but Arnaud becomes jealous when Nelly begins dating his good-looking young publisher.', 106, NULL, 6.87, '2024-09-17 21:46:10', 'https://www.themoviedb.org/movie/12652', NULL),
(647, 'Courage Under Fire ', 1996, '/vDJurMJkrx049AiXa3DJx5Zx7a4.jpg', 'A US Army officer, who made a \"friendly fire\" mistake that was covered up, has been reassigned to a desk job. He is tasked to investigate a female chopper commander\'s worthiness to be awarded the Medal of Honor. At first all seems in order. But then he begins to notice inconsistencies between the testimonies of the witnesses...', 116, NULL, 6.50, '2024-09-17 21:46:11', 'https://www.themoviedb.org/movie/10684', NULL),
(648, 'Mission: Impossible ', 1996, '/l5uxY5m5OInWpcExIpKG6AR3rgL.jpg', 'When Ethan Hunt, the leader of a crack espionage team whose perilous operation has gone awry with no explanation, discovers that a mole has penetrated the CIA, he\'s surprised to learn that he\'s the prime suspect. To clear his name, Hunt now must ferret out the real double agent and, in the process, even the score.', 110, NULL, 6.99, '2024-09-17 21:46:12', 'https://www.themoviedb.org/movie/954', NULL),
(649, 'Cold Fever (Á köldum klaka) ', 1995, '/hFqI4uEViGZWPzebAm0gFs63Ewp.jpg', 'A Japanese businessman travels to Iceland and has a series of misadventures while venturing to a remote area to perform a traditional burial ritual where his parents died several years back.', 85, NULL, 6.60, '2024-09-17 21:46:13', 'https://www.themoviedb.org/movie/68445', NULL),
(650, 'Moll Flanders ', 1996, '/lHVpzsvjLU7qSCB8UWFqIAavSRu.jpg', 'The daughter of a thief, young Moll is placed in the care of a nunnery after the execution of her mother. However, the actions of an abusive priest lead Moll to rebel as a teenager, escaping to the dangerous streets of London. Further misfortunes drive her to accept a job as a prostitute from the conniving Mrs. Allworthy. It is there that Moll first meets Hibble, who is working as Allworthy\'s servant but takes a special interest in the young woman\'s well-being. With his help, she retains hope for the future, ultimately falling in love with an unconventional artist who promises the possibility of romantic happiness.', 123, NULL, 6.05, '2024-09-17 21:46:13', 'https://www.themoviedb.org/movie/18989', NULL),
(651, 'Superweib, Das ', 1996, '/Aw7t5TYwvMt3Y55pcLsSBfikOy4.jpg', '', 86, NULL, 4.30, '2024-09-17 21:46:14', 'https://www.themoviedb.org/movie/10801', NULL),
(652, '301, 302 (301/302) ', 1995, '/7gMh5BcWebJ5qy4M1529FjmK94H.jpg', 'Two obsessive-compulsives, a chef and an anorexic writer, are neighbors in an apartment building. The chef (301) tries to entice her neighbor to eat with fabulous meals. The writer (302) refuses to eat, and this refusal begins a turbulent relationship that forces both women to delve into their pasts of torment.', 100, NULL, 6.10, '2024-09-17 21:46:15', 'https://www.themoviedb.org/movie/54285', NULL),
(653, 'Dragonheart ', 1996, '/5ciO16x4LQ7uhy854YHvQuQvHU9.jpg', 'In an ancient time when majestic fire-breathers soared through the skies, a knight named Bowen comes face to face and heart to heart with the last dragon on Earth, Draco. Taking up arms to suppress a tyrant king, Bowen soon realizes his task will be harder than he\'d imagined: If he kills the king, Draco will die as well.', 103, NULL, 6.53, '2024-09-17 21:46:16', 'https://www.themoviedb.org/movie/8840', NULL),
(654, 'And Nobody Weeps for Me (Und keiner weint mir nach) ', 1996, '/gT4SfSGVEJR4TMm1WIM56Qgq4dr.jpg', '', 102, NULL, 2.00, '2024-09-17 21:46:17', 'https://www.themoviedb.org/movie/278978', NULL),
(655, 'My Mother\'s Courage (Mutters Courage) ', 1995, '/s7kkNyAWJZuNuD30vrh8cY79AuU.jpg', 'The deportation of 4000 Jews from Budapest to Auschwitz in July 1944, as told by George Tabori, and how the narrator’s mother escaped it, owing to coincidence, courage and some help from where you’d least expect it.', 93, NULL, 5.60, '2024-09-17 21:46:17', 'https://www.themoviedb.org/movie/124625', NULL),
(656, 'Eddie ', 1996, '/1pb3lvOd5dQrByeJwyCHCKrFeva.jpg', 'Eddie is a New York limo driver and a fanatical follower of the New York Knicks professional basketball team. The team is struggling with a mediocre record when, in mid-season, \"Wild Bill\" Burgess, the new owner, as a public relations gimmick, stages an \'honorary coach\' contest, which Eddie wins. The fans love it, so \"Wild Bill\" fires the coach and hires her. She takes the bunch of overpaid prima', 100, NULL, 5.45, '2024-09-17 21:46:18', 'https://www.themoviedb.org/movie/11107', NULL),
(657, 'Yankee Zulu ', 1994, '/gOPkzkmi5XkGDUkurhpBK9gNHpI.jpg', 'Two South African boys, one white, Rhino, and one black, Zulu, go their separate ways after an incident. Many years later, they meet up again as adults, when one, after living for years in the United States, is now a wanted criminal. The two end up being a part of a madcap chase involving a check for a large amount of lottery money, pursued by Gen. Diehard and Rhino\'s ex-wife Rowena, who was the cause of the rift between the two protagonists.', 100, NULL, 5.93, '2024-09-17 21:46:19', 'https://www.themoviedb.org/movie/16417', NULL),
(658, 'Billy\'s Holiday ', 1995, '/xe08JcSJuUzOijAsbl8HmlbspnU.jpg', 'This movie is all about a normal guy called Billy Apples. He is a social drinker and sometimes lead singer of a band. While he is doing all of this, he still manages to bring up his teenage daughter. One night while sitting at home Billy finds that he has a talent! He finds that he is able to sing like his idol, 50\'s singer Billie Holiday. From there he is going places, from huge live performances to even cutting a hit record, but in the end he must make a choice between the life he has, and the life he once knew. Written by Graham Wilson Jr', 92, NULL, 0.00, '2024-09-17 21:46:20', 'https://www.themoviedb.org/movie/70934', NULL);
INSERT INTO movies (id, name, released_at, poster_url, synopsis, duration, trailer_url, average_rating, created_at, url, updated_at) VALUES
(659, 'Purple Noon (Plein soleil) ', 1960, '/asTqniOVviEV8agTTeMA1Sy72Og.jpg', 'Tom Ripley is a talented mimic, moocher, forger and all-around criminal improviser; but there\'s more to Tom Ripley than even he can guess.', 118, NULL, 7.57, '2024-09-17 21:46:21', 'https://www.themoviedb.org/movie/10363', NULL),
(660, 'August ', 1996, '/lWU5Sf6xQGzVWd2OkKlDZhdK29k.jpg', 'Set in 1890s North Wales over a long, hot August weekend, the Victorian calm of a household is suddenly upset with the arrival of a London couple who impose their city ways and thoughts on the more rurally based family. An adaptation of Anton Chekhov\'s play, \"Uncle Vanya.\"', 94, NULL, 4.04, '2024-09-17 21:46:22', 'https://www.themoviedb.org/movie/161070', NULL),
(661, 'James and the Giant Peach ', 1996, '/nl2oB6EbD1fHFuP2TLUHDtqs7Ux.jpg', 'When the young orphan boy James spills a magic bag of crocodile tongues, he finds himself in possession of a giant peach that flies him away to strange lands.', 79, NULL, 6.56, '2024-09-17 21:46:22', 'https://www.themoviedb.org/movie/10539', NULL),
(662, 'Fear ', 1996, '/mUVTKyDGKgpSF41PEsrrXDzBhSo.jpg', 'Nicole Walker always dreamed of being swept away by someone special — someone strong, sexy and sensitive who would care for her more than anything else in the world. David is all that and more: a modern-day knight who charms and seduces her, body and soul. But her perfect boyfriend is not all he seems to be. His sweet facade masks a savage, dark side that will soon transform Nicole\'s dream into a nightmare.', 97, NULL, 6.43, '2024-09-17 21:46:23', 'https://www.themoviedb.org/movie/10543', NULL),
(663, 'Kids in the Hall: Brain Candy ', 1996, '/j7LYkIa2KC98ZqZmFIjEmtvlv87.jpg', 'A pharmaceutical scientist creates a pill that makes people remember their happiest memory, and although it\'s successful, it has unfortunate side effects.', 89, NULL, 6.11, '2024-09-17 21:46:24', 'https://www.themoviedb.org/movie/18414', NULL),
(664, 'Faithful ', 1996, '/bnC3m8J6nN30GE9GKo2lkSWU0yD.jpg', 'A depressed housewife whose husband is having an affair contemplates suicide, but changes her mind when she faces death by a killer hired to do her in.', 91, NULL, 5.30, '2024-09-17 21:46:25', 'https://www.themoviedb.org/movie/47502', NULL),
(665, 'Underground ', 1995, '/h8N6y13t4VusrDdH5PzTkwvBvgN.jpg', 'A group of Serbian socialists prepares for the war in a surreal underground filled by parties, tragedies, love and hate.', 170, NULL, 7.80, '2024-09-17 21:46:26', 'https://www.themoviedb.org/movie/11902', NULL),
(666, 'All Things Fair (Lust och fägring stor) ', 1995, '/y1oFNynXrIzlPUe4CXKMR2dpNep.jpg', 'Stig is a 15-year-old pupil of 37-year-old teacher Viola. He is attracted by her beauty and maturity while she is drawn to him by his youth and innocence, a godsent relief from her drunk and miserable husband.', 125, NULL, 6.51, '2024-09-17 21:46:27', 'https://www.themoviedb.org/movie/27098', NULL),
(667, 'Bloodsport 2 (a.k.a. Bloodsport II: The Next Kumite) ', 1996, '/xVfSGAbOK4FucTwkYrXJjeBFqv4.jpg', 'After thief Alex Cardo gets caught while stealing an ancient katana in East Asia, he soon finds himself imprisoned and beaten up by the crowd there. One of the guards, Demon, feels upset by Alex appearance and tortures him as often as he gets the opportunity. Alex finds a friend and mentor in the jailhouse, Master Sun, who teaches him a superior fighting style called Iron Hand. When a \'best of the best kumite\' is to take place, Demon gets an invitation. Now Master Sun and Alex need to find a way to let Alex take part in the kumite too.', 90, NULL, 5.37, '2024-09-17 21:46:29', 'https://www.themoviedb.org/movie/25087', NULL),
(668, 'Song of the Little Road (Pather Panchali) ', 1955, '/2pZR9zmUzsblDLE5ndBe57ScqIi.jpg', 'Impoverished priest Harihar Ray, dreaming of a better life for himself and his family, leaves his rural Bengal village in search of work.  Preserved by the Academy Film Archive in partnership with The Film Foundation in 1996.', 125, NULL, 7.98, '2024-09-17 21:46:30', 'https://www.themoviedb.org/movie/5801', NULL),
(670, 'World of Apu, The (Apur Sansar) ', 1959, '/6Tz1Q69o2n3Zwb0ZffzPL0nFt2T.jpg', 'Apu is a jobless ex-student dreaming vaguely of a future as a writer. An old college friend talks him into a visit up-country to a village wedding.  Preserved by the Academy Film Archive in 1996.', 105, NULL, 8.13, '2024-09-17 21:46:32', 'https://www.themoviedb.org/movie/896', NULL),
(671, 'Mystery Science Theater 3000: The Movie ', 1996, '/tlakU3uwNiUgd7aOlb2RoAsGTnY.jpg', 'Dr. Clayton Forrester figures he can rule the world if he deadens his subjects\' brains by making them endure terrible movies. Exploiting his access to nearby satellite-dwellers Mike Nelson and his robot pals, Crow T. Robot and Tom Servo, Forrester makes them watch \"This Island Earth\", a cheesy 1950s spaceship film. But when Mike and friends make funny comments throughout the movie and others that follow, Forrester\'s plan looks increasingly flimsy.', 73, NULL, 6.64, '2024-09-17 21:46:33', 'https://www.themoviedb.org/movie/3065', NULL),
(672, 'Tarantella ', 1995, '/smutDepG3PYjKmPgSuErwQEbmHf.jpg', 'When her mother suddenly dies, Diane Di Sorella must return to her New Jersey home after years of being estranged from her family.', 100, NULL, 7.00, '2024-09-17 21:46:34', 'https://www.themoviedb.org/movie/318177', NULL),
(673, 'Space Jam ', 1996, '/4RN5El3Pj2W4gpwgiAGLVfSJv2g.jpg', 'With their freedom on the line, the Looney Tunes seek the help of NBA superstar Michael Jordon to win a basketball game against a team of moronic aliens.', 88, NULL, 6.83, '2024-09-17 21:46:35', 'https://www.themoviedb.org/movie/2300', NULL),
(674, 'Barbarella ', 1968, '/kfaRSR3geV3I65icyHWBBEsE9u.jpg', 'In the far future, a highly sexual woman is tasked with finding and stopping the evil Durand-Durand. Along the way she encounters various unusual people.', 98, NULL, 5.96, '2024-09-17 21:46:36', 'https://www.themoviedb.org/movie/8069', NULL),
(675, 'Hostile Intentions ', 1994, '/ulynXxIyB9bmEbH0mKI23vUF1ND.jpg', 'A weekend of fun becomes a fight for survival when three American women land in a Mexican jail. After being sexually molested by the guards, they attempt to escape with the help of a fellow prisoner.', 90, NULL, 6.00, '2024-09-17 21:46:37', 'https://www.themoviedb.org/movie/288173', NULL),
(676, 'They Bite ', 1996, '/eIm9qNAZdDpwTyXs6aKN4fs3UWm.jpg', 'Aliens who\'ve come to earth to spawn deep beneath the ocean begin terrorizing a Florida beach community. An ichthyologist and a young filmmaker team up to uncover the mystery of these monsters from the deep--before they strike again.', 98, NULL, 3.61, '2024-09-17 21:46:38', 'https://www.themoviedb.org/movie/187851', NULL),
(678, 'Some Folks Call It a Sling Blade ', 1993, '/fRK5Mro9hBpwIlm0d0K6dC0vC0n.jpg', '25 years after committing a double murder, Karl Childers is going to be released from an institution for the criminally insane. A local reporter comes to talk to him, and listens in horror about his life leading up to the crime. This is the short film that inspired the full-length \"Sling Blade\".', 25, NULL, 6.70, '2024-09-17 21:46:39', 'https://www.themoviedb.org/movie/27768', NULL),
(679, 'Run of the Country, The ', 1995, '/ArlhiYSVjDeJKSl1qfCNdQH3DMW.jpg', 'An Irish lad who fled from his oppressive, widowed father falls for a girl from an affluent family.', 109, NULL, 6.80, '2024-09-17 21:46:40', 'https://www.themoviedb.org/movie/221917', NULL),
(680, 'Alphaville (Alphaville, une étrange aventure de Lemmy Caution) ', 1965, '/fFJP3D5fJDFxN7ChqSye1DZ0fTL.jpg', 'Lemmy Caution is on a mission to eliminate Professor Von Braun, the creator of a malevolent computer that rules the city of Alphaville. Befriended by the scientist’s daughter Natasha, Lemmy must unravel the mysteries of the strictly logical Alpha 60 and teach Natasha the meaning of the word “love.”', 99, NULL, 6.96, '2024-09-17 21:46:41', 'https://www.themoviedb.org/movie/8072', NULL),
(681, 'Coup de torchon (Clean Slate) ', 1981, '/sYlANrZi5vxaHhmPaktuPlsO2Wz.jpg', 'A pathetic police chief, humiliated by everyone around him, suddenly wants a clean slate in life, and resorts to drastic means to achieve it.', 128, NULL, 7.07, '2024-09-17 21:46:42', 'https://www.themoviedb.org/movie/35797', NULL),
(682, 'Tigrero: A Film That Was Never Made ', 1994, '/aPzqmiB0KCd3NXpiT4i1JTOpLVz.jpg', 'In 1993, Sam Fuller takes Jim Jarmusch on a trip into Brazil\'s Mato Grosso, up the River Araguaia to the village of Santa Isabel Do Morro, where 40 years before, Zanuck had sent Fuller to scout a location and write a script for a movie based on a tigrero, a jaguar hunter. Sam hopes to find people who remember him, and he takes film he shot in 1954. He\'s Rip Van Winkle, and, indeed, a great deal changed in the village. There are televisions, watches, and brick houses. But, the same Karajá culture awaits as well. He gathers the villagers to show his old film footage, and people recognize friends and relatives, thanking Fuller for momentarily bringing them back to life.', 75, NULL, 6.90, '2024-09-17 21:46:43', 'https://www.themoviedb.org/movie/88030', NULL),
(683, 'Eye of Vichy, The (Oeil de Vichy, L\') ', 1993, '/65I2JFYRswmJHMJE7sAbqWpcYDH.jpg', 'Directed by French filmmaker Claude Chabrol, this documentary examines Nazi and Vichy newsreels and propaganda films from World War II meant to turn the French against the Jews and the Allied Forces and into Nazi sympathizers.  This movie is only made of archive pictures: the official newsreels that were broadcasted on French movie screens during 1940 and 1944 (the Occupation).', 110, NULL, 5.20, '2024-09-17 21:46:44', 'https://www.themoviedb.org/movie/185191', NULL),
(684, 'Windows ', 1980, '/j4xaABkDbVOJRb1xllsfN3z2CPB.jpg', 'Emily Hollander becomes the subject of a lesbian obsession at the hands of Andrea Glassen, her next-door neighbour.', 96, NULL, 5.08, '2024-09-17 21:46:45', 'https://www.themoviedb.org/movie/83857', NULL),
(685, 'It\'s My Party ', 1996, '/ltrjg99gc3bA3P5E6WaIbGMxWHS.jpg', 'Nick, a gay, HIV-positive architect, begins to display severe symptoms of AIDS and makes preparations to kill himself before he is unable to function normally. He arranges a party to reconnect and say goodbye to his closest friends and his confused parents. But when his ex-partner, Brandon, a television director who left Nick when he was diagnosed with HIV, shows up, what was supposed to be a celebratory event becomes much more difficult for everyone.', 110, NULL, 6.28, '2024-09-17 21:46:46', 'https://www.themoviedb.org/movie/33245', NULL),
(687, 'Country Life ', 1994, '/36jCH48ohLaJ2TLhUbauJZ9FebH.jpg', 'Adaptation of Chekhov\'s \"Uncle Vanya\" set in rural Australia in the 1920s. Jack Dickens and his niece Sally run the family farm to support brother-in-law Alexander as a (supposedly brilliant) literary critic in London. Action begins when Alexander returns with his beautiful young wife Deborah, revealing himself as an arrogant failure and wanting to sell the farm out from under Jack. Blakemore introduces themes about Australia\'s separation from England, as well as expanding the pacifist and ecological philosophies espoused by the local Doctor Max Askey.', 118, NULL, 6.40, '2024-09-17 21:46:46', 'https://www.themoviedb.org/movie/124460', NULL),
(688, 'Operation Dumbo Drop ', 1995, '/nfHqQ48aJyxDALQZxTXuN7d2QuX.jpg', 'Five Green Berets stationed in Vietnam in 1968 grudgingly undertake the mission of a lifetime -- to secretly transport an 8,000-pound elephant through 200 miles of rough jungle terrain. High jinks prevail when Capt. Sam Cahill promises the Montagnard villagers of Dak Nhe that he\'ll replace their prized elephant in time for an important ritual. But for Capt. T.C. Doyle, the mission becomes a jumbo-sized headache!', 107, NULL, 5.16, '2024-09-17 21:46:47', 'https://www.themoviedb.org/movie/27281', NULL),
(690, 'Promise, The (Versprechen, Das) ', 1995, '/pa0g9SFf6LglgrIJ2niDL9v7r6O.jpg', 'East-Berlin, 1961, shortly after the erection of the Wall. Konrad, Sophie and three of their friends plan a daring escape to Western Germany. The attempt is successful, except for Konrad, who remains behind. From then on, and for the next 28 years, Konrad and Sophie will attempt to meet again, in spite of the Iron Curtain. Konrad, who has become a reputed Astrophysicist, tries to take advantage of scientific congresses outside Eastern Germany to arrange encounters with Sophie. But in a country where the political police, the Stasi, monitors the moves of all suspicious people (such as Konrad\'s sister Barbara and her husband Harald), preserving one\'s privacy, ideals and self-respect becomes an exhausting fight, even as the Eastern block begins its long process of disintegration.', 115, NULL, 6.50, '2024-09-17 21:46:48', 'https://www.themoviedb.org/movie/105045', NULL),
(691, 'Mrs. Winterbourne ', 1996, '/2JlRKnF6qQdCRKRWgXcgPUHMPGv.jpg', 'Connie Doyle is eighteen, pregnant and alone. She accidentally ends up on a train where she meets Hugh Winterbourne and his wife pregnant Patricia. The train wrecks and she wakes up in the hospital to find out that it\'s been assumed that she\'s Patricia. Hugh\'s mother takes her in and she falls in love with Hugh\'s brother Bill. Just when she thinks everything is going her way, her ex-boyfriend shows up.', 105, NULL, 7.16, '2024-09-17 21:46:49', 'https://www.themoviedb.org/movie/40001', NULL),
(692, 'Solo ', 1996, '/hmlQkosTapaJfcjQwFzlKslloZt.jpg', 'An android fighting-machine is charged with destroying a small brigade of rebels in a Latin American war who are fighting to maintain their freedom and protect their village. Contrary to his programming, Peebles decides to stay and assist the rebels in their plight. Having gained this information, his \"creators\" develop a more powerful android to try and defeat him.', 94, NULL, 4.60, '2024-09-17 21:46:50', 'https://www.themoviedb.org/movie/29621', NULL),
(693, 'Under the Domim Tree (Etz Hadomim Tafus) ', 1994, '/tjdP7TUOyUdlSialMmdnpDp9PZK.jpg', 'Based on Gila Almagor’s autobiographical book, Under the Domim Tree follows a group of teenagers who survived the Holocaust in a boarding school in the early 50s. During the day, they are like all other adolescents, but at night they struggle with their painful memories. The place where they feel secure is under the Domim tree.', 102, NULL, 6.30, '2024-09-17 21:46:51', 'https://www.themoviedb.org/movie/117730', NULL),
(694, 'Substitute, The ', 1996, '/jlhe2SKWqW3F7BEQl3sOkgXLtkW.jpg', 'When an inner-city Miami schoolteacher gets her knee broken after standing up to the school\'s gang leader, her mercenary combat specialist boyfriend goes undercover as a substitute teacher to take down the punk. Soon he discovers a conspiracy of criminals at work, and must reassemble his team from his last jungle raid to stop them.', 114, NULL, 6.90, '2024-09-17 21:46:52', 'https://www.themoviedb.org/movie/20762', NULL),
(695, 'True Crime ', 1996, '/nPYe83tWVSwVFRyWa6f5aaE7bbu.jpg', 'Mary Giordano is a bright, intelligent student who goes to a catholic school. She also has an addiction to mystery novels and detective magazines, which inspire her to do her own detective work. When she starts snooping around on the case of a murderer of teenage girls, it gets her in hot water with her mentor Detective Jerry Gunn. But it also starts a team up with police cadet Tony Campbell. The two work together to find the murderer. But the closer Mary gets to solving the murder, the more danger she puts herself in of being the next victim.', 94, NULL, 5.70, '2024-09-17 21:46:53', 'https://www.themoviedb.org/movie/37144', NULL),
(696, 'Butterfly Kiss ', 1995, '/dmQ2rKLSsofdXok2y9Xp5gfUqaB.jpg', 'Deeply mentally unbalanced drifter Eunice roams grim northern Britain committing psychosexual serial murders of both men and women while ostensibly searching for an unknown woman named Judith. She spares the life of lonely but kind-hearted gas station cashier Miriam, who abandons her dismal life to follow her damaged new lover. While attempting to hide the evidence of her multiple crimes, Miriam tries to understand Eunice\'s bizarre quest.', 88, NULL, 6.50, '2024-09-17 21:46:54', 'https://www.themoviedb.org/movie/48260', NULL),
(697, 'Feeling Minnesota ', 1996, '/fCJ5eUZw6mGS53spQxGUu7rzFm1.jpg', 'Sam Clayton\'s marriage to ex-stripper Freddie comes about when she\'s strong-armed into the match by Red, a club proprietor who once did her a favor. But Freddie falls in love with Jjaks, Sam\'s brother, and the pair tries to escape the situation together. It isn\'t long before both Sam and Red catch up with them, resulting in threats against the two of them -- although tension also starts to build between Sam and Red.', 99, NULL, 5.40, '2024-09-17 21:46:55', 'https://www.themoviedb.org/movie/12656', NULL),
(698, 'Delta of Venus ', 1995, '/j43W5XkXR7u7uVAvfniEXiQ3Bpv.jpg', 'A struggling American writer and a fellow American expatriate begin a sordid affair among the chaos and discord of 1940 Paris, France on the brink of World War II.', 99, NULL, 4.23, '2024-09-17 21:46:56', 'https://www.themoviedb.org/movie/38867', NULL),
(699, 'To Cross the Rubicon ', 1991, NULL, 'Kendall (Patricia Royce) just got dumped by her boyfriend, David (J.D. Souther). But it\'s nothing that a much younger rock musician -- and the advice of her best friend (and David\'s ex-), Claire (Lorraine Devon) -- couldn\'t fix. Only problem is, Claire and David have rekindled their lost romance. Now, Claire and Kendall\'s friendship is put to the ultimate test as they try to help each other decipher men and love in this romantic comedy.', 0, NULL, 9.00, '2024-09-17 21:46:57', 'https://www.themoviedb.org/movie/277270', NULL),
(700, 'Angus ', 1995, '/x1Py4TB8Y0Wx9IZ62derpSDqwjd.jpg', 'Angus is a large, pathetic 14-year-old whose thoughts are most often filled with the image of only one girl, Melissa Lefevre. Angus is shy and thinks that he has no chance of ever \'getting\' her. Being especially uncool, he is incredibly surprised (along with the rest of the school) that he is chosen to dance with her at the Winter Ball. The only one not surprised is the cool kid who set him up to fail, but Angus\' best friend is going to help him win the heart of Melissa by developing a new look for him', 90, NULL, 6.54, '2024-09-17 21:46:58', 'https://www.themoviedb.org/movie/25969', NULL),
(701, 'Daens ', 1992, '/5OjbOeMuDiUgl6oRuUiwGQZakT9.jpg', 'In the 1890s, Father Adolf Daens goes to Aalst, a textile town where child labor is rife, pay and working conditions are horrible, the poor have no vote, and the Catholic church backs the petite bourgeoisie in oppressing workers. He writes a few columns for the Catholic paper, and soon workers are listening and the powerful are in an uproar. He\'s expelled from the Catholic party, so he starts the Christian Democrats and is elected to Parliament. After Rome disciplines him, he must choose between two callings, as priest and as champion of workers. In subplots, a courageous young woman falls in love with a socialist and survives a shop foreman\'s rape; children die; prelates play billiards.', 138, NULL, 7.10, '2024-09-17 21:46:59', 'https://www.themoviedb.org/movie/44103', NULL),
(702, 'Faces ', 1968, '/qTkhxFQ0o6DEtTtPXkv4IA5M90J.jpg', 'Middle-aged suburban husband Richard abruptly tells his wife, Maria, that he wants a divorce. As Richard takes up with a younger woman, Maria enjoys a night on the town with her friends and meets a younger man. As the couple and those around them confront a seemingly futile search for what they\'ve lost -- love, excitement, passion -- this classic American independent film explores themes of aging and alienation.', 130, NULL, 7.17, '2024-09-17 21:47:00', 'https://www.themoviedb.org/movie/753', NULL),
(703, 'Boys ', 1996, '/kxpLUlvqptToQbLZJbQ7YO4MUAe.jpg', 'Fed up with boarding school and frustrated with the way others have planned his life, John Baker Jr. wants a change -- anything to shake up his staid routine. The moment arrives when he stumbles upon a woman, Patty Vare, unconscious in a field. Deciding to risk it, John takes her to his dorm to look after her, much to the disapproval of his friends. John\'s decision proves fateful as he and Patty grow close to one another. However, she may be keeping secrets from him.', 86, NULL, 5.41, '2024-09-17 21:47:01', 'https://www.themoviedb.org/movie/43634', NULL),
(704, 'Quest, The ', 1996, '/xMDo0ewl6XMZei44UNGMfho6eBq.jpg', 'Ghang-gheng, the ancient winner-take-all competition in which the deadliest fighters from around the world employ the most spectacular feats of martial arts skills ever displayed in order to win the prized Golden Dragon. But fighting prowess alone will not be enough for Chris to triumph over such daunting foes.', 95, NULL, 6.15, '2024-09-17 21:47:02', 'https://www.themoviedb.org/movie/9103', NULL),
(705, 'Cosi ', 1996, '/g4b3tEgmPSq7mZ7db1r9i5jHEHV.jpg', 'Lewis, a young amateur theater director, is offered a job with a governmental program for the rehabilitation of mentally ill patients in a Sydney institution. His project is overrun by one of the patients who wants to stage the opera Cosi Fan Tutte by Mozart despite the fact that none of the patients are able to sing and none of them speak Italian. A comedy of errors ensues, but one which unifies the patients and their director in unexpected ways.', 102, NULL, 6.30, '2024-09-17 21:47:03', 'https://www.themoviedb.org/movie/90214', NULL),
(706, 'Sunset Park ', 1996, '/rkt8cYfOV6vcqlDbut7jak9qaPh.jpg', 'A school teacher takes over a talented, but undisciplined high school basketball team and turns them into a winning team.', 99, NULL, 6.10, '2024-09-17 21:47:04', 'https://www.themoviedb.org/movie/29649', NULL),
(707, 'Mulholland Falls ', 1996, '/tT5rYDXloX5ZxISr8HdlRC9TBcP.jpg', 'In 1950s Los Angeles, a special crime squad of the LAPD investigates the murder of a young woman.', 107, NULL, 6.00, '2024-09-17 21:47:05', 'https://www.themoviedb.org/movie/10990', NULL),
(708, 'Truth About Cats & Dogs, The ', 1996, '/5V10mg1rAbwWYNF6IjnEYokIR8f.jpg', 'A successful veterinarian and radio show host with low self-esteem asks her model friend to impersonate her when a handsome man wants to see her.', 93, NULL, 6.00, '2024-09-17 21:47:06', 'https://www.themoviedb.org/movie/8866', NULL),
(709, 'Oliver & Company ', 1988, '/x8XqdiZ0Oxu5iXF9SiFub9Lae8J.jpg', 'This animated take on Oliver Twist re-imagines Oliver as an adorable orphaned kitten who struggles to survive in New York City and falls in with a band of canine criminals led by an evil human. First, Oliver meets Dodger, a carefree mutt with street savoir faire. But when Oliver meets wealthy Jenny on one of the gang\'s thieving missions, his life changes forever.', 74, NULL, 6.72, '2024-09-17 21:47:07', 'https://www.themoviedb.org/movie/12233', NULL),
(710, 'Celtic Pride ', 1996, '/5P3p9I2ADnTbBdIAl4ZUeUXGuIi.jpg', 'Two over-loyal Celtic fans kidnap their opponent\'s star player in order to guarantee their team the championship.', 91, NULL, 5.28, '2024-09-17 21:47:08', 'https://www.themoviedb.org/movie/23449', NULL),
(711, 'Flipper ', 1996, '/kbsePEyGVpbf3R3vn7yLVnB2lTO.jpg', 'Sandy Ricks is sent by his mom to Coral Key, a rustic island in the Florida keys, to spend the summer with his uncle Porter Ricks. Sandy dislikes everything about his new environment until a new friend comes into his life, a dolphin named Flipper, that brings uncle and nephew together and leads Sandy on the summer adventure of a lifetime.', 95, NULL, 5.51, '2024-09-17 21:47:09', 'https://www.themoviedb.org/movie/36355', NULL),
(712, 'Captives ', 1994, '/vfIqkf0WHiDQZuYGP720pGfWMg6.jpg', 'A beautiful young dentist working in a tough British prison starts to become attracted to a violent inmate after the break-up of her marriage, and embarks upon an illicit affair with him, with terrible consequences for all.', 100, NULL, 5.90, '2024-09-17 21:47:10', 'https://www.themoviedb.org/movie/37667', NULL),
(713, 'Of Love and Shadows ', 1994, '/tyg3WAaMa87ln7E1v4AtFkBxYEO.jpg', 'Irene is a magazine editor living under the shadow of the Pinochet dictatorship in Chile. Francisco is a handsome photographer and he comes to Irene for a job. As a sympathizer with the underground resistance movement, Francisco opens her eyes and her heart to the atrocities being committed by the state.', 103, NULL, 5.03, '2024-09-17 21:47:11', 'https://www.themoviedb.org/movie/90148', NULL),
(714, 'Dead Man ', 1995, '/dOvHDs2jlMYL1dMfbFabEwyBNWg.jpg', 'William Blake, an accountant turned fugitive, is on the run. During his travels, he meets a Native American man called Nobody, who guides him on a journey to the spiritual world.', 121, NULL, 7.30, '2024-09-17 21:47:13', 'https://www.themoviedb.org/movie/922', NULL),
(715, 'Horseman on the Roof, The (Hussard sur le toit, Le) ', 1995, '/tsmwnxi8hGXQTNVqBRCAVsfeGON.jpg', 'In a time of war and disease, a young officer gallantly tries to help a young woman find her husband.', 135, NULL, 6.47, '2024-09-17 21:47:14', 'https://www.themoviedb.org/movie/11876', NULL),
(716, 'Switchblade Sisters ', 1975, '/rJ2cKHfBnBHzV1aNMd4fzxjKyhr.jpg', 'A tough gang of teenage girls are looking for love and fighting for turf on the mean streets of the city! Bad girls to the core, these impossibly outrageous high school hoodlums go where they want ... and create mayhem wherever they go!', 91, NULL, 6.35, '2024-09-17 21:47:15', 'https://www.themoviedb.org/movie/52633', NULL),
(717, 'Mouth to Mouth (Boca a boca) ', 1995, '/asp8oMLM84migGU0px9bemdLieX.jpg', 'For financial reasons an unemployed aspiring actor works for a phone-sex enterprise. One day he receives a call from the mysterious wife of one of his best clients.', 106, NULL, 5.30, '2024-09-17 21:47:16', 'https://www.themoviedb.org/movie/62364', NULL),
(718, 'Visitors, The (Visiteurs, Les) ', 1993, '/iBsuPhz0pwWgtOhe4ysqFjwNk3t.jpg', 'After a wizard\'s spell goes awry, 12th-century Gallic knight Godefroy de Papincourt, Count of Montmirail finds himself transported to 1993, along with his dimwitted servant, Jacquouille la Fripouille. Startled and perplexed by modern technology, the duo run amok, destroying cars and causing chaos until they meet Beatrice de Montmirail, an aristocratic descendant of the nobleman, who may be able to help them get back to 1123.', 107, NULL, 7.10, '2024-09-17 21:47:17', 'https://www.themoviedb.org/movie/11687', NULL),
(719, 'Multiplicity ', 1996, '/pvbpsWdvSChCiBa86hNnZVj0pNE.jpg', 'Construction worker Doug Kinney finds that the pressures of his working life, combined with his duties to his wife Laura and daughter Jennifer leaves him with little time for himself. However, he is approached by geneticist Dr. Owen Leeds, who offers Doug a rather unusual solution to his problems: cloning.', 117, NULL, 5.75, '2024-09-17 21:47:18', 'https://www.themoviedb.org/movie/9304', NULL),
(720, 'Wallace & Gromit: The Best of Aardman Animation ', 1996, '/tWkYclnnChwoMMBFECsEjd5hb77.jpg', 'Anthology of Aardman Animation short films released in theaters in 1996, centered on the new release of the third Wallace & Gromit short, \"A Close Shave.\"  Includes: \"A Close Shave,\" \"Creature Comforts\" and \"Heat Electric Commercials\" by Nick Park; \"Rex the Runt: How Dinosaurs Became Extinct\", \"Rex the Runt: Dreams\" and \"Ident\" by Richard Goleszowski; \"Wat\'s Pig\" and \"My Baby Just Cares For Me\" by Peter Lord; \"Early Bird\" by Peter Lord and David Sproxton; \"Pib and Pog\" directed by Peter Peake', 75, NULL, 7.50, '2024-09-17 21:47:19', 'https://www.themoviedb.org/movie/503475', NULL),
