(722, 'Haunted World of Edward D. Wood Jr., The ', 1996, '/1iHw2fqWftJDtIGgos2aiOR8anm.jpg', 'Often called the worst director in the history of cinema, Ed Wood is nevertheless a beloved figure among cult-film aficionados for his oddball productions. This documentary takes a look back at Wood\'s unique career at the margins of 1950s Hollywood, speaking to those who loved him and hated him. Bela Lugosi Jr. discusses his father\'s work in the abysmal \"Plan 9 From Outer Space,\" while a Baptist reverend recalls how he was tricked into financing the film.', 112, NULL, 7.60, '2024-09-17 21:47:21', 'https://www.themoviedb.org/movie/73183', NULL),
(723, 'Two Friends ', 1986, '/5aWJn4WISrsvVxyxgAmjLgoTWba.jpg', 'The story of the end of a friendship between two teenage girls, told backwards over the course of nine months.', 78, NULL, 5.90, '2024-09-17 21:47:22', 'https://www.themoviedb.org/movie/123067', NULL),
(724, 'Craft, The ', 1996, '/8bW2RdRkloYtEPhbQZN4wcdmJP4.jpg', 'A Catholic school newcomer falls in with a clique of teen witches who wield their powers against all who dare to cross them -- be they teachers, rivals or meddlesome parents.', 101, NULL, 6.77, '2024-09-17 21:47:23', 'https://www.themoviedb.org/movie/9100', NULL),
(725, 'Great White Hype, The ', 1996, '/yEPiu0mC4NqMHOoFLsC6CxQW34d.jpg', 'When the champ\'s promoter, Rev. Sultan, decides something new is needed to boost the marketability of the boxing matches, he searches and finds the only man to ever beat the champ. The problem is that he isn\'t a boxer anymore and he\'s white. However, once Rev. Sultan convinces him to fight, he goes into heavy training while the confident champ takes it easy and falls out of shape.', 91, NULL, 5.21, '2024-09-17 21:47:24', 'https://www.themoviedb.org/movie/20759', NULL),
(726, 'Last Dance ', 1996, '/hsMe9TYfPs1VfpZs9xVLZBVGcES.jpg', 'Upon taking a new job, young lawyer Rick Hayes is assigned to the clemency case of Cindy Liggett, a woman convicted of first degree murder and sentenced to death. As Hayes investigates the background for her case, the two begin to form a deep friendship, while all the while the date for her execution draws nearer.', 103, NULL, 5.70, '2024-09-17 21:47:25', 'https://www.themoviedb.org/movie/46063', NULL),
(727, 'War Stories ', 1995, '/qak8Mk1flb1dQwnBRAC0RNxFsOt.jpg', 'Seven New Zealand women speak about their lives during World War II: some lost husbands, some got married, some went into service themselves. The director lets the women tell their stories simply, alternating between them talking and archival footage of the war years.', 95, NULL, 3.50, '2024-09-17 21:47:26', 'https://www.themoviedb.org/movie/365371', NULL),
(728, 'Cold Comfort Farm ', 1995, '/fkPm7MQhn3YqcRDM9qFDKNHiw7D.jpg', 'In this adaptation of the satirical British novel, Flora Poste, a plucky London society girl orphaned at age 19, finds a new home with some rough relatives, the Starkadders of Cold Comfort Farm. With a take-charge attitude and some encouragement from her mischievous friend, Mary, Flora changes the Starkadders\' lives forever when she settles into their rustic estate, bringing the backward clan up to date and finding inspiration for her novel in the process.', 95, NULL, 6.69, '2024-09-17 21:47:27', 'https://www.themoviedb.org/movie/32513', NULL),
(729, 'Institute Benjamenta, or This Dream People Call Human Life ', 1995, '/vuyajHfhz5dRVxxRskZHWPUguG1.jpg', 'Jakob arrives at the Institute Benjamenta (run by brother and sister Johannes and Lisa Benjamenta) to learn to become a servant. With seven other men, he studies under Lisa: absurd lessons of movement, drawing circles, and servility. He asks for a better room. No other students arrive and none leave for employment. Johannes is unhappy, imperious, and detached from the school\'s operation. Lisa is beautiful, at first tightly controlled, then on the verge of breakdown. There\'s a whiff of incest. Jakob is drawn to Lisa, and perhaps she to him. As winter sets in, she becomes catatonic. Things get worse; Johannes notes that all this has happened since Jakob came. Is there any cause and effect?', 104, NULL, 7.72, '2024-09-17 21:47:28', 'https://www.themoviedb.org/movie/40651', NULL),
(730, 'Low Life ', 1994, '', '', 0, NULL, 0.00, '2024-09-17 21:47:29', 'https://www.themoviedb.org/movie/', NULL),
(731, 'Heaven\'s Prisoners ', 1996, '/yUWVNHA3dVc1CmxNIcXZWqbqWc8.jpg', 'A hardened New Orleans cop, Dave Robicheaux, finally tosses in the badge and settles into life on the bayou with his wife. But a bizarre plane crash draws him back into the fray when his family is viciously threatened.', 132, NULL, 5.10, '2024-09-17 21:47:30', 'https://www.themoviedb.org/movie/36915', NULL),
(732, 'Original Gangstas ', 1996, '/uirrsTZmoPmscHZdyWz4tiXVqHE.jpg', 'A violent street gang, the Rebels, rule the streets of Gary, Indiana. The Rebels shoot Marvin Bookman, a store-keeper, for giving the police information about a drive-by shooting they committed. Marvin\'s son, former NFL star John who created the Rebels, returns to Gary to be with his father and, with a little help from his friends, to destroy the Rebels his way.', 99, NULL, 5.62, '2024-09-17 21:47:31', 'https://www.themoviedb.org/movie/40507', NULL),
(733, 'Rock, The ', 1996, '/j5mxLNWjUlXUUk8weFBtnF4afIR.jpg', 'When vengeful General Francis X. Hummel seizes control of Alcatraz Island and threatens to launch missiles loaded with deadly chemical weapons into San Francisco, only a young FBI chemical weapons expert and notorious Federal prisoner have the skills to penetrate the impregnable island fortress and take him down.', 137, NULL, 7.13, '2024-09-17 21:47:32', 'https://www.themoviedb.org/movie/9802', NULL),
(734, 'Getting Away With Murder ', 1996, '/zL9RbLQrhTyi60ZeXjc8hEIaTxf.jpg', 'When the very moralistic college ethics instructor Jack Lambert finds himself living next door to an accused German death camp commander, he takes it upon himself to rid the world of this man.', 88, NULL, 4.80, '2024-09-17 21:47:33', 'https://www.themoviedb.org/movie/25697', NULL),
(735, 'Cemetery Man (Dellamorte Dellamore) ', 1994, '/cI5AV3jCuxmoQp0N7Z16SI2b7Xk.jpg', 'Cemetery watchman, Francesco Dellamorte, is tasked with dispatching the recently deceased when they rise from their graves.', 103, NULL, 6.90, '2024-09-17 21:47:34', 'https://www.themoviedb.org/movie/21588', NULL),
(736, 'Twister ', 1996, '/fZ0Y2qSDKQJolrQhIDpTwx3GlYB.jpg', 'An unprecedented series of violent tornadoes is sweeping across Oklahoma. Tornado chasers, headed by Dr. Jo Harding, attempt to release a groundbreaking device that will allow them to track them and create a more advanced warning system. They are joined by Jo\'s soon to be ex-husband Bill, a former tornado chaser himself, and his girlfriend Melissa.', 113, NULL, 6.50, '2024-09-17 21:47:35', 'https://www.themoviedb.org/movie/664', NULL),
(737, 'Barb Wire ', 1996, '/jW5TLptY7PL1Mllq1g1uMjwXLXT.jpg', 'A sexy nightclub owner, Barb Wire moonlights as a mercenary in Steel Harbor, one of the last free zones in the now fascist United States. When scientist Cora Devonshire wanders into Barb\'s establishment, she gets roped into a top-secret government plot involving biological weapons. Soon Barb is reunited with her old flame Axel Hood, who is now Cora\'s husband and a guerrilla fighter, resulting in plenty of tense action.', 98, NULL, 3.96, '2024-09-17 21:47:36', 'https://www.themoviedb.org/movie/11867', NULL),
(738, 'Garçu, Le ', 1995, '/9cDgEmObLg8nmOdJLSHVTMTlyVc.jpg', 'A self-centered man (Gérard Depardieu) with many diversions occasionally visits his 4-year-old son (Antoine Pialat) and the boy\'s mother (Géraldine Pailhas).', 102, NULL, 6.40, '2024-09-17 21:47:37', 'https://www.themoviedb.org/movie/47119', NULL),
(739, 'Honey Moon (Honigmond) ', 1996, NULL, 'German Comedy', 92, NULL, 0.00, '2024-09-17 21:47:38', 'https://www.themoviedb.org/movie/314352', NULL),
(741, 'Ghost in the Shell (Kôkaku kidôtai) ', 1995, '/9gC88zYUBARRSThcG93MvW14sqx.jpg', 'In the year 2029, the barriers of our world have been broken down by the net and by cybernetics, but this brings new vulnerability to humans in the form of brain-hacking. When a highly-wanted hacker known as \'The Puppetmaster\' begins involving them in politics, Section 9, a group of cybernetically enhanced cops, are called in to investigate and stop the Puppetmaster.', 83, NULL, 7.93, '2024-09-17 21:47:39', 'https://www.themoviedb.org/movie/9323', NULL),
(742, 'Thinner ', 1996, '/3GR7uE3zMwERu2CgwdgTbAufFzU.jpg', 'An obese lawyer finds himself growing \"Thinner\" when an old Romani man places a hex on him. Now the lawyer must call upon his friends in organized crime to help him persuade the old man to lift the curse. Time is running out for the desperate lawyer as he draws closer to his own death, and grows ever thinner.', 92, NULL, 5.92, '2024-09-17 21:47:40', 'https://www.themoviedb.org/movie/10280', NULL),
(743, 'Spy Hard ', 1996, '/yoegp9XEG4YCbJJKR0wvm0BGYpG.jpg', 'The evil Gen. Rancor has his sights set on world domination, and only one man can stop him: Dick Steele, also known as Agent WD-40. Rancor needs to obtain a computer circuit for the missile that he is planning to fire, so Steele teams up with Veronique Ukrinsky, a KGB agent whose father designed the chip. Together they try to locate the evil mastermind\'s headquarters, where Veronique\'s father and several other hostages are being held.', 81, NULL, 5.38, '2024-09-17 21:47:41', 'https://www.themoviedb.org/movie/10535', NULL),
(744, 'Brothers in Trouble ', 1995, '/hzPSO1tehGTkqtJjc79ONicQnfJ.jpg', 'Amir is an illegal Pakistani immigrant smuggled into England in the 1960\'s to work, to send money to his family and perhaps even bring them over with him. A skilled laborer, he is forced to do unskilled work like shoveling sheep dung and processing wool. He lives in a boarding house with nearly a dozen other men, under the supervision of Hussein Shah. He befriends a young student, Sakib, who dreams of being a writer. Their existence is punctuated by secret movies, a visiting prostitute, fear of detection and deportation, and the gangster-like smuggler who comes by for his take every week. The household is shaken up by the arrival of a white girl, Shah\'s girlfriend, and the sense of femininity and family she brings.', 102, NULL, 2.00, '2024-09-17 21:47:41', 'https://www.themoviedb.org/movie/124613', NULL),
(745, 'Wallace & Gromit: A Close Shave ', 1995, '/qdIR27trLyrlJ5nmkbcG3Bomah6.jpg', 'Wallace\'s whirlwind romance with the proprietor of the local wool shop puts his head in a spin, and Gromit is framed for sheep-rustling in a fiendish criminal plot.', 30, NULL, 7.56, '2024-09-17 21:47:42', 'https://www.themoviedb.org/movie/532', NULL),
(746, 'Force of Evil ', 1948, '/x33LVKf4yWdjMeczJkzE5sIw4VG.jpg', 'Lawyer Joe Morse wants to consolidate all the small-time numbers racket operators into one big powerful operation. But his elder brother Leo is one of these small-time operators who wants to stay that way, preferring not to deal with the gangsters who dominate the big-time.', 79, NULL, 6.60, '2024-09-17 21:47:43', 'https://www.themoviedb.org/movie/26744', NULL),
(747, 'Stupids, The ', 1996, '/uR0EPkE66y2DU21NOZAu6xtfpQL.jpg', 'An incredibly dull-witted family unknowingly stumble upon an illegal weapons deal while on the trail of their \"stolen\" garbage.', 94, NULL, 4.67, '2024-09-17 21:47:44', 'https://www.themoviedb.org/movie/16299', NULL),
(748, 'Arrival, The ', 1996, '/7ARbqk8SqABU8QqANvpJCpMQ5nj.jpg', 'Zane Ziminski is an astrophysicist who receives a message that seems to have extraterrestrial origins. Eerily soon after his discovery, Zane is fired. He then embarks on a search to determine the origins of the transmission that leads him into a Hitchcockian labyrinth of paranoia and intrigue.', 115, NULL, 5.99, '2024-09-17 21:47:45', 'https://www.themoviedb.org/movie/10547', NULL),
(749, 'Man from Down Under, The ', 1943, '/vkduflNPvXr2NegyqV3OhOtxrnr.jpg', 'An Australian blowhard raises two orphaned children as his own in the years leading up to WWII.', 103, NULL, 6.50, '2024-09-17 21:47:46', 'https://www.themoviedb.org/movie/245268', NULL),
(750, 'Dr. Strangelove or: How I Learned to Stop Worrying and Love the Bomb ', 1964, '/7SixLzxcqezkZEYU8pcHZgbkmjp.jpg', 'After the insane General Jack D. Ripper initiates a nuclear strike on the Soviet Union, a war room full of politicians, generals and a Russian diplomat all frantically try to stop the nuclear strike.', 95, NULL, 8.12, '2024-09-17 21:47:47', 'https://www.themoviedb.org/movie/935', NULL),
(751, 'Careful ', 1992, '/qolQ7M5hpbBwcvpMpfeSMyU64rs.jpg', 'The mountain-village passions of a German widow and her sons unfold in the style of a 1920s movie.', 100, NULL, 6.10, '2024-09-17 21:47:48', 'https://www.themoviedb.org/movie/55613', NULL),
(752, 'Vermont Is For Lovers ', 1992, '/dBiufr6Xow23YvQjSRGgd0xAvu5.jpg', 'Vermont is for Lovers is an independently produced docudrama released in 1992, starring George Thrush and Marya Cohn and shot on location Tunbridge, Vermont. The film concerns a couple visiting Vermont in order to be married, and interviewing local residents on the subject of marriage. Largely improvised and using non-professional actors, the film was shown at various film festivals including the Melbourne International Film Festival and the Hawaii International Film Festival. The movie was not very well-received by the national press, with the New York Times calling it, “vaguely amiable.” While the Washington Post review commented that the film was an “all-too-easy target for ridicule,” it also mentioned one of the film’s high points: “In one scene, a typically droll Vermont resident (playing himself) sums up his state’s fabled coolness to strangers by suggesting that a sign be placed at the state line, reading ‘Welcome to Vermont. Now Leave.’”', 88, NULL, 6.50, '2024-09-17 21:47:49', 'https://www.themoviedb.org/movie/215107', NULL),
(753, 'Month by the Lake, A ', 1995, '/cgoiGvNffe4tZC33x6RIQQiKIp9.jpg', 'For 16 years Miss Bentley has been spending April at an elegant hillside villa on Lake Como. This year, 1937, her London society artist father has recently died and the only other English-speaking guests are brash Americans. Then Major Wilshaw arrives. He suggests they meet for cocktails and Miss Bentley stands him up -- not even thinking about it -- as she helps the new nanny of an Italian family settle in. Miss Beaumont, a tall, young American who has dropped out of finishing school in Switzerland, is bored and finds some amusement in flirting with the major, whose libido is awakened for the first time since before the great war. And Miss Bentley now finds more about the major to admire than his ears.', 92, NULL, 5.86, '2024-09-17 21:47:50', 'https://www.themoviedb.org/movie/41007', NULL),
(754, 'Gold Diggers: The Secret of Bear Mountain ', 1995, '/6USWKkOjS40KY19Q0gPEelEiDhc.jpg', 'Two teen girls, one from the city, one from the country, try to find the hidden gold of Bear Mountain learning about friendship, loyalty and courage on the way.', 94, NULL, 6.26, '2024-09-17 21:47:51', 'https://www.themoviedb.org/movie/35645', NULL),
(755, 'Kim ', 1950, '/koPgzZ60Kd2JI6uxJQ1pD06cIf6.jpg', 'During the British Raj, the orphan of a British soldier poses as a Hindu and is torn between his loyalty to a Buddhist mystic and aiding the English secret service.', 113, NULL, 6.25, '2024-09-17 21:47:52', 'https://www.themoviedb.org/movie/110465', NULL),
(756, 'Carmen Miranda: Bananas Is My Business ', 1994, '/aYYFx5SDQmhTwZnYxSA3r5xlAir.jpg', 'A biography of the Portuguese-Brazilian singer Carmen Miranda, whose most distinctive feature was her tutti-frutti hat. From her arrival in the US as the \"Brazilian Bombshell\" to her Broadway career and Hollywood stardom in the 1940s.', 91, NULL, 7.60, '2024-09-17 21:47:53', 'https://www.themoviedb.org/movie/255546', NULL),
(757, 'Ashes of Time (Dung che sai duk) ', 1994, '/1I5EksYqL87d1dxvpci1YX95CS6.jpg', 'Ouyang Feng is a heartbroken and cynical man who spends his days in the desert, connecting expert swordsmen with those seeking revenge and willing to pay for it. Throughout five seasons in exile, Ouyang spins tales of his clients\' unrequited loves and unusual acts of bravery.', 100, NULL, 7.05, '2024-09-17 21:47:53', 'https://www.themoviedb.org/movie/40751', NULL),
(758, 'Jar, The (Khomreh) ', 1992, '/nNzLYuhVLkzaW9xA8Fl0m4jxd4K.jpg', 'In the yard of an Iranian village school stands in the shade of a tree a large stoneware jar from which all the pupils drink fresh water. On an unfortunate day, the jar starts leaking. The schoolmaster tries hard to get a new one but in vain. The only solution is to have it fixed...', 86, NULL, 7.20, '2024-09-17 21:47:54', 'https://www.themoviedb.org/movie/275096', NULL),
(759, 'Maya Lin: A Strong Clear Vision ', 1994, '/fqYvHdWNV84yF7zPV3ENHOZ2Jow.jpg', 'A film about the work of the artist most famous for her monuments such as the Vietnam Memorial Wall and the Civil Rights Fountain Memorial.', 83, NULL, 7.00, '2024-09-17 21:47:55', 'https://www.themoviedb.org/movie/85778', NULL),
(760, 'Stalingrad ', 1993, '/rB78VDAOK94KJWp9ofgE3GSQEor.jpg', 'A German Platoon is explored through the brutal fighting of the Battle of Stalingrad. After half of their number is wiped out and they\'re placed under the command of a sadistic captain, the platoon lieutenant leads his men to desert. The platoon members attempt escape from the city, now surrounded by the Soviet Army.', 134, NULL, 7.29, '2024-09-17 21:47:56', 'https://www.themoviedb.org/movie/11101', NULL),
(761, 'Phantom, The ', 1996, '/8k8RSMkmGR9Lp6FbKtithM3KIQb.jpg', 'The 21st successor to the role of Bengalla\'s resident superhero must travel to New York to prevent a rich madman from obtaining three magic skulls that would give him the secret to ultimate power.', 100, NULL, 5.23, '2024-09-17 21:47:57', 'https://www.themoviedb.org/movie/9826', NULL),
(762, 'Striptease ', 1996, '/edkpT3vgjEjVrF461AbIwZgkvC7.jpg', 'Bounced from her job, Erin Grant needs money if she\'s to have any chance of winning back custody of her child. But, eventually, she must confront the naked truth: to take on the system, she\'ll have to take it all off. Erin strips to conquer, but she faces unintended circumstances when a hound dog of a Congressman zeroes in on her and sharpens the shady tools at his fingertips, including blackmail and murder.', 115, NULL, 5.54, '2024-09-17 21:47:58', 'https://www.themoviedb.org/movie/9879', NULL),
(763, 'Last of the High Kings, The (a.k.a. Summer Fling) ', 1996, '/pSdzsYKg1wpmYpflD1ZEq5Cf9rd.jpg', 'It is 1977, Dublin rocks to the music of Thin Lizzy and the world is stunned by the death of Elvis Presley. Frankie, caught between acne and adulthood, has just completed his final exams in school. Convinced he will fail, he survives the summer organising a beach party, having lustful thoughts about two girls he believes are unobtainable and fending off the advances from a visiting American family friend, all whilst coping with his oddball family.', 102, NULL, 5.80, '2024-09-17 21:47:58', 'https://www.themoviedb.org/movie/63564', NULL),
(764, 'Heavy ', 1995, '/xo2KsY7hOHDqpgYlDStL56zmgaq.jpg', 'Victor is a cook who works in a greasy roadside restaurant owned by his mother, Dolly. It\'s just the two of them, a waitress named Delores, and a heavy drinking regular, Leo. But things change when Callie, a beautiful college dropout, shows up as a new waitress and steals Victor\'s heart. But Victor is too shy to do anything about it, and too self-consciously overweight to dream of winning Callie away.', 105, NULL, 6.58, '2024-09-17 21:47:59', 'https://www.themoviedb.org/movie/22621', NULL),
(765, 'Jack ', 1996, '/9ZklgGqTljzg9VxzumbVOC1UKAs.jpg', 'Jack Powell suffers from an affliction that makes him grow four times faster than normal, so the 10 year old boy looks like a 40 year old man. After years of being tutored at home, Jack convinces his overprotective parents to send him to public school. The children don\'t know what to make of Jack, but with the help of his fifth-grade teacher, he makes an effort to win them over.', 113, NULL, 6.29, '2024-09-17 21:48:00', 'https://www.themoviedb.org/movie/7095', NULL),
(766, 'I Shot Andy Warhol ', 1996, '/eF4iTAjunicLQyc6AdF7JNwSBOC.jpg', 'Based on the true story of Valerie Solanas who was a 1960s radical preaching hatred toward men in her \"Scum\" manifesto. She wrote a screenplay for a film that she wanted Andy Warhol to produce, but he continued to ignore her. So she shot him. This is Valerie\'s story.', 103, NULL, 6.16, '2024-09-17 21:48:01', 'https://www.themoviedb.org/movie/26890', NULL),
(767, 'Grass Harp, The ', 1995, '/pcdi92LC26RW3zm97SwF3NXYTUr.jpg', 'Based on the novel by Truman Capote, this often-witty coming-of-age drama looks at a young man growing up with an unusual family in the Deep South in the 1940s. Becoming an orphan in 1935, Collin moves to his dad\'s cousins Verena and Dolly. Verena is a rich, bossy businesswoman. Dolly, Collin and the maid revolt, moving to a tree house.', 107, NULL, 5.90, '2024-09-17 21:48:02', 'https://www.themoviedb.org/movie/46732', NULL),
(768, 'Someone Else\'s America ', 1995, '/xtJfxmlIe3iRFFTP4TNFRwacVz.jpg', 'This tale takes place in a bar. The Spanish Alonso and his blind mother run this place. Bay, who is Alonso\'s friend live here too. This story tells something about Alonso and Bay and the \"American Dream\".', 96, NULL, 6.70, '2024-09-17 21:48:02', 'https://www.themoviedb.org/movie/124633', NULL);
INSERT INTO movies (id, name, released_at, poster_url, synopsis, duration, trailer_url, average_rating, created_at, url, updated_at) VALUES
(769, 'Marlene Dietrich: Shadow and Light ', 1996, '/faHxYNlQ7RGDtqmaNBpFf0HKozg.jpg', 'Following the life of Marlene Dietrich through her films (including home movies) and interviews with family, friends, co-workers, acquaintances, and presumed lovers. From the cabaret scene in 1920\'s Berlin, silent films in Germany, her triumph in _The Blue Angel_ in 1930 (for which her screen test is included in this film), to Hollywood with Josef von Sternberg. The highest paid female star of her time, the luster dimmed by 1935. and in the later part of the decade she might be the most valuable actress in the world but also the most unemployable. But with _Destry Rides Again_ Marlene became a sex symbol who could play comedy and the most remarkable comeback in Hollywood was a reality. She was one of the most active entertainers of the allied troops during WW II. After the war movies were infrequent, but a new career on the stage continued for another 20 years, until she retired into seclusion for the last decade of her life.', 52, NULL, 0.00, '2024-09-17 21:48:03', 'https://www.themoviedb.org/movie/581579', NULL),
(770, 'Costa Brava ', 1946, '', '', 0, NULL, 0.00, '2024-09-17 21:48:04', 'https://www.themoviedb.org/movie/', NULL),
(771, 'Life Is Rosy (a.k.a. Life Is Beautiful) (Vie est belle, La) ', 1987, '/aWU6bdzk1vqmGhMTKixafxIEeBW.jpg', 'A young man with dreams of pursuing a career in music moves form his small village to  the capital. Along the way he falls head over heels for a woman - the same woman his boss is also pursuing for his own reasons.', 80, NULL, 6.20, '2024-09-17 21:48:05', 'https://www.themoviedb.org/movie/202425', NULL),
(772, 'Quartier Mozart ', 1992, '/399VYKyl8sBpz3MEDunsyfgAl1z.jpg', 'The boisterous and cheerful lives of the residents of Cameroon are barely dented by incursions of supernatural power in this humor-filled rendition of traditional folk tales in modern guise. In the story, a cheerfully naughty girl crosses paths with a witch who has the power to satisfy her curiosity about men by changing her into a young man. She then becomes one of the boy suitors for the amorous attentions of a policeman\'s daughter. Some of the men have unusual names and even odder magical gifts: one of them has the ability to make a man\'s genitals disappear when he shakes hands with him.', 80, NULL, 5.20, '2024-09-17 21:48:06', 'https://www.themoviedb.org/movie/196940', NULL),
(773, 'Touki Bouki ', 1973, '/kcBYKHyg9GcQqa6DWq0AuQDhtPI.jpg', 'Mory, a cowherd, and Anta, a university student, try to make money in order to go to Paris and leave their boring past behind.', 91, NULL, 6.64, '2024-09-17 21:48:07', 'https://www.themoviedb.org/movie/77771', NULL),
(774, 'Wend Kuuni (a.k.a. God\'s Gift) ', 1982, '/7t0xjFUqy4T9gcM9lKYle8tTIq3.jpg', 'In pre-colonial times a peddler crossing the savanna discovers a child lying unconscious in the bush. When the boy comes to, he is mute and cannot explain who he is. The peddler leaves him with a family in the nearest village. After a search for his parents, the family adopts him, giving him the name Wend Kuuni (God\'s Gift) and a loving sister with whom he bonds. Wend Kuuni regains his speech only after witnessing a tragic event that prompts him to reveal his own painful history.', 71, NULL, 6.40, '2024-09-17 21:48:07', 'https://www.themoviedb.org/movie/181083', NULL),
(775, 'Spirits of the Dead ', 1968, '/9HmCwfPG7URPSXSrmEAFN65VoWE.jpg', 'Anthology film from three European directors based on stories by Edgar Allan Poe: a cruel countess haunted by a ghostly horse, a sadistic young man haunted by his double, and an alcoholic actor haunted by the Devil.', 121, NULL, 6.30, '2024-09-17 21:48:08', 'https://www.themoviedb.org/movie/41225', NULL),
(776, 'Babyfever ', 1994, '/fFazehXwOoYhHITyNCi5GDRrWQa.jpg', 'Gena is an average woman who is torn between her current boyfriend\'s desire to marry her and start a family, and the unexpected arrival of an old boyfriend wanting to pick up where they left off. To further complicate matters, she might be pregnant herself. In the mist of this unsettled personal life, Gena leaves her two men to attend a baby shower party for a girl friend and talks with the various female attendees all of whom are facing their own ticking biological clocks.', 109, NULL, 2.00, '2024-09-17 21:48:09', 'https://www.themoviedb.org/movie/188589', NULL),
(777, 'Pharaoh\'s Army ', 1995, '/yhzCZwkiFYrOrvmMlz14HnV0cM5.jpg', 'Union soldiers in search of food descend on the farm of a Confederate family and decide to stay until one in their ranks\' wounds have healed. While the war weary Union captain (Chris Cooper) falls for the mother of the family (Patricia Clarkson) - whose husband is off fighting for the rebels - her son plots revenge on the dirty, double-dealing Yankees. Co-stars Kris Kristofferson.', 90, NULL, 6.50, '2024-09-17 21:48:10', 'https://www.themoviedb.org/movie/87190', NULL),
(778, 'Trainspotting ', 1996, '/yKmmT0q35R4AfW9Rbq2IPVAPwk3.jpg', 'Heroin addict Mark Renton stumbles through bad ideas and sobriety attempts with his unreliable friends -- Sick Boy, Begbie, Spud and Tommy. He also has an underage girlfriend, Diane, along for the ride. After cleaning up and moving from Edinburgh to London, Mark finds he can\'t escape the life he left behind when Begbie shows up at his front door on the lam, and a scheming Sick Boy follows.', 94, NULL, 7.97, '2024-09-17 21:48:11', 'https://www.themoviedb.org/movie/627', NULL),
(779, '\'Til There Was You ', 1997, '/ndbW89bKquf5gMXgncY2fCkrIa.jpg', 'Two strangers, whose paths are always crossing, finally meet when fate steps in. It took them twenty years to fall in love at first sight.', 113, NULL, 3.90, '2024-09-17 21:48:11', 'https://www.themoviedb.org/movie/32872', NULL),
(780, 'Independence Day (a.k.a. ID4) ', 1996, '/p0BPQGSPoSa8Ml0DAf2mB2kCU0R.jpg', 'Strange phenomena surface around the globe. The skies ignite. Terror races through the world\'s major cities. As these extraordinary events unfold, it becomes increasingly clear that a force of incredible magnitude has arrived. Its mission: total annihilation over the Fourth of July weekend. The last hope to stop the destruction is an unlikely group of people united by fate and unimaginable circumstances.', 145, NULL, 6.89, '2024-09-17 21:48:12', 'https://www.themoviedb.org/movie/602', NULL),
(781, 'Stealing Beauty ', 1996, '/5ugxnyVmBK952bwOcE4M0szNimx.jpg', 'Lucy Harmon, an American teenager is arriving in the lush Tuscan countryside to be sculpted by a family friend who lives in a beautiful villa. Lucy visited there four years earlier and exchanged a kiss with an Italian boy with whom she hopes to become reacquainted.', 116, NULL, 6.70, '2024-09-17 21:48:13', 'https://www.themoviedb.org/movie/14553', NULL),
(782, 'Fan, The ', 1996, '/lu7CjP8YES5dJMCFg5O9o9jCkjl.jpg', 'When the San Francisco Giants pay center-fielder, Bobby Rayburn $40 million to lead their team to the World Series, no one is happier or more supportive than #1 fan, Gil Renard.  When Rayburn becomes mired in the worst slump of his career, the obsessed Renard decides to stop at nothing to help his idol regain his former glory—not even murder.', 116, NULL, 5.97, '2024-09-17 21:48:14', 'https://www.themoviedb.org/movie/9566', NULL),
(783, 'Hunchback of Notre Dame, The ', 1996, '/dNhZjiQ5jblNwhxrrXDt3ai9KXC.jpg', 'Isolated bell-ringer Quasimodo wishes to leave Notre Dame tower against the wishes of Judge Claude Frollo, his stern guardian and Paris\' strait-laced Minister of Justice. His first venture to the outside world finds him Esmeralda, a kind-hearted and fearless Romani woman who openly stands up to Frollo\'s tyranny.', 91, NULL, 7.12, '2024-09-17 21:48:15', 'https://www.themoviedb.org/movie/10545', NULL),
(784, 'Cable Guy, The ', 1996, '/iLmtIWy64uIkxLyi0A0vyzFfn5f.jpg', 'When recently single Steven moves into his new apartment, cable guy Chip comes to hook him up—and doesn\'t let go. Initially, Chip is just overzealous in his desire to be Steven\'s pal, but when Steven tries to end the \'friendship\', Chip shows his dark side. He begins stalking Steven, who\'s left to fend for himself because no one else can believe Chip\'s capable of such behaviour.', 96, NULL, 5.99, '2024-09-17 21:48:15', 'https://www.themoviedb.org/movie/9894', NULL),
(785, 'Kingpin ', 1996, '/axNjHHylLwT5oOahajqHtIEYZ10.jpg', 'After bowler Roy Munson swindles the wrong crowd and is left with a hook for a hand, he settles into impoverished obscurity. That is, until he uncovers the next big thing: an Amish kid named Ishmael. So, the corrupt and the hopelessly naive hit the circuit intent on settling an old score with Big Ern.', 114, NULL, 6.49, '2024-09-17 21:48:16', 'https://www.themoviedb.org/movie/11543', NULL),
(786, 'Eraser ', 1996, '/1FUV5ZmEkbxvqwQW0az4tFFOSmo.jpg', 'U.S. Marshall John Kruger erases the identities of people enrolled in the Witness Protection Program. His current assignment is to protect Lee Cullen, who\'s uncovered evidence that the weapons manufacturer she works for has been selling to terrorist groups. When Kruger discovers that there\'s a corrupt agent within the program, he must guard his own life while trying to protect Lee\'s.', 115, NULL, 6.10, '2024-09-17 21:48:17', 'https://www.themoviedb.org/movie/9268', NULL),
(787, 'Gate of Heavenly Peace, The ', 1995, '/a097YNBiTFR9eryZPylZ2INwExz.jpg', 'The Gate of Heavenly Peace is a feature-length documentary about the 1989 protest movement, reflecting the drama, tension, humor, absurdity, heroism, and many tragedies of the six weeks from April to June in 1989. The film reveals how the hard-liners within the government marginalized moderates among the protesters (including students, workers and intellectuals), while the actions of radical protesters undermined moderates in the government. Moderate voices were gradually cowed and then silenced by extremism and emotionalism on both sides.', 180, NULL, 7.84, '2024-09-17 21:48:18', 'https://www.themoviedb.org/movie/52059', NULL),
(788, 'Nutty Professor, The ', 1996, '/fMtb5aZoLRNbMnCkatFsTmPRfl5.jpg', 'When beautiful Carla Purty joins the university faculty, genetic professor Dr. Sherman Klump grows desperate to whittle his 400-pound frame down to size and win her heart. So, with one swig of his experimental fat-reducing serum, Sherman becomes \'Buddy Love\', a fast-talking, pumped-up, plumped down Don Juan.', 95, NULL, 5.63, '2024-09-17 21:48:19', 'https://www.themoviedb.org/movie/9327', NULL),
(789, 'I, the Worst of All (Yo, la peor de todas) ', 1990, '/svqJY9yyrPl42UbFaSbANvcTY9C.jpg', 'Assumpta Serna stars as the brilliant and beautiful poet Sister Juana Inés de la Cruz in this magnificent portrayal of 17th Century Mexico. In order to pursue her love of writing, Juana enters the convent and gains international renown. When the Inquisition comes, the local Vicereine becomes Juana\'s protectress and erotic muse, and soon begins a thrilling romance of startling passion and intensity.', 105, NULL, 5.60, '2024-09-17 21:48:20', 'https://www.themoviedb.org/movie/123763', NULL),
(790, 'Unforgettable Summer, An (Un été inoubliable) ', 1994, '/aQeuQzrl1bU4lSz7qklkJEnZTAx.jpg', 'In 1925 Romania, young Marie-Therese Von Debretsy refuses the flirtatious advances of her husband\'s commanding officer. As a result, the cosmopolitan family is reassigned to a brutally bleak and dangerous outpost on the Bulgarian/Romanian frontier where both their relationship and humanity are severely tested.', 82, NULL, 5.86, '2024-09-17 21:48:21', 'https://www.themoviedb.org/movie/81949', NULL),
(791, 'Last Klezmer: Leopold Kozlowski, His Life and Music, The ', 1994, '', '', 0, NULL, 0.00, '2024-09-17 21:48:21', 'https://www.themoviedb.org/movie/', NULL),
(792, 'Hungarian Fairy Tale, A (Hol volt, hol nem volt) ', 1987, '/h4OS61Kpd52ZqfvMIMGNdwiC2uB.jpg', 'Shot in B&W, Gyula Gazdag\'s film follows the surreal and often comic quests of young Andris, an orphan searching for a father who doesn\'t exist, and Orban, a government clerk who\'s had enough of oppressive bureaucracy.', 97, NULL, 5.40, '2024-09-17 21:48:22', 'https://www.themoviedb.org/movie/42005', NULL),
(793, 'My Life and Times With Antonin Artaud (En compagnie d\'Antonin Artaud) ', 1993, '/lQQ8odh4KuXaKGOBuVSGrAIoGim.jpg', 'May, 1946, in Paris young poet Jacques Prevel meets Antonin Artaud, the actor, artist, and writer just released from a mental asylum. Over ten months, we follow the mad Artaud from his cruel coaching of an actress in his \"theatre of cruelty\" to his semi-friendship with Prevel who buys him drugs and hangs on his every word. Meanwhile, Prevel divides his time between Jany, his blond, young, drug-hazed mistress, and Rolande, his dark-haired, long-suffering wife, who has a child during this time. Cruelty, neglect, poverty, egoism, madness, and the pursuit of art mix on the Left Bank.', 90, NULL, 6.50, '2024-09-17 21:48:23', 'https://www.themoviedb.org/movie/124306', NULL),
(794, 'Midnight Dancers (Sibak) ', 1994, '/pIjJUGUptsElcaYmvld04ZPfw1O.jpg', 'Brothers Joel, Dennis and Sonny  work together as dancers at a low-rent gay bar in downtown Manila, in the Philippines. Despite his mother\'s pleas, Sonny decides to quit college to work full-time at the bar, while Dennis has moved beyond dancing into prostitution at the urging of the manipulative club manager. Joel, the eldest, tries to balance his secret gay life with his socially respectable role as a husband and father.', 118, NULL, 5.40, '2024-09-17 21:48:24', 'https://www.themoviedb.org/movie/183955', NULL),
(795, 'Somebody to Love ', 1994, '/9ShSfdYCbDoPtgZpZ1MbkrexuIQ.jpg', 'Mercedes is a taxi dancer who wants to be an actress. She\'s involved with the married Harry, who considers himself a respected actor. Ernesto is in love with Mercedes, but he doesn\'t dance or have money.', 102, NULL, 5.20, '2024-09-17 21:48:25', 'https://www.themoviedb.org/movie/44535', NULL),
(796, 'Very Natural Thing, A ', 1974, '/nxHEvJU4Ae97gyTyi7TuGvusuXF.jpg', 'When David, an ex-monk still in his twenties meets Mark, he falls hard; soon he\'s asked Mark if they can live together. Things go well for awhile, and then differences in their definition of \"commitment\" begin to push them apart. Mark wants other sexual adventures, David tries to go along. Can they talk through the crisis in their relationship or is a breakup in the offing? David sees his relationship with Mark as a marriage, so if it ends, can David\'s heart ever heal?', 86, NULL, 7.20, '2024-09-17 21:48:26', 'https://www.themoviedb.org/movie/44495', NULL),
(797, 'Old Lady Who Walked in the Sea, The (Vieille qui marchait dans la mer, La) ', 1991, '/1neWsF03Ret9dSjF0wsKF7mZpKn.jpg', 'A con artist couple takes a young, handsome petty thief under their wing, but jealousies flare when the woman develops an interest in him.', 98, NULL, 5.60, '2024-09-17 21:48:26', 'https://www.themoviedb.org/movie/78285', NULL),
(798, 'Daylight ', 1996, '/7XL0WcNx1AuFLR96vka3cHOgy7a.jpg', 'A group of armed robbers fleeing the police head for the New Jersey Tunnel and run right into trucks transporting toxic waste. The spectacular explosion that follows results in both ends of the tunnel collapsing and the handful of people who survived the explosion are now in peril. Kit Latura is the only man with the skill and knowledge to lead the band of survivors out of the tunnel before the structure collapses.', 115, NULL, 6.08, '2024-09-17 21:48:27', 'https://www.themoviedb.org/movie/11228', NULL),
(799, 'Frighteners, The ', 1996, '/2ZwWDOoU1yy9qyhLEatcgI94ESy.jpg', 'Once an architect, Frank Bannister now passes himself off as an exorcist of evil spirits. To bolster his facade, he claims his \"special\" gift is the result of a car accident that killed his wife. But what he does not count on is more people dying in the small town where he lives. As he tries to piece together the supernatural mystery of these killings, he falls in love with the wife of one of the victims and deals with a crazy FBI agent.', 110, NULL, 6.89, '2024-09-17 21:48:28', 'https://www.themoviedb.org/movie/10779', NULL),
(800, 'Lone Star ', 1996, '/lBxY8znsRoqa9Dy2NCe8I6GPsRm.jpg', 'When the skeleton of his murdered predecessor is found, Sheriff Sam Deeds unearths many other long-buried secrets in his Texas border town.', 135, NULL, 7.00, '2024-09-17 21:48:29', 'https://www.themoviedb.org/movie/26748', NULL),
