(808, 'Alaska ', 1996, '/rVNkF2hxeOusnOrD46DbdQyiqOf.jpg', 'Jake Barnes and his two kids, Sean and Jessie, have moved to Alaska after his wife died. He is a former airline pilot now delivering toilet paper across the mountains. During an emergency delivery in a storm his plane goes down somewhere in the mountains. Annoyed that the authorities aren\'t doing enough, Jessie and Sean set out on an adventure to find their father with the help of a polar bear which they have saved from a ferocious poacher. Conflict ensues.', 109, NULL, 5.80, '2024-09-17 21:48:36', 'https://www.themoviedb.org/movie/36344', NULL),
(809, 'Fled ', 1996, '/5oGdTgWXCOKerrfdBxJrOlFyifL.jpg', 'During a routine prison work detail, convict Piper is chained to Dodge, a cyberhacker, when gunfire breaks out. Apparently, the attack is related to stolen money that the Mafia is after, and some computer files that somebody wants desperately to bury. The pair, who don\'t exactly enjoy each other\'s company, escape and must work together if they are to reach Atlanta alive. Luckily, they meet a woman who may be willing to help them.', 98, NULL, 5.54, '2024-09-17 21:48:37', 'https://www.themoviedb.org/movie/18550', NULL),
(810, 'Kazaam ', 1996, '/k6kXq27UVxf7zGCWSvygYYIp9eP.jpg', 'When Max fools a gang of local toughs, he finds himself in big trouble. Fleeing from the thugs, Max runs into an old warehouse and bumps into a boom box. By doing that, he manages to release Kazaam, a genie who has been held captive for thousands of years.', 93, NULL, 4.18, '2024-09-17 21:48:37', 'https://www.themoviedb.org/movie/11511', NULL),
(812, 'Magic Hunter (Büvös vadász) ', 1994, '/wTQ77lqIwlJBz98IeCO4srTmT0B.jpg', 'A battle-scarred, has-been Hungarian cop, tormented by his memories of nearly killing an innocent woman in his custody, enters into a Faustian pact in which he trades his soul for a handful of \"magic\" bullets that always hit the mark. A mysterious and mythical story.', 106, NULL, 5.10, '2024-09-17 21:48:38', 'https://www.themoviedb.org/movie/172198', NULL),
(813, 'Larger Than Life ', 1996, '/jdpEVxE5IUQv1qEBxWcQM49qDF9.jpg', 'Motivational Speaker Jack Corcoran is determined to get his career off the ground, but the biggest gigs he can get are the ones nobody wants. One day, he receives a telegram that his circus clown father has passed away and left a \"huge\" inheritance: an elephant that was his father\'s pride and joy. His main intention to sell the pachyderm off, Jack must choose between loud and rude zookeeper Mo or attractive animal show owner Terry. As the two trek through the country Jack and the elephant develop a bond, and it changes his approach to life for the better.', 93, NULL, 5.45, '2024-09-17 21:48:39', 'https://www.themoviedb.org/movie/34170', NULL),
(814, 'Boy Called Hate, A ', 1995, '/mbagWLUzEemKmiWnJNWGrU3SkWJ.jpg', 'After a run-in with the law, an angry maladjusted young man starts calling himself \"Hate\". One night he saves a girl from a lusty Assistant District Attorney. He falsely accuses them of robbery, so they go on the run and make things worse.', 97, NULL, 4.60, '2024-09-17 21:48:40', 'https://www.themoviedb.org/movie/281085', NULL),
