(818, 'Very Brady Sequel, A ', 1996, '/7xqOkzAQvXCLkDtmlWU6HZnOhru.jpg', 'A man claiming to be Carol Brady\'s long-lost first husband, Roy Martin, shows up at the suburban Brady residence one evening. An impostor, the man is actually determined to steal the Bradys\' familiar horse statue, a $20-million ancient Asian artifact.', 90, NULL, 5.83, '2024-09-17 21:48:43', 'https://www.themoviedb.org/movie/12606', NULL),
(819, 'Stefano Quantestorie ', 1993, '/gxV6O7elYGvfzWmvzROq2NWtaG.jpg', 'Stefano is now forty years old but has not yet found his purpose in life, remaining an eternal dreamer waiting for that decisive enlightenment. With his parents who have great plans for him, Stefano realizes that he lost most of his years without a real goal and thinks back to all those missed opportunities that could have led him to another path, between old loves and unexploited opportunities .', 82, NULL, 6.40, '2024-09-17 21:48:44', 'https://www.themoviedb.org/movie/69895', NULL),
(820, 'Death in the Garden (Mort en ce jardin, La) ', 1956, '/3HSPxDE0rvvvklNxYqba8glk3S5.jpg', 'In a remote Amazon jungle village, a group of angry diamond prospectors revolt when the local government undertakes a violent crackdown.', 105, NULL, 6.50, '2024-09-17 21:48:44', 'https://www.themoviedb.org/movie/35206', NULL),
(821, 'Crude Oasis, The ', 1995, '/1FrbZeFn5yhjlsfP4FkKV0lv8l.jpg', 'A young housewife plagued by disturbing nightmares comes face to face with the handsome stranger from her dreams. Obsessed with this mysterious man, she follows him through the night to a desolate roadside bar. There, she uncovers her deepest desires.', 81, NULL, 3.50, '2024-09-17 21:48:45', 'https://www.themoviedb.org/movie/525936', NULL),
(822, 'Hedd Wyn ', 1992, '/fkQJVqXittOKXTubdiID5cRFExr.jpg', '\'Hedd Wyn\' is a 1992 Welsh anti-war biopic. Ellis Humphrey Evans, a farmer\'s son and poet living at Trawsfynydd in the Meirionydd countryside of upland Wales, competes for the most coveted prize of all in Welsh Poetry - that of the chair of the National Eisteddfod, which in August 1917 was due to be held in Birkenhead (one of the rare occasions when it was held in England). After submitting his entry, under his bardic name \"Hedd Wyn\" (\"Blessed Peace\") Evans later departs from Meirionydd by train to join the Royal Welsh Fusiliers in Liverpool, despite his initial misgivings about the war. Ellis  is sent to fight in the trenches of Flanders.  \'Hedd Wyn\' was the first Welsh-language film to be nominated for an Oscar.', 123, NULL, 5.33, '2024-09-17 21:48:46', 'https://www.themoviedb.org/movie/151489', NULL),
(823, 'Collector, The (La collectionneuse) ', 1967, '/zErPp680oDKX3IILQqOgkeeaxWr.jpg', 'A bombastic, womanizing art dealer and his painter friend go to a seventeenth-century villa on the Riviera for a relaxing summer getaway. But their idyll is disturbed by the presence of the bohemian Haydée, accused of being a “collector” of men.', 86, NULL, 6.86, '2024-09-17 21:48:47', 'https://www.themoviedb.org/movie/4837', NULL),
