(825, 'Regular Guys (Echte Kerle) ', 1996, '/yh8IiyblpNt8QSK2r7FMStuI85q.jpg', 'Christoph, cop and self-confident macho, has trouble with his fiance. After a long night he wakes up in the arms of Edgar, a good-looking, gay auto-mechanic. His live gets more and more troublesome after his girl friend throws him out of their apartment and as last resort he moves to Edgars place. Working together with a new, good-looking, very self-confident, female collegue, but living with a good-looking gay guy makes him pretty uncertain about his sexuality and his role as a cop. Written by Konstantin Articus', 100, NULL, 5.90, '2024-09-17 21:48:49', 'https://www.themoviedb.org/movie/9098', NULL),
