(828, 'Adventures of Pinocchio, The ', 1996, '/rGPFPkUmPam6arT22ey8jWpKzL2.jpg', 'One of puppet-maker Geppetto\'s creations comes magically to life. This puppet, Pinocchio, has one major desire and that is to become a real boy someday. In order to accomplish this goal he has to learn to act responsibly. This film shows you the adventures on which he learns valuable lessons.', 90, NULL, 5.30, '2024-09-17 21:48:51', 'https://www.themoviedb.org/movie/18975', NULL),
(829, 'Joe\'s Apartment ', 1996, '/jITEDqVp2SonHCeC77dI5JaWD1t.jpg', 'A nice guy has just moved to New York and discovers that he must share his run-down apartment with a couple thousand singing, dancing cockroaches.', 81, NULL, 5.59, '2024-09-17 21:48:52', 'https://www.themoviedb.org/movie/11962', NULL),
(830, 'First Wives Club, The ', 1996, '/2ApifgYnfdJUSmCKzTBrWOYYWsn.jpg', 'After years of helping their hubbies climb the ladder of success, three mid-life Manhattanites have been dumped for a newer, curvier model. But the trio is determined to turn their pain into gain. They come up with a cleverly devious plan to hit their exes where it really hurts - in the wallet!', 102, NULL, 6.70, '2024-09-17 21:48:53', 'https://www.themoviedb.org/movie/2925', NULL),
