(833, 'High School High ', 1996, '/y8xLC2EpknonqkSZzVwjikH5yVS.jpg', 'Richard Clark has just left the well-known Wellington Academy to teach at Marion Barry High School. Now, he will try to inspire the D-average students into making good grades and try to woo a fellow teacher.', 86, NULL, 5.50, '2024-09-17 21:48:55', 'https://www.themoviedb.org/movie/9308', NULL),
(834, 'Phat Beach ', 1996, '/qp0oxzhvQWfkVZ2Iy6uhklrT0g0.jpg', 'A hefty homeboy borrows his dad\'s Mercedes and goes to the beach with his friends for wild sun &amp; fun.', 89, NULL, 5.50, '2024-09-17 21:48:56', 'https://www.themoviedb.org/movie/92381', NULL),
(835, 'Foxfire ', 1996, '/ywrSScJT43HerqWPlMu8nigLFzg.jpg', 'The story of five teenage girls who form an unlikely bond after beating up a teacher who has sexually harassed them. They build a solid friendship but their wild ways begin to get out of control.', 102, NULL, 6.04, '2024-09-17 21:48:57', 'https://www.themoviedb.org/movie/18555', NULL),
(836, 'Chain Reaction ', 1996, '/4ahjVHwXXsq5zK57ds8FwWY73MS.jpg', 'At the University of Chicago, a research team that includes brilliant student machinist Eddie Kasalivich experiences a breakthrough: a stable form of fusion that may lead to a waste-free energy source. However, a private company wants to exploit the technology, so Kasalivich and physicist Dr. Lily Sinclair are framed for murder, and the fusion device is stolen. On the run from the FBI, they must recover the technology and exonerate themselves.', 107, NULL, 5.70, '2024-09-17 21:48:58', 'https://www.themoviedb.org/movie/12123', NULL),
(837, 'Matilda ', 1996, '/wYoDpWInsBEVSmWStnRH06ddoyk.jpg', 'Matilda Wormwood is an exquisite and intelligent little girl. Unfortunately, her parents, Harry and Zinnia misunderstand her because they think she is so different. As time passes, she finally starts school and has a kind teacher, loyal friends, and a sadistic headmistress. As she gets fed up with the constant cruelty, she begins to realize that she has a gift of telekinetic powers. After some days of practice, she suddenly turns the tables to stand up to Harry and Zinnia and outwit the headmistress.', 98, NULL, 7.16, '2024-09-17 21:48:59', 'https://www.themoviedb.org/movie/10830', NULL),
(838, 'Emma ', 1996, '/rDj805Hdkhj0xrIaqXxUj2SbxZo.jpg', 'Emma Woodhouse is a congenial young lady who delights in meddling in other people’s affairs. She is perpetually trying to unite men and women who are utterly wrong for each other. Despite her interest in romance, Emma is clueless about her own feelings, and her relationship with gentle Mr. Knightly.', 121, NULL, 6.70, '2024-09-17 21:49:01', 'https://www.themoviedb.org/movie/3573', NULL),
(839, 'Crow: City of Angels, The ', 1996, '/wcWXBujfOUKYbWRnfnAUJaqxRrn.jpg', 'A murder victim is brought back to life by a mysterious crow. With the help of a beautiful woman, he exacts revenge on his killers – only to realize his enemy has discovered the one weakness that can destroy him forever.', 84, NULL, 5.53, '2024-09-17 21:49:02', 'https://www.themoviedb.org/movie/10546', NULL),
(840, 'House Arrest ', 1996, '/mpQg8IgbmrMY0skgpTXBA9EhiWy.jpg', 'High-schooler Grover Beindorf and his younger sister Stacy decide that their parents, Janet and Ned, are acting childishly when they decide to divorce after 18 years of marriage, so they lock them up in the basement until they\'ll sort out their problems.', 108, NULL, 5.29, '2024-09-17 21:49:03', 'https://www.themoviedb.org/movie/18862', NULL),
(841, 'Eyes Without a Face (Yeux sans visage, Les) ', 1959, '/8y7Z9Gvcq52uOlJlUWyn2epGGRd.jpg', 'Dr. Génessier is riddled with guilt after an accident that he caused disfigures the face of his daughter, the once beautiful Christiane, who outsiders believe is dead. Dr. Génessier, along with accomplice and laboratory assistant Louise, kidnaps young women and brings them to the Génessier mansion. After rendering his victims unconscious, Dr. Génessier removes their faces and attempts to graft them on to Christiane\'s.', 84, NULL, 7.59, '2024-09-17 21:49:04', 'https://www.themoviedb.org/movie/31417', NULL),
(842, 'Tales from the Crypt Presents: Bordello of Blood ', 1996, '/aKkUQ0Zd9TFlqfcMMHFKQBB15wZ.jpg', 'Private eye Rafe Guttman is hired by repressed, born-again Katherine to find her missing bad-boy brother. The trail leads him to a whorehouse run by a thousand-year-old vampire and secretly backed by Katherine\'s boss, televangelist Jimmy Current.', 87, NULL, 5.91, '2024-09-17 21:49:05', 'https://www.themoviedb.org/movie/9431', NULL),
(843, 'Lotto Land ', 1995, NULL, 'This film tells two interwoven stories of two single-parent families in a poor, racially-mixed neighborhood in Brooklyn. The first story is about a young black man (with aspirations of getting away from his friends who are involved in drugs) who falls in love with a latino girl (who is heading off to college on a full scholarship). The second is about their parents, (she works in the neighborhood liquor store; he works for the phone company). The story takes place against the backdrop of a winning lottery ticket worth $27 million being sold to someone in the neighborhood from the liquor store.', 87, NULL, 7.00, '2024-09-17 21:49:06', 'https://www.themoviedb.org/movie/124619', NULL),
(844, 'Story of Xinghua, The (Xinghua san yue tian) ', 1994, '/yKMBI1zQza96lojjlpccQNx7SBG.jpg', 'Xinghua lives with her husband, who makes money by selling stones from the Great Wall. But she is unable to give him a son to inherit this wealth. When her husband hatches a plan to tear down the local historic fortress to find a legendary hidden treasure, she finds herself drawn to a gentler, more educated man who wants to preserve it.', 90, NULL, 2.00, '2024-09-17 21:49:07', 'https://www.themoviedb.org/movie/297645', NULL),
(845, 'Day the Sun Turned Cold, The (Tianguo niezi) ', 1994, '/uBGVTO4C9aC2StWlPc0esb1L0W.jpg', 'Guan Jian wants to report the murder of his father who died 10 years ago. The alleged murderer whom Guan Jian accuses of the crime is his own mother.', 99, NULL, 5.70, '2024-09-17 21:49:08', 'https://www.themoviedb.org/movie/48144', NULL),
(846, 'Flirt ', 1995, '/gxvzR6DNBKQOQZmCDFZoMJs20TL.jpg', 'The same situation is played out in different cities (New York, Berlin and Tokyo). A lover has to choose whether to commit to a partner who is returning home. In each case there are other people involved, an ex-partner and someone else in a \"permanent\" relationship, what do they choose to do?', 85, NULL, 6.15, '2024-09-17 21:49:09', 'https://www.themoviedb.org/movie/46986', NULL),
(847, 'Big Squeeze, The ', 1996, '/e29bxyk9pOKcswJ98LbeLkkEFvc.jpg', 'Benny, a hapless grifter, is thrown off a train after cheating at cards, and into the life of Tanya, a lovely bartender. Tanya has been supporting her husband, a former ballplayer, since his accident, waiting for an insurance settlement that will solve all their financial woes. But when it comes, he refuses to share it with her, claiming with newfound piety that money is the root of all evil. She then enlists the help of Benny to concoct a scheme to get her fair share of the settlement, and he finds one: a local Catholic mission needs money for repairs and Benny decides to create a miracle that will encourage husband Henry to fork over the money - which Benny and Tanya will intercept and share.', 98, NULL, 3.50, '2024-09-17 21:49:10', 'https://www.themoviedb.org/movie/144982', NULL),
(848, 'Spitfire Grill, The ', 1996, '/2pyhUxh7Dn82MD3zOzT9TTnNsXp.jpg', 'Percy, upon being released from prison, goes to the small town of Gillead, to find a place where she can start over again. She is taken in by Hannah, to help out at her place, the Spitfire Grill. Percy brings change to the small town, stirring resentment and fear in some, and growth in others.', 117, NULL, 6.50, '2024-09-17 21:49:11', 'https://www.themoviedb.org/movie/47907', NULL),
(849, 'Escape from L.A. ', 1996, '/3L9lL2eUsmLNNfENPwNOc82Hzpw.jpg', 'Into the 9.6-quaked Los Angeles of 2013 comes Snake Plissken. His job: wade through L.A.\'s ruined landmarks to retrieve a doomsday device.', 100, NULL, 5.86, '2024-09-17 21:49:12', 'https://www.themoviedb.org/movie/10061', NULL),
(850, 'Cyclo (Xich lo) ', 1995, '/mdOsnSVTLwHMEH1juOLMiwXcO5o.jpg', 'Follows a young cyclo driver on his poverty-driven descent into criminality in modern-day Ho Chi Minh City. The boy\'s struggles to scratch out a living for his two sisters and grandfather in the mean streets of the city lead to petty crime on behalf of a mysterious Madame from whom he rents his cyclo.', 123, NULL, 7.00, '2024-09-17 21:49:12', 'https://www.themoviedb.org/movie/36266', NULL),
(851, 'Basquiat ', 1996, '/gFfVhN8BbgHhMb3ZNQRAH5xc7kq.jpg', 'The brief life of Jean Michel Basquiat, a world renowned New York street artist struggling with fame, drugs and his identity.', 108, NULL, 6.61, '2024-09-17 21:49:13', 'https://www.themoviedb.org/movie/549', NULL),
(852, 'Tin Cup ', 1996, '/rB7OvMmjcBFoogleORaUqrRgp8g.jpg', 'A washed up golf pro working at a driving range tries to qualify for the US Open in order to win the heart of his succesful rival\'s girlfriend.', 135, NULL, 6.03, '2024-09-17 21:49:14', 'https://www.themoviedb.org/movie/10478', NULL),
(853, 'Dingo ', 1991, '/2PUNScaxHlMVXPtCyjAvTj4u6A3.jpg', 'Young John Anderson is captivated by jazz musician, Billy Cross when he performs on the remote airstrip of his Western Australian outback hometown after his plane is diverted. Years later, now a family man and making a meagre living tracking dingoes and playing trumpet in a local band, John still dreams of joining Billy on trumpet and makes a pilgrimage to Paris.', 109, NULL, 5.70, '2024-09-17 21:49:15', 'https://www.themoviedb.org/movie/66634', NULL),
(854, 'Ballad of Narayama, The (Narayama Bushiko) ', 1958, '/kwvNyyXFsVAPg9PYQsogcXj99lV.jpg', 'In Kabuki style, the film tells the story of a remote mountain village where the scarcity of food leads to a voluntary but socially-enforced policy in which relatives carry 70-year-old family members up Narayama mountain to die. Granny Orin is approaching 70, content to embrace her fate. Her widowed son Tatsuhei cannot bear losing his mother, even as she arranges his marriage to a widow his age. Her grandson Kesa, who\'s girlfriend is pregnant, is selfishly happy to see Orin die. Around them, a family of thieves are dealt with severely, and an old man, past 70, whose son has cast him out, scrounges for food. Will Orin\'s loving and accepting spirit teach and ennoble her family?', 98, NULL, 7.40, '2024-09-17 21:49:16', 'https://www.themoviedb.org/movie/116690', NULL),
(855, 'Every Other Weekend (Un week-end sur deux) ', 1990, '/cuLeBjugiYnlnyw4a1cpdBMdGK6.jpg', 'Camille, a mercurial César-winning actress, has seen better times. Estranged from her husband, she\'s with her children only every other weekend. It\'s her weekend, but her agent has booked her to MC a Rotary club dinner in Vichy. She takes them with her, and when her husband learns this, he demands to pick them up at once. She bolts in a rented car to the seaside, trying to improve her relations with the children, especially the precocious and distant Vincent. He loves astronomy. A rare meteor shower is due in a few days, so she suggests they go to a plateau in Spain hoping to see it. He agrees, but the relationship remains difficult, and her husband is on their trail.', 104, NULL, 6.64, '2024-09-17 21:49:17', 'https://www.themoviedb.org/movie/213917', NULL),
(856, 'Mille bolle blu ', 1993, '/bD7VryaPAOXvS3j4WSqTAUj4BvP.jpg', 'The movie tells the little stories of a group of families who live in the same building in Rome as seen from the eyes of Sandrino, a little kid who is awaiting for a total eclipse of the sun, that really happened during summer of \'61, and it was was fully visible from Italy. He sees his family life, a young girl who is about to marry a man she doesn\'t love, an old man who has just died and whose relatives fight for his inheritance, a blind trumpet player who hopes to recover, his little friends...', 97, NULL, 6.40, '2024-09-17 21:49:18', 'https://www.themoviedb.org/movie/145925', NULL),
(857, 'Crows and Sparrows (Wuya yu maque) ', 1949, '/noVzFIlYfBR7hhAHwRI5OfhjlVK.jpg', 'At a Shanghai apartment, Mr Hou, a Nationalist official, gets ready to move to Taiwan upon the imminent defeat of the KMT during the Civil War. Mrs Hou gives an ultimatum to the rest of the tenants to move out on behalf of her husband, who is the \"owner\" of the flat and who is now planning to sell it. From the conversations with the rest, we find out that Hou has been a Hanjian during the Sino-Japanese War and that he has since taken over the apartment by force from the old landlord, Mr Kong.  The tenants, including Mr Kong, Mrs Xiao, Little Broadcast (alias Mr Xiao, played by Zhao Dan) and a schoolteacher, Mr Hua, and his wife, initially plan to band together, but circumstances force them to find other ways out. Mr Hua tries to find a place to stay at the KMT-sponsored school he is teaching in. Little Broadcast and Mrs Xiao invest in black market gold. As the situation escalates, Mr Hua gets arrested by KMT agents and his young daughter falls desperately ill.', 113, NULL, 5.80, '2024-09-17 21:49:19', 'https://www.themoviedb.org/movie/100914', NULL),
(858, 'Godfather, The ', 1972, '/3bhkrj58Vtu7enYsRolD1fZdja1.jpg', 'Spanning the years 1945 to 1955, a chronicle of the fictional Italian-American Corleone crime family. When organized crime family patriarch, Vito Corleone barely survives an attempt on his life, his youngest son, Michael steps in to take care of the would-be killers, launching a campaign of bloody revenge.', 175, NULL, 8.69, '2024-09-17 21:49:19', 'https://www.themoviedb.org/movie/238', NULL),
(859, 'Hippie Revolution, The ', 1996, '/p5SC0B48GKtwOMLVK0qdY4p164F.jpg', 'Back in the stone aged we all went to San Fransisco to escape our parents and the Vietnam war. To laugh, dance and love each other. To make love not war. Music bt Country Joe & The Fish, Quicksilver Messenger Service, The Steve Miller Band and Mother Earth.', 93, NULL, 0.00, '2024-09-17 21:49:20', 'https://www.themoviedb.org/movie/484245', NULL),
(860, 'Maybe, Maybe Not (Bewegte Mann, Der) ', 1994, '/2TcZBHcseRXLxNq2RXnKIsbKZwi.jpg', 'The heterosexual man Axel is thrown out of his girlfriends home for cheating and ends up moving in with a gay man. Axel learns the advantages of living with gay men even though they are attracted to him and when his girlfriend wants him back he must make a tough decision.', 94, NULL, 6.23, '2024-09-17 21:49:21', 'https://www.themoviedb.org/movie/159', NULL),
(861, 'Supercop (Police Story 3: Supercop) (Jing cha gu shi III: Chao ji jing cha) ', 1992, '/1C49MPtKZ8fZXtzwSj4Ha0eEEjl.jpg', 'A Hong Kong detective teams up with his female Red Chinese counterpart to stop a Chinese drug czar.', 96, NULL, 6.80, '2024-09-17 21:49:22', 'https://www.themoviedb.org/movie/11134', NULL),
(862, 'Manny & Lo ', 1996, '/zFmI1p0CTLneVkqFtgq5jub0hvV.jpg', 'A pregnant teen and her younger sister run away from foster homes and kidnap a woman whom they believe can help with the pregnancy.', 88, NULL, 5.80, '2024-09-17 21:49:23', 'https://www.themoviedb.org/movie/88224', NULL),
(864, 'Wife, The ', 1995, '/3xZ0FXwnLy8yFuIrQ9ytCawg8cA.jpg', 'Ten years into a marriage, the wife is disappointed by the husband\'s lack of financial success, meaning she has to work and can\'t treat herself and the husband finds the wife slovenly and mean-spirited: she neither cooks not cleans particularly well and is generally disagreeable. In turn, he alternately ignores her and treats her as a servant. Neither is particularly happy, not helped by their unsatisfactory lodgers. The husband is easily seduced by an ex-colleague, a widow with a small child who needs some security, and considers leaving his wife.', 96, NULL, 6.90, '2024-09-17 21:49:24', 'https://www.themoviedb.org/movie/132641', NULL),
(865, 'Small Faces ', 1996, '/pYFtU8vFj86TY435w99aK5fNjzl.jpg', 'Three teenage brothers, gang-member Bobby, troubled mama\'s boy Alan and self-assured prankster Lex, reside in a downtrodden section of Glasgow, Scotland, circa 1968. But while Bobby and Alan are beginning to experience the power of raging hormones, the story focuses on Lex, who begins a downward spiral after he accidentally shoots the leader of Bobby\'s gang. Lex\'s cockiness and immaturity unfortunately prevent him from understanding the effect his subsequent crimes will have on both himself, and on those around him.', 108, NULL, 6.32, '2024-09-17 21:49:25', 'https://www.themoviedb.org/movie/42758', NULL),
(866, 'Bound ', 1996, '/nfXU25TsAUsLMTJ6oHlgxPUcUOF.jpg', 'Corky, a tough female ex-convict working on an apartment renovation in a Chicago building, meets a couple living next door, Caesar, a paranoid mobster, and Violet, his seductive girlfriend, who is immediately attracted to her.', 105, NULL, 7.20, '2024-09-17 21:49:25', 'https://www.themoviedb.org/movie/9303', NULL),
(867, 'Carpool ', 1996, '/rYoZR4EtrfziT5WXhZzcNbH5GuE.jpg', 'A man with an important business meeting finds himself having to take care of the carpool for the neighborhood school children when his wife gets sick. Stopping to get donuts for the kids, things go even more awry when he finds himself a victim of a robbery. However, the situation only gets worse as a desperate man who had been contemplating a bank robbery robs the robbers and takes the man and the kids hostage in their van as his truck is blocked by an armored car. The thing then proceeds into a comedic chase movie. The father finds his kids don\'t really respect him and they react better to the robber. The end result is everyone gets a lifestyle change, including the original store owner.', 89, NULL, 5.00, '2024-09-17 21:49:26', 'https://www.themoviedb.org/movie/23945', NULL),
(868, 'Death in Brunswick ', 1991, '/8ezPcoGAlX9kj4ZlOHBFWBQOALR.jpg', 'A reserved man in need of a job, Carl Fitzgerald finds employment at a Greek restaurant. Upon meeting waitress Sophie, Carl begins dating the attractive woman. Though it seems things are improving for Carl, an unexpected situation leads to the death of Mustafa, a shady coworker, and Carl must figure out how to cover up the incident. Unsure of what to do, Carl enlists the help of his buddy, Dave, to get rid of Mustafa\'s corpse.', 109, NULL, 5.98, '2024-09-17 21:49:27', 'https://www.themoviedb.org/movie/37820', NULL),
(869, 'Kansas City ', 1996, '/k4qg4fTPCzpktfD0Rrub9Dzlv2M.jpg', 'A pair of kidnappings expose the complex power dynamics within the corrupt and unpredictable workings of 1930s Kansas City.', 116, NULL, 6.29, '2024-09-17 21:49:28', 'https://www.themoviedb.org/movie/22479', NULL),
(870, 'Gone Fishin\' ', 1997, '/lGRHE7s2iGgJ0JNO9gxm8BJKelt.jpg', 'Two fishing fanatics get in trouble when their fishing boat gets stolen while on a trip.', 94, NULL, 4.80, '2024-09-17 21:49:29', 'https://www.themoviedb.org/movie/9054', NULL),
(871, 'Lover\'s Knot ', 1996, NULL, 'A pair of lovers have no idea that their affair is overseen and orchestrated by an angel sent by Cupid to see that they remain together in this romantic comedy.', 82, NULL, 4.00, '2024-09-17 21:49:30', 'https://www.themoviedb.org/movie/241058', NULL),
(872, 'Vive L\'Amour (Ai qing wan sui) ', 1994, '/i60TuLXoZQaU9dJlClWf5kNdoKE.jpg', 'Three lonely young denizens of Taipei unknowingly share an apartment: May, a real estate agent who uses it for her sexual affairs; Ah-jung, her current lover; and Hsiao-kang, who\'s stolen the key and uses the apartment as a retreat.', 118, NULL, 7.10, '2024-09-17 21:49:30', 'https://www.themoviedb.org/movie/11985', NULL),
(873, 'Shadow of Angels (Schatten der Engel) ', 1976, '/oATeeK5N7t0ST7vxTpPllkGb34i.jpg', 'Beautiful, detached, laconic, consumptive Lily Brest is a streetwalker with few clients. She loves her idle boyfriend Raoul who gambles away what little she earns. The town\'s power broker, called the rich Jew, discovers she is a good listener, so she\'s soon busy. Raoul imagines grotesque sex scenes between Lily and the Jew; he leaves her for a man. Her parents, a bitter Fascist who is a cabaret singer in drag and her wheelchair-bound mother, offer no refuge. Even though all have a philosophical bent, the other whores reject Lily because she tolerates everyone, including men. She tires of her lonely life and looks for a way out. Even that act serves the local corrupt powers.', 101, NULL, 4.00, '2024-09-17 21:49:31', 'https://www.themoviedb.org/movie/10232', NULL),
(874, 'Killer: A Journal of Murder ', 1995, '/bGhq64TzH7i1jSmK0tYHbDmgzVQ.jpg', 'Carl Panzram is sent to Leavenworth Prison for burglary. While there, he is brutally beaten by a guard. Neophyte guard Henry Lesser feels sympathy for Panzram, befriends him, and gets him to write his life story. Lesser learns that Panzram\'s past is much more violent than he thought, but also that he\'s capable of being a much better person than the rest of the prison staff believes - or so Lesser thinks.', 91, NULL, 5.88, '2024-09-17 21:49:32', 'https://www.themoviedb.org/movie/59569', NULL);
INSERT INTO movies (id, name, released_at, poster_url, synopsis, duration, trailer_url, average_rating, created_at, url, updated_at) VALUES
(875, 'Nothing to Lose ', 1994, '/obRFIwQWBieexkUQtZBNROeZTcR.jpg', 'A young street fighter seeks revenge against a powerful drug lord who killed his entire family. Using of his many special combat skills, he\'s about to take down a whole criminal operation, reaching his goal whatever the consequences.', 83, NULL, 2.00, '2024-09-17 21:49:33', 'https://www.themoviedb.org/movie/410921', NULL),
(876, 'Supercop 2 (Project S) (Chao ji ji hua) ', 1993, '/wYGXe2BRIyNX2z7Y6UdQoiw8yfk.jpg', 'As a crime wave sweeps through Hong Kong, the police call Jessica Yang (Yeoh), a rising star in the ranks, to help stop a notorious gang of thieves! What Jessica doesn\'t realize is that her boyfriend - recently discharged from the force - is the leader of this ruthless crime ring!', 104, NULL, 5.70, '2024-09-17 21:49:34', 'https://www.themoviedb.org/movie/38955', NULL),
(877, 'Girls Town ', 1996, '/4Qyr7s8heJnMm0rM20YwtSvYI77.jpg', 'The death of a friend galvanizes three high school young women to reassess their friendship and their lives.', 90, NULL, 6.10, '2024-09-17 21:49:34', 'https://www.themoviedb.org/movie/110513', NULL),
(878, 'Bye-Bye ', 1995, '/hJB8GT95PXKZ2MBrOIOx2xrhbSm.jpg', 'In Paris, Ismaél, a young Tunisian, cares for two brothers, Nouredine, a cripple, and streetwise Mouloud, 14. In haste, Ismaél and Mouloud go to Marseilles where an uncle lives. Nouredine has died in a fire, and Ismaél feels guilt on top of grief. Ismaél becomes friends with Jacky, a white man whose father and brother hate immigrants. Mouloud hangs out with cousin Rhida who breaks Islamic rules and deals hash. Ismaél decides Mouloud must return to Tunisia, but the boy runs off, becoming an acolyte to Rhida\'s supplier. Ismaél and Jacky\'s Arab girlfriend start an affair, friends betray friends, and the racism gets ugly. Can Ismaél rescue himself and Mouloud or will life in France crush them?', 104, NULL, 6.10, '2024-09-17 21:49:35', 'https://www.themoviedb.org/movie/114089', NULL),
(879, 'Relic, The ', 1997, '/3MpMbZTrXp6ccrir16nV7YTJ4vx.jpg', 'A homicide detective teams up with an evolutionary biologist to hunt a giant creature that is killing people in a Chicago museum.', 110, NULL, 5.98, '2024-09-17 21:49:36', 'https://www.themoviedb.org/movie/11015', NULL),
(880, 'Island of Dr. Moreau, The ', 1996, '/hOJeQXve8W9rNRhdgC1WV3GQJyA.jpg', 'A shipwrecked sailor stumbles upon a mysterious island and is shocked to discover that a brilliant scientist and his lab assistant have found a way to combine human and animal DNA—with horrific results.', 96, NULL, 4.90, '2024-09-17 21:49:37', 'https://www.themoviedb.org/movie/9306', NULL),
(881, 'First Kid ', 1996, '/t7yTkuXQpnougXmRIqgfT32axZi.jpg', 'Some say that to be the leader of a country is one of the loneliest jobs in the world. But being the child of a world leader can be doubly so. Constantly surrounded by security officers, restricted in movements and having almost every waking moment carefully monitored makes normalcy an impossibility. No one knows this better than young Luke Davenport, the son of U.S. President Davenport. He vents his loneliness, frustration and feelings of isolation from family and friends by being a brat to his private Secret Service agent. When the agent snaps from the strain in front of the First Lady, a new agent is assigned to Luke. He turns out to be the enormous Sam Simms, a bit of a rogue who managed to rise through the ranks by sheer determination rather than strict adherence to Secret-Service protocol. At first, Luke tries all his old tricks upon Sam. But instead of getting angry, Sam seems to actually understand.', 101, NULL, 5.70, '2024-09-17 21:49:38', 'https://www.themoviedb.org/movie/12559', NULL),
(882, 'Trigger Effect, The ', 1996, '/2kEJ0R3ZC9g5tSCuCh7O9IHvcCj.jpg', 'A blackout leaves those affected to consider what is necessary, what is legal, and what is questionable, in order to survive in a predatory environment.', 94, NULL, 5.80, '2024-09-17 21:49:39', 'https://www.themoviedb.org/movie/58770', NULL),
(884, 'Sweet Nothing ', 1996, '/fQzq50uVV2vjaTUzUp3j0hZ00R6.jpg', 'Angel celebrates the birth of his daughter by taking his first hit of crack cocaine. With the hesitant support of his wife, Monika, he joins a friend of his to deal drugs for a short time--enough time to get out of debt and buy some nice things for the family. Three years later, Angel is still dealing, and has not saved any money, instead spending it on crack. His addiction grows, straining his friendship and his family life, and he gradually loses control.', 89, NULL, 6.50, '2024-09-17 21:49:39', 'https://www.themoviedb.org/movie/124851', NULL),
(885, 'Bogus ', 1996, '/unp3wg7uzIV3HikMexGQJpO0OHc.jpg', 'Recently orphaned, a young boy is taken in by his godmother who is shocked to realize that she can see the boy\'s imaginary friend: a flamboyant, French magician named Bogus.', 110, NULL, 5.80, '2024-09-17 21:49:40', 'https://www.themoviedb.org/movie/3587', NULL),
(886, 'Bulletproof ', 1996, '/gPzTPl5PumZurZMZwIyPIkBEmay.jpg', 'An undercover police officer named Rock Keats befriends a drug dealer and car thief named Archie Moses in a bid to catch the villainous drug lord Frank Coltan. But the only problem is that Keats is a cop, his real name is Jack Carter, and he is working undercover with the LAPD to bust Moses and Colton at a sting operation the LAPD has set up.', 84, NULL, 5.70, '2024-09-17 21:49:41', 'https://www.themoviedb.org/movie/10723', NULL),
(887, 'Talk of Angels ', 1998, '/krvPwGvk6UmwlzwVo3s5dh0AitG.jpg', 'This is the story of a young Irish woman who comes to Spain to escape from the pressures she feels about her impending marriage to a political activist in Ireland. But in Spain in the 1930\'s, taking a job of governess in a wealthy family, she finds the same kinds of political unrest. In fact, it isn\'t long before she finds herself attracted to a married man who is similarly involved in the struggle against fascism and Franco. This awakens her to her nature that brings her to such men and resolves for her what she must do about the life she left in Ireland', 96, NULL, 5.80, '2024-09-17 21:49:42', 'https://www.themoviedb.org/movie/56077', NULL),
(889, '1-900 (06) ', 1994, '/lSf3TgDjG7gPoAp3lfpOE6mVPjl.jpg', 'Sarah, 30, single, well educated, likes art, places a voice ad for phone sex, inviting replies from men under 35, sturdy and sensual. Wilbert, a chubby middle aged architect, leaves a message that he is Thomas, 32 and well formed. A week later, she phones. She likes his voice, he likes her laugh, so once a week she phones him (he\'s not to know her last name, where she lives, or her number). Portraits emerge of humor and sadness. He presses for details of her life and tells her about his work; she wants these Thursday calls to be fantasy and release, separate from the rest of who she is. The film dramatizes these tensions of lies and truth, connection and distance. Written by', 87, NULL, 4.80, '2024-09-17 21:49:43', 'https://www.themoviedb.org/movie/101230', NULL),
(890, 'Baton Rouge (Bâton rouge) ', 1988, '/iBU6MbJFxMZclYOFE5DngvyCQHg.jpg', 'Poor gigolo tries to frame his rich mature mistress, but gets tangled in his own wiles.', 90, NULL, 5.00, '2024-09-17 21:49:44', 'https://www.themoviedb.org/movie/253632', NULL),
(891, 'Halloween: The Curse of Michael Myers (Halloween 6: The Curse of Michael Myers) ', 1995, '/noCnM8nEI2bEDSdKHh0RKbwBwbC.jpg', 'Six years after being kidnapped by a cult, Jamie tries to escape the clutches of her serial killer uncle, Michael Myers.', 88, NULL, 5.20, '2024-09-17 21:49:45', 'https://www.themoviedb.org/movie/10987', NULL),
(892, 'Twelfth Night ', 1996, '/uMvHIh50LqWJxUK26eYWV10epdq.jpg', 'Shakespeare\'s comedy of gender confusion, in which a girl disguises herself as a man to be near the count she adores, only to be pursued by the woman he loves.', 134, NULL, 6.94, '2024-09-17 21:49:46', 'https://www.themoviedb.org/movie/44705', NULL),
(893, 'Mother Night ', 1996, '/xooxiCcc4hdBz7Glf3qwZhvoBaF.jpg', 'An American spy behind the lines during WWII serves as a Nazi propagandist, a role he cannot escape in his future life as he can never reveal his real role in the war.', 114, NULL, 6.70, '2024-09-17 21:49:46', 'https://www.themoviedb.org/movie/20318', NULL),
(894, 'Liebelei ', 1933, '/yQyvKKKotBSnKk3ZFyhCzDzhnsy.jpg', 'Vienna in the beginning of the twentieth century. Cavalry Lieutenant Fritz Lobheimer is about to end his affair with Baroness Eggerdorff when he meets the young Christine, the daughter of an opera violinist. Baron Eggerdorff however soon hears of his past misfortune...', 88, NULL, 7.00, '2024-09-17 21:49:47', 'https://www.themoviedb.org/movie/43596', NULL),
(895, 'Venice/Venice ', 1992, '/jk8PwaZ14Duxy8hmLbYLFcYTUP9.jpg', 'An atmospheric coming-of-age story featuring an imaginative young boy named Marek who dreams of escaping an increasingly dangerous Poland on the eve of war for beautiful Venice.', 110, NULL, 7.00, '2024-09-17 21:49:48', 'https://www.themoviedb.org/movie/79782', NULL),
(896, 'Wild Reeds (Les roseaux sauvages) ', 1994, '/31lBDXmmg0p7mXkSZaM9kfHbY0d.jpg', 'As the Algerian War draws to a close, a teenager with a girlfriend starts feeling homosexual urges for two of his classmates: a country boy, and a French-Algerian intellectual.', 115, NULL, 7.10, '2024-09-17 21:49:49', 'https://www.themoviedb.org/movie/26933', NULL),
(897, 'For Whom the Bell Tolls ', 1943, '/j5tBLqs599srb0lryNZIlAWfWWy.jpg', 'Spain in the 1930s is the place to be for a man of action like Robert Jordan. There is a civil war going on and Jordan—who has joined up on the side that appeals most to idealists of that era—has been given a high-risk assignment up in the mountains. He awaits the right time to blow up a crucial bridge in order to halt the enemy\'s progress.', 170, NULL, 6.50, '2024-09-17 21:49:50', 'https://www.themoviedb.org/movie/27854', NULL),
(898, 'Philadelphia Story, The ', 1940, '/dKUubjvxO78XDts6VP1Ggcp4R9O.jpg', 'When a rich woman\'s ex-husband and a tabloid-type reporter turn up just before her planned remarriage, she begins to learn the truth about herself.', 113, NULL, 7.62, '2024-09-17 21:49:51', 'https://www.themoviedb.org/movie/981', NULL),
(899, 'Singin\' in the Rain ', 1952, '/w03EiJVHP8Un77boQeE7hg9DVdU.jpg', 'In 1927 Hollywood, a silent film production company and cast make a difficult transition to sound.', 103, NULL, 8.20, '2024-09-17 21:49:52', 'https://www.themoviedb.org/movie/872', NULL),
(900, 'American in Paris, An ', 1951, '/lyDXkvG53ldz6Cf7dbjJl7TaoP5.jpg', 'Jerry Mulligan is an exuberant American expatriate in Paris trying to make a reputation as a painter. His friend Adam is a struggling concert pianist who\'s a long time associate of a famous French singer, Henri Baurel. A lonely society woman, Milo Roberts, takes Jerry under her wing and supports him, but is interested in more than his art.', 113, NULL, 7.01, '2024-09-17 21:49:52', 'https://www.themoviedb.org/movie/2769', NULL),
(901, 'Funny Face ', 1957, '/tzTjalpIz6NyFrWPPlOBFoBjb7z.jpg', 'A shy Greenwich Village book clerk is discovered by a fashion photographer and whisked off to Paris where she becomes a reluctant model.', 103, NULL, 6.97, '2024-09-17 21:49:53', 'https://www.themoviedb.org/movie/13320', NULL),
(902, 'Breakfast at Tiffany\'s ', 1961, '/79xm4gXw4l7A5D0XukUOJRocFYQ.jpg', 'Holly Golightly is an eccentric New York City playgirl determined to marry a Brazilian millionaire. But when young writer Paul Varjak moves into her apartment building, her past threatens to get in their way.', 115, NULL, 7.70, '2024-09-17 21:49:54', 'https://www.themoviedb.org/movie/164', NULL),
(903, 'Vertigo ', 1958, '/15uOEfqBNTVtDUT7hGBVCka0rZz.jpg', 'A retired San Francisco detective suffering from acrophobia investigates the strange activities of an old friend\'s wife, all the while becoming dangerously obsessed with her.', 129, NULL, 8.17, '2024-09-17 21:49:55', 'https://www.themoviedb.org/movie/426', NULL),
(904, 'Rear Window ', 1954, '/ILVF0eJxHMddjxeQhswFtpMtqx.jpg', 'A wheelchair-bound photographer spies on his neighbors from his apartment window and becomes convinced one of them has committed murder.', 115, NULL, 8.35, '2024-09-17 21:49:56', 'https://www.themoviedb.org/movie/567', NULL),
(905, 'It Happened One Night ', 1934, '/2PNUGWAflH6UUumas0POMmokHlc.jpg', 'A rogue reporter trailing a runaway heiress for a big story joins her on a bus heading from Florida to New York and they end up stuck with each other when the bus leaves them behind at one of the stops along the way.', 105, NULL, 7.82, '2024-09-17 21:49:57', 'https://www.themoviedb.org/movie/3078', NULL),
(906, 'Gaslight ', 1944, '/gXKszCl5Q1KrgWRWpPcqn94CP58.jpg', 'A newlywed fears she\'s going mad when strange things start happening at the family mansion.', 114, NULL, 7.50, '2024-09-17 21:49:57', 'https://www.themoviedb.org/movie/13528', NULL),
(907, 'Gay Divorcee, The ', 1934, '/rfPQfRTsl3RKcf77OllAGgVB7ED.jpg', 'Seeking a divorce from her absentee husband, Mimi Glossop travels to an English seaside resort. There she falls in love with dancer Guy Holden, whom she later mistakes for the corespondent her lawyer hired.', 107, NULL, 6.90, '2024-09-17 21:49:58', 'https://www.themoviedb.org/movie/28288', NULL),
(908, 'North by Northwest ', 1959, '/8gvfRlVpcKaTVqipXpYOGWBN1aO.jpg', 'Advertising man Roger Thornhill is mistaken for a spy, triggering a deadly cross-country chase.', 136, NULL, 7.98, '2024-09-17 21:49:59', 'https://www.themoviedb.org/movie/213', NULL),
(909, 'Apartment, The ', 1960, '/mQFw91P5t4cT199BGQDzjVJcSUl.jpg', 'Bud Baxter is a minor clerk in a huge New York insurance company, until he discovers a quick way to climb the corporate ladder. He lends out his apartment to the executives as a place to take their mistresses. Although he often has to deal with the aftermath of their visits, one night he\'s left with a major problem to solve.', 125, NULL, 8.20, '2024-09-17 21:50:00', 'https://www.themoviedb.org/movie/284', NULL),
(910, 'Some Like It Hot ', 1959, '/hVIKyTK13AvOGv7ICmJjK44DTzp.jpg', 'Two musicians witness a mob hit and struggle to find a way out of the city before they are found by the gangsters. Their only opportunity is to join an all-girl band as they leave on a tour. To make their getaway they must first disguise themselves as women, then keep their identities secret and deal with the problems this brings - such as an attractive bandmate and a very determined suitor.', 122, NULL, 8.10, '2024-09-17 21:50:01', 'https://www.themoviedb.org/movie/239', NULL),
(911, 'Charade ', 1963, '/ijJ73UgR6nOqjSP8MO0Z7hawCdm.jpg', 'After Regina Lampert falls for the dashing Peter Joshua on a skiing holiday in the French Alps, she discovers upon her return to Paris that her husband has been murdered. Soon, she and Peter are giving chase to three of her late husband\'s World War II cronies, Tex, Scobie and Gideon, who are after a quarter of a million dollars the quartet stole while behind enemy lines.', 113, NULL, 7.70, '2024-09-17 21:50:02', 'https://www.themoviedb.org/movie/4808', NULL),
(912, 'Casablanca ', 1942, '/5K7cOHoay2mZusSLezBOY0Qxh8a.jpg', 'In Casablanca, Morocco in December 1941, a cynical American expatriate meets a former lover, with unforeseen complications.', 102, NULL, 8.16, '2024-09-17 21:50:02', 'https://www.themoviedb.org/movie/289', NULL),
