(971, 'Cat on a Hot Tin Roof ', 1958, '/vWf1AR8rC6WjGKELlmLv2VAUZJB.jpg', 'An alcoholic ex-football player drinks his days away, having failed to come to terms with his sexuality and his real feelings for his football buddy who died after an ambiguous accident. His wife is crucified by her desperation to make him desire her: but he resists the affections of his wife. His reunion with his father—who is dying of cancer—jogs a host of memories and revelations for both father and son.', 108, NULL, 7.60, '2024-09-17 21:50:53', 'https://www.themoviedb.org/movie/261', NULL),
(972, 'Last Time I Saw Paris, The ', 1954, '/3RCMk1ygrk3e2vJFWjQ0LjW1XqR.jpg', 'Reporter Charles Wills, in Paris to cover the end of World War II, falls for the beautiful Helen Ellswirth following a brief flirtation with her sister, Marion. After he and Helen marry, Charles pursues his novelistic ambition while supporting his new bride with a deadening job at a newspaper wire service. But when an old investment suddenly makes the family wealthy, their marriage begins to unravel — until a sudden tragedy changes everything.', 116, NULL, 6.00, '2024-09-17 21:50:54', 'https://www.themoviedb.org/movie/57575', NULL),
(973, 'Meet John Doe ', 1941, '/dnBZbFE2OGlTGNGBVTn6t83tJtd.jpg', 'As a parting shot, fired reporter Ann Mitchell prints a fake letter from unemployed \"John Doe,\" who threatens suicide in protest of social ills. The paper is forced to rehire Ann and hires John Willoughby to impersonate \"Doe.\" Ann and her bosses cynically milk the story for all it\'s worth, until the made-up \"John Doe\" philosophy starts a whole political movement.', 122, NULL, 7.30, '2024-09-17 21:50:55', 'https://www.themoviedb.org/movie/32574', NULL),
(974, 'Algiers ', 1938, '/cvNQjlXJxRQrmB5VCcyssjKIwW8.jpg', 'Pepe Le Moko is a notorious thief, who escaped from France. Since his escape, Moko has become a resident and leader of the immense Casbah of Algiers. French officials arrive insisting on Pepe\'s capture are met with unfazed local detectives, led by Inspector Slimane, who are biding their time. Meanwhile, Pepe meets the beautiful Gaby, which arouses the jealousy of Ines.', 96, NULL, 6.41, '2024-09-17 21:50:55', 'https://www.themoviedb.org/movie/22657', NULL),
(975, 'Something to Sing About ', 1937, '/lGnovhVbh3LuR3rkuTRhnagxJqk.jpg', 'James Cagney has a rare chance to show his song-and-dance-man roots in this low-budget tale of a New York bandleader struggling with a Hollywood studio boss.', 93, NULL, 6.30, '2024-09-17 21:50:56', 'https://www.themoviedb.org/movie/76464', NULL),
(976, 'Farewell to Arms, A ', 1932, '/eNmPByGZJqlp60nCZRhsAlVAb3F.jpg', 'A tale of the World War I love affair, begun in Italy, between American ambulance driver Lt. Frederic Henry and British nurse Catherine Barkley. Eventually separated by Frederic\'s transfer, tremendous challenges and difficult decisions face each as the war rages on.', 89, NULL, 6.20, '2024-09-17 21:50:57', 'https://www.themoviedb.org/movie/22649', NULL),
(977, 'Moonlight Murder ', 1936, '/milDzDPmmu3k44zhwaNiOsA2qSH.jpg', 'An escaped lunatic, a mysterious swami, and various lovers all have designs on a famous opera singer.', 65, NULL, 5.00, '2024-09-17 21:50:58', 'https://www.themoviedb.org/movie/176841', NULL),
(979, 'Nothing Personal ', 1995, '/mvQ6sXAftEX1UsFvvNKF89ubd6F.jpg', 'A raw depiction of the Belfast \'troubles\' as savage tribal warfare. Set shortly after the 1975 cease fire, the film focuses on the tribulations of Kenny, Protestant leader of a group of Shankill Road Loyalists, and his one-time friend Liam, a Catholic.', 83, NULL, 4.50, '2024-09-17 21:50:59', 'https://www.themoviedb.org/movie/125587', NULL),
(980, 'Yes, Madam (a.k.a. Police Assassins) (a.k.a. In the Line of Duty 2) (Huang gu shi jie) ', 1985, '/4KcufMSckdPInz4VAxg3VTpQtDo.jpg', 'Two unlucky thieves break into a just murdered man\'s hotel room and steal his passport with a hidden microfilm wanted by a triad boss. Two hard kicking women cops from HK and UK get the case.', 93, NULL, 7.15, '2024-09-17 21:51:00', 'https://www.themoviedb.org/movie/39448', NULL),
(981, 'Dangerous Ground ', 1997, '/3oFap1KH6zTTP1w0iQ6uQZrzKU4.jpg', 'Vusi Madlazi returns to the South African village he left as a young boy to bury his father. He meets up with his brother Ernest, who tells him their other brother Stephen couldn\'t be contacted. Vusi goes to Johannesburg to find him, but at first can only find his neighbor/girlfriend, Karin, a stripper. Vusi proceeds to learn how conditions have changed since the end of apartheid, not always for the better for black men.', 95, NULL, 4.40, '2024-09-17 21:51:01', 'https://www.themoviedb.org/movie/52855', NULL),
(982, 'Picnic ', 1955, '/aKCSA9JUp9JkztAjzODPTrtZmzC.jpg', 'Labor Day in a small Kansas farm town. Hal, a burly and resolute drifter, jumps off a dusty freight train car with the purpose of visiting Alan, a former college classmate and son of the richest man in town.', 114, NULL, 6.30, '2024-09-17 21:51:02', 'https://www.themoviedb.org/movie/39940', NULL),
(983, 'Madagascar Skin ', 1995, '/r33ET00aIBy7j0E9wJCXj4bWMET.jpg', 'This is the story of Harry and Flint, an unlikely couple. Harry is a shy young gay man who can\'t seem to fit into his local bar scene. Flint is a crusty, older, and seemingly straight man with a questionable background. They meet on a gorgeous coastline, and evolve from distrust to deep love.', 96, NULL, 5.50, '2024-09-17 21:51:03', 'https://www.themoviedb.org/movie/172868', NULL),
(984, 'Pompatus of Love, The ', 1996, '/i94UXzKj8OF1hUyXlT4BHvfgJZI.jpg', 'Four guys sit around drinking beer and talking, trying to figure out the meaning of \"the pompatus of love\" (from the Steve Miller song \"Joker\") and analyzing their relationships with women.', 99, NULL, 4.10, '2024-09-17 21:51:04', 'https://www.themoviedb.org/movie/85328', NULL),
(985, 'Small Wonders ', 1995, '/4XLDtVjOX9DVjEaSfuqkpaWA9xT.jpg', 'A dedicated music teacher in East Harlem instructs a gaggle of underprivileged children in the art of the violin. In the climax, they play Carnegie Hall with some of the world\'s foremost fiddlers.', 77, NULL, 7.40, '2024-09-17 21:51:05', 'https://www.themoviedb.org/movie/124632', NULL),
(986, 'Fly Away Home ', 1996, '/obcQJkZB2OsRxd5GWIcQ5Qjv4YW.jpg', 'Amy is only 13 years old when her mother is killed. She goes to Canada to live with her father, an eccentric inventor whom she barely knows. Amy is miserable in her new life... until she discovers a nest of goose eggs that were abandoned when a local forest was torn down. The eggs hatch and Amy becomes \"Mama Goose\". When Winter comes, Amy, and her dad must find a way to lead the birds South.', 107, NULL, 6.90, '2024-09-17 21:51:06', 'https://www.themoviedb.org/movie/11076', NULL),
(987, 'Bliss ', 1997, '/zGdGINvf9oSysprbWnu85dIM7rc.jpg', 'A newly married happy couple visits a sex therapist to determine why the wife can\'t achieve an orgasm with her husband. This causes a horrific suppressed memory to emerge and she becomes more and more distant.', 103, NULL, 5.50, '2024-09-17 21:51:07', 'https://www.themoviedb.org/movie/63945', NULL),
(988, 'Grace of My Heart ', 1996, '/fkgVjmbN9VdBxguNi6tz6lb3sDu.jpg', 'Philadelphia teenager Edna Buxton wins a talent contest during the early rock \'n\' roll era, changes her name to Denise Waverly and moves to New York City to make it big. Though she flops as a recording artist, fast-talking record producer Joel Millner recognizes her songwriting talent and teams her with struggling songsmith Howard Caszatt.', 116, NULL, 6.30, '2024-09-17 21:51:07', 'https://www.themoviedb.org/movie/58985', NULL),
(989, 'Brother of Sleep (Schlafes Bruder) ', 1995, '/wjvaafRCIGKLTJYm45oWgB494gJ.jpg', 'In the beginning of the 19th century, Johannes Elias Alder is born in a small village in the Austrian mountains. While growing up he is considered strange by the other villagers and discovers his love of music, especially rebuilding and playing the organ at the village church. After experiencing an \"acoustic wonder\", his eye color changes and he can hear even the most subtle sounds.', 127, NULL, 6.70, '2024-09-17 21:51:08', 'https://www.themoviedb.org/movie/890', NULL),
(990, 'Maximum Risk ', 1996, '/18HVWwyLihWJPzGpSVl3omRRMyL.jpg', 'Alain Moreau\'s investigation into the death of his identical twin brother leads him from the beauty of the south of France to the mean streets of New York City and into the arms of his brother\'s beautiful girlfriend. Pursued by ruthless Russian mobsters and renegade FBI agents, the duo race against time to solve his brother\'s murder and expose an international conspiracy.', 100, NULL, 5.73, '2024-09-17 21:51:09', 'https://www.themoviedb.org/movie/10861', NULL),
(991, 'Michael Collins ', 1996, '/baEsjm8fMi51hDOFwwDQRekY9Xw.jpg', 'Michael Collins plays a crucial role in the establishment of the Irish Free State in the 1920s, but becomes vilified by those hoping to create a completely independent Irish republic.', 132, NULL, 6.90, '2024-09-17 21:51:10', 'https://www.themoviedb.org/movie/1770', NULL),
(992, 'Rich Man\'s Wife, The ', 1996, '/uE7BXhR6QkSGCIK6gTPGfFRAggY.jpg', 'A rich man\'s wife finds she has a bad prenuptial agreement with an even worse husband. Over drinks with a stranger, she fantasizes about doing her husband in to void the prenup — but much to her surprise, the stranger decides to turn her imagination into reality.', 94, NULL, 5.40, '2024-09-17 21:51:11', 'https://www.themoviedb.org/movie/44465', NULL),
(993, 'Infinity ', 1996, '/45cU6BNyRGKhDQZKzVSll4eTgwh.jpg', 'Story of the early life of genius and Nobel Prize-winning physicist Richard Feynman.', 119, NULL, 6.20, '2024-09-17 21:51:11', 'https://www.themoviedb.org/movie/2033', NULL),
(994, 'Big Night ', 1996, '/nnQrJT4LCj6v2LjboUogkcRUPBr.jpg', 'Primo and Secondo, two immigrant brothers, pin their hopes on a banquet honoring Louis Prima to save their struggling restaurant.', 107, NULL, 6.89, '2024-09-17 21:51:12', 'https://www.themoviedb.org/movie/18203', NULL),
(996, 'Last Man Standing ', 1996, '/nEMNuHELBxPAglynxuc9ZvKOlpv.jpg', 'John Smith is a mysterious stranger who is drawn into a vicious war between two Prohibition-era gangs. In a dangerous game, he switches allegiances from one to another, offering his services to the highest bidder. As the death toll mounts, Smith takes the law into his own hands in a deadly race to stay alive.', 101, NULL, 6.30, '2024-09-17 21:51:13', 'https://www.themoviedb.org/movie/9333', NULL),
(997, 'Caught ', 1996, '/33sUPXPUqIe9YnZ80d8xzkiL2gb.jpg', 'A middle-aged couple has a drifter enter their lives. The fish-store owners find that the mysterious young man awakens the couple in ways they didn\'t expect. Things get tense when the drifter begins an affair with the woman of the house.', 110, NULL, 5.80, '2024-09-17 21:51:14', 'https://www.themoviedb.org/movie/47260', NULL),
(998, 'Set It Off ', 1996, '/wKO2hAMCMWTkEFLPOpKF9zRxxW1.jpg', 'Four inner-city Black women, determined to end their constant struggle, decide to live by one rule — get what you want or die trying. So the four women take back their lives and take out some banks in the process.', 123, NULL, 7.20, '2024-09-17 21:51:15', 'https://www.themoviedb.org/movie/9400', NULL);
INSERT INTO movies (id, name, released_at, poster_url, synopsis, duration, trailer_url, average_rating, created_at, url, updated_at) VALUES
(999, '2 Days in the Valley ', 1996, '/kKSr1PP7IVJek8heFWbSrmJXVMZ.jpg', 'In a sleepy bedroom community of LA\'s San Fernando Valley, the murder of a professional athlete by two hit men sets into motion a chain of events that puts the mundane lives of a dozen residents on a collision course. This clever tale tells the story of two hit men, a mistress, a nurse, a vindictive ex-wife, a wealthy art dealer and his lovelorn assistant, a suicidal writer and his dog, and a bitter cop and his partner.', 104, NULL, 6.20, '2024-09-17 21:51:16', 'https://www.themoviedb.org/movie/9401', NULL),
(1000, 'Curdled ', 1996, '/a8GtmDKoifFkcyqeqcjQjLVIOVc.jpg', 'Gabriela, a Colombian immigrant, is obsessed with understanding violent crime. The current string of murders by \"The Blue Blood Killer\" of affluent Miami socialites provides her with fodder for her scrapbook of death. She lands a job with a post-murder cleaning service and during a Blue-Blood clean-up job, discovers evidence that police have overlooked.', 88, NULL, 5.88, '2024-09-17 21:51:16', 'https://www.themoviedb.org/movie/12241', NULL),
